INSERT INTO `champions` (`id`, `name`, `champion_id`, `created_at`, `updated_at`, `key`, `attackrange`, `mpperlevel`, `mp`, `attackdamage`, `hp`, `hpperlevel`, `attackdamageperlevel`, `armor`, `mpregenperlevel`, `hpregen`, `critperlevel`, `spellblockperlevel`, `mpregen`, `attackspeedperlevel`, `spellblock`, `movespeed`, `attackspeedoffset`, `crit`, `hpregenperlevel`, `armorperlevel`, `title`, `lore`, `enemytips1`, `enemytips2`, `enemytips3`, `allytips1`, `allytips2`, `allytips3`, `f2p`, `sale`, `sale_price`, `votes`, `tags`) VALUES
(1, 'Aatrox', 266, '2014-10-21 17:54:20', '2015-04-09 10:19:24', 'Aatrox', 150.00, 45.00, 105.60, 60.38, 537.80, 85.00, 3.20, 24.38, 0.00, 6.59, 0.00, 1.25, 0.00, 3.00, 32.10, 345.00, -0.04, 0.00, 0.50, 3.80, 'Die Klinge der Düsteren', 'Aatrox ist ein legendärer Krieger, einer von fünf, die von einem uralten Volk, das als Die Düsteren bekannt ist, übrig geblieben sind. Er schwingt seine riesige Klinge mit Anmut und Selbstvertrauen. Er schlägt in einem Stil, der einen beim Zuschauen hypnotisiert, Schneisen durch ganze Legionen. Mit jedem niedergemähten Widersacher trinkt Aatrox‘ scheinbar lebendige Klinge dessen Blut, wodurch seine Macht anwächst und sein brutaler, eleganter Feldzug befeuert wird.<br><br>Die früheste Geschichte über Aatrox ist so alt wie die Geschichtsschreibung selbst. Sie handelt von einem Krieg zwischen zwei großen Fraktionen, derer man sich nur als das Protektorat und die Magierfürsten erinnert. Im Laufe der Zeit errangen die Magierfürsten eine Reihe von vernichtenden Siegen, wodurch sie kurz davor standen, ihre Erzfeinde für alle Zeit auszulöschen. Am Tage ihrer letzten Konfrontation stand die Armee des Protektorats ihren Gegnern in der Unterzahl, erschöpft und schlecht ausgerüstet gegenüber. Sie machten sich auf ihre unvermeidliche Niederlage gefasst.<br><br>Gerade als alle Hoffnung verloren schien, erschien Aatrox in den Rängen des Protektorats. Mit Hilfe weniger Worte ermahnte er die Krieger, bis zum letzten Mann zu kämpfen, bevor er sich selbst in die Schlacht stürzte. Seine Anwesenheit inspirierte die verzweifelten Kämpfer. Zunächst konnten sie nur ehrfürchtig zusehen, wie dieser unbekannte Held sich durch ihre Gegner schlug. Sein Körper und seine Klinge bewegten sich, als wären sie eins. Schon bald waren die Krieger selbst von einem mächtigen Kriegshunger beseelt und folgten Aatrox in das Schlachtgetümmel. Jeder kämpfte mit der wilden Stärke von zehn von ihnen, bis sie einen überaus unwahrscheinlichen Sieg errungen hatten.<br><br>Nach der Schlacht verschwand Aatrox wieder, doch nicht so die neugefundene Wildheit der Armee des Protektorats. Ihrem überraschenden Sieg sollten noch viele folgen, bis sie endlich siegreich nach Hause zurückkehren konnten. Ihre Landsleute empfingen sie als Helden, doch auch wenn sie ihre gesamte Zivilisation vor deren Zerstörung bewahrt hatten, hatte die Dunkelheit in den Verstand jedes einzelnen Kriegers Einzug gehalten. Etwas in ihrem Inneren hatte sich verändert. Mit der Zeit verblassten ihre Erinnerungen an die Schlacht und eine grauenvolle Erkenntnis nahm ihren Platz ein: Ihre Heldentaten waren in Wahrheit brutale Gräueltaten, die sie mit eigenen Händen vollbracht hatten.<br><br>Geschichten wie diese tauchen in den Mythen vieler Kulturen auf. Will man ihnen allen Glauben schenken, hat Aatrox das Blatt einiger der entscheidendsten Kriege der Geschichte gewendet. Auch wenn diese Erzählungen ihn als einen Erlöser in dunklen Zeiten im Gedächtnis behalten, könnte Aatrox‘ wahres Vermächtnis eine Welt voller Zank und Streit sein.<br><br>„Manche kämpfen um Ehre, manche kämpfen um Ruhm. Es zählt nur, dass man kämpft.“ - Aatrox <br>', 'Wenn Aatrox tödlichen Schaden erleidet, wird er in Höhe des aktuellen Wertes in seinem Ressourcenbalken geheilt. Sollte er einen tödlichen Treffer erleiden, während sein Ressourcenbalken niedrig ist, wird er mit einem niedrigeren Wert an Leben wiederbelebt.', 'Wenn Aatrox „Düsterflug“ in Richtung deiner Position ausführt, solltest du vermeiden, hochgeschlagen zu werden, indem du vom Einschlagszentrum weg gehst.', 'Aatrox verlässt sich für den Großteil seines Schadens und seines Überlebens auf automatische Angriffe. Indem du „Randuins Omen“ oder „Gefrorenes Herz“ kaufst, verringerst du sein Angriffstempo und schwächst dadurch beide Komponenten ungemein.', 'Vermeide es, einen Kampf anzufangen, wenn du wenig Leben hast, es sei denn, dein Blutbrunnen ist voll, damit du genug Leben zurückerhältst, um weiter kämpfen zu können.', 'Lebensraub auszubauen, kann bei Aatrox sehr nützlich sein, um seine Lebenskosten auszugleichen.', 'Massaker eignet sich wunderbar, um das Ruder herumzureißen. Du musst es auf jeden Fall im richtigen Moment einsetzen, um dessen Vorteile am effektivsten einzusetzen.', 0, 0, 487, 2027, ' Fighter Tank'),
(2, 'Thresh', 412, '2014-10-21 17:54:20', '2015-04-09 10:19:24', 'Thresh', 450.00, 44.00, 273.92, 47.70, 560.52, 89.00, 2.20, 16.00, 0.80, 6.92, 0.00, 0.00, 6.00, 3.50, 30.00, 335.00, 0.00, 0.00, 0.55, 0.00, 'Der Kettenwächter', 'Thresh ist ein sadistischer Geisterschnitter, der sich an der Folter der Lebenden und der Toten weidet. Einst war er ein Gefängniswärter, der alle, die ihm untergeben waren, mit erbarmungsloser Brutalität quälte. Daraufhin wurde er mit seinen eigenen Ketten von den Gefangenen, die er gefoltert hatte, aufgehängt. Nun da seine bösartige Essenz befreit ist, durchstreift der Kettenwächter Runeterra auf der Suche nach Beute. Seine Freude zieht er aus dem langsamen Brechen des Verstandes seiner widerspenstigsten Opfer, bevor er deren Seelen in seiner kränklich grün glimmenden Laterne einfängt.', 'Threshs „Todesurteil“ hat eine lange Zauberzeit. Achte darauf, wann er zu zaubern beginnt, um ausweichen zu können.', 'Das absichtliche Durchbrechen einer Wand von „Die Kiste“ kann es einem verwundbaren Verbündeten erlauben, unbeschadet zu fliehen.', 'Thresh verlässt sich für einen Teil seiner defensiven Werte auf das Sammeln von Seelen. Bestrafe ihn, wenn er versucht Seelen einzusammeln.', 'Beim Einsatz von Threshs „Laterne“ ist Kommunikation der Schlüssel. Lasse deine Teamkollegen wissen, wie du sie einsetzen möchtest.', '„Todesurteil“ und „Auspeitschen“ können in beliebiger Zauberreihenfolge kombiniert werden, um wirkungsvolle Kombinationen zu zaubern.', 'Thresh kann Seelen sammeln, ohne dass er selbst Einheiten töten muss. Wenn du deine Stellung auf der Karte so planst, dass du immer in der Nähe vieler Todesstöße bist, kann dir das dabei helfen, deine Seelensammlung zu maximieren.', 0, 0, 0, 2801, ' Support Fighter'),
(3, 'Tryndamere', 23, '2014-10-21 17:54:20', '2015-04-09 10:19:24', 'Tryndamere', 125.00, 0.00, 100.00, 61.38, 625.64, 98.00, 3.20, 24.11, 0.00, 8.51, 0.00, 1.25, 0.00, 2.90, 32.10, 345.00, -0.07, 0.00, 0.90, 3.10, 'Der Barbarenkönig', 'Angetrieben von seiner unbändigen Wut schlägt sich Tryndamere seinen Weg durch die Tundra, während er es in der Kunst des Kampfes zur Meisterschaft bringt, indem er Freljords größte Krieger herausfordert. Der zornige Barbar dürstet nach Rache an demjenigen, der seinen Klan vernichtete, und er streckt all jene nieder, die sich zwischen ihn und seine endgültige Vergeltung stellen.<br><br>Im ewigen Kampf um das Überleben im rauhen, eisig kalten Freljord führten Tryndamere und sein Volk mit anderen Stämmen Kriege um die wenigen Ressourcen, die das Land bot. Einer dieser Kämpfe veränderte sein Leben für immer. Plünderer überfielen Tryndameres Klan im Dunkel der Nacht und obwohl seine Krieger die erste Welle von Angreifern zurückschlagen konnten, waren sie nicht auf die dunkle Gestalt vorbereitet, die sich daraufhin zeigte. Sie schwang ein gewaltiges, lebendiges Schwert und trieb mit ihrer überirdischen Magie die Angreifer in einen grenzenlosen Blutrausch. Tryndameres Stamm war binnen Sekunden ausgelöscht. Ohne Hoffnung, das rätselhafte Wesen besiegen zu können, stürzte sich Tryndamere in den sicheren Tod. Die düstere Kreatur schlug ihn zur Seite, wodurch der junge Barbar tödliche Wunden erlitt.<br><br>Tryndamere musste zusehen, wie Tod und Zerstörung in seiner Heimat um sich griffen, während auch ihm das Leben entglitt. Niemand war noch übrig - nur die Schreie der Sterbenden waren zu vernehmen. Da es ihm unmöglich war, sich dem Tod zu überlassen, gab Tryndamere seinem Zorn nach. Sein Blut kochte und seine Wut verschlang ihn und so verbannte er seine Sterblichkeit. Er kam strauchelnd wieder auf die Beine - kaum fähig, sein Schwert zu halten - und stählte sich für die alles entscheidende Konfrontation mit der schattengleichen Gestalt. Doch die düstere Kreatur hob nicht einmal ihre Klinge, sondern bedachte Tryndamere stattdessen mit einem wissenden Lächeln, bevor sie sich in die Schatten zurückzog. Dies war das letzte Mal, dass der Barbar seine Nemesis sah.<br><br>Als Mann, der seiner Heimat und seines Volkes beraubt wurde, durchstreift Tryndamere seit Jahren Freljord, und hat sich geschworen, aus sich ein brutales Instrument der Rache zu machen. Er suchte alle Stämme in den Eiswüsten auf, schlug jeden ihrer Krieger, bis es niemanden mehr gab, den er herausfordern konnte. Auf diese Weise wurde er ein Meister der Kampfkunst der Barbaren und nutzte seinen Zorn als Kraft, mit der man rechnen musste. Mit dem Schwert in der Hand und der Wut im Herzen befindet er sich nun auf einer unsterblichen Suche nach Vergeltung an dem, der das Leben, das er einst kannte, zerstörte.<br><br>„Zorn ist meine Waffe.“ - Tryndamere<br>', 'Versuche, Tryndamere schon früh zu bedrängen, damit er keine Vasallen töten und sich durch „Blutdurst“ heilen kann.', 'Vergiss nicht, dass Tryndamere dich nur verlangsamen kann, wenn du ihm den Rücken zudrehst.', 'Tryndamere verursacht größtenteils normalen Schaden. Falls er zu stark wird, denk mal über die Anschaffung eines „Dornenpanzers“ nach.', 'Zögere die Verwendung von „Unbändige Wut“ hinaus, um Gegner zu einem unvorsichtigen Angriff zu bewegen und diese trotzdem zu besiegen.', '„Blutdurst“ ist besonders in einer frühen Phase effektiv, um Tryndamere zu heilen. Versuch also, möglichst nichts davon zu verschwenden.', 'Falls der Gegner seine Rüstung verstärkt, versuch, Gegenstände wie „Letzter Atemzug“ oder „Youmus Geistklinge“ zu benutzen.', 0, 0, 0, 3812, ' Fighter Assassin'),
(4, 'Gragas', 79, '2014-10-21 17:54:20', '2015-04-09 10:19:24', 'Gragas', 125.00, 47.00, 400.00, 61.38, 583.52, 89.00, 3.50, 26.05, 0.80, 8.68, 0.00, 1.25, 6.00, 2.05, 32.10, 330.00, -0.04, 0.00, 0.85, 3.60, 'Der Unruhestifter', 'Das Einzige, was für Gragas noch wichtiger ist als das Kämpfen, ist das Trinken. Sein unstillbarer Durst nach stärkerem Bier trieb ihn auf der Suche nach den wirkungsvollsten und unkonventionellsten Ingredienzien, die er in seine Destillerie werfen kann, voran. Aufgrund seiner impulsiven und unvorhersehbaren Natur liebt es dieser rauflustige Säufer ebenso Fässer zu zerschlagen wie auch Schädel. Dank seiner sonderbaren Gebräue und seiner temperamentvollen Art ist es immer ein riskantes Vorhaben, mit Gragas einen zu heben.<br><br>Gragas liebt nichts mehr als einen feinen Schluck, doch sein massiver Körperbau hielt ihn davon ab, den seeligen Zustand des Rausches zu erreichen. Eines Nachts, als er alle Fässer geleert, aber noch immer nicht genug hatte, ging ihm ein Licht auf: Warum braute er sich selbst nicht etwas, das ihn endlich richtig besoffen machte? In diesem Moment schwor er sich, das ultimative Bier zu brauen.<br><br>Gragas Suche brachte ihn letztlich nach Freljord, wo die Verheißung, das reinste Eiswasser für sein Rezept zu bekommen, ihn in unerforschte Eiswüsten führte. Während er in einem unbarmherzigen Eissturm die Orientierung verlor, stolperte Gragas über eine große Heulende Schlucht. Dort fand er ihn: einen makellosen Eissplitter, ganz anders als alles, was er bis dahin gesehen hatte. Dieser nicht schmelzende Splitter verlieh seinem Lager nicht nur unglaubliche Eigenschaften, sondern hatte auch einen praktischen Nebeneffekt: Das Gemisch blieb immer schön kühl auf Serviertemperatur.<br><br>Von seinem neuesten Gebräu beflügelt machte sich Gragas in Richtung Zivilisation auf, um die fermentierten Früchte seiner Arbeit mit anderen zu teilen. Das Schicksal wollte es, dass die erste Menschenansammlung, die Gragas‘ trübe Augen erblickten, die Zukunft Freljords bestimmen würde. Er platzte in eine sich schlecht entwickelnde Verhandlung zwischen zwei Stämmen, die eine Allianz mit Ashe diskutierten. Obwohl Ashe eine Unterbrechung der Spannung willkommen war, reagierten die anderen Krieger auf die Störung gereizt und bedachten den betrunkenen Einfaltspinsel mit Beleidigungen. Ganz seiner Natur gemäß antwortete Gragas mit einem diplomatischen Kopfstoß und trat damit eine Schlägerei los, die nur in den Legenden Freljords ihresgleichen fand.<br><br>Als jene, die bei dieser großartigen Auseinandersetzung zu Boden gegangen waren, endlich aufwachten, bot Ashe ihnen freundlich einen Becher Bier als Alternative zum Kampf an. Als ihre hitzigen Gemüter im Sud ertränkt waren, schlossen sich die beiden eben noch kurz vor einem Krieg stehenden Stämme in ihrer Liebe zu Gragas‘ Gebräu zusammen. Obwohl ein Streit abgewendet werden konnte und Gragas zum Helden erklärt wurde, hatte er noch immer nicht sein Ziel der trunkenen Glückseligkeit erreicht. Also machte er sich wieder auf, um die Tundra nach Zutaten für Runeterras perfekten Schluck zu durchkämmen.<br><br>„Davon wachsen dir Haare auf der Brust!“ - Gragas<br>', 'Gragas kann mit seiner ultimativen Fähigkeit alle wegschleudern. Pass auf, dass du nicht zu ihm geschleudert wirst, oder schlimmer noch: in einen gegnerischen Turm.', '„Bauchrammer“ hat eine sehr kurze Abklingzeit, wodurch man Gragas nur schwer verfolgen kann. Vergeude deine Energien also lieber nicht, indem du ihm hinterher rennst.', '', 'Die Schadensverringerung durch „Betrunkene Wut“ tritt ein, sobald du zu trinken beginnst. Versuche es einzusetzen, wenn du siehst, dass du Schaden zu erwarten hast.', 'Versuche Gegner mit „Explosives Fass“ zu deinen Türmen zu schleudern.', 'Versuche „Bauchrammer“ und „Explosives Fass“ zu kombinieren, um Tötungen für dein Team verbuchen zu können.', 0, 0, 0, 1446, ' Fighter Mage'),
(5, 'Cassiopeia', 69, '2014-10-21 17:54:20', '2015-04-09 10:19:25', 'Cassiopeia', 550.00, 60.00, 370.80, 52.38, 506.00, 75.00, 3.20, 22.22, 0.75, 5.69, 0.00, 0.00, 8.36, 1.68, 30.00, 335.00, -0.03, 0.00, 0.50, 4.00, 'Die Umarmung der Schlange', 'Cassiopeia ist eine furchteinflößende Kreatur - halb Frau, halb Schlange -, deren bloßer Blick tötet. Die jüngste Tochter einer der einflussreichsten Familien Noxus'' war einst eine wunderschöne und raffinierte Verführerin, die selbst Herzen aus Stahl für ihre Zwecke manipulieren konnte. Das Gift eines uralten Shurima-Grabwächters verwandelte sie, weshalb sie nun den Interessen Noxus'' auf ... subtilere Weise dient.', 'Achte auf Cassiopeias Schadenspotential mit „Doppelzahn“, sollte sie dich vergiftet haben.', 'Wende dich von Cassiopeia ab, wenn sie „Versteinernder Blick“ einsetzt, um nur verlangsamt und nicht betäubt zu werden.', '', 'Benutze „Doppelzahn“ möglichst auf ein vergiftetes und unbewegliches Ziel, wie Gegner, die durch „Versteinernder Blick“ betäubt sind, um möglichst viel Schaden zu verursachen.', 'Ziele vor deine Gegner, um mit „Giftexplosion“ leichter zu treffen.', '', 0, 0, 0, 2779, ' Mage'),
(6, 'Poppy', 78, '2014-10-21 17:54:20', '2015-04-09 10:19:25', 'Poppy', 125.00, 30.00, 235.40, 61.97, 559.08, 81.00, 3.38, 28.72, 0.45, 8.37, 0.00, 0.00, 7.16, 3.35, 30.00, 345.00, -0.02, 0.00, 0.55, 4.00, 'Die eiserne Botschafterin', 'Während andere junge Yordle Hüpfspiele spielten oder Blumenkränze flochten, holte sich Poppy Schwielen und Ölflecken in ihres Vaters Rüstungsladen. Blomgrun, ihr Vater, war der angesehenste Rüstungsschmied in der Stadt Bandle. Das einzige, was er so sehr liebte wie seine Arbeit, war seine Tochter Poppy - die er nach dem lebhaften Geräusch, das die Funken begleitete, die aus dem immerwährenden Feuer der Schmiede stoben, benannte. An dem Tag, als sie das erste Mal seinen treuen Hammer „Whomper“ anheben konnte, quoll er über vor Stolz. Poppy fand sofort Gefallen an seiner Kunst und offenbarte ein natürliches Talent für das Schmieden, welches Blomgrun durch hingebungsvolle Anleitung verfeinerte.<br><br>Eines Tages beauftragte ein demacianischer General namens Florin Berell Blomgrun damit, einen unvergleichlich prächtigen Helm zu fertigen. Blomgrun steckte all sein Herzblut in dieses Projekt, fest entschlossen, Florin seine beste Arbeit zu präsentieren. Er ließ Poppy das Juwel in der Mitte einsetzen, womit er ihr das wichtigste Teil anvertraute. Als die beiden fertig waren, brachen sie in Richtung Demacia auf, um den Helm persönlich abzuliefern. Doch das Oberkommando von Noxus bekam einen Hinweis auf den Auftrag des Generals, woraufhin zwei noxische Assassinen ausgesandt wurden, um die Lieferung abzufangen. Blomgrun konnte die Assassinen lange genug beschäftigen, dass Poppy mit dem wertvollen Helm flüchten konnte. Sie musste hilflos von einem Gebüsch aus mit ansehen, wie ihr Vater erschlagen wurde. Doch anstatt nach Hause zu fliehen, schleppte sie den Helm alleine den Rest des Weges bis nach Demacia. Sie lehnte eine Bezahlung dafür ab und begründete dies damit, dass keine Summe das Leben ihres Vaters kompensieren könne. Stattdessen bot sie den Helm als Geschenk an, um den letzten Willen ihres Vaters zu ehren. Florin sah hinter den Tränen in ihren Augen die grimmige Entschlossenheit. Er veranlasste die Führung von Bandle, Poppy als yordle''schen Botschafter in Demacia einzusetzen. Schon bald darauf trat Poppy freiwillig der Liga der Legenden bei, um Noxus mit dem Hammer ihres Vaters zerschmettern zu können.<br><br>„Poppy mag klein sein, doch Whomper - oder ihr Wille - ist es nicht.“', 'Das Ziel von „Diplomatische Immunität“ kann Poppy weiterhin beeinträchtigen oder Schaden zufügen. Solange dieser Zauber aktiv ist, ist Poppy in der Regel sehr aggressiv. Versuche sie dafür zu bestrafen, dass sie dich als Ziel ausgesucht hat.', 'Wenn du im Dickicht gegen Poppy kämpfst, ist dies wegen „Heroischer Ansturm“ sehr gefährlich. Versuche sie im offenen Gelände zu stellen.', '', '„Diplomatische Immunität“ kann sowohl defensiv als offensiv eingesetzt werden. Es kann sich lohnen ein Ziel mit hoher Schadensrate auszuwählen und zu versuchen, es zu töten.', 'Versuche durch den Tempovorteil von „Tugend von Demacia“ eine bessere Position für „Heroischer Ansturm“ zu erreichen.', '', 0, 0, 0, 857, ' Fighter Assassin'),
(7, 'Ryze', 13, '2014-10-21 17:54:20', '2015-04-09 10:19:25', 'Ryze', 550.00, 55.00, 342.40, 55.04, 558.48, 86.00, 3.00, 21.55, 0.80, 5.27, 0.00, 0.00, 6.00, 2.11, 30.00, 340.00, 0.00, 0.00, 0.55, 3.90, 'Der Zauberschurke', 'Es gibt auf Runeterra viele, die vom Studium der Magie oder, in letzter Zeit, dem aufkommenden Feld der Techmaturgie angezogen sind. Für die meisten findet die Erlangung solchen Wissens in Form eines Studiums an einer Universität oder einer Schule statt. In den Hallen für herkömmliche Studien fühlte sich Ryze jedoch nie wirklich zu Hause und seine Verbindung zur Magie von Runeterra war stärker und ursprünglicher als jene derer, die versuchten, ihn zu unterrichten. Als junger Mann machte er sich auf eigene Faust auf den Weg, um zu entdecken, was bereits nach ihm rief. Ryze bereiste die Welt auf der Suche nach der Weisheit der mächtigsten Eremiten, Hexen und Schamanen - jedem, der etwas zu teilen bereit war, das jenseits dessen lag, was in den Stadtstaaten Valorans gelehrt wurde. Nachdem er von diesem Quell der Weisheit auch den letzten Tropfen in sich aufgesogen hatte, fing Ryze an, nach dem verlorenen, vergessenen und verbotenen Wissen der Welt zu forschen, wobei er in mystische Welten abtauchte, die zu betreten andere sich fürchteten.<br><br>Ryzes unermüdliche Suche nach magischem Wissen brachte ihn zu einer uralten Form von Zauberkraft, die als Dornenmagie bezeichnet wird. Für diese Kunst musste sich Ryze Zaubersprüche auf seinen Körper tätowieren, wodurch immerfort unermessliche Mengen arkaner Kraft durch ihn hindurch strömen, damit er sich endlich mit den mystischen Energien Runeterras verbinden konnte. Von einer seiner Reisen brachte er außerdem die riesige und unzerstörbare Schriftrolle mit, die er auf seinem Rücken trägt. Der Zweck des darauf geschriebenen Zaubers bleibt ein Geheimnis, das nur Ryze selbst kennt. Er behauptet jedoch, dass es etwas äußerst Abscheuliches ist, etwas, das er vor der Welt beschützen muss. Dies weckt die Neugier vieler, doch niemand ist sich sicher, wie man die Rolle von Ryze trennen sollte oder ob es überhaupt möglich ist, den Zauberschurken zu überrumpeln, um dies tun zu können. In der Zwischenzeit ist Ryze der Liga der Legenden beigetreten, um die magischen Kreaturen und die mächtigen Willenskrieger zu studieren, die hier kämpfen, damit er endlich seine Studien zum mystischen Runeterra abschließen kann.<br><br>„Ryze ist nicht mehr nur ein Magier - er ist selbst zu einem Geschöpf der Magie geworden.“ - Hoher Rat Heywan Relivash<br>', 'Sei vorsichtig, wenn du dich Ryze mit weniger als vollem Leben näherst.', '„Läutern“ und „Schleier der Todesfee“ sind besonders effektiv gegen Ryze.', 'Ryze kann immer nur einen Spieler im „Runenkäfig“ festhalten. Zusammen mit Freunden anzugreifen, ist die effektivste Methode, aber denk daran, der „Zauberkaskade“ auszuweichen, die zwischen dir und deinen Verbündeten hin- und herspringen kann.', 'Ryze kann sich selbst als Pol für seine „Zauberkaskade“ verwenden, wenn es keine weiteren Gegner gibt, von denen diese abprallen könnte.', 'Die Verwendung von Ryzes Ultimativer Fähigkeit, um Vasallen zu besiegen, kann zu einem großen Goldvorteil werden.', '', 0, 0, 0, 1252, ' Mage Fighter'),
(8, 'Sion', 14, '2014-10-21 17:54:20', '2015-04-09 10:19:25', 'Sion', 150.00, 45.00, 275.60, 59.72, 542.64, 73.00, 4.00, 23.04, 0.60, 10.18, 0.00, 1.25, 8.01, 1.30, 32.10, 345.00, -0.08, 0.00, 0.80, 3.00, 'Der untote Moloch', 'BLUT.<br><br>RIECHE ES.<br><br>WOLLEN. SEHNEN. BRAUCHEN!<br><br>NAH JETZT. SIE KOMMEN.<br><br>KEINE KETTEN? FREI! TÖTEN!<br><br>IN REICHWEITE. JA! STERBEN! STERBEN!<br><br>Vorbei. Zu schnell. Kein Kampf. Mehr. Ich will ... mehr.<br><br>Eine Stimme? Nicht vertraut. Ich sehe ihn. Der Großgeneral. Mein General.<br><br>Er geht voran. Ich folge. Marschiere. Wo hin? Ich sollte es wissen. Ich kann mich nicht erinnern.<br><br>Es fließt alles ineinander. Ist es von Bedeutung? Noxus obsiegt. Der Rest? Nichtig. So lange her, ... dass ich Sieg gekostet habe.<br><br>Der Kriegszug schaukelt. Rattert. Ein beengter Käfig. Sinnlose Zeremonie. Das Warten. Unerträglich. Schneller, Hunde!<br><br>Dort. Banner. Demacianer und ihre Mauern. Feiglinge. Ihre Tore werden bersten. Gedanken an ein Massaker.<br><br>Wer erteilte den Befehl anzuhalten? Die Untergebenen antworten nicht. Keine bekannten Gesichter. Falls ich mich nicht erinnere, wird sich die Geschichte auch nicht erinnern.<br><br>Der Käfig wird geöffnet. Endlich! Kein Warten mehr. WIR GREIFEN AN!<br><br>Schlingen und Pfeile? Kinderwaffen! Ihre Mauern werden sie nicht beschützen!<br><br>Ich kann ihre Angst schmecken. Sie zucken unter jedem Hieb zusammen, während ihre Barrikaden zerbersten. BALD SCHON!<br><br>Noxische Trommeln. Demacianische Schreie. Ruhm bedeutet kein Lob. Ruhm bedeutet Blut an deinen Händen! Das ist Leben!<br><br>Tausend zermalmte Leichen liegen mir zu Füßen, demacianische Häuser brennen überall um mich herum. Es ist zu schnell vorbei! Nur noch einen ...<br><br>Die Männer starren. Furcht in ihren Augen. Wenn sie beim Anblick des Sieges Furcht verspüren, sollte ich ihnen diese feigen Augen ausreißen. Keine Furcht in den Augen des Großgenerals, nur Anerkennung. Er ist mit dieser Eroberung zufrieden.<br><br>Während ich mit dem Großgeneral über das Schlachtfeld gehe und das Blutbad in Augenschein nehme, sehne ich mich nach einem weiteren Widersacher. Er humpelt. Eine Wunde am Bein von der Schlacht? Falls sie ihm Schmerzen bereitet, zeigt er es nicht. Ein wahrer Noxier. Aber ich mag seinen Begleiter nicht. Er pickt an den Toten herum, obwohl er sich nichts verdient hat. Seine Kriegshunde waren eine passendere Begleitung.<br><br>Demacia wird schon bald in unsere Hände fallen. Ich kann es fühlen. Ich bin bereit zu marschieren. Der Großgeneral besteht darauf, dass ich raste. Wie kann ich mich ausruhen, wenn meine Feinde noch immer leben?<br><br>Warum laufen wir herum? Das Warten nagt an mir. Ich bin mir selbst überlassen. Der Vogel schaut zu. Er macht mich nervös. Würde er jemand anderem gehören, würde ich ihn zerquetschen.<br><br>Die Müdigkeit setzt ein. Ich habe mich nie so ... müde gefühlt.<br><br>Boram? Seid ihr es? Was flüstert ihr da?<br><br>Wo bin ich?<br><br>Gefangen? Weggesperrt wie ein Hund. Wie?<br><br>Es gab ... eine Schlacht, wir rissen die Festung nieder, die Stille danach. Wurden wir überfallen? Ich kann mich nicht erinnern.<br><br>Ich wurde verwundet. Ich kann die zerfetzte Scharte spüren ... doch keinen Schmerz. Sie hielten mich für tot. Nun bin ich ihre Trophäe. Das Schicksal lacht mich aus. Ich will nicht eingesperrt sein! Sie werden bedauern, dass sie mich verschont haben.<br><br>Demacianische Würmer! Sie plappern Nettigkeiten, doch sie sind alle skrupellos. Dieser Ort ist eine nasskalte Grube. Sie bringen mir kein Essen. Es gibt keine Folter. Sie stellen mich nicht zur Schau. Ich wurde zum Verrotten zurückgelassen.<br><br>Ich erinnere mich an meinen größten Triumph. Ich hielt einen König an seinem Genick und fühlte den letzten Schlag seines Herzens durch meinen festen Griff. Ich erinnere mich nicht daran, wie ich ihn losließ. Ist dies deine Vergeltung, Jarvan?<br><br>Ich höre den Triumphmarsch. Stiefel auf Stein. Undeutlich, durch die Mauern des Verließes. Das Donnern noxischer Trommeln. Ich werde frei sein. Demacianisches Blut wird durch die Straßen fließen!<br><br>Niemand kam. Ich hörte keinen Kampf. Keinen Rückzug. Habe ich es mir eingebildet?<br><br>Dieser Stumpf schmerzt gar nicht. Ich habe den eisernen Stiefel gar nicht richtig bemerkt. Er ist von Rost zerfressen.<br><br>Wann habe ich mein Bein verloren?<br><br>Ich rieche das Blut noch immer. Eine Schlacht. Sie gibt mir Trost.<br><br>Der Hunger nagt an mir. Ich habe nicht geschlafen. Die Zeit kriecht dahin. So müde.<br><br>Wie lange?<br><br>So dunkel. Diese Grube. Ich erinnere mich. Großgeneral. Sein Flüstern. Was war es?<br><br>Nicht wer ich glaube.<br><br>Vergehen. Darf nicht vergessen.<br><br>Nachricht. Schnitt. Erinnern.<br><br>„SION - Nehmt euch vor Raben in Acht.“<br><br>BEFREIT MICH!<br><br>BLUT.<br>', 'Auch wenn Sion dennoch mit „Dezimierender Schlag“ trifft: Je früher er diesen ausführen muss, umso schwächer ist auch seine Wirkung.', 'Nutze die Zeit nach Sions Tod, um dich in Position zu bringen und auf seine Rückkehr zu warten.', '', 'Du kannst deine Richtung nur sehr eingeschränkt verändern, solange „Unaufhaltbarer Ansturm“ aktiv ist. Versuche also, eine möglichst gerade Strecke zu deinem Ziel zu haben.', '„Brüllen des Schlächters“ eignet sich ideal, um einen sehr kräftigen Treffer mit „Dezimierender Schlag“ zu landen.', 'Über die Verbesserung von „Seelenschmelze“ kannst du einsehen, wie stark dein Schild noch ist, wodurch du die Explosion genau im richtigen Augenblick auslösen kannst.', 0, 0, 295, 983, ' Tank Fighter'),
(9, 'Annie', 1, '2014-10-21 17:54:20', '2015-04-09 10:19:26', 'Annie', 625.00, 50.00, 334.00, 50.41, 511.68, 76.00, 2.62, 19.22, 0.80, 5.42, 0.00, 0.00, 6.00, 1.36, 30.00, 335.00, 0.08, 0.00, 0.55, 4.00, 'Das Kind der Finsternis', 'In der Zeit kurz vor der Bildung der Liga gab es im grausamen Stadtstaat Noxus einige, die nicht mit den Schandtaten des Oberkommandos von Noxus einverstanden waren. Das Oberkommando hatte gerade einen Putschversuch des selbsternannten Kronprinzen Raschallion verhindert und ein hartes Durchgreifen gegenüber jeglicher Form von Widerspruch gegen die neue Regierung bahnte sich an. Diese politisch und sozial Ausgestoßenen, bekannt als der Graue Orden, versuchten, mit ihren Nachbarn in Frieden auszukommen, während sie nach dunklem Geheimwissen suchten. Die Anführer dieser Gemeinschaft von Ausgestoßenen waren miteinander verheiratet: Gregori Hastur, der Graue Hexenmeister, und seine Frau Amoline, die Schattenhexe. Zusammen leiteten sie eine Abwanderungswelle von Magiern und Intellektuellen aus Noxus ein und schufen für ihre Anhänger eine neue Heimat hinter der Großen Barriere am Nordrand der unbarmherzigen Voodoo-Länder. Obwohl es zeitweise nicht leicht war zu überleben, schaffte es die Kolonie des Grauen Ordens, in einem Land zu gedeihen, in dem so viele andere versagt hätten.<br><br>Jahre nach dem Exodus bekamen Gregori und Amoline ein Kind: Annie. Schon sehr früh wussten Annies Eltern, dass ihre Tochter etwas ganz Besonderes war. Im Alter von zwei Jahren bezauberte sie auf wundersame Weise einen Schattenbär - einen schrecklichen Bewohner der versteinerten Wälder außerhalb der Kolonie - und machte ihn zu ihrem Haustier. Bis zum heutigen Tag hat sie ihren Bären „Tibbers“ an ihrer Seite und verwandelt ihn oftmals in ein Stofftier, das sie wie ein Kinderspielzeug bei sich tragen kann. Die Verbindung von Annies Abstammung und der dunklen Magie ihres Geburtsorts hat diesem kleinen Mädchen eine gewaltige arkane Macht verliehen. Und eben jenes Mädchen ist es, das sich nunmehr unter den begehrtesten Champions innerhalb der Liga der Legenden wiederfindet. Selbst bei dem Stadtstaat, der seine Eltern verbannt hätte, wären sie nicht vorher geflohen, ist sie sehr beliebt.<br><br>„Annie könnte zu den mächtigsten Champions zählen, die je auf den Richtfeldern gekämpft haben. Ich erschaudere, wenn ich daran denke, zu was sie im Stande sein wird, wenn sie erst einmal erwachsen ist.“ - Hoher Rat Kiersta Mandrake<br>', 'Annies beschworener Bär, Tibbers, verbrennt gegnerische Einheiten in seiner Nähe. Versuche dich von ihm fernzuhalten, nachdem er beschworen wurde.', '„Zerschmettern“ kann benutzt werden, um Tibbers niederzuringen.', 'Achte auf eine weiße, wabernde Energie um Annie. Sie ist dann bereit, ihre Betäubung einzusetzen.', 'Eine Betäubung in der Hinterhand zu haben, kann einen Gruppenkampf entscheidend beeinflussen.', 'Der umsichtige Einsatz von „Auflösung“ ermöglicht es Annie, schon sehr früh Gold durch besiegte Gegner anzuhäufen.', '„Geschmolzener Schild“ kann benutzt werden, um gezielt die für eine Betäubung notwendigen Zauber zu sprechen, wodurch es manchmal lohnenswert sein kann, zumindest eine Stufe darin zu investieren.', 0, 0, 0, 3760, ' Mage'),
(10, 'Karma', 43, '2014-10-21 17:54:20', '2015-04-09 10:19:26', 'Karma', 525.00, 50.00, 374.00, 53.54, 522.44, 83.00, 3.30, 20.38, 0.80, 5.62, 0.00, 0.00, 6.00, 2.30, 30.00, 335.00, 0.00, 0.00, 0.55, 3.80, 'Die Erleuchtete', 'Karma ist eine Frau mit eisernem Willen und ungebundener spiritueller Macht. In ihr manifestiert sich die Seele Ionias und auf den Richtfeldern besitzt sie eine inspirierende Präsenz, schützt ihre Verbündeten und drängt ihre Gegner zurück. Als starke Anführerin, hin- und hergerissen zwischen Tradition und Veränderung, versucht Karma, Ionias Frieden zu wahren - wenn nötig auch mit Gewalt.<br><br>Einst lebte Karma ein ruhiges Leben in einem kleinen ionischen Dorf. Die Dorfbewohner folgten, von weisen Mönchen angeleitet, den Traditionen aus wohltätiger Magie und Friedfertigkeit. Karma, die für ihre überaus starke Verbindung zur Geisterwelt bekannt war, und von den Ihren als gerechte Schlichterin gepriesen wurde, fügte sich gern in diese Traditionen, waren sie doch ein essenzieller Bestandteil der Erleuchtung, die von allen Ioniern gesucht wird.<br><br>Ihr innerer Friede wurde auf den Prüfstand gestellt, als die Armeen von Noxus Ionia überfielen. Während die weisen Mönche des Dorfes der Meinung waren, dass ihre Friedfertigkeit sie vor Harm schützen würde, hatte Karma doch genug über die Grausamkeit der Noxier gehört, um die Weisheit der Dorfältesten öffentlich infrage zu stellen. Streng und unnachgiebig hießen sie sie, den Traditionen zu vertrauen. Als die Eindringlinge auf das Dorf vordrangen, zogen die weisen Mönche hinaus, um ein unblutiges Ende des Kampfes zu verhandeln. Der noxische General war von ihrer Zurschaustellung von Schwäche angewidert und schlachtete die Mönche eigenhändig ab, derweil er seinen Truppen befahl, das Dorf anzugreifen.<br><br>Während die Noxier vorrückten, bereiteten sich die Dorfbewohner, an ihre Eide der Friedfertigkeit gebunden, darauf vor, ihren Tod zu akzeptieren. Doch Karma wollte den Tod nicht hinnehmen und sah stattdessen einen anderen Weg: ein Leben zu opfern, um viele zu retten. Um die Ihren zu retten, griff sie auf die Kräfte in sich zurück und beschwor die volle Macht ihres Willens. Eine Woge aus Willensfeuer brach aus ihrem Körper hervor und bewegte sich spiralförmig auf den noxischen General zu. Die Flamme nahm die Form von Zwillingsdrachen an, das Symbol Ionias selbst. Es war das erste Mal, dass Karma ihre Kräfte dazu gebraucht hatte, zu verletzen, anstatt zu schützen, und weder sie noch die Dorfbewohner hatten jemals zuvor etwas Ähnliches gesehen. Als die Magie verblasste, lag der General zu ihren Füßen und seine Soldaten waren geflohen. Die Gegner ergaben sich Karmas Stärke und ließen die Ihren und deren Traditionen unberührt.<br><br>Während der Krieg weiter tobte, wurde Karma zu einer beeindruckenden Anführerin des ionischen Widerstandes, doch der Konflikt fand kein Ende, als die noxischen Armeen den ionischen Gestaden flüchtend den Rücken zukehrten. Ionia teilte sich auf zwischen den Kämpfern des Widerstands, die es nach Rache verlangte, und den Mönchen, die verlangten, zu den spirituellen Traditionen zurückzukehren. Karma sah einen dritten Pfad, einen, der die Stärke, die Ionia im Krieg gefunden hatte, mit den friedvollen Traditionen verband, die der Nation noch immer wichtig waren. Nun trachtet sie danach, ihrem verwüsteten Land einen dauerhaften Frieden zu sichern. <br><br>„Euer inneres Feuer kann euch niemand nehmen. Nutzt es weise.“ - Karma<br>', 'Karmas passive Fähigkeit verringert die Abklingzeit von „Mantra“, wenn sie gegnerische Champions mit Fähigkeiten und normalen Angriffen trifft. Lasse nicht zu, dass sie gratis Treffer auf dir landen kann.', 'Karmas „Seelenflackern“ explodiert mit zusätzlichem Schaden in dem Gebiet, in dem es platziert wird. Reagiere schnell und flüchte aus dem Kreis, um zu vermeiden, dass du hohen Schaden erleidest.', '„Konzentrierte Entschlossenheit“ ist ein mächtiges Werkzeug zum Unterbrechen von Kämpfen. Baue Distanz auf, um zu vermeiden, dass du festgehalten wirst, und versuche anschließend anzugreifen.', '„Entflammen“ belohnt eine aggressive Spielweise. Versuche Fähigkeiten und normale Angriffe auf deinen Gegner zu feuern, um die Abklingzeit von „Mantra“ zu verringern und bleibe in der Offensive.', 'Wenn du „Konzentrierte Entschlossenheit“ einsetzt, solltest du deine Widersacher mit „Inneres Feuer“ verlangsamen oder dir selbst mit „Inspirieren“ mehr Tempo verleihen, falls du Probleme bekommst, an einem Ziel dranzubleiben.', 'Gehe nicht zu sparsam mit „Mantra“ um. „Entflammen“ ist am stärksten in Teamkämpfen, wodurch du „Mantra“ ganz leicht mehrmals wieder aufladen kannst.', 1, 0, 0, 1487, ' Mage Support'),
(11, 'Nautilus', 111, '2014-10-21 17:54:20', '2015-04-09 10:19:26', 'Nautilus', 175.00, 50.00, 284.00, 57.54, 576.48, 86.00, 3.30, 26.46, 0.70, 8.37, 0.00, 1.25, 8.62, 1.00, 32.10, 325.00, 0.02, 0.00, 0.55, 3.25, 'Der Titan der Tiefen', 'Einst war Nautilus ein Seemann, der von der Kriegsakademie angeheuert wurde, die unerforschten Weiten des Meeres des Behüters zu erkunden. Diese Expedition brachte ihn tief hinein in unbekannte Gewässer, wo er und seine Besatzung herausfanden, dass sich in einem großen Teil des Ozeans anstelle der tiefblauen Wellen eine schwarze, ölige Flüssigkeit befand, die keiner von der Mannschaft einzuordnen wusste. Obwohl es ihre Aufgabe war, alles Neue, das sie fanden, zu untersuchen, war kein Mann an Bord willens, dem trüben Wasser zu trotzen - abgesehen von Nautilus. Nur wenige Augenblicke, nachdem er den schwergewichtigen Taucheranzug angelegt hatte und über die Reling des Schiffes geklettert war, packte ihn etwas, das in der Brühe gelauert hatte. Er klammerte sich an das Schiff, aber das Ding aus der Tiefe zog unerbittlich an ihm, wodurch das gesamte Schiff ins Wanken geriet. Die anderen Seemänner bekamen Angst und trafen eine schreckliche Entscheidung. Noch während er sie ungläubig anstarrte und um Hilfe flehte, lösten sie mit einem Ruck seinen Griff von der Reling. Er stürzte in das tiefschwarze Meer, während er in seiner Verzweiflung vergeblich nach dem Anker griff. Als er immer tiefer hinabsank, konnte er nichts anderes tun, als zuzusehen, wie der dunkle Umriss seines Schiffes immer kleiner wurde. Dann wurde alles schwarz.<br><br>Als Nautilus erwachte, war er zu etwas anderem geworden. Der riesige eiserne Anzug war jetzt auf unerklärliche Weise Teil von ihm, sodass er nicht sagen konnte, wo dieser endete und er selbst begann. Alle Einzelheiten seiner Erinnerung waren verschwommen und undeutlich, nur eine Tatsache stach kristallklar heraus: er war hier zurückgelassen worden, allein in den Tiefen, in welche die Sonne niemals vordrang, um zu sterben. In seinen Händen hielt er noch immer den Anker, der zu den Männern gehörte, die sein Schicksal besiegelt hatten. Da er keinen anderen Sinn sah, nahm er diesen Hinweis und stapfte los - durch sein Gewicht war es ihm nicht möglich zu schwimmen oder zu rennen -, um nach Antworten zu suchen. Er streifte ziellos und ohne jedes Zeitgefühl durch so etwas wie einen nie enden wollenden Traum. Als er strauchelnd an der Küste von Bilgewasser angelangte, konnte er keine Spuren mehr von dem Mann finden, der er einst gewesen war. Kein Haus, keine Familie, kein Leben, zu dem er hätte zurückkehren können. Entsetzte Seeleute, die seine Geschichte gehört hatten, wiesen Nautilus den Weg zurück zur Akademie, doch die Beschwörer weigerten sich die Namen derer preiszugeben, die sie außer ihm noch angeheuert hatten. Zu diesem Zeitpunkt hatte Nautilus bereits von der Liga der Legenden gehört. Darin sah er eine Möglichkeit, jene aufzuspüren und zu bestrafen, die für die Zeit und das Leben, das er verloren hatte, verantwortlich waren.<br><br>„Ist man in der vollkommenen Dunkelheit gefangen, so gibt es nur noch den Weg nach vorn.“ - Nautilus<br>', 'Nutzt Nautilus „Reißende Flut“ direkt neben dir, so bleib stehen bis die Wirkung vorbei ist und bewege dich nicht. Läufst du zu früh, begibst du dich direkt in die sekundären Explosionen, nimmst zusätzlichen Schaden und wirst verlangsamt.', 'Nautilus kann viel Flächenschaden mit seinen normalen Angriffen verursachen, solange sein Schild bestehen bleibt. Versuche den Schild auszuschalten, wenn du kannst.', '', 'Versuche dich mit „Schlepphaken“ an nahem Terrain entlang zu hangeln, um Gegner zu überraschen, und nutze dann „Reißende Flut“, um besser zu treffen.', '„Reißende Flut“ wird verzögert ausgelöst, was sich auf der Flucht ausnutzen oder bei angreifenden Gegnern zur Ablenkung einsetzen lässt.', '', 0, 0, 0, 1569, ' Tank Fighter'),
(12, 'Lux', 99, '2014-10-21 17:54:20', '2015-04-09 10:19:26', 'Lux', 550.00, 50.00, 334.00, 53.54, 477.72, 79.00, 3.30, 18.72, 0.80, 5.42, 0.00, 0.00, 6.00, 1.36, 30.00, 330.00, 0.00, 0.00, 0.55, 4.00, 'Die Lady des Lichts', 'Geboren als eine der angesehenen Kronwachts, der Musterfamile demacianischer Pflichterfüllung, war Luxanna zu Großem bestimmt. Sie wuchs als einzige Tochter der Familie auf und fand umgehend Gefallen an der vorzüglichen Ausbildung und den prachtvollen Banketten, die für Familien, die in so hohem Ansehen wie die Kronwachts standen, zum guten Ton gehörten. Während Lux heranwuchs, wurde augenfällig, dass sie über die Maßen begabt war. So konnte sie Streiche spielen, bei denen die Leute glaubten, Dinge gesehen zu haben, die gar nicht existierten. Sie konnte sich direkt vor den Augen anderer verbergen. Irgendwie war sie in der Lage, arkane Zaubersprüche - schon nachdem sie nur ein einziges Mal das Wirken der Magie beobachtet hatte - in ihren Einzelheiten wiederzugeben. Sie wurde als Wunderkind gefeiert und gewann die Zuneigung von Regierung, Militär und dem Volk Demacias gleichermaßen.<br><br>Sie war eine der jüngsten Frauen, die je von der Akademie der Magie geprüft wurden, und so entdeckte man bei ihr eine einzigartige Fertigkeit, mit der sie die Mächte und Kräfte des Lichts befehligen kann. Die junge Lux sah dies als großartiges Geschenk an, etwas, das sie annehmen und dazu verwenden musste, Gutes zu tun. Als es ihrer einzigartigen Fähigkeiten gewahr wurde, rekrutierte sie das demacianische Militär und bildete sie für verdeckte Operationen aus. Schnell wurde sie für ihre waghalsigen Unternehmungen bekannt, wobei die gefährlichste fraglos jene war, bei der sie sich weit in den Kammern des Oberkommandos von Noxus wiederfand. Sie beschaffte wertvolle Hintergrundinformationen über den Konflikt zwischen Noxus und Ionia und erwarb sich dadurch bei Demacianern und Ioniern gleichermaßen großen Respekt. Mit Aufklärung und Überwachung jedoch konnte sie nicht wirklich viel anfangen. Als Hoffnungsschimmer ihres Volkes lag Lux'' wahre Bestimmung innerhalb der Liga der Legenden, wo sie in die Fußstapfen ihres Bruders treten konnte und ihre Gaben zur Inspiration aller Einwohner Demacias entfalten konnte.<br><br>„Ihr wegweisendes Licht ermüdet die Feinde, doch am meisten sorgen sollten sie sich, wenn es erlischt.“ - Garen, Macht von Demacia<br>', 'Lux kann hervorragend mehrere Gegner festhalten. Versuche dein Team zu verteilen und greife dann aus verschiedenen Richtungen an, damit sie nicht alle gleichzeitig erfassen kann.', 'Achte auf Lux'' „Finales Funkeln“, wenn du nur noch wenige Lebenspunkte besitzt. Ein roter Zielstrahl wird dem vorausgehen, also versuche diesem auszuweichen.', '', 'Lux kann hervorragend mehrere Gegner festhalten. Versuche „Schillernde Singularität“ einzusetzen, um Gegner am Vorstoß oder an der Flucht zu hindern.', 'Solltest du Probleme mit dem Zielen für „Prismatische Barriere“ haben, denke daran, dass sie immer wieder zu dir zurückkehrt. Stelle dich einfach so, dass sich deine Verbündeten zwischen dir und der Welle befinden.', '„Schillernde Singularität“ eignet sich hervorragend, um damit die Gegend auszukundschaften. Benutze es bei hohem Gras, bevor du einen Blick hinein wirfst.', 0, 0, 395, 1460, ' Mage Support'),
(13, 'Ahri', 103, '2014-10-21 17:54:20', '2015-04-09 10:19:27', 'Ahri', 550.00, 50.00, 334.00, 53.04, 514.40, 80.00, 3.00, 20.88, 0.80, 6.50, 0.00, 0.00, 6.00, 2.00, 30.00, 330.00, -0.06, 0.00, 0.60, 3.50, 'Die neunschwänzige Füchsin', 'Anders als andere Füchse, die durch die Wälder des südlichen Teils von Ionia streiften, hatte Ahri schon immer eine seltsame Verbindung zur magischen Welt um sie herum gespürt; eine Verbindung, die auf irgendeine Weise unvollständig war. Tief in ihrem Inneren fühlte sie, dass die Haut, in die sie hineingeboren worden war, ihr nicht passte und träumte davon, eines Tages ein Mensch zu werden. Ihr Ziel schien für alle Zeit unerreichbar, bis sie zufällig auf die Spuren einer menschlichen Schlacht stieß. Es war eine entsetzliche Szene, das Land war überzogen mit verwundeten und sterbenden Soldaten. Zu einem fühlte sie sich hingezogen: Ein edel gekleideter Mann, der von einem verblassenden Magiefeld umgeben war, durch das dessen Lebenskraft schnell dahinschwand. Sie näherte sich ihm und etwas in ihrem Inneren meldete sich und griff auf eine Art und Weise nach dem Mann, die sie nicht verstand. Seine Lebensessenz floss, getragen von unsichtbaren Magieströmen, durch sie hindurch. Das Gefühl war berauschend und überwältigend. Als ihr Rausch vorüber war, stellte sie entzückt fest, dass sie sich verwandelt hatte. Ihr geschmeidiger weißer Pelz war verschwunden und ihr Körper war rank und schlank - die Form der Menschen, die um sie herum verstreut lagen.<br><br>Doch auch wenn sie nun menschlich erschien, wusste sie, dass die Transformation in Wahrheit unvollständig war. Listig wie sie war, nahm sie die Gepflogenheiten der menschlichen Gesellschaft an und nutzte ihre ausgezeichnete Gabe der Schönheit, um ahnungslose Männer zu verführen. Sie konnte ihre Lebensessenz in sich aufnehmen, wenn sie sich im Bann ihrer Verführungskünste befanden. Sie nährte sich an ihrem Verlangen und dies brachte sie ihrem Traum näher, doch während sie immer mehr Leben nahm, flammte in ihr ein seltsames Gefühl der Reue auf. Sie hatte Bedenken gegenüber Handlungen, die ihr als Fuchs nie Kopfzerbrechen bereitet hatten. Sie erkannte, dass sie der stechende Schmerz ihrer sich entwickelnden Moral nicht loslassen würde. Auf der Suche nach einer Lösung fand Ahri die Kriegsakademie, die Heimstätte der talentiertesten Magier Runeterras. Sie boten ihr durch ihre Dienste in der Liga der Legenden eine Chance, menschlich zu werden, ohne weiteren Schaden anzurichten.<br><br>„Gnade ist ein menschlicher Luxus ... und eine Verantwortung.“ - Ahri<br>', 'Ahris Durchhaltevermögen sinkt gewaltig, wenn ihre ultimative Fähigkeit, „Geisterhast“ nicht verfügbar ist.', 'Bleibe hinter Vasallen, damit sie nicht zu leicht mit „Bezaubern“ treffen kann, was ihr Schadenspotential deutlich verringert.', '', 'Benutze „Bezaubern“, um Kombinationen vorzubereiten. Dadurch wird es viel leichter, mit „Kugel der Täuschung“ oder „Fuchsfeuer“ zu treffen.', 'Eröffne Teamkämpfe mit „Bezaubern“ und verfolge Flüchtende mit „Geisterhast“.', '„Geisterhast“ erlaubt es Ahri, ihre Fähigkeiten einzusetzen, indem es den Weg für „Bezaubern“ frei macht, Doppeltreffer mit „Kugel der Täuschung“ vereinfacht und Ahri nahe genug an einen Gegner für „Fuchsfeuer“ bringt.', 0, 0, 0, 3832, ' Mage Assassin');
INSERT INTO `champions` (`id`, `name`, `champion_id`, `created_at`, `updated_at`, `key`, `attackrange`, `mpperlevel`, `mp`, `attackdamage`, `hp`, `hpperlevel`, `attackdamageperlevel`, `armor`, `mpregenperlevel`, `hpregen`, `critperlevel`, `spellblockperlevel`, `mpregen`, `attackspeedperlevel`, `spellblock`, `movespeed`, `attackspeedoffset`, `crit`, `hpregenperlevel`, `armorperlevel`, `title`, `lore`, `enemytips1`, `enemytips2`, `enemytips3`, `allytips1`, `allytips2`, `allytips3`, `f2p`, `sale`, `sale_price`, `votes`, `tags`) VALUES
(14, 'Olaf', 2, '2014-10-21 17:54:20', '2015-04-09 10:19:27', 'Olaf', 125.00, 45.00, 265.60, 59.98, 597.24, 93.00, 3.50, 26.04, 0.57, 8.51, 0.00, 1.25, 7.46, 2.70, 32.10, 350.00, -0.10, 0.00, 0.90, 3.00, 'Der Berserker', 'Die meisten Menschen würden sagen, der Tod ist etwas, das man fürchten sollte. Olaf würde nicht zu diesen gehören. Der Berserker lebt nur für das Getöse des Schlachtrufs und das Aufeinanderprallen von Stahl. Angespornt durch seinen Hunger nach Ruhm und den sich abzeichnenden Fluch eines Todes in Vergessenheit stürzt sich Olaf mit waghalsiger Hingabe in jeden Kampf. Dem Blutdurst tief in seinem Inneren nachgebend fühlt sich Olaf nur richtig lebendig, wenn er mit dem Tode ringt.<br><br>Die Halbinsel Lokfar gehört zu den brutalsten Orten in Freljord. Dort ist die Rage das einzige Feuer, das gefrorene Knochen wärmen kann; Blut die einzige Flüssigkeit, die ungehindert fließt; und es gibt dort kein schrecklicheres Schicksal als alt, gebrechlich und vergessen zu werden. Olaf gehörte zu den Kriegern Lokfars, denen es an Siegen nicht mangelte und die andere gern daran teilhaben ließen. Als er sich eines Abends mit seinen Klanbrüdern über der glühenden Asche eines geplünderten Dorfes seiner Taten rühmte, wurde einer der älteren Krieger Olafs Gepolter müde. Der alte Kämpfer hielt Olaf an, die Omen zu lesen und herauszufinden, ob Olafs Schicksal mit seiner Prahlerei zusammenpasste. Von der Herausforderung angestachelt verhöhnte Olaf den Neid des betagten Räubers und warf die Fingerknochen einer seit vielen Jahren toten Bestie, um den unermesslichen Ruhm, der ihm im Tode zuteil werden würde, vorherzusagen. Doch alle Heiterkeit war bei den Anwesenden verflogen, als ein Klanmitglied die Omen deutete: Die Knochen kündeten von einem langen Leben und einem friedlichen Dahinscheiden Olafs.<br><br>Wutentbrannt stürmte Olaf hinaus in die Nacht, fest entschlossen zu beweisen, dass die Vorhersehung falsch sei, indem er Lokfars gefürchtete Frostschlange aufsuchte und erschlug. Das Monster hatte während seines langen Lebens sowohl Tausende Männer als auch Schiffe verschlungen, deshalb wäre der Tod im Kampf gegen diese Kreatur ein passendes Ende für einen Krieger. Als Olaf sich in die schwarzen Tiefen ihres Rachens stürzte, fiel er nur tiefer in das Schwarz seines Verstands. Als der Schock des gefrierenden Wassers ihn aus der Dunkelheit riss, lag der abgeschlachtete Kadaver der Bestie neben ihm im Wasser. Niedergeschlagen, doch nicht besiegt, machte sich Olaf auf, jede legendäre Kreatur mit Klauen und Reißzähnen in der Hoffnung zu jagen, der nächste Kampf würde sein letzter sein. Jedes Mal stürzte er sich Hals über Kopf seinem ersehnten Tod entgegen, nur um durch die Raserei, die über ihn hinwegfegte, wenn er kurz vor dem Abgrund stand, verschont zu werden.<br><br>Olaf schloss daraus, dass keine einfache Bestie ihm den Tod eines Kriegers gewähren konnte. Seine Lösung bestand darin, es mit dem gefürchtetsten Stamm Freljords aufzunehmen: den Winterklauen. Sejuani schien von Olafs Herausforderung an ihren Kriegstrupp amüsiert, doch seine Dreistigkeit würde ihm keine Gnade verschaffen. Sie befahl den Angriff und sandte viele ihrer Krieger aus, um Olaf zu überwältigen. Einer nach dem anderen fiel, bis er sich selbst einmal mehr in Blutrausch verlor und mühelos seinen Weg bis zur Anführerin der Winterklauen bahnte. Die Wucht des Aufpralls zwischen Olaf und Sejuani ließ die Gletscher beben und auch wenn er unaufhaltsam schien, zwang Sejuani den Berserker zum Innehalten. Als sie sich gegenüberstanden, durchdrang Sejuanis starrer Blick Olafs Berserkerwahn auf eine Art, wie es keine Waffe je vermocht hatte. Seine Raserei war lange genug gedämpft, dass sie ihm ein Angebot unterbreiten konnte: Sejuani schwor, dass sie Olaf zu seinem glorreichen Tod verhelfen werde, wenn er seine Axt für ihre Eroberungskampagne einsetzen würde. In diesem Augenblick gelobte Olaf, er würde sein Vermächtnis in Freljords Eis ritzen.<br><br>„Wenn du deinen Ahnen gegenübertrittst, sag ihnen, Olaf hat dich geschickt.“ - Olaf<br>', 'Olaf wird immer gefährlicher, je mehr er an Leben verliert. Mach ihn erst am Ende eines Kampfes kampfunfähig, um ihm den Rest zu geben.', 'Wenn du Olaf in der Anfangsphase des Spiels davon abhalten kannst, seine Axt aufzuheben, minimiert dies den Schaden, den er verursacht.', 'Trotz seiner Immunität gegenüber kampfunfähig machenden Fähigkeiten ist Olafs Verteidigung durch den Schaden während „Ragnarök“ verringert. Falls du Olaf während „Ragnarök“ nicht entkommen kannst, versuche, deinen und den Schaden deiner Teamkollegen auf ihn zu konzentrieren.', 'Bei niedrigen Leben kann Olaf „Berserker-Wut“, „Boshafte Schläge“ und „Ragnarök“ kombinieren, um trügerisch stark zu erscheinen.', 'Die durch „Boshafte Schläge“ gewährte zusätzliche Heilung verstärkt sowohl deinen Lebensraub aus allen Quellen als auch Heilungen von Verbündeten', '', 0, 0, 0, 1239, ' Fighter Tank'),
(15, 'Viktor', 112, '2014-10-21 17:54:20', '2015-04-09 10:19:27', 'Viktor', 525.00, 50.00, 324.00, 52.04, 516.04, 78.00, 3.00, 22.72, 0.80, 7.84, 0.00, 0.00, 6.00, 2.11, 30.00, 335.00, -0.05, 0.00, 0.65, 4.00, 'Der Vorbote der Maschinen', 'Schon früh in seinem Leben entdeckte Viktor seine Hingabe für die Wissenschaft und Erfindungen, insbesondere im Feld der mechanischen Automatisierungstechnik. Er besuchte Zhauns prestigeträchtige techmaturgische Universität und leitete dort das Team, das Blitzcrank erschuf - ein wissenschaftlicher Durchbruch, der ihn nach ganz oben bringen sollte. Unglücklicherweise wurde ihm dieser Triumph durch Professor Stanwick genommen, der seine Arbeit stahl und sich selbst die Entwicklung von Blitzcranks Bewusstsein zuschrieb. Später verwendete er Viktors Forschungen, um Urgot wiederzubeleben. Viktors Rufe nach Gerechtigkeit stießen auf taube Ohren und er versank in tiefe Depressionen. Er zog sich aus der Universität zurück, verbarrikadierte sich selbst in seinem Privatlabor und durchtrennte so alle menschlichen Bande. Dort, im Geheimen, entsann er ein Projekt, für das niemand anderes den Ruhm einheimsen könnte. Es drang ihm danach, sowohl sein Arbeitsfeld zu revolutionieren als auch die neidischen menschlichen Emotionen, die in ihm kochten, zu eliminieren. Er entwarf Teile, um seinen eigenen Körper zu ersetzen und zu verbessern.<br><br>Als sich Viktor wieder erhob, verblieb so gut wie keine Spur von dem einstigen Mann. Er hatte nicht nur einen Großteil seiner Anatomie ersetzt, sondern auch seine Persönlichkeit hatte sich verändert. Seine bisherige Hoffnung, die Gesellschaft zu verbessern, wich einer Besessenheit mit dem, was er als die „glorreiche Evolution“ bezeichnete. Er sah sich selbst als den Stammvater und Pionier von Valorans Zukunft - einer Zukunft, in der der Mensch sein Fleisch aufgeben würde, um dieses durch verschiedene überlegene Hextech-Verbesserungen zu ersetzen. Auch wenn sich Viktors anfängliche Ansprachen zahlreicher Bedenken gegenübersahen, so waren Wissenschaftler dennoch von der Perfektion seiner Maschinerie verblüfft. Indem er seinen Verstand mit techmaturgischen Geräten verband, konnte er den Fortschritt seiner Forschungsarbeit enorm beschleunigen. Seine Transformation entfernte das, was er als seine emotionale Schwäche vernahm, aber es verblieb dennoch eine gewisse Menge Missgunst gegenüber dem Professor. Viktor trat der Liga der Legenden bei, um seine Erfindungen an den mächtigsten Gegnern, die Valoran bieten konnte, zu messen und um mögliche verbleibende Schwächen oder Ineffizienzen zu beseitigen.<br><br>„In der Hand der einen ist die Techmaturgie ein Werkzeug. In der Hand der anderen eine Befreiung.“ - Viktor<br>', 'Achte darauf, wie nahe du Viktor an dich heran lässt. Viktor kann seine Gegner besser kontrollieren, je näher er diesen ist.', 'Reagiere auf die von Viktor benutzte Verstärkung, indem du auf das Licht seines Stabs achtest (lila, gelb, blau, rot).', '', '„Todesstrahl“ kann Gegnern gezielt zusetzen oder ihnen eine Passage verwehren. Verwende es zusammen mit „Gravitationsfeld“, um deinem Gegner seine Position zu diktieren.', 'Achte darauf, die richtige Verstärkung zu wählen.', '', 0, 0, 440, 2112, ' Mage'),
(16, 'Anivia', 34, '2014-10-21 17:54:20', '2015-04-09 10:19:27', 'Anivia', 600.00, 53.00, 346.04, 51.38, 467.60, 70.00, 3.20, 21.22, 0.80, 5.57, 0.00, 0.00, 6.00, 1.68, 30.00, 325.00, 0.00, 0.00, 0.55, 4.00, 'Der Kryophönix', 'Anivia ist ein Wesen kältesten Winters, eine mystische Personifikation der Eismagie und eine uralte Beschützerin Freljords. Sie befehligt die gesamte Macht und Wut, die dem Land eigen ist, und ruft sowohl den Schnee als auch den bitterkalten Wind an, ihre Heimat vor jenen zu schützen, die ihr Schaden zufügen wollen. Als wohlwollende aber rätselhafte Kreatur ist Anivia durch Leben, Tod und Wiedergeburt auf ewig daran gebunden, über Freljord Wache zu halten.<br><br>Anivia ist ebenso ein Teil von Freljord wie der nie endende Frost. Lange bevor Sterbliche einen Fuß in die eiskalte Tundra dieses Landes gesetzt haben, hatte sie zahllose Lebenszyklen durchlaufen und war ebenso viele Tode gestorben. Der Beginn und das Ende eines jeden ewigen Zyklus‘ kündete von einer großen Veränderung, die von der Beruhigung wütender Stürme bis zum Aufkommen und Abklingen ganzer Eiszeitalter reichen konnte. Man sagt, wenn der Kryophönix stirbt, endet eine Ära; und wenn sie wiedergeboren wird, beginnt eine neue Ära.<br><br>Auch wenn Anivias vergangene Lebenszyklen in ihrer Erinnerung verblasst sind, kennt sie ihren Zweck: Sie muss Freljord um jeden Preis beschützen.<br><br>Bei ihrer letzten Wiedergeburt wurde Anivia Zeugin des Aufstiegs eines mächtigen und vereinten menschlichen Stammes. Sie bewachte ihr Land mit Stolz, denn es florierte, doch solche Einigkeit konnte nicht lange währen. Der große Stamm zerbrach in drei kleinere und nach dem Umbruch musste Anivia mit ansehen, wie die Völker Freljords einander bekriegten. Als sie darum kämpfte, dem Aufruhr, der ihre Heimat spaltete, Einhalt zu gebieten, verspürte sie eine noch größere Bedrohung: Ein uraltes Unheil erwuchs tief im Inneren der Erde. Zu ihrem Entsetzen fühlte sie, wie die reine Magie des Eises sich verdunkelte und verdorben wurde. Wie Blut durch Wasser, schlich sich die Finsternis in Freljord ein. Da ihr Schicksal so eng mit der Macht des Landes verwoben ist, wusste Anivia, dass, sollte das Böse in ihrer Heimat Fuß fassen, dasselbe Böse auch seinen Weg in ihr Herz finden würde. Sie konnte nicht länger nur als Beschützerin agieren - der Kryophönix musste eingreifen.<br><br>Anivia fand schon bald eine Verbündete in Ashe, der Frostbogenschützin. Auch sie glaubte an die Einheit, um der immerwährenden Zwietracht in Freljord ein Ende zu setzen. Anivia bot der Stammesführerin ihre Hilfe an. Nun, da sich ein Krieg am Horizont abzeichnet, bereitet sich Anivia darauf vor, um Frieden zu kämpfen, doch sie kennt die unvermeidliche Wahrheit ihres Schicksals. Eines Tages wird das Böse aus dem Eis auferstehen und sie wird es zerstören müssen - koste es, was es wolle.<br><br>„Ich bin der Zorn des Eissturms, der Biss des Windes und die Kälte des Eises. Ich bin Freljord.“<br>- Anivia', 'Versuch, Anivia während der Pfad-Gefechte anzugreifen. Mit mehreren Leuten ist es einfacher, das Ei zu zerstören.', 'Wenn du einen Fernkämpfer spielst, dann bleib weit genug von Anivia weg, um dem „Blitzeis“ besser ausweichen zu können.', 'Versuch, Anivia auf den Hauptpfaden anzugreifen. Im Urwald kann sie die kleinen Wege schon mit niedrigstufigen „Kristallisieren“ versperren.', '„Blitzeis“ und „Frostbiss“ können eine vernichtende Kombination ergeben.', 'Anivia ist durch „Eissturm“ besonders von Mana abhängig. Versuch daher Gegenstände mit zusätzlichem Mana zu bekommen, oder besorge dir die Verbesserung Wappen des uralten Golems in der Kluft der Beschwörer.', 'Für gegnerische Champions kann es schwierig werden, ihr Ei schon früh im Spiel zu zerstören. Durch einen anfänglichen aggressiven Spielstil lässt sich dies besonders gut ausnutzen.', 0, 0, 395, 2943, ' Mage Support'),
(17, 'Garen', 86, '2014-10-21 17:54:20', '2015-04-09 10:19:28', 'Garen', 125.00, 0.00, 0.00, 57.88, 616.28, 96.00, 3.50, 27.54, 0.00, 7.84, 0.00, 1.25, 0.00, 2.90, 32.10, 345.00, 0.00, 0.00, 0.50, 2.70, 'Die Macht von Demacia', 'Überall in Valoran wird die Entschlossenheit von Demacias Militär entweder gefeiert oder verachtet, aber immer respektiert. Ihr „Null Toleranz“-Kodex wird sowohl vom Militär als auch der Zivilbevölkerung strikt eingehalten. Im Kampf bedeutet dies, dass demacianische Truppen unter keinen Umständen zurückweichen, fliehen oder sich ergeben würden. Diese Grundsätze werden durch unangefochtene Demagogen vorangetrieben, die als Vorbilder fungieren. Garen, der tapfere Krieger mit dem Titel „Die Macht von Demacia“, ist das Paradigma, mit dem diese Anführer verglichen werden. Tausende großer Helden erhoben sich und fielen auf den blutigen Schlachtfeldern zwischen Demacia und seinen Erzrivalen, allen voran Noxus. Unter diesen mächtigen Bannern des Krieges kreuzte Garen zum ersten Mal den Stahl mit Katarina, der unheimlichen Klinge. Die Infanteristen, die bei diesem Ereignis Zeuge waren (und überlebten) beschrieben den Kampf so, als hätten die beiden einen tödlichen Walzer getanzt, der von einer Symphonie klirrender Klingen begleitet wurde.<br><br>Garen, der Stolz des demacianischen Militärs und der Anführer der Furchtlosen Vorhut, kehrte zum ersten Mal in seiner Karriere atemlos aus einem Kampf zurück, auch wenn einige munkeln mögen, dass dies andere Gründe als pure Erschöpfung hatte. Die Glaubhaftigkeit dieser Gerüchte wurde immer wieder neu untermauert, als Garen daraufhin jede Gelegenheit nutzte, der unheimlichen Klinge erneut entgegen zu treten. Als Paradigma der demacianischen Ethik unterstützte Garen niemals solche Behauptungen, denn er wusste, andere könnten es nicht verstehen. Schon das Verfolgen eines würdigen Gegners auf dem Schlachtfeld wäre für einen wahren Krieger ein Grund, sich jeden Morgen neu zu erheben. Doch die Verheißung eines solchen, zudem so wunderschönen und genau entgegengesetzten, wäre eine Bestätigung für seine Existenz.<br><br>„Der effektivste Weg, einen Gegner zu töten, ist, seinen Nächsten zu durchbohren.“ - Garen, über Frontlinienstrategie<br>', 'Kombiniere verschiedene Gegenstände, die deine Rüstung erhöhen, um den großen physischen Schaden, den Garen verursacht, zu verringern.', 'Halte dich von Garen fern, wenn deine Lebensenergie zu stark abnimmt, da er dir sonst mit Hilfe von „Demacianische Gerechtigkeit“ ein schnelles Ende bereiten kann.', 'Pass auf, wenn du Garen im Gebüsch angreifst. Du kannst dir dabei viel Schaden durch „Richten“ einhandeln.', 'Garens Regeneration erhöht sich außerordentlich stark, wenn er einige Sekunden lang jeden Schaden vermeiden kann.', '„Mut“ steigert die Effektivität defensiver Gegenstände. Stelle sicher, dich entsprechend deiner Gegner und deren Schadensarten auszurüsten.', 'Garen wird nur durch Abklingzeiten in seine Schranken gewiesen, deshalb sind Gegenstände wie „Youmus Geistklinge“ und „Brutalisierer“ für ihn besonders lohnenswert.', 0, 0, 0, 2661, ' Fighter Tank'),
(18, 'Singed', 27, '2014-10-21 17:54:20', '2015-04-09 10:19:28', 'Singed', 125.00, 45.00, 290.60, 62.32, 542.76, 82.00, 3.38, 27.88, 0.55, 8.02, 0.00, 0.00, 7.52, 1.81, 30.00, 345.00, 0.02, 0.00, 0.55, 3.50, 'Der verrückte Chemiker', 'Singed entstammt einer langen Linie von Chemikern, die in Zhaun verehrt wurden. Schon in seiner Jugend überflügelte sein Talent beim Brauen von Tränken das seiner Altersgenossen um Längen, sodass er sich schnell von seinen weniger außergewöhnlichen Chemikerkollegen abhob. Folglich war es auch für niemanden überraschend, als er vom berüchtigten Warwick, dem Meisterapotheker, der ein lukratives Angebot des noxischen Militärs im Rahmen einer Kampagne gegen Ionia angenommen hatte, zum Lehrling erwählt wurde. In Warwicks Laboratorien schuftete Singed ohne Unterlass und sog alles in sich auf, was er vom tödlichen Handwerk seines Vorgängers lernen konnte. Singed kümmerte sich wenig um Tod und Verderben - die Resultate seiner Mühen. Als der Fluch der Lykanthropie seinen Meister traf, war Singed bereit und brannte geradezu darauf, den Schritt vom Arbeitspferd zum Erfinder zu vollziehen. Er war bereit, der Welt seine Genialität zu zeigen, indem er eine ganz neue Dimension des Leids an die ionische Front brachte. Sein Fortschrittseifer war unersättlich und wenn passende Testobjekte rar waren, so sagt man sich, probierte er seine volatilen Mixturen nicht selten an seinem eigenen Fleisch aus.<br><br>Als der unsichere Frieden, der durch die Liga der Legenden aufrecht erhalten wird, in der Welt Einzug hielt, ging Singed an den einzigen Ort, an dem er seine geliebte Kunst zur Schau stellen konnte: die Kriegsakademie. Zu der Zeit war er kaum noch als Mensch zu erkennen, sein erfindungsreiches Handwerk war für seinen Körper Lebensquell und Untergang zugleich. Tausende Verbrennungen - Zwischenfälle mit Schatten und Flammen - verunstalten seine böse zugerichtete Gestalt. Dadurch dass sie ständig solch rauen Bedingungen ausgesetzt waren, starben seine Nerven ab, wurde sein Körper abgehärtet und seine Physis gestärkt. Er wurde zu einem wahrhaftigen Moloch. Im Zusammenspiel mit einem beeindruckenden Arsenal tödlicher Gebräue wurde Singed dadurch zu einer Macht, mit der man auf den Richtfeldern rechnen muss.<br><br>„Meine tödlichste Dosis soll den Namen meines Mäzens tragen!“ - Singed, als er dem Irrsinnstrank seinen Namen verlieh<br>', 'Halte Abstand, um nicht in Singeds Verbündete geschleudert zu werden.', 'Singed muss nah an dein Team gelangen, um effektiv zu sein. Nutze dies aus, um ihn mit Massenkontrolleffekten in Schach zu halten, während du seine Verbündeten angreifst.', 'Pass auf, wenn du Singed jagst. Er ist sehr schwer kleinzukriegen und kann eine Giftspur hinterlassen, um während deiner Verfolgung Schaden an dir zu verursachen.', 'Die „Giftspur“ ist sehr effektiv dabei, Vasallen auszuschalten und Gegner zu beharken, wodurch Singed das Kräfteverhältnis einer gesamten Linie verschieben kann.', 'Nutze „Irrsinnstrank“, um deine Gegner zu einer Verfolgung in der „Giftspur“ zu bewegen.', 'Das Werfen von Gegnern in einen eigenen Turm kann ihnen schweren Schaden zufügen.', 1, 0, 0, 1176, ' Tank Fighter'),
(19, 'Lissandra', 127, '2014-10-21 17:54:20', '2015-04-09 10:19:28', 'Lissandra', 550.00, 50.00, 304.00, 50.54, 506.12, 84.00, 2.70, 20.22, 0.40, 6.92, 0.00, 0.00, 5.67, 1.36, 30.00, 325.00, 0.00, 0.00, 0.55, 3.70, 'Die Eishexe', 'Lissandras Magie verwandelt die pure Macht des Eises in etwas Dunkles und Schreckliches. Mit der Kraft ihres schwarzen Eises kann sie mehr als ihre Gegner nur zu Eis erstarren lassen ... sie spießt all jene auf, die sich ihr entgegenstellen, und zerschmettert sie dann. Den verängstigten Bewohnern des Nordens ist sie nur als „Eishexe“ bekannt. Die Wahrheit ist aber um ein Vielfaches düsterer: Lissandra verdirbt die Natur und plant, ein Eiszeitalter über die Welt hereinbrechen zu lassen.<br><br>Vor Jahrhunderten verriet Lissandra ihren Stamm an böse Kreaturen, die als Gefrorene Seher bekannt sind, im Austausch gegen Macht. Dies war der letzte Tag, an dem warmes Blut durch ihre Adern floss. Mit ihren verdorbenen Stammesangehörigen und der Stärke der Seher suchte sie das Land heim wie ein schrecklicher Eissturm. Während sich ihr Imperium ausweitete, wurde die Welt immer kälter und Eis ließ das Land erzittern. Als die Seher von uralten Helden geschlagen wurden, verlor Lissandra nicht den Glauben und schwor, die Welt auf ihre Rückkehr vorzubereiten.<br><br>Lissandra arbeitete daran, alles Wissen über die Seher zu eliminieren. Mit Hilfe von Magie nahm sie menschliche Gestalt an und gab sich als zahllose Weissager und Ältere aus. Im Laufe der Generationen schrieb sie die Geschichten Freljords neu und veränderte so die Vergangenheit seines Volkes. Heutzutage werden die bruchstückhaften Geschichten über die Seher als Kindermärchen abgetan. Doch diese Täuschung war nicht genug, Lissandra benötigte auch eine Armee.<br><br>Sie setzte sich den edlen Stamm der Frostwächter als Ziel. Lissandra wusste, dass es Jahrhunderte dauern würde, die Frostwächter zu korrumpieren, und brachte ihr größtes Täuschungsmanöver auf den Weg. Sie stahl die Identität der Anführerin der Frostwächter, indem sie sie ermordete. Dann begann sie langsam damit, die stolzen Traditionen des Stammes zu verfälschen. Als ihre menschliche Gestalt alterte, täuschte sie ihren eigenen Tod vor und ermordete dann ihre Nachfolgerin, um deren Identität zu stehlen. Mit jeder weiteren Generation kapselten sich die Frostwächter immer mehr ab, wurden brutal und verdorben. Heute sieht die Welt sie noch immer als einen edlen, friedlichen Stamm an, der sie gegen böse Kreaturen wie die Eishexe schützt. In Wahrheit jedoch dienen sie nun der Hexe und arbeiten auf die glorreiche Rückkehr der Seher hin.<br><br>Lissandra weiß, dass an diesem Tag Nationen untergehen werden und die Welt in Eis neugeboren werden wird.<br><br>„Schließe deine Augen und gib dich der Kälte hin.“ - Lissandra<br>', 'Der beste Weg, Lissandra davon abzuhalten, ihren „Frostpfad“ als Fortbewegungsmittel zu nutzen, ist, sie bewegungsunfähig zu machen, bevor sie ihn erneut aktivieren kann.', ' Lissandras „Frostring“ hat auf niedrigeren Rängen eine lange Abklingzeit. Greif sie an, wenn sie die Fähigkeit nicht bereit hat.', 'Lissandras „Eissplitter“ verlangsamt nur die erste Einheit, die es trifft. Nähere dich Lissandra, indem du hinter den Vasallen deines Teams stehst, um zu vermeiden, dass du verlangsamt wirst.', 'Du kannst sofort deine ultimative Fähigkeit auf dich selbst anwenden, indem du die Taste für auf dich selbst ausgeführte Fähigkeiten zusammen mit der Taste für die ultimative Fähigkeit (standardmäßig sind das Alt+R) drückst.', 'Wenn du „Frostpfad“ wirkst und dann in die entgegengesetzte Richtung läufst, wird dies deine Gegner verunsichern, welchen Weg du wirklich einschlägst.', 'Lissandras Fähigkeiten haben eine kürzere Reichweite als die vieler anderer Magier. Demnach können Gegenstände, die sowohl Fähigkeitsstärke als auch Defensive bieten, wie Zhonyas Stundenglas und Höllenzepter, eine gute Wahl sein, damit du nicht nur überlebst, sondern auch Schaden verursachst.', 0, 0, 0, 1288, ' Mage'),
(20, 'Maokai', 57, '2014-10-21 17:54:20', '2015-04-09 10:19:28', 'Maokai', 125.00, 46.00, 327.28, 63.54, 572.20, 90.00, 3.30, 28.72, 0.45, 8.68, 0.00, 0.00, 7.21, 2.12, 30.00, 335.00, -0.10, 0.00, 0.85, 4.00, 'Der gewundene Treant', 'Maokai war einst ein friedlicher Naturgeist, der in einem idyllischen Wald beheimatet war, doch die Arroganz der Menschen setzte diesem Leben ein Ende. Nun ist er ein knorriger Schatten seines einstigen Selbst, verdorben durch dunkle Magie, welche der natürlichen Ordnung von Leben und Tod trotzt. Beseelt von Macht, um die er nie gebeten hat, wurde der mächtige Treant zu einer rachsüchtigen Kraft der Natur, die seine Gegner mit wilder Magie und Ästen, die so hart sind wie Eisen, zerreißt, während er in Valoran nach Wegen sucht, den Schatteninseln wieder zu ihrem einstigen Ruhm zu verhelfen.<br><br>Bevor die Schatteninseln zu einem Land des Todes wurden, wimmelte es dort vor Leben und Schönheit der Natur. Dies galt für nichts so sehr wie für den geheiligten Wald der Inseln: Ein Paradies voller blühender Bäume und zahlloser Arten von sowohl Tieren als auch Geistern. Als der König der Schatteninseln seinen Zauberern befahl, die Barriere, die Leben und Tod voneinander trennt, aufzubrechen, diente ihm der Wald als Quelle der Macht, aus der die Magi sich reichlich bedienten.<br><br>Das Ritual der Zauberer hatte Erfolg und zerstörte den Kreislauf des Lebens. Auf diese Weise wurden Kräfte entfesselt, die sie sich nicht hätten vorstellen können. Die Lebenskraft sickerte aus jedem Lebewesen auf den Schatteninseln: mächtige Bäume verdorrten zu knorrigen Hüllen, Menschen wurden zu verdorbenen Schatten und Waldgeister verwandelten sich in hohle Schemen. Maokai, der stärkste Geist des geheiligten Waldes, sah mit Schrecken, wie seine Welt um ihn herum zerfiel und starb. Er kämpfte, um die Wunde in der Welt zu heilen, doch er konnte die Zerstörung, die durch die Torheit der Menschen verursacht wurde, nicht aufhalten. Als die grässlichen Energien versuchten, den mächtigen Geist zu überwältigen, unternahm dieser einen letzten verzweifelten Versuch, das Leben des Landes zu bewahren. Maokai nistete sich in die uralte Eiche im Herzen der spirituellen Kraft des Waldes ein. Dort sammelte er die Essenz der Inseln in dem Baum, während die Verderbnis des Untodes hungrig danach gierte, allem habhaft zu werden, was sich in ihrer Reichweite befand. Gestärkt von unbändiger Magie konnte Maokai nicht vollständig verzehrt werden, auch wenn der Geist aus diesem Kampf nicht unversehrt hervorging.<br><br>Maokai, der nun mit den Essenzen von Leben und Tod durchtränkt war, wurde eins mit der uralten Eiche und verkrümmte sich zu einer Abscheulichkeit. Jahrhundertelang waren Schmerz und Trauer die einzigen Begleiter des Geistes. Seine Äste wurden ihm schwer, während er die Verwüstung von allem, das er je gekannt und geliebt hatte, beweinte. Seine Wurzeln wurden der Erde entrissen, während er gegen die Zauberer wütete, die seine Heimat zugrunde gerichtet hatten. Aber es war nicht alles verloren. Maokai hatte den letzten Lebensfunken, der den Schatteninseln blieb, bewahrt, und mit ihm die Hoffnung, dass Leben in dieses Land zurückkehren kann.<br><br>Wie Motten zum Licht wurden die gequälten Schatten der Schatteninseln zu der Lebensessenz in Maokais Innerem hingezogen. Der Geist beschützte den Samen des Lebens vor den erbarmungslosen Untoten, doch Maokai wusste, er konnte sie nicht für alle Zeit abwehren. Er musste aus dem Land des Todes, zu dem seine Heimat geworden war, fliehen. Also warf er sich selbst ins Meer und vertraute darauf, dass die Natur ihn zu einem lebenden Land geleiten würde. Er hoffte, dort die Mittel zu finden, die Mächte des Untodes auszutreiben und das Leben auf den Schatteninseln wiederherzustellen.<br><br>„Es hat Konsequenzen, wenn ihr die natürliche Ordnung herausfordert.“ - Maokai<br>', 'Halte Vasallen zwischen dir und Sprösslingen, um vor diesen geschützt zu sein. Mit genügend Tempo kann man ihnen ebenfalls entkommen.', '„Rachsüchtiger Mahlstrom“ verursacht mehr Schaden, wenn du Maokai oder dessen Verbündete im Wirkbereich angreifst.', 'Maokai erleidet keinen Schaden, während er „Gewundener Vormarsch“ einsetzt, also spare dir deine Fähigkeiten.', 'Sprösslinge können in hohes Gras und über Hindernisse hinweg geworfen werden, um dort Gegner aufzudecken.', 'Warte mit „Rachsüchtiger Mahlstrom“ bis deine Gegner völlig in einen Kampf vertieft sind.', 'Höhere Stufen von „Arkanes Schmettern“ und „Gewundener Vormarsch“ gewähren Maokai viele Möglichkeiten, die Bewegungsmöglichkeiten von Gegnern zu verringern, während „Sprösslingwurf“ seinen Schaden und die Möglichkeit, viele Vasallen gleichzeitig zu töten, erhöht.', 0, 0, 0, 1314, ' Tank Mage'),
(21, 'Morgana', 25, '2014-10-21 17:54:20', '2015-04-09 10:19:28', 'Morgana', 450.00, 60.00, 340.80, 55.46, 547.48, 86.00, 3.50, 25.38, 0.80, 5.70, 0.00, 0.00, 6.00, 1.53, 30.00, 335.00, 0.00, 0.00, 0.60, 3.80, 'Der gefallene Engel', 'Es gibt weit entfernt von hier eine Welt, die von geflügelten Wesen bewohnt wird, die mit der Gabe der Unsterblichkeit gesegnet sind. Dort wütet noch immer ein uralter Konflikt. Wie so viele Konflikte hat auch dieser Krieg Familien gespalten. Eine Seite behauptete von sich, Wesen perfekter Ordnung und Gerechtigkeit zu sein, die kämpfen, um die Welt unter ihrem Gesetz und ihrer starken zentralen Herrschaft zu vereinen. Diejenigen, die gegen sie kämpften, hielten diese für Tyrannen, die nicht in der Lage waren, die Situation ganz zu erfassen, die Individualität und Freiheit für die Illusion von Effizienz und Sicherheit opfern würden. Morgana gehörte zu denen, die gegen das kämpften, was sie als die Tyrannei ihrer Art empfand und wurde dafür als „Gefallene“ gebrandmarkt. Ganz unschuldig war Morgana jedoch bestimmt nicht, hatte sie doch vergessene Wege ausgelotet, um verbotene Macht anzusammeln, um eine mächtige Meisterin der Schwarzen Künste zu werden. Dieses Ziel wurde von der Besessenheit genährt, den General der gegnerischen Armee zu bekämpfen, ihre Schwester Kayle.<br><br>Auch wenn beide leibliche Geschwister waren, warf Kayle den Fehdehandschuh, indem sie jede geschwisterliche Beziehung leugnete, als Morgana sich nicht ihrer Sache anschloss. Daraufhin eignete sich Morgana genug Macht an, um Kayle nicht nur ebenbürtig zu sein, sondern sie sogar herausfordern zu können. Als die Zeit gekommen war und die beiden sich zum letzten Male gegenüberstehen sollten, wurde Morgana plötzlich nach Valoran beschworen. Zunächst vereinbarte Morgana mit den Beschwörern der Liga, im Austausch gegen noch größere Macht zu kämpfen. Nachdem auch Kayle in die Liga aufgenommen wurde, kämpft Morgana nun in der Liga der Legenden mit dem Privileg, ihre Schwester immer wieder und wieder und wieder vernichten zu können. Sie lauert auf den Tag, an dem die Verbindung zur Kriegsakademie sie nicht länger hält und an diesem Tage plant sie, Kayle ein für allemal zu zerstören und als Held nach Hause zurückzukehren.<br><br>„Es gibt keine Atempause so lang Kayles Tyrannei weiter existiert.“ - Morgana<br>', '„Gepeinigte Erde“ verursacht Unmengen an Schaden an Einheiten, denen schon viel Leben fehlt. Achte auf Morganas Versuche, dich darin festzuhalten, wenn du schon stark geschwächt bist.', 'Morgana muss dich mit „Dunkle Bindung“ treffen, damit ihre anderen Angriffe effektiv sind. Versuche Vasallen als Schild vor „Dunkle Bindung“ zu nutzen.', '', 'Der gerissene Einsatz von „Schwarzer Schild“ kann den Ausgang größerer Kämpfe beeinflussen.', 'Gegenstände, welche die Überlebenschancen erhöhen, können Morgana zusammen mit „Schwarzer Schild“ und „Seelenfessel“ nur schwer ausschaltbar machen.', '„Gepeinigte Erde“ eignet sich wunderbar zum farmen, wenn du allein in einer Lane unterwegs bist.', 0, 0, 0, 1177, ' Mage Support'),
(22, 'Evelynn', 28, '2014-10-21 17:54:20', '2015-04-09 10:19:29', 'Evelynn', 125.00, 45.00, 265.60, 53.88, 531.20, 90.00, 3.50, 26.50, 0.60, 9.82, 0.00, 1.25, 8.11, 3.60, 32.10, 340.00, 0.00, 0.00, 0.55, 3.80, 'Die Witwenmacherin', 'Evelynn ist schnell und todbringend - und damit eine der tödlichsten - und teuersten - Assassinen in ganz Runeterra. Sie kann durch reine Willenskraft mit den Schatten verschmelzen und so geduldig ihre Beute verfolgen und den richtigen Moment abwarten, um zuzuschlagen. Auch wenn Evelynn zweifellos nicht vollkommen menschlich ist, erzählt man sich, dass sie von den Schatteninseln stammt - auch wenn ihre Verbindung zu diesem gequälten Reich von Geheimnissen umwittert ist.', 'Magische Augen können dir helfen, Evelynns Position aufzuspüren, damit du dich besser auf einen Angriff vorbereiten kannst.', 'Evelynn ist verwundbar gegenüber Verlangsamungen, sobald sie „Dunkle Raserei“ für das zusätzliche Lauftempo genutzt hat.', 'Wenn du annimmst, Evelynn hätte deine Lane verlassen, lass es deine Teammitglieder wissen, indem du ihnen dies über den Chat oder Hinweissignale auf der Minikarte mitteilst.', 'Wenn du getarnt bist, solltest du darauf achten, dass du nicht zu nahe an gegnerische Champions herankommst, wo du aufgedeckt wirst. Du kannst dies durch glühende rotgelbe Augen über deren Köpfen erkennen.', 'Versuche „Dunkle Raserei“ einzusetzen, nachdem deine Gegner ihr zusätzliches Lauftempo verbraucht haben.', 'Evelynn kann sich auf Angriffsschaden konzentrieren, um fortwährend mehr Schaden zu verursachen, oder Fähigkeitsstärke nutzen, um höhere Schadensspitzen zu erlangen. Ein gutes Gleichgewicht kann die beste Lösung darstellen.', 0, 0, 292, 1974, ' Assassin Mage'),
(23, 'Fizz', 105, '2014-10-21 17:54:20', '2015-04-09 10:19:29', 'Fizz', 175.00, 40.00, 267.20, 58.04, 558.48, 86.00, 3.00, 22.41, 0.80, 8.18, 0.00, 1.25, 6.00, 3.10, 32.10, 335.00, -0.05, 0.00, 0.70, 3.40, 'Der Gezeitentäuscher', 'Vor Jahrhunderten erbaute ein uraltes, im Wasser lebendes Volk eine verborgene Stadt unterhalb eines Berges im Meer. Auch wenn diese Kreaturen Feinde hatten, war die Stadt eine uneinnehmbare Festung und sie wurden, in dem Schutz, den sie ihnen bot, selbstgefällig. Fizz jedoch war mit einem neugierigen Geist ausgestattet, der sich nicht mit einem so komfortablen Leben zufrieden gab. Unfähig der Verlockung der Gefahr zu widerstehen, hatte Fizz die Angewohnheit, sich auf der Suche nach Ärger aus der Stadt zu stehlen. Durch seine vielen Abenteuer wurde er zu einem mächtigen Kämpfer mit großem Einfallsreichtum, der ihn befähigte, die Gefahr mit gekonnter Leichtigkeit zu umgehen. Eines Tages kehrte Fizz zurück und fand die Stadt verlassen vor - alle waren spurlos verschwunden. Da ihn nun nichts mehr in der Stadt hielt, barg Fizz einen verzauberten Dreizack aus den Ruinen und machte sich allein auf den Weg.<br><br>Jahrelang zog Fizz durch den Ozean und nutzte die Fähigkeiten, die er sich während seiner Abenteuer als kleiner Junge angeeignet hatte, um zu überleben. Schließlich entdeckte Fizz den Hafen von Bilgewasser. Die Existenz von Leben oberhalb des Wassers faszinierte ihn, sodass er nicht anders konnte, als die Insel zu erkunden. Durch seine uferlose Neugier wurde er unbeabsichtigt in die Angelegenheiten der Menschen, die dort lebten, verstrickt und seine Anwesenheit blieb nicht unbemerkt. Seine Dummheiten verärgerten viele Bewohner, die letztlich versuchten, ihn einzufangen oder zu töten. Fizz war in die Ecke getrieben und bereitete sich darauf vor, in die See zurückzukehren, auch wenn er Bilgewasser liebgewonnen hatte. Als er an den Hafenanlagen stand, griff ein riesiger Drachenhai den Hafen an. Fizz besiegte das Untier, indem er seinen Einfallsreichtum und sein Wissen um die Schwächen der Kreaturen zu seinem Vorteil nutzte. Damit hatte er sich den Dank und den Respekt der Menschen verdient und so entschied er sich, in Bilgewasser zu bleiben. Er trat der Liga der Legenden bei, um seiner neuen Heimat noch besser dienen zu können.<br><br>„Fizz lässt selbst die bissigsten Seemänner von Bilgewasser im Kampf wie betrunkene Landratten aussehen. Es ist gut, dass er auf unserer Seite ist.“ - Miss Fortune, die Kopfgeldjägerin<br>', 'Fizz wird äußerst tödlich, wenn dein Leben auf ein kritisches Niveau fällt - jeder seiner automatischen Angriffe verursacht wiederholt Schaden, der mit fallendem Leben stark zunimmt - du solltest Fizz nur entsprechend gestärkt entgegentreten.', 'Fizz glänzt vor allem in längeren Geplänkeln - du solltest ihn nicht verfolgen, wenn es sich vermeiden lässt!', '', 'Da sich Fizz durch Einheiten bewegen kann, solltest du in einer Lane nach Gelegenheiten suchen, durch Vasallen hindurch zu ziehen und „Seestein-Dreizack“ anzuwenden - der Schaden wird ständig zunehmen, während das Leben des Gegners sinkt.', 'Fizz'' ultimative Fähigkeit, „Köder auswerfen“, kann direkt auf einen Gegner oder dort, wo du ihn in Kürze vermutest, verwendet werden - der Explosionseffekt findet immer statt.', 'Fizz skaliert vor allem mit Fähigkeitsstärke - setzt das gegnerische Team auf Schadensspitzen, solltest du auf Gegenstände wie „Stab der Zeitalter“ oder „Rylais Kristallzepter“ setzen - und auf Gegenstände wie „Rabadons Todeshaube“, wenn du glaubst, auf das zusätzliche Leben verzichten zu können.', 0, 0, 0, 3113, ' Assassin Fighter'),
(24, 'Zed', 238, '2014-10-21 17:54:20', '2015-04-09 10:19:29', 'Zed', 125.00, 0.00, 200.00, 54.71, 579.40, 80.00, 3.40, 26.88, 0.00, 7.09, 0.00, 1.25, 50.00, 2.10, 32.10, 345.00, -0.03, 0.00, 0.65, 3.50, 'Der Meister der Schatten', 'Zed ist in 200 Jahren der erste Ninja, der die uralten, verbotenen Pfade beschreitet. Er trotzte seinem Klan und seinem Meister, wodurch er das Gleichgewicht und die Disziplin, die ihn sein ganzes Leben lang eingeengt hatten, hinter sich ließ. Zed bietet nun jenen Macht, die bereit sind, das Wissen von den Schatten mit offenen Armen zu empfangen, und erschlägt all jene, die sich an die Ignoranz klammern.<br><br>Als Waise wurde Zed von einem großen Ninjameister aufgenommen und ausgebildet. Nur ein weiterer Schüler erschien Zed ebenbürtig - der Sohn des Meisters, Shen. Es schien, als könne Zed nie die Gunst des Meisters gewinnen, da jede Begegnung der beiden Rivalen in einem Unentschieden endete. Frustriert und eifersüchtig suchte er nach einem Vorteil. Der junge Ninja wagte sich in einen verschlossenen Teil des Klantempels, in dem er eine verzierte, Unheil verkündende Truhe fand. Da er das dunkle Wissen in ihrem Inneren spürte, wusste Zed, dass er sie nicht öffnen sollte, doch nichtsdestotrotz spähte er hinein. In derselben Sekunde berührten Schatten seinen Geist und gaben Techniken preis, die lange verborgen waren. Dieses geheimen Vorsprungs habhaft forderte er nun Shen erneut heraus und besiegte dieses Mal den Sohn des Meisters. In seinem Moment des Sieges erwartete er Lob und Anerkennung, doch der Meister wusste aus irgendeinem Grund, dass Zed verbotene Pfade beschritten hatte und verbannte ihn.<br><br>Gedemütigt zog der junge Ninja jahrelang umher. Aus seiner Bitterkeit wurde Ehrgeiz und er begann andere im Stil der Schatten zu unterrichten. Ebenso wie seine Kraft wuchs auch der Kreis seiner Anhänger, doch er wusste, dass seine Techniken ohne die Truhe nie perfekt sein würden. Eines Tages betrachtete Zed seine Anhänger und sah, dass seine Schüler nun eine Armee waren. Er führte sie zurück zum Tempel, um seinen Tribut einzufordern. Er war überrascht, den Meister an den Toren wartend vorzufinden. Er empfing Zed und seine Schüler, als wären sie willkommene Gäste. Der alte Mann legte sein Schwert zu Zeds Füßen und erklärte, er habe Zed als Meister im Stich gelassen. Indem er seinen einstmaligen Schüler verbannte, hatte der Meister ihn den Schatten anheim gegeben, anstatt ihn auf den Pfad der Balance zu führen. Der alte Mann bat Zed, den Tempel zu betreten, die Truhe zu zerstören und seine Anhänger zum Gleichgewicht zu führen. Der dunkle Ninja folgte dem Meister in das Innere des Tempels. Wenige Augenblicke später hörten die versammelten Ninjas, wie Zed schmerzerfüllt aufschrie. Rätselhafterweise kam er unversehrt wieder zum Vorschein und warf Shen den abgetrennten Kopf des Meisters zu Füßen. Wuterfüllt schreiend befahl Zed seinen Anhängern, die Schüler des Meisters zu erschlagen und die Truhe zu ergreifen.<br><br>An diesem Tag zerfiel der alte Ninjaorden. Auch wenn viele Schüler starben, konnten einige von ihnen dank Shens heldenhafter Taten fliehen. Nun ist der Tempel ein düsterer Übungsplatz für den Orden der Schatten. Zed regiert als Meister des Ordens und sein Erlass ist simpel: perfektioniere deine Techniken und töte alle Ninjas, die sich weigern, die Schatten mit offenen Armen zu empfangen.<br><br>„Gleichgewicht ist eine Lüge - wir sind die wahren Ninjas.“ - Zed<br><br>', 'Zed erhält einen zusätzlichen Effekt durch Gegenstände mit Angriffsschaden, die er erwirbt. Deshalb ist Rüstung äußerst effektiv gegen ihn.', 'Zed ist am verwundbarsten, nachdem er „Lebender Schatten“ eingesetzt hat, da sein Schaden, seine Verlangsamung und seine Beweglichkeit davon abhängen.', 'Zeds „Schattenschlag“ verlangsamt dich nur, wenn dich sein Schatten damit trifft.', 'Du kannst den Schadensausstoß von „Zeichen des Todes“ maximieren, indem du Energie und Abklingzeiten aufsparst, bis du deine ultimative Fähigkeit einsetzt.', 'Wenn du „Lebender Schatten“ schnell doppelt anklickst, wird Zed sofort zu seinem Schatten teleportiert, wodurch du schnell flüchten kannst.', 'Wenn du „Lebender Schatten“ vor „Zeichen des Todes“ einsetzt, kann sich Zed sicher aus dem Kampf entfernen.', 0, 0, 0, 3782, ' Assassin Fighter'),
(25, 'Heimerdinger', 74, '2014-10-21 17:54:20', '2015-04-09 10:19:29', 'Heimerdinger', 550.00, 40.00, 307.20, 55.54, 476.00, 75.00, 2.70, 19.04, 0.80, 11.01, 0.00, 0.00, 6.00, 1.36, 30.00, 340.00, 0.00, 0.00, 1.75, 3.00, 'Der verehrte Erfinder', 'Aus dem Tagebuch von Professor Cecil B. Heimerdinger<br><br>14.10.<br><br>09:15<br><br>Momentane meteorologische Bedingungen in Bandle scheinen optimal. Luftdruck ist ideal für die heutigen Experimente!<br><br>Heute Nachmittag starte ich den fünften Versuch mit meinem Tridyminiumobulator. Es müssen noch einige Feinabstimmungen vorgenommen werden; habe mir meinen Schnurrbart versengt. Energiedurchsatz muss angepasst werden.<br><br>16:00<br><br>Tridyminiumobulator hält noch immer nicht die gewünschte Energieeffizienz aufrecht. Weitere Versuche notwendig. Zwischenzeitlich habe ich etwas Neues, sehr Verblüffendes herausgefunden.<br><br>Als ich nach den heutigen Testläufen nach Hause ging, kam ich an einer Schar junger Yordle vorbei, die sich gegenseitig ein kugelförmiges Geschoss zuwarfen. Das Konzept ist denkbar einfach: Wirf das Objekt zu jemandem, fange es, wirf es zu einem anderen Yordle - und dann von vorn. Doch Fehlkalkulationen seitens der Yordle führten zu verschiedenen Fehlern! Sie warfen mit inkonsistenter Genauigkeit und Kraft, sodass der „Ball“ (wie sie es nennen) wiederholt zu Boden fiel ... Dieser Vorgang kann auf vielfältige Weise verbessert werden. Meinen Berechnungen zufolge, und nachdem ich verschiedene Daten von den Teilnehmern gesammelt hatte, wäre der Spaß bei gleichbleibender Geschwindigkeit und Bogenbahn um 44,57 % höher! Ich muss das heute Abend noch einmal durchgehen.<br><br>15.10.<br><br>05:20<br><br>Eureka! Ich habe eine Lösung entwickelt.<br><br>Ich habe einen automatisierten Ballwerfer erfunden. Aktueller Name: H-28G. Er ermöglicht eine gleichbleibende Geschwindigkeit und Flugbahn, wodurch sichergestellt wird, dass der Empfänger den Ball immer fangen kann. Er richtet sich selbst auf den nächsten Yordle aus (sollte sich mehr als einer in der näheren Umgebung befinden), damit jeder einmal dran kommt. Ich werde ihn heute zu den jungen Yordle schaffen und ihnen meine Erfindung vorführen.<br><br>Ach ja: Habe heute Morgen eine giftige Säure über meinen Schuhen verschüttet. Ärgerlich.<br><br>10:30<br><br>Habe heute den automatischen Ballwerfer getestet. Lief nicht wie geplant. Die Jugendlichen waren entsprechend gespannt auf meine Erfindung, doch als die Maschine eingeschaltet wurde, stellte sich heraus, dass sie viel zu kraftvoll war! Selbst mit niedrigsten Einstellungen riss sie einen Yordle völlig von den Füßen. Ganz offensichtlich habe ich die Geschwindigkeit ihrer Würfe überschätzt ... Ich werde ihn mir bald noch einmal anschauen und die nötigen Anpassungen vornehmen.<br><br>Doch im Augenblick hat der Tridyminiumobulator höchste Priorität; noch vor dem Mittagessen will ich seine Komplikationen behoben haben. Sobald meine Arbeiten entsprechend vorangekommen sind, werde ich ihn irgendwo ausprobieren müssen. Bandle erweist sich für Feldstudien allerdings als unzureichend.<br><br>16.10.<br><br>15:55<br><br>Offenbar befindet sich ein Riese in der Stadt. Eine höchst beunruhigende Anomalie. Der Lärm draußen stört meine Forschungen!<br><br>Muss heute das Fischbecken kontrollieren. Sie waren ungewöhnlich ruhig ...<br><br>17.10.<br><br>10:40<br><br>Ich habe gehört, dass viele Yordle aufgrund mit dem Riesen im Zusammenhang stehender Störungen verletzt wurden. Falls dies nicht bald aufhört, wird eine Intervention unumgänglich werden! Ich hoffe, H-28G ist noch intakt. Es würde mich eine Menge Zeit kosten, wenn ich ihn neu aufbauen müsste.<br><br>16:30<br><br>Alles ist wieder ruhig. Anscheinend ist der Riese zur Vernunft gekommen und weggerannt. Morgen muss ich H-28G reinholen, sobald ich wichtigere Dinge erledigt habe. Ich habe den Tridyminiumobulator fast bis zur Perfektion verbessert!<br><br>18.10.<br><br>08:30<br><br>Heute ist schon ziemlich viel passiert. Ein Klopfen an meiner Tür ließ mich aufschrecken. Ich hatte den Eindruck, die gesamte Stadt stünde vor meinem Haus. Wenn sich normalerweise eine Menge zusammenfindet, hat es etwas damit zu tun, dass sie eine belanglose Beschwerde über meine Arbeit vorzubringen haben. Doch dieses Mal jubelten sie!<br><br>Erstaunlicherweise erkannte einer der jungen Yordle in dem H-28G-Prototyp, den ich zurückgelassen hatte, einen Vorteil bei der Narretei mit diesem Riesen. Der Yordle erwies sich als einfallsreich und funktionierte die Erfindung kurzerhand in ein provisorisches Geschütz um. Es hat genug Schlagkraft, um einen Riesen zu verjagen ... Stellt euch das nur vor! Was für ein raffinierter kleiner Bursche.<br><br>Ich wünschte, ich könnte sein gleichgesinntes Encephalon in naher Zukunft nutzbringend einsetzen ... Ich habe bereits große Pläne und seine Mitarbeit könnte wertvoll sein - doch er müsste Bandle verlassen. Der Umfang meiner Pläne setzt ein ausgedehnteres Testgelände voraus.<br><br>Runeterra sollte genügen!', 'Es ist besser, Heimerdingers Geschütztürme alle auf einmal mithilfe der Vasallen zu zerstören, anstatt sie einzeln zu bekämpfen.', 'Hüte dich vor Heimerdingers „Aufrüsten!!!“, denn er kann es einsetzen, um fast allem, was ihm zusetzt, etwas entgegenzusetzen. Sobald seine ultimative Fähigkeit raus ist, schnappst du ihn dir.', '', 'Die geschickte Platzwahl für Geschütztürme kann den Kampf entscheiden. Gegen die meisten Gegner funktionieren Geschütztürme am besten, wenn sie einander unterstützen können, doch wenn der Gegner viel Flächenschaden hat, könnten deine Türme schnell zerstört werden. Durch das Platzieren von Geschütztürmen in Büschen hast du den Überraschungseffekt auf deiner Seite.', 'Für Heimerdingers Überleben ist es sehr wichtig, dass „Elektronensturm-Granate“ exakt zündet. Die Verlangsamung und die Betäubung halten Gegner lange genug fest, um ihnen zuzusetzen. Sie dient aber auch als erste Abwehrmethode gegen einen Überraschungsangriff.', 'Durch eine weite Streuung von Hextech-Mikroraketen erreichst du zuverlässigeren Schaden und wirst gegen mehrere Ziele effektiver. Den größten Schaden verursacht aber ein fokussierter Angriff.', 0, 0, 0, 1562, ' Mage Support');
INSERT INTO `champions` (`id`, `name`, `champion_id`, `created_at`, `updated_at`, `key`, `attackrange`, `mpperlevel`, `mp`, `attackdamage`, `hp`, `hpperlevel`, `attackdamageperlevel`, `armor`, `mpregenperlevel`, `hpregen`, `critperlevel`, `spellblockperlevel`, `mpregen`, `attackspeedperlevel`, `spellblock`, `movespeed`, `attackspeedoffset`, `crit`, `hpregenperlevel`, `armorperlevel`, `title`, `lore`, `enemytips1`, `enemytips2`, `enemytips3`, `allytips1`, `allytips2`, `allytips3`, `f2p`, `sale`, `sale_price`, `votes`, `tags`) VALUES
(26, 'Rumble', 68, '2014-10-21 17:54:20', '2015-04-09 10:19:29', 'Rumble', 125.00, 0.00, 100.00, 61.04, 584.40, 80.00, 3.20, 25.88, 0.00, 8.01, 0.00, 1.25, 0.00, 1.85, 32.10, 345.00, -0.03, 0.00, 0.60, 3.50, 'Die mechanisierte Bedrohung', 'Selbst unter Yordle war Rumble immer der Kleine unter den Kleinen. So war er daran gewöhnt, ständig gehänselt zu werden. Um zu überleben, musste er rauflustiger und einfallsreicher sein als seine Altersgenossen. Er entwickelte ein hitziges Gemüt und hatte den Ruf, Streit anzufangen, egal, wer seinen Weg kreuzte. Dadurch wurde er zum Einzelgänger, aber das störte ihn nicht. Er mochte es, herumzubasteln und zog die Gesellschaft von Apparaturen vor - für gewöhnlich fand man ihn beim Durchstöbern eines Schrottplatzes. Als Mechaniker hatte er großes Talent. Seine Lehrer empfahlen ihm die Einschreibung an der Yordle-Akademie für Wissenschaft und Fortschritt in Piltover, wo er ohne Weiteres zu einem von Heimerdingers geschätzten Schützlingen hätte werden können, doch Rumble lehnte ab. Er glaubte, Heimerdinger und seine Mitarbeiter wären „Verräter“, die für ein aufmunterndes Kopftätscheln überlegene Yordle-Technologie an Menschen verkauften, die trotz dessen weiterhin nur Witze auf ihre Kosten machten. Als eine Gruppe menschlicher Absolventen der Yordle-Akademie nach Bandle segelte, um den Ort zu besuchen, an dem ihr Mentor geboren und aufgezogen worden war, konnte Rumble der Versuchung nicht widerstehen, ihnen (sozusagen) Aug'' in Aug'' gegenüberzutreten. Er hatte vorgehabt, sich die Menschen nur mal genauer anzusehen, doch vier Stunden und einige Wortgefechte später kehrte er verletzt und blutig nach Hause zurück, im Ohr noch immer die Litaneien, wie beschämend er für „erleuchtete“ Yordle wie Heimerdinger sei. Am nächsten Morgen verließ er Bandle ohne ein Wort und ward monatelang nicht gesehen. Als er zurückkehrte, saß er am Steuer einer klirrenden, mechanischen Monstrosität. Er bugsierte sie unter den Augen verblüffter Zuschauer ins Zentrum der Stadt und verkündete dort, dass er der Liga der Legenden beitreten werde, um der Welt zu zeigen, wozu Yordle-Tech wirklich fähig ist, wenn es sich nicht hinter einer fremden Flagge verstecken muss.<br><br>„Uff, es wird ewig dauern, dein Gesicht wieder von meinem Overall zu kratzen!“ - Rumble<br>', 'Achte genau auf Rumbles Hitzeleiste. Überhitzt er, schnapp ihn dir, während er seine Fähigkeiten nicht einsetzen kann.', 'Rumbles ultimative Fähigkeit kann sehr viel Schaden verursachen, wenn du im Wirkbereich bleibst. Siehst du die Raketen, solltest du dich schnellstmöglich wegbewegen.', 'Rumble verursacht fast nur magischen Schaden. Einige Magieresistenzen können diesen erheblich senken.', 'Versuche, im Gefahrenbereich zu bleiben, um deine Effektivität zu erhöhen. Man überhitzt zu leicht, wenn man die Fähigkeiten häufig einsetzt.', 'Versuche deine Ziele in Reichweite des Flammenwerfers zu halten. Er kann auf Dauer viel Schaden verursachen.', 'Zeichnet sich ein Sieg ab, kannst du die ultimative Fähigkeit nutzen, um einen Fluchtweg zu blockieren.', 0, 0, 0, 1136, ' Fighter Mage'),
(27, 'Mordekaiser', 82, '2014-10-21 17:54:20', '2015-04-09 10:19:30', 'Mordekaiser', 125.00, 0.00, 120.00, 57.58, 555.40, 80.00, 3.50, 24.88, 0.00, 3.37, 0.00, 1.25, 0.00, 3.00, 32.10, 340.00, -0.10, 0.00, 0.55, 3.50, 'Der Meister des Metalls', 'Das scheußliche Gespenst Mordekaiser gehört zu den schrecklichsten und hasserfülltesten Geistern, die auf den Schatteninseln ihr Unwesen treiben. Begraben in einer uralten Rüstung soll der Meister des Metalls der erste Nichtlebende gewesen sein, ein Wiedergänger, der sogar schon existierte, bevor die Schatteninseln ihre Gestalt annahmen. Seine verdorbene Seele labt sich an seinem eigenen Leid sowie an der Pein, die er anderen bereitet. All jene, die es wagen, sich Mordekaiser im Kampf zu stellen, riskieren, mit einem schrecklichen Fluch belegt zu werden: Er versklavt die Seelen seiner Opfer, auf dass sie Instrumente der Zerstörung werden mögen.', 'Mordekaisers Fähigkeiten laden seinen Schild auf und machen ihn so immer härter. Konzentriere dich auf ihn, um ihn niederzuringen.', 'Halte Abstand und stehe nicht bei Vasallenwellen, da er „Schutz der Vernichtung“ gegen sie einsetzen wird.', 'Nimm dich vor der Kombination „Sklaverei des Todes“ und „Entzünden“ in Acht. Wenn du nur wenig Trefferpunkte hast, wird sie dir den Rest geben und sein Team wird einen mächtigen Geist erhalten.', 'Du kannst eine Seele durch Drücken der Alt-Taste und Benutzen der rechten Maustaste steuern.', 'Manchmal ist Angriff die beste Verteidigung. Benutze Mordekaisers Fähigkeiten um seinen Schild aufzuladen.', 'Denk daran, dass „Sklaverei des Todes“ wegen seines Lebensraubs auch defensiv eingesetzt werden kann.', 0, 0, 395, 1107, ' Fighter Mage'),
(28, 'Sona', 37, '2014-10-21 17:54:20', '2015-04-09 10:19:30', 'Sona', 550.00, 45.00, 340.60, 50.04, 482.36, 77.00, 3.00, 20.54, 0.40, 5.42, 0.00, 0.00, 9.00, 2.30, 30.00, 325.00, -0.03, 0.00, 0.55, 3.30, 'Die Virtuosin', 'Sona hat keine Erinnerungen an ihre wahren Eltern. Als Kleinkind wurde sie auf der Türschwelle eines ionischen Waisenhauses zurückgelassen, gebettet auf ein uraltes Instrument in einem erlesenen Kasten unbekannter Herkunft. Sie war ein ungewöhnlich braves Kind - immer ruhig und zufrieden. Ihre Fürsorger waren sich sicher, sie würde schnell ein neues Heim finden. Aber schon bald wurde klar, dass das, was sie für eine ungewöhnliche Herzlichkeit hielten, im Grunde nur die Unfähigkeit zu sprechen oder irgendeinen Ton zu erzeugen darstellte. Sona verblieb bis in ihre Jugendjahre im Waisenhaus und konnte nur in hoffnungsloser Stille mit ansehen, wie mögliche Adoptiveltern an ihr vorbeizogen. Zu dieser Zeit verkauften ihre Fürsorger ihr ungewöhnliches Instrument an begierige Sammler in der Hoffnung, so für ihre Zukunft sorgen zu können. Doch aufgrund unzähliger bizarrer und unerwarteter Gründe wurde es immer wieder zurückgegeben oder fand sich einfach vor dem Haus wieder.<br><br>Als eine wohlhabende demacianische Frau mit dem Namen Lestara Buvelle von dem Instrument erfuhr, brach sie sofort nach Ionia auf. Als die Fürsorger ihr das Instrument vorzeigten, erhob sie sich wortlos und sah sich im Haus um, wobei sie vor Sonas Zimmer stehen blieb. Ohne Zögern adoptierte sie Sona und hinterließ eine großzügige Spende für das Instrument. Unter Lestaras Weisung entdeckte Sona eine tiefe Verbindung mit dem Instrument, das Lestara „Etwahl“ nannte. In ihren Händen spielte es Klänge, die die Herzen der Umstehenden beruhigte oder erbeben lies. Binnen Monaten sorgte sie dank des mysteriösen Etwahls für ausverkaufte Vorstellungen. Ihr Spiel berührte die innersten Gefühle und manipulierte so mühelos die Emotionen ihrer Zuhörer - und das ohne eine einzige niedergeschriebene Note. Insgeheim entdeckte sie eine mächtige und tödliche Verwendung für ihr Etwahl, bei der sie entfernte Objekte durch dessen Vibrationen zerschneiden konnte. Sie perfektionierte dieses Können im Geheimen und meisterte so ihre Gabe. Als sie sich dazu bereit fühlte, zog sie zum einzigen Ort aus, der ihr eine angemessene Bühne für ihre Aufführungen bieten könnte: die Liga der Legenden.<br><br>„Ihre Melodie bewegt die Seele, ihre Stille zertrennt den Körper.“ - Jericho Swain, nach einem Konzertbesuch<br>', 'Verteilt euch, wenn sich Sona nähert, damit sie nicht das gesamte Team zum Tanzen bringen kann.', 'Schalte Sona zuerst aus, denn sie kann ihr Team wieder heilen, wenn man ihr zu lange Zeit gibt.', '', 'Markiere deine Verbündeten, während Sonas Auren aktiv sind, lass dich aber nicht von Gegnern erwischen.', 'Spare dir „Crescendo“ für den entscheidenden Wendepunkt auf.', 'Wenn du „Arie der Beharrlichkeit“ zeitlich geschickt einsetzt, steigerst du deine Überlebenschancen.', 0, 0, 0, 2300, ' Support Mage'),
(29, 'Katarina', 55, '2014-10-21 17:54:20', '2015-04-09 10:19:30', 'Katarina', 125.00, 0.00, 0.00, 58.00, 510.00, 83.00, 3.20, 26.88, 0.00, 4.50, 0.00, 1.25, 0.00, 2.74, 32.10, 345.00, -0.05, 0.00, 0.55, 3.50, 'Die unheimliche Klinge', 'Angetrieben von einem starken Killerinstinkt nutzt Katarina ihre Talente als Assassine zum Ruhme Noxus und zum weiteren Aufstieg ihrer Familie. Obwohl ihr Eifer sie zu immer großartigeren Taten anspornt, führt er sie manchmal auch in die Irre.<br><br>Schon in ihrer Kindheit zeigte Katarina eine natürliche Begabung für den Kampf. Als Tochter eines prominenten noxischen Generals standen ihr viele Wege offen, doch sie verschmähte sie alle zu Gunsten des Pfades der Klinge. Unter dem gestrengen Training der begabtesten Assassinen in Noxus, von denen ihr Vater der beste war, dauerte es nicht lange, bis Katarina nach einem ersten Auftrag verlangte. Die Aufgabe, die man ihr stellte, war ärgerlicherweise simpel: die Ermordung eines demacianischen Offiziers von niederem Rang. Als sie sich daran machte, das gegnerische Lager zu infiltrieren, entdeckte Katarina eine Möglichkeit, die zu verlockend war, als dass sie sie unbeachtet hätte lassen können - die Ankunft eines demacianischen Generals. Nachdem sie ihm bis zu seinem Zelt hinterhergeschlichen war, entledigte sie sich rasch seiner Wachen und schlitzte ihm die Kehle auf. Zufrieden mit ihrer beeindruckenden Tötung verschwand sie in die Nacht. Doch Katarinas Euphorie schwand schon am nächsten Tag, als ihr eigentliches Ziel, der demacianische Offizier, seine Truppen bei einem Angriff auf unvorbereitete noxische Soldaten anführte. Obwohl die Noxier beherzt kämpften, mussten sie herbe Verluste hinnehmen. Wütend über ihren Fehler machte Katarina sich auf, ihre ursprüngliche Aufgabe zu vollenden. Als sie zum Lager kam, spionierte sie ihr streng bewachtes Ziel aus und musste feststellen, dass ein Mord im Verborgenen nicht länger möglich war. Sie zog ihre Klingen und schwor, dass der Offizier sterben würde, was immer es kosten möge. Sie stürzte sich in die Schlacht und entfesselte einen Wirbelwind aus Stahl. Eine Klinge nach der anderen blitzte auf und eine Wache nach der anderen fiel. Jeder Hieb brachte sie einen Schritt näher an den Offizier heran. Ein letzter geworfener Dolch stellte ihre Ehre wieder her. Blutüberströmt und verletzt konnte Katarina den demacianischen Truppen nur um ein Haar entkommen und kehrte als eine andere nach Noxus zurück. Die Narbe, die sie sich in dieser Nacht zuzog, wird sie nun immer daran erinnern, dass sie nie wieder zulassen darf, dass die Leidenschaft über die Pflicht obsiegt.<br><br>„Stellt niemals meine Loyalität in Frage. Ihr könnt nicht einmal erahnen, was ich dafür auf mich nehme.“ - Katarina<br>', 'Katarinas Fähigkeiten verursachen magischen Schaden, also leg dir Magieresistenz zu, um ihr etwas entgegensetzen zu können, auch wenn sie Gegenstände mit Angriffsschaden kombiniert.', 'Versuche Katarina kampfunfähig zu machen, wenn sie ihren „Todes-Lotus“ einsetzt.', '', 'Warte bis das gegnerische Team im Kampf gegen dein Team abgelenkt ist und benutze dann „Blitzschritt“ in das Gemenge, um einen vernichtenden „Todes-Lotus“ zu entfesseln.', 'Die Verwendung von „Blitzschritt“ auf einen verbündeten Champion, Vasallen oder platziertes Auge ist eine gute Möglichkeit, um zu entkommen.', '', 0, 0, 0, 1535, ' Assassin Mage'),
(30, 'Kog''Maw', 96, '2014-10-21 17:54:20', '2015-04-09 10:19:30', 'KogMaw', 500.00, 40.00, 322.20, 49.04, 546.16, 87.00, 3.00, 19.88, 0.70, 5.92, 0.00, 0.00, 8.68, 2.65, 30.00, 325.00, -0.06, 0.00, 0.55, 3.50, 'Der Schlund des Abgrunds', 'Bevor der Prophet Malzahar in Icathia wiedergeboren wurde, hörte er eine unweltliche Stimme, die ihn dorthin führte und sich tief in seinem Bewusstsein verankerte. Diese Stimme nährte Malzahar mit schrecklichem Tatendrang, und auch wenn sie Malzahar selbst nicht mehr heimsuchte, so ging ihr lockender Ruf doch weiter. Etwas in der Leere hörte diesen Ruf widerhallen und folgte ihm nach Runeterra. Ein verdorbenes Wesen kroch über eine Schwelle, die es nicht verstand, und weitete somit einen Riss zwischen Welten, die sich nie hätten berühren sollen. In den gespenstischen Ruinen von Icathia manifestierte es sich: Kog''Maw, ein Unwesen getrieben von schrecklicher Neugierde. Der Lockruf, der es nach Runeterra brachte, war immer noch zu vernehmen und zog es weiter und weiter in Malzahars Richtung. Unterwegs erforschte Kog''Maw seine neue Umgebung mit unnachgiebiger Neugier, zum grenzenlosen Entsetzen aller, die es auf seinem Weg traf.<br><br>Die Farben und Gerüche von Runeterra berauschten Kog''Maw und er erforschte die Früchte dieser Welt auf die einzige Art, die er kannte: indem er sie verschlang. Zunächst aß er nur von der wilden Flora und Fauna, die er fand. Als er aber die Sturmwind-Wüsten überquerte, traf er auf einen Stamm von Nomaden. Von den uns bekannten Naturgesetzen ungehindert verschlang Kog''Maw jeden einzelnen von ihnen und alles, was sie ihm in den Weg stellten, viele Male sein eigenes Gewicht betragend. Die geistesgegenwärtigsten seiner Opfer mögen sich noch gefragt haben, ob der ätzende Speichel, der den Boden verbrannte, auf den er tropfte, hiermit etwas zu tun haben könnte, aber jede Überlegung dieser Art wurde abrupt beendet. Als diese Fresswalze der Zerstörung schließlich am Kriegsinstitut ankam, begrüßte Malzahar Kog''Maw mit einem appetitanregendem Vorschlag: koste das Beste, was Runeterra im Angebot hat auf den Richtfeldern der Liga.<br><br>„Wenn das nur Hunger ist, will ich das Ding nicht wütend sehen.“ - Tryndamere, der Barbarenkönig<br>', 'Kog''Maw besitzt keine guten Fluchtfähigkeiten, also ist er ziemlich aufgeschmissen, wenn er überrumpelt wird.', 'Nimm die Beine in die Hand, sobald Kog''Maw stirbt!!!!', 'Die Reichweite der „Lebendigen Artillerie“ erhöht sich mit jeder Stufe.', 'Kog''Maw kann dank seines „Bioarkanen Trommelfeuers“ aus größerer Distanz angreifen als die meisten anderen Champions.', 'Benutze „Leerenschlick“, um die perfekte „Lebendige Artillerie“ zu erschaffen.', 'Versuche, soviel wie möglich aus deiner „Icathianischen Überraschung“ herauszuholen.', 0, 0, 0, 1256, ' Marksman Mage'),
(31, 'Ashe', 22, '2014-10-21 17:54:20', '2015-04-09 10:19:31', 'Ashe', 600.00, 35.00, 231.80, 51.09, 527.72, 79.00, 2.85, 21.21, 0.40, 5.42, 0.00, 0.00, 6.97, 4.00, 30.00, 325.00, -0.05, 0.00, 0.55, 3.40, 'Die Frostbogenschützin', 'Durch jeden Pfeil, den sie mit ihrem uralten eisverzauberten Bogen abschießt, beweist Ashe, dass sie eine Meisterbogenschützin ist. Sie wählt jedes Ziel mit Bedacht aus, wartet auf den richtigen Moment und schlägt dann mit Kraft und Präzision zu. Und mit demselben Weitblick und derselben Konzentration verfolgt sie ihr Ziel, die Stämme Freljords zu vereinen und sie zu einer mächtigen Nation zu schmieden.<br><br>Als Kind war Ashe immer eine Träumerin. Sie staunte über kolossale, verlassene Festungen ihrer Vorfahren und verbrachte Stunden damit, am Feuer sitzend den Geschichten über Freljords legendenumwobene Helden zu lauschen. Am allermeisten liebte sie die Legende von Avarosa, der angesehenen Königin eines einst großen und vereinten Freljord. Obwohl ihre Mutter sie der Dummheit schalt, schwor Ashe, sie würde eines Tages die versprengten und kriegerischen Stämme der Tundra einen. Tief in ihrem Herzen wusste sie, dass, wenn ihr Volk erneut zusammenstünde, es wieder zu wahrer Größe fände.<br><br>Als Ashe gerade einmal fünfzehn Jahre alt war, wurde ihre Mutter getötet, während diese den Stamm auf einem unbesonnenen Kriegszug befehligte. Plötzlich in die Rolle der Anführerin hineingeworfen, traf Ashe die schwierige Entscheidung, der Vision ihrer Kindheit zu folgen, anstatt die Rache, nach der sie dürstete, zu vollstrecken. Leidenschaftlich redete sie gegen das Verlangen ihres Stammes nach Vergeltung an und erklärte, es sei die Zeit gekommen, Blutfehden beizulegen und einen anhaltenden Frieden auszuhandeln. Einige ihrer Krieger stellten in Frage, dass Ashe geeignet sei, die Herrschaft zu übernehmen, und heckten einen verräterischen Plan aus, die neue Anführerin zu töten.<br><br>Die Assassinen schlugen zu, während Ashe routinemäßig auf einer Jagd war, doch der Plan wurde von dem warnenden Schrei eines großen Falken durchkreuzt. Ashe schaute sich um und sah, wie ihre Stammesangehörigen mit gezogenen Schwertern auf sie zukamen. Zahlenmäßig unterlegen und überwältigt rannte Ashe stundenlang. Schließlich fand sie sich tief in unbekanntem Gebiet wieder. Ihre Waffe hatte sie während der Hetzjagd verloren. Als sie einen weiteren Schrei des Falken hörte, setzte sie ihr Vertrauen in die sonderbare Kreatur und folgte ihr zu einer Lichtung. Dort fand sie den Vogel vor, der sich auf einem Steinhaufen - ein uraltes Hügelgrab, wie es in Freljord üblich war - niedergelassen hatte. Nach einem letzten Blick auf sie kreischte der Falke und flog davon. Während sie auf den Erdwall zuging, spürte sie, wie ihr Atem zu Eis erstarrte und eine unnatürliche Kälte sie bis auf die Knochen frösteln ließ. Der Stein, der ganz oben auf dem Grabhügel lag, war mit nur einer Rune beschriftet: Avarosa.<br><br>Die Assassinen stoben aus dem Dickicht auf die Lichtung. Ashe nahm den Runenstein von dem Hügelgrab, um sich zu verteidigen, deckte damit jedoch etwas auf, das unter ihm verborgen war: ein reich verzierter Bogen, der aus Eis geschnitzt war. Sie griff nach ihm und schrie vor Schmerzen auf, als sich auf ihren Fingern Frost bildete, und riss den Bogen aus seiner Ruhestätte. Kälte floss von der verzauberten Waffe in Ashe über und erweckte eine gewaltige Kraft, die schon immer in ihrem Inneren existiert hatte.<br><br>Ashe drehte sich um, um sich ihren Assassinen zu stellen. Sie spannte den Bogen und erschuf rein instinktiv durch ihren Willen Pfeile aus purem Eis, das sich aus der kalten, knisternden Luft um sie herum bildete. Mit einer einzigen eisigen Salve beendete sie die Auflehnung. Nachdem sie den Grabstein behutsam an seinen Platz zurückgelegt hatte, dankte sie Avarosa für ihr Geschenk und kehrte nach Hause zurück. Ashes Stamm erkannte die legendäre Waffe in der Hand der Bogenschützin sofort als Segen der uralten Freljord-Königin persönlich.<br><br>Mit Avarosas Bogen und ihrer Vision von einer friedlichen Vereinigung wuchs Ashes Stamm schon bald merklich an und wurde zum größten in Freljord. Jene, die nun als Avarosa bekannt sind, stehen in dem Glauben zusammen, dass ein vereintes Freljord einmal mehr zu einer großartigen Nation werden wird.<br><br>„Ein Stamm, ein Volk, ein Freljord.“ - Ashe<br>', 'Ashe besitzt nur sehr wenige Verteidigungsmöglichkeiten, und ist daher anfällig gegen Hinterhalte.', 'Mit „Läuterung“ kann man die Betäubung von „Verzauberter Kristallpfeil“ entfernen und so den Kampf zu seinen Gunsten wenden.', '', 'Versuche den „Verzauberten Kristallpfeil“ in die Laufrichtung sich bewegender Gegner zu feuern, um deine Trefferchancen zu erhöhen.', 'Der Beschwörerzauber „Teleportation“ kann zusammen mit „Verzauberter Kristallpfeil“ genutzt werden, um weiter entfernte Gegner anzugreifen, noch während diese betäubt sind.', '„Habicht-Schuss“ entlarvt Einheiten im Gebüsch. Falls ein Gefecht im Urwald stattfindet, kann dir das einen erheblichen Vorteil verschaffen.', 0, 0, 0, 3831, ' Marksman Support'),
(32, 'Lulu', 117, '2014-10-21 17:54:20', '2015-04-09 10:19:31', 'Lulu', 550.00, 55.00, 292.40, 46.37, 552.76, 82.00, 2.60, 19.22, 0.80, 6.00, 0.00, 0.00, 6.00, 2.25, 30.00, 325.00, 0.00, 0.00, 0.60, 3.70, 'Die Zauberin der Fae', 'Vielleicht mehr noch als irgendein anderer Champion der Liga folgt Lulu ihrem eigenen Rhythmus. Während ihrer Kindheit in Bandle verbrachte sie die meiste Zeit damit, allein im Wald umherzustreifen oder sich in einem Tagtraum zu verlieren. Es war nicht so, dass sie unsozial gewesen wäre; das tägliche Gewusel in Bandle konnte nur einfach nicht mit der lebhaften Welt ihrer Vorstellungskraft mithalten. Sie sah Wunder an Stellen, welche die meisten Menschen übersahen. So fand sie auch Pix, einen Feengeist, der ihr weismachte, er wäre in einem Vogelhäuschen gefangen. Lulus Fantasie machte Pix auf sie aufmerksam und er ergriff die Gelegenheit, sie in seine Welt zu locken. Er brachte sie zur Feenwiese, dem verzauberten Heim der Fae, verborgen auf einer Lichtung in den Wäldern. Dort veränderten sich die wie in Stein gemeißelten Gegebenheiten der Außenwelt - wie Größe und Farbe - so schnell und wundersam wie die Richtung, aus welcher der Wind wehte. Lulu fühlte sich auf der Feenwiese endlich zu Hause und verbrachte die Zeit dort mit Pix, denn sie war fasziniert von diesem geheimen Ort.<br><br>Schon bald verlor sie den Sinn für die Zeit. Ihr Leben auf der Feenwiese war angenehm und natürlich. Sie und Pix spielten zusammen Spiele der Fae, die Art von Spielen, von denen man ihr gesagt hatte, sie wären nur „Einbildung“ ... und sie wurde außerordentlich gut darin. Es kam für sie einer ordentlichen Überraschung gleich, als sie sich plötzlich erinnerte, dass sie in Bandle ein Leben zurückgelassen hatte. Der Feenwiese wohnte eine Magie inne, die alles, was außerhalb ihrer Grenzen lag, weit weg und surreal erscheinen ließ. Lulu entschied sich, ihr früheres Zuhause zu besuchen, um dort von den wundervollen Dingen zu erzählen, die sie gelernt hatte, doch als sie und Pix zurückkehrten, hatte sich die Welt verändert. Die Zeit war, wie sie herausfand, eine Größe, die auf der Feenwiese in anderen Bahnen verlief, sodass während ihrer Abwesenheit Jahrhunderte vergangen waren. Lulu versuchte sich den Bewohnern der Außenwelt wieder anzuschließen, doch ihre Bestrebungen zeigten unglückselige Erfolge. So nahm sie alle Kinder mit, um Verstecken zu spielen, verwandelte sie für kurze Zeit in Blumen und Tiere, um das Spiel abwechslungsreicher zu gestalten, doch deren Eltern schätzten ihre Bemühungen ganz und gar nicht. Als die Yordle darauf bestanden, dass sie ihr Land verlassen sollte, wandte sie sich einem Ort voller magischer Energie zu, an dem jene mit ungewöhnlichen Fähigkeiten nicht nur geduldet, sondern verehrt wurden: der Liga der Legenden.<br><br>„Die beste Verbindung zwischen zwei Punkten ist umgekehrt, mittendurch, dann umgedreht und wieder drumherum.“ - Lulu<br>', 'Die Stöße von Lulus Fee können abgefangen werden - verstecke dich hinter deinen Vasallen, um zusätzlichen Treffern zu entgehen.', 'Lulu glänzt besonders dann, wenn sie Freiräume besitzt. Lass das nicht zu! Setze ihr wiederholt zu, um sie und ihren Partner aus der Lane zu drängen.', '', '„Glitterlanze“ kann mit verschiedenen Winkeln genutzt werden, je nachdem wo sich der Mauszeiger befindet - der abgedeckte Bereich kann sich so massiv ändern.', '„Hilf, Pix!“ gewährt Fernkämpfern zusätzlichen Schaden und „Wildwuchs“ lässt Tanks oder Kämpfer besser eröffnen.', '', 1, 0, 0, 1448, ' Support Mage'),
(33, 'Karthus', 30, '2014-10-21 17:54:20', '2015-04-09 10:19:31', 'Karthus', 450.00, 61.00, 372.48, 45.66, 516.00, 75.00, 3.25, 20.88, 0.80, 6.42, 0.00, 0.00, 6.00, 2.11, 30.00, 335.00, 0.00, 0.00, 0.55, 3.50, 'Der Todessänger', 'Karthus ist ein Bote des Vergessens, der der Schönheit und Reinheit des Todes hingebungsvoll ergeben ist. Selbst als er noch jung gewesen ist, war er bereits vollkommen von der Sterblichkeit besessen und wurde in seinem Streben nach der Erfüllung seines düsteren Verlangens immer erbarmungsloser. Um mit dem Tode eins zu sein, reiste Karthus zu den Schatteninseln und bot sich willentlich dem Untod dar. Karthus verwandelte sich in den Todessänger, einen fürchterlichen Lich, dessen einziger Daseinszweck darin besteht, die selige Gabe der Vernichtung weiterzureichen.', 'Karthus kann noch kurz weiter Zauber wirken, nachdem er getötet wurde. Entferne dich von seiner Leiche, um dich in Sicherheit zu bringen.', 'Achte darauf, dass du immer genug Leben hast, um „Requiem“ zu überleben, selbst wenn du öfters zur Basis zurückkehren musst, um dort zu regenerieren.', '', 'Arbeite mit deinen Verbündeten zusammen, um mit „Requiem“ auch Champions in anderen Lanes auszuschalten.', '„Verwüsten“ ist sehr stark, wenn es darum geht, Unmengen an Vasallen zu besiegen oder gegnerische Champions zu beharken.', '', 0, 0, 0, 2587, ' Mage'),
(34, 'Alistar', 12, '2014-10-21 17:54:20', '2015-04-09 10:19:31', 'Alistar', 125.00, 38.00, 278.84, 61.11, 613.36, 102.00, 3.62, 24.38, 0.80, 8.68, 0.00, 1.25, 6.00, 2.12, 32.10, 330.00, 0.00, 0.00, 0.85, 3.50, 'Der Minotaurus', 'Als mächtigster Krieger, der je aus den Stämmen der Minotauren an der Großen Barriere hervorging, verteidigte Alistar seinen Stamm vor den vielen Gefahren Valorans, zumindest bis die Noxische Armee kam. Alistar wurde durch Intrigen von Keiran Darkwill, dem jüngsten Sohn von General Boram Darkwill und Anführer der noxischen Spähtruppen, aus seinem Dorf gelockt. Als Alistar heimkehrte, war sein Dorf niedergebrannt und seine Familie ermordet worden. Rasend vor Wut nahm er es mit einem ganzen Regiment noxischer Elitesoldaten auf und tötete Hunderte. Nur durch das Einschreiten einiger der fähigsten Beschwörer von Noxus gelang es, Alistars Wut zu bändigen. Er wurde in Ketten nach Noxus geschafft und musste die folgenden Jahre als Gladiator endlose Kämpfe zur Unterhaltung der reichsten Einwohner von Noxus bestreiten.<br><br>Das einst so großherzige Gemüt Alistars drohte langsam zu zerbrechen und er wäre sicherlich verrückt geworden, wäre da nicht Ayelia gewesen, eine junge Dienerin, mit der er sich anfreundete, und die ihm auch die Flucht ermöglichte. Wieder in Freiheit trat Alistar als Champion der neu gegründeten Liga der Legenden bei und hoffte, eines Tages endgültig Rache an Noxus nehmen zu können und das Mädchen zu finden, das einst seine Hoffnung wieder aufleben ließ. Nach anfänglichem Widerwillen, seinen Status als berühmter Champion zu nähren, entdeckte Alistar bald, dass Ruhm auch Macht bedeutet und er wurde zum wortgewandten Anwalt all jener, die von Noxus unterdrückt werden. Er steht zudem dafür ein, Dinge aufzudecken, die das noxische Militär lieber verbergen will - etwas, das ihn bei Noxus'' Elite sehr unbeliebt machte. Seine gemeinnützige Arbeit brachte ihm einige Preise ein, die in interessantem Kontrast zu der Wut und der Zerstörung stehen, die er in die Liga bringt.<br><br>„Wenn du als Beschwörer den Stier bei den Hörnern packen willst, dann könnte Alistar etwas dagegen haben.“', 'Alistar kann sehr störend sein, aber manchmal ist es besser, sich zunächst auf einfachere Ziele zu konzentrieren.', 'Nimm dich vor der Kombination „Pulverisieren“ und „Kopfstoß“ in Acht, wenn du dich in der Nähe von Türmen bewegst.', 'Wenn Alistar seine ultimative Fähigkeit einsetzt, ist es meist besser, sich zurückzuziehen und zu warten, bis der Effekt beendet ist, bevor man ihn wieder angreift.', '„Pulverisieren“ eignet sich gut dazu, eine bessere Position für „Kopfstoß“ zu erlangen.', 'Bei Alistar ist das Lauftempo besonders wichtig. Bedenke dies, wenn du seine Stiefel kaufst.', '„Blitz“ in Verbindung mit „Pulverisieren“ und „Kopfstoß“ kann es dir ermöglichen, deine Gegner zu überrumpeln und sie in deine Verbündeten zu stoßen.', 0, 0, 0, 2306, ' Tank Suppport'),
(35, 'Darius', 122, '2014-10-21 17:54:20', '2015-04-09 10:19:31', 'Darius', 125.00, 37.50, 263.00, 55.88, 582.24, 93.00, 3.50, 29.88, 0.35, 9.85, 0.00, 1.25, 6.58, 2.65, 32.10, 340.00, -0.08, 0.00, 0.95, 3.50, 'Die Hand von Noxus', 'Es gibt kein großartigeres Symbol der noxischen Macht als Darius, den gefürchtetsten und kampferprobtesten Krieger dieser Nation. In jungen Jahren zum Waisen geworden, musste Darius darum kämpfen, sich und seinen jüngeren Bruder am Leben zu halten. Zu dem Zeitpunkt, als er in die Armee eintrat, hatte er bereits die Stärke und Disziplin eines Veteranensoldaten entwickelt. Der ersten wahren Prüfung seiner Entschlossenheit musste sich Darius in einer entscheidenden Schlacht gegen Demacia stellen, in der die noxischen Streitmächte erschöpft und zahlenmäßig unterlegen waren. Darius'' Hauptmann befahl seinen Truppen den Rückzug, doch Darius weigerte sich, solch einen Akt der Feigheit zu akzeptieren. Darius brach aus der Formation aus, ging mit großen Schritten auf den Hauptmann zu und köpfte ihn mit nur einem Hieb seiner gewaltigen Axt. Die Soldaten, ebenso erschrocken wie inspiriert, folgten Darius in die Schlacht und kämpften mit unvorstellbarer Stärke und unglaublichem Eifer. Am Ende einer langen und zermürbenden Schlacht gingen sie letztlich siegreich aus dieser hervor.<br><br>Durch diesen Sieg mit neuem Schwung beflügelt, führte Darius seine nun überaus loyalen Truppen in einer verheerenden Kampagne gegen Demacia an. Nachdem er seine Stärke auf dem Schlachtfeld unter Beweis gestellt hatte, richtete sich Darius'' Blick gen Heimat. Er sah ein von Schwäche gezeichnetes Noxus, in welchem habgierige, selbstgefällige Adlige ihrer Nation die Kraft aussaugten. Fest entschlossen, sein Land wieder zu Größe zu verhelfen, nahm Darius selbst die Herausforderung an, die noxische Führung wieder aufzubauen. Viele in Noxus sahen in Darius'' Auswahl einen Versuch, Macht zu erlangen, aber für die Besetzung des Throns schmiedete er ganz andere Pläne. Er hatte den Aufstieg Jericho Swains mit begeistertem Interesse verfolgt. In Swain sah Darius einen Anführer, welcher den Verstand und die Zielstrebigkeit besaß, Noxus Ruhm zu bescheren. Zusammen mit dem Meister der Taktik arbeitet Darius nun daran, die Nation mit Hilfe seiner Vision wahrer noxischer Stärke zu vereinen. <br><br>„Ein vereintes Noxus könnte die Welt kontrollieren - und verdiente dies auch.“ - Darius<br>', 'Solange Darius'' „Axtgriff“ abklingt, ist er verwundbarer und ihm kann leichter zugesetzt werden.', 'Darius'' Fähigkeiten, aus Kämpfen zu entkommen, sind begrenzt. Besitzt du einen Vorteil, solltest du diesen unbedingt ausnutzen.', '', '„Dezimieren“ ist eine mächtige Fähigkeit, um Gegnern zuzusetzen.', '„Noxische Guillotine“ verursacht mehr Schaden, je mehr Treffer du zuvor erzielen kannst. Treffe fünf Mal, um den Schaden zu verdoppeln.', 'Darius profitiert vor allem von mehr Durchhaltevermögen. Je länger du einen Kampf hinauszögern kannst, umso mächtiger wird er.', 0, 0, 0, 4371, ' Fighter Tank'),
(36, 'Vayne', 67, '2014-10-21 17:54:20', '2015-04-09 10:19:32', 'Vayne', 550.00, 35.00, 231.80, 53.46, 498.44, 83.00, 3.25, 19.01, 0.40, 5.42, 0.00, 0.00, 6.97, 4.00, 30.00, 330.00, -0.05, 0.00, 0.55, 3.40, 'Die Jägerin der Nacht', 'Die Welt ist nicht immer so zivilisiert wie die Menschen glauben mögen. Es gibt noch immer solche, die den schwärzesten Pfaden der Magie folgen und von den dunklen Mächten, welche Runeterra durchströmen, korrumpiert werden. Shauna Vayne ist sich dieser Tatsache durchaus bewusst. Als junges, privilegiertes Mädchen im Herzen der Elite Demacias versuchte ihr Vater sie vom stets wachsamen Auge der Ordnungshüter zu überzeugen. Jung und naiv wie sie war, glaubte sie wahrhaftig, dass ihre Welt eine Welt der vollkommenen Sicherheit sei ... bis zu der einen Nacht, in der eine verdrehte Hexe sich für ihren Vater interessierte. Die böswillige Frau überwältigte die ihm zur Seite gestellte Wache und folterte ihre Familie, bevor sie sie tötete. Die junge Shauna konnte nur entkommen, indem sie sich versteckte und dann floh, sobald das alte Weib gegangen war, die Schreie derer, die sie liebte, noch immer in den Ohren, während sie davonrannte. An diesem Tag entflammte ein brennender Hass in ihr, der nie vergehen wird.<br><br>Mit dem Geld ihres Vaters konnte Vayne für sich sorgen und sobald ein Ausbilder sie als Schülerin angenommen hatte, begann sie zu trainieren. Als sie zu einer erwachsenen Frau herangereift war, war sie eine erbitterte Kriegerin. Doch die Schlachtfelder waren ihr nicht zur Heimat bestimmt. Demacia brauchte einen Beschützer, einen, der jene jagen würde, welche der Dunkelheit anheimgefallen waren. Shauna nutzte die Kontakte ihrer Familie, um die erste Jägerin der Nacht zu werden - und heute ist ihr Heldenmut Stoff von Legenden. Man sagt, jene, die schwarze Magie praktizieren, würden zusammenfahren, wenn sie hören, dass die Jägerin der Nacht wieder durch die Schatten streift. Trotz ihres Kreuzzuges hat Shauna die Liga der Legenden mit Schrecken betrachtet. Einige der Champions sind zweifellos den schwärzesten Zauberkünsten erlegen, wurden aber dennoch mit offenen Armen in der Liga empfangen, obwohl man sie zum Schutze aller hätte unschädlich machen müssen. Für die Jägerin der Nacht ist die Zeit gekommen, ihre geheime Mission in die Tat umzusetzen - die Liga der Legenden zu reinigen.<br><br>„Nicht alle Schatten muss man fürchten. Zumindest nicht, wenn Vayne sich durchsetzt.”', 'Vayne ist recht zerbrechlich und mit entsprechend Druck wird sie sehr vorsichtig spielen müssen.', 'Lass nicht zu, dass dich Vayne an eine Wand nageln kann.', '', '„Hechtrolle“ hat verschiedene Verwendungsmöglichkeiten, aber Vayne kann damit keine Mauern überwinden.', '„Verdammen“ kann genutzt werden, um Gegner für eine Tötung festzuhalten oder einem Verfolger zu entkommen.', 'Stürze dich nicht als erstes in einen Teamkampf. Überlass deinen Teammitgliedern die Eröffnung.', 0, 0, 0, 7143, ' Marksman Assassin'),
(37, 'Varus', 110, '2014-10-21 17:54:20', '2015-04-09 10:19:32', 'Varus', 575.00, 36.00, 310.48, 49.04, 537.76, 82.00, 3.00, 23.21, 0.80, 5.42, 0.00, 0.00, 7.34, 3.00, 30.00, 330.00, -0.05, 0.00, 0.55, 3.40, 'Der Pfeil der Vergeltung', 'Aufgrund seines unvergleichlichen Könnens im Umgang mit dem Bogen und seines unbestrittenen Sinns für Ehre wurde Varus als Wächter eines heiligen ionischen Tempels auserkoren. Der Tempel war gebaut worden, um eine uralte Grube des Verderbens in sich aufzunehmen, die so abscheulich war, dass die Ältesten Ionias fürchteten, sie könnte die Insel in Finsternis hüllen. Varus war auf seine Position stolz, da für diese Aufgabe nur die außergewöhnlichsten ionischen Krieger ausgewählt wurden. Er lebte zusammen mit seiner Familie in einem nahegelegenen Dorf und führte ein ruhiges Leben in disziplinierter Routine, bis zu dem Tage, an dem die Truppen Noxus'' in Ionia einmarschierten. Ihre Stoßtruppen hinterließen nichts als Tod und Verwüstung und der Tempel lag genau auf ihrem Weg. Varus war gezwungen, eine Entscheidung zu treffen. Die Ehre zwang ihn zu bleiben und den Tempel zu verteidigen, doch ohne ihn würden die wenigen Einwohner des Dorfes der herannahenden Kriegsmaschinerie nur wenig Widerstand entgegenbringen können. Schweren Herzens entschied er sich, seine Rolle als Wächter zu erfüllen. Er konnte nicht zulassen, dass das Verderben entkam.<br><br>Seine Pfeile spalteten die Truppen, die an diesem Tag versuchten, ihm den Tempel abzuringen. Als er jedoch in das Dorf zurückkehrte, fand er nur noch einen glimmenden Friedhof vor. Die Reue beim Anblick seiner abgeschlachteten Familie wich überwältigender Trauer, die sich schließlich in brodelnden Hass verwandelte. Er schwor, jeden noxischen Eindringling niederzumetzeln, doch zunächst einmal musste er stärker werden. Er wandte sich dem zu, dessen Schutz er alles geopfert hatte. Die Grube des Verderbens würde ihn mit Haut und Haaren verschlingen wie eine Flamme den Docht, doch ihre grässliche Macht würde in seinem Inneren brennen, bis er verloren war. Dies war ein Weg, von dem es keine Wiederkehr geben konnte ... Fest entschlossen überantwortete er sich den schwarzen Flammen und er spürte, wie sich grausame Energie mit seiner Haut verband ... und mit ihr das Versprechen des Untergangs. Er ging los mit dem Ziel, alle Noxier, die mit der Invasion zu tun gehabt hatten, bluten zu lassen - eine entsetzliche Aufgabe, die ihn letzten Endes zu den berühmt-berüchtigtsten Akteuren des Überfalls in die Liga der Legenden führte.<br><br>„Das Leben eines Pfeils ist vergänglich, nur bestimmt durch Richtung und Ziel.“ - Varus<br>', 'Stehst du unter dem Einfluss von Varus'' Verderbnis, so erleidest du zusätzlichen Schaden.', 'Kann Varus einen Todesstoß erzielen oder half er bei einer Tötung, dann erhält er kurzzeitig zusätzliches Angriffstempo, was ihn noch viel gefährlicher macht.', 'Du wirst an Ort und Stelle festgehalten, falls dich eine der Ranken von Varus'' ultimativer Fähigkeit, „Kette der Verderbnis“ erreicht. Du kannst dem aber entgehen, wenn du der Ranke lange genug fernbleiben kannst.', 'Schaltest du „Verdorbener Köcher“ früh frei, kann dir das dabei helfen, gegnerischen Champions zuzusetzen oder Todesstöße gegen Vasallen zu erzielen.', 'Bei Kämpfen auf kurze Distanz kann es manchmal besser sein, „Durchdringender Pfeil“ schnell einzusetzen, anstatt diesen erst komplett zu laden.', 'Versuche die sehr große Reichweite von „Durchdringender Pfeil“ auszunutzen, um gegnerische Champions zu treffen, solange diese noch außer Reichweite sind oder wenn sie sich bereits zurückziehen.', 0, 0, 0, 5653, ' Marksman Mage'),
(38, 'Udyr', 77, '2014-10-21 17:54:20', '2015-04-09 10:19:32', 'Udyr', 125.00, 30.00, 270.40, 58.29, 593.32, 99.00, 3.20, 25.47, 0.45, 8.71, 0.00, 1.25, 7.50, 2.67, 32.10, 345.00, -0.05, 0.00, 0.75, 4.00, 'Der Geistwanderer', 'Udyr ist mehr als nur ein Mensch, er ist ein Gefäß für die ungezähmte Macht von vier ursprünglichen Tiergeistern. Wenn er sich die animalische Natur der Geister zu Nutze macht, kann Udyr ihre einmaligen Stärken nutzen: Der Tiger gewährt ihm Schnelligkeit und Wildheit, die Schildkröte Widerstandsfähigkeit, der Bär Macht und der Phönix seine ewige Flamme. Mit ihren vereinten Kräften kann Udyr all jene zurückdrängen, die versuchen wollen, der natürlichen Ordnung zu schaden.<br><br>In Freljord gibt es eine einzigartige Kaste, die außerhalb der Gesellschaft dieser wilden Landstriche lebt. Sie sind die Bewahrer einer natürlichen Welt: die Geistwanderer. Einmal in jeder Generation wird ein Kind unter einem blutroten Mond geboren, ein Kind, von dem man sagt, es lebe zwischen den zwei Welten: der Welt des Geistes und der Welt der Menschen. Dieses Kind wird zum Geistwanderer gebracht, auf dass es die schamanische Linie fortführe. Udyr war solch ein Kind und beherrschte das Heulen der Tundrawölfe, noch bevor er die Sprache seiner Ahnen erlernte. Mit Hilfe des Geistwanderers würde Udyr eines Tages die Bedeutung der Rufe der Geister lernen und sich der Sorge um das Gleichgewicht der Natur verschreiben. Der Geistwanderer sagte Udyr oft, er würde häufiger geprüft werden als jene, die vor ihm kamen, da die Geister Freljords immer unruhiger würden, doch der Grund dafür blieb ihm verborgen.<br><br>Die Antwort erhielt er im tiefsten Winter, als Udyr und der Geistwanderer von einer furchteinflößenden Gestalt heimgesucht wurden, deren Name sich nur durch ängstliches Flüstern verbreitet hatte: die Eishexe. In dem Wissen, der Junge würde eine leichte Beute für ihre abscheuliche Magie, schirmte der Geistwanderer das Kind vor dem Angriff der Eishexe ab - bezahlte dafür jedoch mit seinem eigenen Leben. Von Trauer zerfressen heulte Udyr zornig auf und fühlte, wie Freljord selbst durch ihn aufheulte. In diesem Moment machte das Kind sich die ursprüngliche Natur der Geister zu eigen und wurde selbst zum Tier. Von seiner ungezähmten Macht durchflutet brachte Udyrs wütendes Gebrüll Berggipfel zum Zittern und löste einen reißenden Lawinenabgang aus. Als Udyr sich endlich aus dem Schnee befreit hatte, war die Eishexe verschwunden.<br><br>Über die Jahre hinweg lernten die Stämme des Nordens, den Wilden und sein Territorium zu meiden. Doch dann nahm Udyr eines Tages die Witterung eines furchtlosen Eindringlings auf. Fest entschlossen, ihn aus seinem Revier zu verjagen, griff er an, nur um jedes Mal mit Leichtigkeit abgewehrt zu werden. Der Wilde sprang wieder und wieder auf den Mann ein, wurde aber jedes Mal im Handumdrehen beiseite gestoßen. Erschöpft und geschlagen spürte Udyr, wie seine Feindseligkeit abebbte und krächzte ein unbeholfenes „Wer“ in Richtung des Fremden. Lee Sin war gekommen, um vom Geistwanderer einen Rat zu erbitten, fand jedoch einen Mann vor, der ebenso von seinem Weg abgekommen war. Der Mönch versprach, er würde Udyrs Pfad ebnen und führte ihn zu einem Kloster, das durch vier ewige Geister von großer Macht und Weisheit beschützt wurde. Dort fand Udyr zu Harmonie.<br><br>Lee Sin brachte Udyr in ein Land, das einen völligen Kontrast zu seinem Geburtsort bildete. Überleben war nicht das einzige Gesetz, welches das Leben der Ionier oder der Kreaturen des Landes beherrschte. Zum ersten Mal fühlte sich Udyr im Frieden mit den ihn umgebenden Geistern und fand Trost in menschlicher Gesellschaft. Seine Zeit inmitten der Mönche lehrte ihn, seine Instinkte zu kontrollieren, während seine Meditationen mit den uralten Tempelgeistern ihm Weisheit verliehen. Durch sie lernte Udyr, sein Leben als nächster Geistwanderer wahrhaft anzunehmen.<br><br>Udyr verdankte den Ioniern sehr viel. Es war eine Schuld, die er nie gebeten wurde zu begleichen, die er aber letztlich mehrfach zurückzahlte. Als die Armeen Noxus einfielen, blieb Udyr nicht untätig, während die brutalen Soldaten die friedlichen Ionier unterdrückten - er hatte nicht vergessen, wie man die Zähne fletschte. Udyr sprang mit der ganzen Wildheit eines in die Enge getriebenen Tieres auf ihre Armeen zu und verschaffte den Eindringlingen gute Gründe, sich vor der Wildnis zu fürchten. Aus den Baumwipfeln heraus fetzten seine Klauen die Noxier in Stücke; am Flussufer warf er sie zurück in die Fluten und auf den Feldern verschlang er sie mit heißem Lauffeuer. Erst als die Noxier mit eingezogenem Schwanz flohen, zügelte Udyr seine Wut.<br><br>Frieden kehrte zurück nach Ionia, doch Udyr spürte noch immer etwas, das ihn nicht zur Ruhe kommen ließ. Die Geister Freljords riefen ihn, warnten vor etwas unnatürlich Bösem, das aus dem Eis emporstieg. Udyr verstand die wahre Gefahr, welche die Eishexe für seine Heimat darstellte: Sie war der Vorbote einer noch größeren Finsternis, die bald über das Land hereinbrechen würde. Bewaffnet mit den mächtigen Geistern der Tempel kehrte Udyr nach Freljord zurück, um die natürliche Welt vor all jenen zu verteidigen, die ihr Gleichgewicht bedrohten.<br><br>„Durch uns wird der Wille der Natur vollstreckt.“ - Udyr<br>', 'Udyr-Spieler beginnen oft im Urwald und tauchen nur daraus auf, um aus dem Hinterhalt anzugreifen. Versuche an Schlüsselpositionen sehende Augen aufzustellen, um seine Bewegungen im Auge zu haben.', 'Sobald der erste Schildeffekt verschwindet, ist die „Macht der Schildkröte“ gegenüber anderen Champions unterlegen. Greif ihn an und zwinge ihn dazu, eine andere Macht zu nutzen, sodass er nicht länger Leben regenerieren kann.', 'Einige Udyr-Spieler kaufen auch Tank-Gegenstände, um widerstandsfähiger zu werden. Wenn dem so ist, solltest du dich stattdessen auf ihre schwächeren Teammitglieder konzentrieren.', '„Macht der Schildkröte“ kommt erst nach der Schadensminderung zum Tragen. Deshalb kann der Kauf von Gegenständen mit defensiven Werten deine Überlebenschance drastisch erhöhen.', 'Udyr ist einer der besten Jungler im Spiel. Du solltest dir diesen Vorteil zu Nutze machen, um deinem Team mehr Erfahrung und mehr Kontrolle über die Karte zu verschaffen.', '', 0, 0, 0, 1449, ' Fighter Tank'),
(39, 'Jayce', 126, '2014-10-21 17:54:20', '2015-04-09 10:19:32', 'Jayce', 125.00, 40.00, 307.20, 50.38, 571.20, 90.00, 3.50, 22.38, 0.80, 7.34, 0.00, 0.00, 6.00, 3.00, 30.00, 335.00, -0.05, 0.00, 0.80, 3.50, 'Der Verteidiger von Morgen', 'Ausgerüstet mit Witz, Charme und seinem Markenzeichen, einem transformierbaren Hammer, hat Jayce sein Leben dem Schutz seiner Heimat, Piltover, gewidmet. Doch lange bevor seine Nation ihn einen Helden nannte, war er ein vielversprechender junger Erfinder. Als Piltover ihn damit beauftragte, einen seltenen arkanen Kristall zu untersuchen, entdeckte Jayce, dass dieser als mächtige Energiequelle genutzt werden kann. Erpicht darauf, sich zu profilieren, begann er, eine Apparatur zu entwickeln, um seine Kraft zu nutzen. Schon bald verbreitete sich die Kunde vom Potenzial des Kristalls über die Grenzen von Piltover hinaus. Viktor, der maschinengestützte Wissenschaftler aus Zhaun, machte Jayce ein Angebot: Zusammen konnten sie den Kristall nutzen, um seine „glorreiche Evolution“ weiter zu verbessern - eine Vision einer durch und mit Technologie verbundenen Menschheit. Jayce lehnte ab, doch Viktor hatte nicht vor, mit leeren Händen von dannen zu ziehen. Er sprengte Jayce mühelos beiseite und schnappte sich den Kristall, wobei er die jämmerlichen Sicherheitskräfte des Labors in Brand setzte und in Richtung Zhaun davoneilte. Jayce erbat von der Regierung Piltovers eine Reaktion, doch die Beamten weigerten sich, einen Akt der Aggression zu unterstützen. Er entschied sich, allein zu handeln, denn ihm wurde klar, dass, wenn sich niemand Viktor in den Weg stellte, Piltover niemals mehr sicher sein würde.<br><br>Jayce kehrte in sein Laboratorium zurück, um sich auf seinen Angriff vorzubereiten. Nach einer intensiven Zeit der Forschung, Entwicklung und praktischen Tests trat er mit seinem krönenden Werk wieder in Erscheinung - dem Merkur-Hammer. Mit der Waffe in seiner Hand marschierte Jayce nach Zhaun und begann seinen Ein-Mann-Angriff. Viktors Gefolgsmänner strömten herbei, um ihn aufzuhalten, doch Jayce fegte sie einfach beiseite und kämpfte sich seinen Weg in das Herz des Labors frei. Dort wurde er der schrecklichen Brillanz von Viktors Kreationen gewahr, die alle von der Energie des arkanen Kristalls angetrieben wurden. Er erkannte, dass er keine andere Wahl hatte als die Energiequelle zu zerstören, doch Viktor stellte sich ihm in den Weg. Auch wenn beide Wissenschaftler schwer verletzt aus diesem Zusammenprall hervorgingen, konnte Jayce einen verzweifelten Schlag auf den Kristall ausführen. Er zerschmetterte ihn und ergriff die Flucht, als Viktors Maschinen in Flammen aufgingen. Als er erschöpft, aber siegreich, nach Hause zurückkehrte, wurde Jayce von den Bewohnern Piltovers als Held empfangen. Er genoss die Verehrung, aber er wusste auch, dass seine Taten die Aufmerksamkeit gefährlicher Feinde erregt hatten. Nachdem er sich der Verteidigung seines Volkes verschrieben hat, ist Jayce Piltovers größte Hoffnung auf eine strahlende Zukunft.<br><br>„Vertraut mir: Wenn wir uns geschickt anstellen, kann sich Piltover jeder Bedrohung stellen. Hey, ich bin der lebende Beweis.“ <br>- Jayce', 'Jayce kann sowohl im Nah- als auch Fernkampf angreifen. Achte auf seine aktuelle Form und seine Waffenfarbe, um zu wissen, worauf er gerade setzt.', 'Achte auf Jayce, wenn er ein „Beschleunigungstor“ platziert, da er wahrscheinlich auch „Schockstoß“ einsetzen wird.', 'Jayce ist im frühen Spielverlauf stark. Ist er im Vorteil, solltest du defensiv spielen.', 'Wechsle häufig deine Waffe. So verstärkst du deine Angriffe und erhältst zusätzliches Tempo.', 'Falls du zu viel einstecken musst, solltest du dich auf die Hammerhaltung konzentrieren, denn diese gewährt dir eine verbesserte Verteidigung.', 'Um mehr Reichweite und Schaden zu bekommen, versuche mit „Schockstoß“ durch das „Beschleunigungstor“ zu feuern.', 0, 0, 0, 1324, ' Fighter Marksman');
INSERT INTO `champions` (`id`, `name`, `champion_id`, `created_at`, `updated_at`, `key`, `attackrange`, `mpperlevel`, `mp`, `attackdamage`, `hp`, `hpperlevel`, `attackdamageperlevel`, `armor`, `mpregenperlevel`, `hpregen`, `critperlevel`, `spellblockperlevel`, `mpregen`, `attackspeedperlevel`, `spellblock`, `movespeed`, `attackspeedoffset`, `crit`, `hpregenperlevel`, `armorperlevel`, `title`, `lore`, `enemytips1`, `enemytips2`, `enemytips3`, `allytips1`, `allytips2`, `allytips3`, `f2p`, `sale`, `sale_price`, `votes`, `tags`) VALUES
(40, 'Leona', 89, '2014-10-21 17:54:20', '2015-04-09 10:19:33', 'Leona', 125.00, 40.00, 302.20, 60.04, 576.16, 87.00, 3.00, 27.21, 0.80, 8.43, 0.00, 1.25, 6.00, 2.90, 32.10, 335.00, 0.00, 0.00, 0.85, 3.10, 'Der strahlende Sonnenaufgang', 'Auf den höher gelegenen Hängen des Berges Targon ist Krieg das Einzige, wofür die Krieger der Rakkor leben und atmen. Doch der Gipfel des Targons ist einer besonderen Gruppe Rakkor vorbehalten, die einer „höheren“ Bestimmung folgen. Mitglieder dieser Gruppe, welche sich die Solari nennen, legen ihre Kriegskluft ab und entscheiden sich dafür, ihr Leben der Verehrung der Sonne zu widmen. Die Legende besagt, die Solari wurden von einem Krieger gegründet, der die rohe Macht der Sonne anrufen und in der Schlacht auf seine Gegner niedergehen lassen konnte. Er beanspruchte den Berg Targon, der Punkt, an dem Valoran der Sonne am nächsten ist, für seine Anbetung der Sonne, eine Tradition, die seit Generationen von den Solari bis zum heutigen Tage weitergeführt wurde.<br><br>Leonas Eltern waren traditionelle Rakkor, beide großgezogen, um in der Hitze der Schlacht bestehen zu können. Für sie war Leona ein Problemkind. Sie war in der Lage, so erbittert zu kämpfen wie jeder andere - ihren Freund aus Kindertagen, Pantheon, eingeschlossen - doch sie teilte nicht deren Eifer zu töten. Sie glaubte, der wahre Wert einer Kriegerin läge in ihrer Fähigkeit zu verteidigen und zu beschützen, da dies permanente Konzentration und die Reinheit des Geistes voraussetzt. Als die Zeit für ihren Ritus von Kor, einer Zeremonie, in der zwei junge Rakkor bis zum Tode kämpfen, um sich das Recht zu verdienen, eine ehrwürdige Waffe zu tragen, gekommen war, weigerte sich Leona zu kämpfen. Dafür ordneten die Anführer der Rakkor ihre Exekution an, doch als sie versuchten, den finalen Schlag auszuführen, brach das Sonnenlicht durch die Wolkendecke und tauchte den Targon in gleißendes Licht. Als es schwand, war Leona unverletzt und ihre Henker lagen bewusstlos um sie herum. Die Solari machten umgehend ihren Anspruch auf Leona geltend und verlangten, dass der Urteilsspruch widerrufen werde. Sie legte die goldene Rüstung der Solari an und sie verliehen ihr das Schwert und den Schild, die einst dem legendären Sonnenkrieger gehört hatten. Die Solari halfen Leona dabei, ihre Fähigkeiten zu schärfen und als sie bereit war, zog sie aus, um der Liga der Legenden beizutreten.<br><br>„Die Strahlen der Sonne erreichen ganz Runeterra - dies gilt auch für das Antlitz ihrer Championesse.“ - Leona<br>', 'Benutzt Leona „Eklipse“, hast du 3 Sekunden, bevor sie damit Schaden verursacht.', 'Nur Gegner in der Mitte von „Sonneneruption“ werden betäubt, weshalb sich diese mit Vorsicht vermeiden lässt.', '', 'Stürme voraus und markiere deine Gegner mit „Sonnenlicht“, noch bevor deine Verbündeten Schaden verursachen.', '„Schild des Tagesanbruchs“ und „Zenitklinge“ bilden eine mächtige Kombination.', 'Du kannst mit „Eklipse“ Unmengen an Schaden abfangen, aber du musst nahe deiner Gegner bleiben, um die Wirkdauer zu verlängern.', 0, 0, 0, 1534, ' Tank Support'),
(41, 'Syndra', 134, '2014-10-21 17:54:20', '2015-04-09 10:19:33', 'Syndra', 550.00, 50.00, 334.00, 53.87, 511.04, 78.00, 2.90, 24.71, 0.80, 6.50, 0.00, 0.00, 6.00, 2.00, 30.00, 330.00, 0.00, 0.00, 0.60, 3.40, 'Die dunkle Herrscherin', 'Syndra, der ein immenses magisches Potenzial bereits in die Wiege gelegt wurde, liebt nichts mehr, als den Geschmack der unglaublichen Macht, die ihr zur Verfügung steht, voll auszukosten. Mit jedem Tag, der vergeht, wird ihre Kontrolle über die magische Kraft wirkungsvoller und verheerender. Sie lehnt jeden Gedanken an Ausgewogenheit oder Zurückhaltung ab und will nichts als die Kontrolle über ihre Macht behalten, selbst wenn dies bedeutet, dass sie die Autoritäten, die versuchen sie aufzuhalten, vernichten muss.<br><br>Während ihrer Jugend in Ionia jagte Syndras erbarmungsloser Einsatz von Magie den Ältesten ihres Dorfes Angst ein. Sie brachten sie zu einem abgelegenen Tempel und übergaben sie der Obhut eines alten Magiers. Zu Syndras Freude erklärte der Magier, der Tempel sei eine Schule - ein Ort, an dem sie ihre Begabungen unter seiner Führung entwickeln konnte. Obschon sie während ihrer Zeit dort sehr viel lernte, hatte Syndra nicht mehr das Gefühl, dass ihre Kräfte sich vermehrten, wie es in ihrer Jugend der Fall gewesen war. Sie wurde immer verdrießlicher, stellte letztlich ihren Mentor zur Rede und forderte von ihm eine Erklärung. Er verriet ihr, dass er Syndras Macht gedämpft hatte, in der Hoffnung, er könne sie Kontrolle und Zurückhaltung lehren. Ihn des Verrats beschuldigend ging sie auf den Magier los und befahl ihm, den Bann zu lösen, der sie ausbremste. Er wich zurück und sagte ihr, wenn sie sich nicht unter Kontrolle hätte, wäre er gezwungen, Syndras Magie vollständig zunichte zu machen. Schäumend vor Wut beschwor sie ihre Macht und schmetterte den alten Mann an die Wand. Nun da ihr Mentor tot war, fühlte sie zum ersten Mal seit Jahren, ihr ungezügeltes Potenzial durch sich hindurchströmen. Wenngleich sie ihre Freiheit zurückgewonnen hatte, weigerte sie sich, zu der Gesellschaft zurückzukehren, die versucht hatte, ihr ihre Gabe zu stehlen. Stattdessen entschied sich Syndra, ihr vormaliges Gefängnis als ihre Festung zu beanspruchen. Die Grenzen ihrer magischen Fähigkeiten austestend entriss sie die Mauern ihres Fundamentes und erhob sie in die Luft. Da sie sich nun eingehend mit ihrer Kunst befassen kann, hat sie es sich zum Ziel gemacht, mächtig genug zu werden, um die schwächlichen, dümmlichen Herrscher Ionias zerstören zu können - und mit ihnen jeden, der es wagte, ihre Größe in Fesseln legen zu wollen.<br><br>„Macht gehört jenen, die bereit sind, sie zu nutzen.“ - Syndra<br>', 'Sichere dir im Kampf gegen Syndra schnell Stiefel, um ihren Zaubern leichter auszuweichen.', 'Greife Syndra an, nachdem sie „Zerstreuen der Schwachen“ eingesetzt hat, da sie während der langen Abklingzeit verwundbarer sein wird.', 'Mit ihrer maximalen Stufe erhalten Syndras Zauber zusätzliche Effekte und ein geändertes Aussehen.', 'Nutze deine ultimative Fähigkeit, wenn du viele Sphären auf dem Richtfeld hast, um deinen Schaden zu steigern.', 'Hast du einen gegnerischen Champion mit „Willenskraft“ getroffen, wird dieser verlangsamt, wodurch dieser „Dunkle Sphäre“ kaum ausweichen können wird.', 'Steigere eine deiner Fähigkeiten schnellstmöglich auf Stufe 5, da diese mit der maximalen Stufe zusätzliche mächtige Effekte erhalten.', 0, 0, 0, 3320, ' Mage Support'),
(42, 'Pantheon', 80, '2014-10-21 17:54:20', '2015-04-09 10:19:33', 'Pantheon', 150.00, 34.00, 267.12, 55.57, 579.16, 87.00, 2.90, 27.65, 0.45, 7.84, 0.00, 1.25, 7.36, 2.95, 32.10, 355.00, 0.00, 0.00, 0.65, 3.90, 'Der Meister der Kriegskunst', 'Hoch über den Wolken am Berg Targon lebt ein unerschütterlicher Menschenschlag, bekannt als Rakkor, der noch immer Kampf und Krieg als ultimative Kunstform verehrt. Die Rakkor erinnern sich noch gut an Runeterras Runenkriege und wissen, dass nur die Liga der Legenden die Zunahme von Gewalt so lange unterdrücken konnte. Jedes Stammesmitglied wächst als disziplinierter und unbarmherziger Krieger heran, der es vorzieht, sowohl noxische als auch demacianische Armeen nur dann anzugreifen, wenn er mindestens zehn zu eins in der Minderheit ist. Krieger der Rakkor werden nicht nur dazu erzogen, mit ihren Händen so tödlich zu sein, wie die besten Meister der waffenlosen Kampfkünste, sondern auch die vielen ehrwürdigen Waffen des Stammes in Perfektion handhaben zu können. Diese Waffen wurden von Generation zu Generation weitergegeben und ihr Innerstes ist Teil der mystischen Natur Runeterras, womit sie zu den gefährlichsten gehören, die es gibt. So überrascht es nicht, dass sie in den Händen Pantheons ihren Weg in die Liga der Legenden gefunden haben.<br><br>Dieser sehr ernste Krieger ist ein Vorbild für sein Volk, seine ganze Existenz ein Lobgesang an die Kunst des Kampfes. Pantheon empfand es als Demütigung, dass die Bewohner Valorans eine Organisation voller sogenannter Champions zur Abschaffung des Krieges einrichteten, ohne die Rakkor daran teilhaben zu lassen. Mit den Segnungen seines Stammes und den Relikten seiner Vorfahren ist er zur Liga der Legenden hinabgestiegen, um der Welt zu zeigen, was ein echter Krieger ist. Ihm ist es egal, wen er bekämpft, er kümmert sich nicht um den Prunk oder das Ansehen eines Champions der Liga, er lebt einzig und allein für den Ruhm des Kampfes. So lange Pantheon atmet, dürstet es ihn nach einem weiteren Gegner, den er besiegen kann.<br><br>„Ich hatte gehofft, dass sie mehr Verstärkung bringen würden.“ - Pantheon, inmitten der sterblichen Überreste eines niedergemetzelten Bataillons von Noxus.<br>', 'Wenn du dich in Büschen versteckt hältst, kann dich Pantheon schwieriger mit „Großer Himmelssturz“ treffen.', 'Gib acht, wenn Pantheon einen Partner mit Betäubungs- oder Festhaltefähigkeiten bei sich hat (z.B. Morgana, Sion), denn dann kann er mit „Herzsucher-Schlag“ verheerenden Schaden anrichten.', 'Pantheons Schild von „Ägidenschutz“ blockt einen normalen Angriff eines Champions oder einen Schuss eines Turms, doch er ist verletzbar, bis er ihn wieder hochfährt, indem er angreift oder Fähigkeiten einsetzt.', 'Der schnelle Gebrauch von „Ägide von Zeonia“ gefolgt von „Herzsucher-Schlag“ kann deine Gegner stark schädigen.', 'Der regelmäßige Gebrauch von „Speerwurf“ zusammen mit Gegenständen zur Erhöhung des Angriffstempos hilft dabei, den „Ägidenschutz“ aufzuladen.', 'Benutze „Großer Himmelssturz“ quer über die Karte, um deinen Verbündeten zu helfen und das Blatt in einem Kampf schnell zu wenden.', 0, 0, 0, 2115, ' Fighter Assassin'),
(43, 'Kha''Zix', 121, '2014-10-21 17:54:20', '2015-04-09 10:19:33', 'Khazix', 125.00, 40.00, 327.20, 55.21, 572.80, 85.00, 3.10, 24.04, 0.50, 7.51, 0.00, 1.25, 7.59, 2.70, 32.10, 350.00, -0.06, 0.00, 0.75, 3.00, 'Der Räuber der Leere', 'Als gefährlicher Jäger der Leere infiltrierte Kha''Zix Valoran, um die vielversprechendsten Kreaturen des Landes zu verschlingen. Jeder Todesstoß lässt ihn die Stärke seiner Beute in sich aufnehmen, wodurch er immer mächtiger wird. Kha''Zix gelüstet am meisten danach, Rengar zu schnappen und zu verschlingen, denn er ist das einzige Geschöpf, das er als ebenbürtig ansieht.<br><br>Als Kha''Zix die Schwelle zu dieser Welt überquerte, war er schwach und vom Heißhunger erfüllt. Die Tiere, auf die er zunächst traf, waren zu winzig, um genügend Energie für die Verwandlung, die er herbeisehnte, zu liefern. Kha''Zix richtete seinen Appetit auf die gefährlichsten Kreaturen, die er finden konnte, und riskierte sein Leben, um seine Bedürfnisse zu stillen. Er labte sich nach jedem Todesstoß und verwandelte sich, wurde zu einem stärkeren, schnelleren Raubtier. Kha''Zix jagte seine Beute schon bald mit ungezügelter Aggressivität und glaubte unaufhaltbar zu sein. Eines Tages, als er gerade wieder ein frisch erlegtes Tier genoss, wurde der Jäger zum Gejagten. Aus der Deckung sprang eine Kreatur, die nur aus Reißzähnen und Stahl zu bestehen schien, auf ihn zu und riss ihn zu Boden. Sie brüllte ihm ins Gesicht, schlitzte ihn auf und vergrub seine Klauen in ihm. Zum ersten Mal spürte Kha''Zix, wie sein eigenes Blut vergossen wurde. Vor Wut aufkreischend schlitzte er das Auge des Untiers auf und drängte es zurück. Sie kämpften von Sonnenuntergang bis Sonnenaufgang. Als sie schließlich dem Tode nah waren, trennten sie sich widerwillig. Als sich seine Wunden zu schließen begannen, loderte in ihm das Feuer der Erwartung bei dem Gedanken daran, einen zu verschlingen, der der Stärke der Leere nahe kam. Er setzte seine Suche nach mächtiger Beute mit neu entflammter Kraft fort. Eines Tages würde Kha''Zix sich an Rengar laben.<br><br>„Töte. Verschlinge. Passe dich an.“ - Kha''Zix<br>', '„Geschmack der Furcht“ verursacht nur gegen isolierte Ziele zusätzlichen Schaden. Nutze das aus, indem du in der Nähe von verbündeten Vasallen, Champions oder Türmen bleibst.', '„Sprung“ und „Leerenangriff“ besitzen lange Abklingzeiten. Kha''Zix ist sehr verwundbar, wenn er sie nicht einsetzen kann.', '', 'Gegner werden als isoliert betrachtet, wenn sie keine nahen Verbündeten besitzen. Der Schaden von „Geschmack der Furcht“ ist gegen solche Ziele massiv erhöht.', '„Verborgene Bedrohung“ wird aktiv, wenn Kha''Zix vom gegnerischen Team nicht gesehen werden kann, beispielsweise durch hohes Gras oder „Leerenangriff“. Vergiss nicht, die Verbesserung auszunutzen, wenn du gegnerische Champions angreifst.', 'Kha''Zix kann sehr gut wählen, wo und wann er kämpfen möchte. Wähle deine Kämpfe also mit Bedacht.', 0, 0, 0, 1591, ' Assassin Fighter'),
(44, 'Riven', 92, '2014-10-21 17:54:20', '2015-04-09 10:19:34', 'Riven', 125.00, 0.00, 0.00, 56.04, 558.48, 86.00, 3.00, 24.38, 0.00, 3.34, 0.00, 1.25, 0.00, 3.50, 32.10, 345.00, 0.00, 0.00, 0.50, 3.20, 'Die Verbannte', 'In Noxus kann jeder Bewohner aufsteigen, ganz gleich welcher Rasse, welchem Geschlecht oder welcher sozialen Schicht er angehört - alles was zählt, ist Stärke. Im tiefen Glauben an dieses Ideal eiferte Riven dieser Größe entgegen. Sie zeigte schon früh ihr Potential als Soldatin, indem sie sich zwang, das Gewicht eines Langschwertes zu bewältigen, als sie gerade mal so groß wie dieses war. Als Kriegerin war sie rücksichtslos und effizient, ihre wahre Stärke aber lag in ihrer Überzeugung. Sie begab sich in Schlachten ohne jede Spur von Zweifel in sich: kein Zögern aus ethischen Beweggründen, keine Angst vor dem Tod. Riven wurde unter Ihresgleichen zu einer Anführerin, zum Aushängeschild des noxischen Geistes. Ihre Leidenschaft war so außergewöhnlich, dass das Oberkommando sie mit einem Schwarzstein-Runenschwert bedachte, das mithilfe noxischer Zauberei geschmiedet und verzaubert worden war. Die Waffe war schwerer als ein Drachenschild und fast ebenso breit - genau nach ihrem Geschmack. Kurz darauf wurde sie nach Ionia als Teil der noxischen Invasion entsandt.<br><br>Was als Krieg begann, wurde bald zur Vernichtung. Die Soldaten Noxus'' folgten den furchteinflößenden zhaunitischen Kriegsmaschinen über Felder des Todes. Dies war nicht der ruhmreiche Kampf, für den Riven trainiert hatte. Sie führte die Befehle ihrer Vorgesetzten aus, das Leben der Überbleibsel eines geschlagenen und gebrochenen Feindes auf Grundlage überspannter Vorurteile auslöschend. Im Verlauf der Invasion, wurde klar, dass die ionische Gesellschaft nicht reformiert, sondern lediglich ausgelöscht werden würde. Im Laufe eines erbitterten Kampfes wurde Rivens Einheit von ionischen Truppen umstellt. Sie riefen nach Verstärkung, als der Feind die Schlinge um sie herum immer enger zog. Was sie stattdessen erhielten, war ein Trommelfeuer biochemischen Terrors, den Singed ersonnen hatte. Riven sah zu, wie um sie herum Ionier und Noxier gleichermaßen Opfer eines unaussprechlich grausamen Schicksals wurden. Sie schaffte es, dem Bombardement zu entfliehen, doch die Erinnerung daran konnte sie nicht auslöschen. Von Noxus für tot gehalten, sah sie die Möglichkeit neu anzufangen. Sie zertrümmerte ihr Schwert, um ihre Verbindung zur Vergangenheit zu durchtrennen, und ging in ein selbst auferlegtes Exil - auf die Suche nach Wiedergutmachung und einem Weg, die reine noxische Vision, an die sie glaubte, zu retten.<br><br>„Es gibt einen Ort zwischen Krieg und Mord, an dem unsere Dämonen lauern.“', 'Riven ist sehr mobil, kann sich mit einzelnen Fähigkeiten jedoch nicht sehr weit bewegen. Wird sie während einer Kombination festgehalten oder zum Schweigen gebracht, verringert sich ihre Effektivität enorm.', 'Riven verursacht nur normalen Schaden. Konzentriere dich auf viel Rüstung, wenn Riven außer Kontrolle gerät.', 'Riven kann besonders gut gegen mehrere Nahkampfangreifer auf einmal vorgehen, da sie vergleichbar viel Schaden verursachen kann. Trete nicht mit zwei Nahkämpfern gegen Riven an, solange sie nicht ihre gesamte Kombination bereits verbraucht hat.', 'Rivens „Gebrochene Schwingen“ zielt auf den Champion, der sich bei der Aktivierung unter dem Mauszeiger befindet. Soll Riven am Gegner vorbeiziehen, muss sich auch der Mauszeiger hinter diesem befinden.', 'Riven mangelt es an Heilfähigkeiten und guter Verteidigung, weshalb sie sich darauf verlassen muss, viel Schaden auf einmal verursachen zu können. Eröffne Kämpfe mit „Gebrochene Schwingen“ und „Ki-Schwall“ und benutze „Heldenmut“, um zu entkommen oder einen Gegenangriff abzuschwächen.', '', 0, 0, 440, 2652, ' Fighter Assassin'),
(45, 'Corki', 42, '2014-10-21 17:54:20', '2015-04-09 10:19:34', 'Corki', 550.00, 37.00, 305.16, 51.24, 512.76, 82.00, 3.00, 23.38, 0.55, 5.42, 0.00, 0.00, 7.42, 2.30, 30.00, 325.00, 0.00, 0.00, 0.55, 3.50, 'Der kühne Bombenschütze', 'Als Heimerdinger und seine Yordle-Kollegen nach Piltover einwanderten, begrüßten sie die Wissenschaft als Lebensstil und leisteten der techmaturgischen Gemeinschaft umgehend große Beiträge. Wo es den Yordle an Statur fehlt, machen sie diesen Mangel mit Fleiß wieder wett. Corki, der kühne Bombenschütze, hat sich seinen Titel verdient, indem er einen dieser Beiträge als Testpilot flog - den Prototypen des Helikopters für Frontlinien-Aufklärungsoperationen, ein Luftkampf-Gefährt, das zum Rückgrat der Expeditions-Streitkräfte von Bandle (ESB) wurde. Zusammen mit seinem Geschwader - den Kreischenden Jodelnattern - fliegt Corki über Valoran hinweg und verschafft sich einen Überblick über die Landschaft, während er nebenbei seinem Publikum am Boden mit Kunststückchen in der Luft den Atem raubt.<br><br>Corki ist das bekannteste Mitglied der Kreischenden Jodelnattern, da er auch unter schwerem Beschuss gelassen bleibt und sein Mut bis zur Schwelle des Wahnsinns reicht. Vor seinem Beitritt zur Liga flog er verschiedene Einsätze und meldete sich oft freiwillig für Missionen, die ihn bis hinter die feindlichen Linien führen würden, um Informationen zu sammeln oder Nachrichten in die heiß umkämpften Gebiete zu übermitteln. Die Gefahr ließ ihn aufblühen, denn nichts liebte er so sehr wie einen spannenden Luftkampf am Morgen. Da er mehr ist als nur ein Fliegerass, nahm er an seinem Helikopter auch verschiedene Modifikationen vor. Beispielsweise rüstete er ihn mit einem ganzen Arsenal an Waffen aus, von denen manche sagen würden, dass sie mehr der Show als dem Kampf dienen. Nachdem als Folge der Vereinbarungen, die mit der Gründung der Liga einhergingen, offene Feindseligkeiten nachließen, wurde Corki sozusagen in den Ruhestand gezwungen. Er fühlte sich, als hätte man ihm „die Motoren abgestellt und die Flügel gestutzt“. Er versuchte, sich mit Stuntflügen und Schluchtenrennen zu behelfen, doch ohne den belebenden Geruch von Schießpulver, das ihm um die Nase wehte, war es nicht dasselbe. Als Heimerdinger der Liga beitrat, war es nicht gerade eine Überraschung, auch Corki kurze Zeit später dort zu erblicken. Er brannte darauf, seinen Mut mit dem der Besten, die die Welt zu bieten hatte, zu messen.<br><br>„Er ist Corki - der Tod von oben!“', 'Achte auf Corkis „Raketenwerfer“. Es verursacht Flächenschaden und kann dich so auch hinter Vasallen treffen.', 'Corki ist nach „Walküre“ verwundbar, konzentriere dich auf ihn, wenn er sie benutzt hat, um einen Kampf zu eröffnen.', '', '„Phosphorbombe“ kann Gegner aufdecken, die sich in nahen hohen Gräsern versteckt halten.', '„Walküre“ kann auch defensiv angewendet werden, um schnell zu entkommen.', 'Corki kann auch während der Nutzung von „Repetiergeschütz“ weiter angreifen. Das voll ausgebaute „Repetiergeschütz“ ist der Schlüssel, Corki zu meistern.', 0, 0, 0, 3686, ' Marksman'),
(46, 'Azir', 268, '2014-10-21 17:54:20', '2015-04-09 10:19:34', 'Azir', 525.00, 42.00, 350.56, 52.00, 524.40, 80.00, 2.80, 19.04, 0.80, 6.92, 0.00, 0.00, 6.00, 1.50, 30.00, 335.00, -0.02, 0.00, 0.55, 3.00, 'Der Imperator des Sandes', 'Einst war er ein Sterblicher, der von seiner eigenen Selbstüberschätzung geblendet wurde, doch nun ist Azir vor kurzem als aufgestiegenes Wesen mit nie dagewesener Kontrolle über die glühend heißen Sande zurückgekehrt. Er will der Shurima wieder zu ihrer einstmaligen Pracht verhelfen, doch einige zweifeln sein Herrschaftsrecht an. Azirs Macht jedoch ist unbestreitbar.', 'Azir verlässt sich auf seine Soldaten, um Schaden zu verursachen, und kann sie nur begrenzt oft bewegen. Versuche aus Zeitfenstern Kapital zu schlagen, in denen seine Soldaten an einem festen Ort stehen.', 'Azir verfügt über einen immensen Schaden über einen langen Zeitraum hinweg, während es ihm hingegen an den Schadensspitzen anderer Magier mangelt. Versuche, ihn mit hohen Schadenszahlen auszuschalten, bevor er das Blatt wenden kann.', 'Versuche, dir Sandsoldaten als Feuer vorzustellen: Stehe nicht im Feuer.', 'Sei vorsichtig, wenn du beide Soldaten von „Erhebe dich!“ einsetzt. Wenn du nicht gerade auf volles Risiko gehen willst, behalte immer einen Soldaten in der Hinterhand, falls du über eine Mauer entkommen musst oder deinen Soldaten falsch platziert hast und jetzt Schaden brauchst.', 'Versuche deine Soldaten in der Lane zwischen die gegnerischen Vasallen und den gegnerischen Champion zu positionieren. Auf diese Weise kannst du sie beide für Todesstöße nutzen und um deinen Lane-Gegenspieler zu bedrohen.', '„Imperiale Phalanx“ solltest du zuallererst unter defensiven Gesichtspunkten betrachten. Setze es ein, wenn der Gegner dich oder deine Verbündeten angreift. Denke daran, dass dein Team durch die mithilfe von „Imperiale Phalanx“ beschworenen Soldaten hindurch gehen kann, und nutze dies zu deinem Vorteil, wenn gegnerische Nahkampf-Champions dich attackieren.', 0, 0, 0, 1312, ' Mage Marksman'),
(47, 'Caitlyn', 51, '2014-10-21 17:54:20', '2015-04-09 10:19:34', 'Caitlyn', 650.00, 35.00, 313.80, 50.04, 524.40, 80.00, 3.00, 22.88, 0.55, 5.67, 0.00, 0.00, 7.42, 4.00, 30.00, 325.00, 0.00, 0.00, 0.55, 3.50, 'Der Sheriff von Piltover', 'Ein Grund, warum Piltover auch als die Stadt des Fortschritts bekannt geworden ist, ist die außerordentlich niedrige Verbrechensrate. Dies war nicht immer der Fall; Briganten und Diebe aller Arten empfanden den Stadtstaat als ideales Ziel für Plünderungen, vor allem wegen seiner wertvollen Ressourcen, die eingeführt werden, um die techmaturgische Forschung voran zu treiben. Einige theoretisieren sogar, dass die Stadt schon lange an das Chaos und das organisierte Verbrechen gefallen wäre, hätte es Caitlyn, den Sheriff von Piltover, nie gegeben. Als Tochter eines wohlhabenden Staatsmannes und einer Hextech-Forscherin entdeckte Caitlyn ihr natürliches Talent für Untersuchungen im Alter von 14 Jahren, als ihr Vater auf dem Weg nach Hause angegriffen und ausgeraubt wurde. Sie schlich sich in dieser Nacht mit dem Gewehr ihres Vaters aus dem Anwesen und verfolgte die Spur der Straßenräuber vom Ort des Verbrechens aus, bis sie diese stellte. Zunächst taten ihre Eltern alles, um ihr dieses riskante Hobby auszutreiben, aber sie war unverbesserlich. Um ihre Tochter auf die einzige ihr bekannte Art zu beschützen, begann Caitlyns Mutter damit, sie mit techmaturgischen Gerätschaften auszurüsten, die ihren detektivischen Plänen zuträglich waren.<br><br>Caitlyn wurde binnen kürzester Zeit stadtbekannt, da sie das Verbrechen in Piltover im Alleingang bezwang und sie sich schon bald in eine bestechende Schönheit verwandelte. Sie kniff nie vor einem Fall oder einer Herausforderung und sie wurde zu einem der zielgenauesten Schützen des Stadtstaats. Ihre Dienste wurden bald darauf von Demacia in Anspruch genommen, um einen mysteriösen Gesetzlosen zu schnappen, der begann, gewagte und Bekanntheit erlangende Raubzüge durchzuführen. Der Bandit, der immer eine Karte mit einem stilisierten „C“ am Ort des Verbrechens zurück ließ, wurde Caitlyns Erzfeind. Bis zum heutigen Tag sucht sie noch immer nach diesem geschickten Einbrecher und der Fall hat sie bereits durch ganz Valoran geführt. Sie ist der Liga der Legenden beigetreten, um ihr Können zu verbessern und den Einfluss zu erlangen, der es ihr ermöglicht, ihr einziges Ziel aufzuspüren, dem es bisher gelang, ihr immer wieder zu entkommen.<br><br>„Na los, lauf. Ich geb dir fünf Minuten Vorsprung.“ - Caitlyn, aus ihrem Buch „Willige Festnahme“<br>', 'Bleibe hinter verbündeten Vasallen, wenn Caitlyn auf „Piltover-Friedensstifter“ setzt, da Folgetreffer immer weniger Schaden verursachen.', 'Du kannst das Projektil von „Ass im Ärmel“ für einen Verbündeten abfangen, indem du dich einfach selbst in die Schussbahn wirfst.', '', 'Nutze ihre „Yordle-Schlagfalle“, indem du sie zeitig so aufstellst, dass du im Kampf immer eine bereit hast.', 'Vermeide es, „Ass im Ärmel“ in großen Teamkämpfen zu benutzen, denn der Schuss könnte so zu leicht den falschen Champion treffen.', 'Feuere das „Kaliber 90-Netz“ vom Gegner weg, um aufzuholen oder Hindernisse zu überspringen.', 0, 0, 0, 2914, ' Marksman'),
(48, 'Nidalee', 76, '2014-10-21 17:54:20', '2015-04-09 10:19:35', 'Nidalee', 525.00, 45.00, 295.60, 47.88, 511.20, 80.00, 3.50, 22.88, 0.80, 6.00, 0.00, 0.00, 6.00, 3.22, 30.00, 335.00, -0.02, 0.00, 0.60, 3.50, 'Die bestialische Jägerin', 'Es gibt nur wenige Bewohner, ganz zu Schweigen von Champions, die sich im unwirtlichen und gefährlichen Land südlich der Großen Barriere angesiedelt haben. Der Großteil des Landes zeugt noch immer von den Wunden des Runenkrieges, besonders der Kumungu-Dschungel. An den seltsamsten Orten dieser Gegend liegen seit langem vergessene Schätze und viele riskieren Leib und Leben bei dem Versuch, sie zu finden. Die Championesse Nidalee war nur ein kleines Mädchen, das mit ihren Eltern auf Schatzsuche war, als sie sich im dichten, verregneten Dschungel verirrten. Der Dschungel ist unbarmherzig und so musste sie die quälenden letzten Tage ihrer Eltern mit ansehen, als diese schließlich einer rätselhaften und bösartigen Seuche zum Opfer fielen.<br><br>So unwahrscheinlich es auch für ein Kind ist, alleine im ungastlichen Dschungel zu überleben, Nidalee schaffte es. Ihre jugendliche Unschuld und ihre vom Glück beseelte Naivität halfen ihr, von den Tieren des Dschungels gemocht zu werden. Schließlich nahm sich eine Puma-Familie ihrer an und zog sie wie ihr eigenes Kind auf. So wuchs sie heran und nahm irgendwie die rohe und wilde Magie der dichten Wildnis in sich auf, wodurch sich ihre menschliche Physiologie und ihr katzenhaftes Verhalten gegenseitig ergänzten und verstärkten. Als sie eines Tages über den gerissenen Überresten einer Gruppe noxischer Holzfäller stand, war dies der Wendepunkt in ihrem Leben. Sie beschloss, wieder in die so genannte „zivilisierten Welt“ zurückzukehren, um dort in der Liga der Legenden die restlichen Wälder vor Noxus und Demacia zu beschützen.<br><br>„Nidalee wurde von ihrer Puma-Familie zum tödlichen Kämpfen mit Zähnen und Krallen erzogen. Etwas an ihrer katzenhaften Erscheinung mag dich anziehen, aber bedenke stets, dass sie keine Miezekatze ist.“', 'Nidalees „Jagd“-Beeinträchtigung wird nur mit „Wurfspeer“ und „Auflauern“ aktiv. Vermeide also, von diesen Fähigkeiten getroffen zu werden, damit ihre Chance auf Folgeschaden verschlechtert wird.', 'Nidalees „Wurfspeer“ verursacht mehr Schaden, je weiter sie entfernt ist. Wenn sie weit weg ist, musst du dem Speer unbedingt ausweichen.', 'Nidalees „Anfallen“ verursacht zusätzlichen Schaden an gejagten Zielen, wofür sie aber nah an ihnen dran sein muss. Hebe dir Massenkontrolle und defensive Fähigkeiten für den Moment auf, in dem sie zum Angriff ausholt.', 'Setze das Gebüsch zu deinem Vorteil ein! Es kann deine Effektivität im Kampf stark erhöhen, wenn du immer wieder in das Gebüsch und wieder heraus gehst.', 'Beginne bei Teamkämpfen damit, den Gegner mit deinem „Wurfspeer“ zu belästigen. Nimm dann die feline Gestalt an, um gejagten Zielen nachzusetzen.', 'Die Fallen von „Auflauern“ verursachen Schaden, dessen Höhe vom aktuellen Leben des Opfers abhängt. Stelle sie in den hinteren Reihen deines Teams auf, bevor während Belagerungen Kämpfe ausbrechen, damit dein Team mehr Schaden an den vorderen Reihen des Gegners verursachen kann.', 0, 0, 0, 1124, ' Assassin Fighter'),
(49, 'Galio', 3, '2014-10-21 17:54:20', '2015-04-09 10:19:35', 'Galio', 125.00, 50.00, 319.00, 61.97, 577.80, 85.00, 3.38, 26.88, 0.80, 8.71, 0.00, 1.25, 6.00, 1.20, 32.10, 335.00, -0.02, 0.00, 0.75, 3.50, 'Der trauernde Beschützer', 'Lange bevor die Liga begann, derlei Formen von Magie zu regulieren, hatten Magier schon mit der Erschaffung künstlichen Lebens experimentiert. Heutzutage ist es strengstens verboten, doch Golems Verstand einzuflößen, war einst unter erfahreneren Gelehrten gar nicht so unüblich. Einer dieser Visionäre war der demacianische Werkmeister Durand. Im Erschaffen empfindsamer Kreaturen war Durand ohnegleichen. Seine Konstrukte dienten den Grenzstädten seines geliebten Stadtstaates als nimmermüde Wächter zum Schutz vor Demacias Nachbar, Noxus. Zu seiner eigenen Verteidigung behielt Durand allerdings sein Opus Magnum: Galio. Dieses mächtige Konstrukt, in das Abbild eines Gargoyles gehauen, beschützte ihn auf all seinen Reisen, was es ihm erlaubte, seine wichtige Arbeit ohne Angst vor jenen, die seinem Heimatland feindlich gesinnt waren, verrichten zu können. Dies ging so lange gut, bis er durch die Effizienz seiner Wächter endlich den Zorn des Oberkommandos von Noxus auf sich zog.<br><br>Durand durchquerte die Heulenden Sümpfe mit seinem Meisterwerk, als er von einer großen Gruppe noxischer Assassinen angegriffen wurde. Von der Überzahl der Gegner überwältigt, musste Galio entsetzt mit ansehen, wie die Mörder seinen Meister niederschlugen und auf der Stelle töteten, bevor sie wieder in den Nebeln der Sümpfe verschwanden. Seines Daseinszwecks beraubt, versank Galio in Verzweiflung. Jahrelang hielt er einsam Totenwache über den Knochen des Meisters, den er nicht beschützen konnte ... als sprichwörtliches Mahnmal seiner immerwährenden Schande, bis eines Tages ein trauriges aber entschlossenes Yordlemädchen, mit einer mächtigen demacianischen Krone in der Hand, im Schatten der Statue Rast machte. Zu Stein erstarrt vor den Blicken seiner unerwarteten Besucherin geschützt, betrachtete Galio die einsame Yordle. Sie sah aus, als würde auch sie eine schwere Bürde auf ihren Schultern tragen. Genauso stumm und stoisch, wie sie gekommen war, brach sie auch in Richtung Demacia auf. Diese Begegnung entzündete einen Funken in Galios Augen. Er entsann sich schließlich wieder des Grundes, für dessen Verteidigung sein Meister gestorben war. Er entstieg seiner selbstgewählten Läuterung und folgte dem tapferen Wesen. Er hatte einen neuen Grund zu leben: der Liga der Legenden beizutreten und im Namen Demacias zu kämpfen.<br><br>„So etwas wie Erlösung gibt es nicht. Es gibt nur Buße.“ - Galio<br>', 'Versuche Angriffe auf Galios Verbündete zu vermeiden, solange sie unter der Wirkung von „Bollwerk“ stehen, da deine Angriffe so schwächer ausfallen und zudem Galio heilen werden.', 'Versuche möglichst abseits von Ansammlungen zu stehen, wenn Galio in der Nähe ist.', 'Ein Angriff auf Galio, während er „Götze von Durand“ einsetzt, wird alle verspotteten Verbündeten befreien.', '„Bollwerk“ auf einen angegriffenen Verbündeten anzuwenden ist eine gute Möglichkeit, Leben zu regenerieren.', '„Gerechter Windstoß“ eignet sich hervorragend, um Gegner zu verfolgen oder selbst zu entkommen.', 'Das Schadenspotential von „Götze von Durand“ kann deutlich gesteigert werden, wenn du es einsetzt, während du von vielen Gegnern umgeben bist.', 0, 0, 440, 1971, ' Tank Mage'),
(50, 'Kennen', 85, '2014-10-21 17:54:20', '2015-04-09 10:19:35', 'Kennen', 550.00, 0.00, 200.00, 50.54, 535.72, 79.00, 3.30, 24.30, 0.00, 5.59, 0.00, 0.00, 50.00, 3.40, 30.00, 335.00, -0.09, 0.00, 0.65, 3.75, 'Das Herz des Sturms', 'Es gibt einen uralten Orden, der auf den ionischen Inseln seinen Ursprung hat und sich einzig der Erhaltung des Gleichgewichts verschrieben hat. Ordnung, Chaos, Licht und Dunkelheit - all diese Dinge müssen in perfekter Harmonie existieren, da dies die Natur des Universums ist. Dieser Orden ist als Kinkou bekannt und stellt ein Triumvirat an Schattenkriegern, um seinen Platz in der Welt zu sichern. Kennen ist einer dieser Schattenkrieger, dem die heilige Aufgabe auferlegt wurde, die Sonne zu jagen, um unermüdlich die Gerechtigkeit der Kinkou durchzusetzen.<br><br>Kennen wurde in der Stadt Bandle geboren und man erzählt sich, dass er in den ersten Momenten seines Lebens erst aus dem Mutterleib gesaust kam, um dann sogleich seiner Hebamme zu entkommen. Seine Eltern hofften, dass er mit zunehmendem Alter etwas von seiner Energie verlieren würde, aber als er erwachsen wurde, war seine Energie nahezu grenzenlos und wurde nur noch von seiner beunruhigenden Schnelligkeit übertroffen. Trotz seiner erstaunlichen Gaben, blieb er nahezu unbemerkt (oder zumindest wurde der Schelm nie erwischt) bis er für eine Wette die große äußere Mauer des Placidium einfach nach oben lief. Als die Berichte dieser Meisterleistung Kinkou zu Ohren kamen, wurde Kennen schnell und leise zu einer Audienz gebracht. Er fand, dass die Rolle des Herz des Sturms gut zu ihm passte und er verbreitete fortan das Wort und die Strafen der Kinkou im ganzen Reich. Er arbeitet nun mit seinen Gefährten Akali und Shen zusammen, um das Gleichgewicht von Valoran zu erzwingen. Es ist daher keine Überraschung, dass diese geheiligte Aufgabe das Triumvirat direkt auf die Richtfelder geführt hat.<br><br>„Das Herz des Sturms schlägt für alle Ewigkeit ... und die Besiegten werden sich für immer daran erinnern.“', 'Spiele etwas vorsichtiger in der Nähe von Kennen, wenn du bereits durch ein „Mal des Sturms“ beeinträchtigt wirst. Wenn er bei dir 3 „Mal des Sturms“ kumuliert, wirst du betäubt.', 'Wenn Kennen einen „Blitzartigen Ansturm“ ausführt und so in deine Nähe kommt, versuche, seine Verletzlichkeit auszunutzen und greife ihn direkt an.', '', 'Du kannst deine Gegner betäuben, wenn du sie mit 3 Malen des Sturms belegst.', '„Blitzartiger Ansturm“ kann benutzt werden, um einen Kampf zu beginnen und dann mit der dadurch gewonnen Energie, andere Fähigkeiten folgen zu lassen.', 'Du kannst einen Gegner durch „Donnernder Wurfstern“ mit einem ersten „Mal des Sturms“ belegen und dann ein weiteres durch Elektrische Welle folgen lassen.', 0, 0, 0, 1294, ' Mage Marksman'),
(51, 'Veigar', 45, '2014-10-21 17:54:20', '2015-04-09 10:19:35', 'Veigar', 525.00, 55.00, 342.40, 50.71, 492.76, 82.00, 2.62, 22.55, 0.80, 5.42, 0.00, 0.00, 6.00, 2.24, 30.00, 340.00, 0.00, 0.00, 0.55, 3.75, 'Der kleine Meister des Bösen', 'Bei den meisten ruft die Vorstellung an Yordle keine Furcht hervor. Das leichtlebige kleine Volk wird trotz seiner Wildheit eher mit einer gewissen Fröhlichkeit in Verbindung gebracht. Ihre schrillen Stimmen und ihr possierliches Aussehen lösen bei den größeren Völkern eine Art Beschützerinstinkt aus oder zumindest die Assoziation kleiner Kinder, die Erwachsene spielen. Hin und wieder jedoch wird ein Yordle so böse, dass er trotz seiner Größe die Herzen anderer mit Angst zu erfüllen vermag. Veigar ist solch ein gefürchteter Yordle. Als Meister der Schwarzen Magie und Verderber kosmischer Energien ist er einer der gefürchtetsten Zauberer Valorans.<br><br>Als Kind war Veigar ein normaler Yordle, mit einer Ausnahme - einer tiefen Neugierde auf die Welt jenseits der Grenzen von Bandle. Der junge Yordle verbrachte einen Großteil seiner Zeit damit, den Rest Valorans zu studieren und war sofort zur Stelle, als es darum ging, in ein Geschäft einzutreten, das Handel mit anderen Hauptstädten betrieb. Zum Unglück Veigars und der ganzen Welt entpuppte sich ein Abkommen mit Händlern aus Noxus als zwielichtiges Geschäft und ging böse aus. Veigar und seine Gefährten wurden in eine Falle gelockt. Von den Behörden gefangen genommen wurde er für viele Jahre innerhalb der Mauern Noxus'' gefangen gehalten. Diese Art von Isolation ist sehr gefährlich für Yordle - was zweifellos der Grund für das Vorgehen der grausamen Gefängniswärter war - und Veigar wurde langsam wahnsinnig.<br><br>Er entkam schließlich als verdrehte Version seines früheren Ichs. Anstatt nach Bandle zurückzukehren, ließ er sich von dunklen Zauberern im ganzen Land ausbilden. Mit Hilfe seines verrückten Willens, der sich auf eine einzige Ausgabe konzentrierte, wurde er schnell aus eigener Kraft zu einem gefährlichen und mächtigen Zauberer. Nun strebt er danach, allen Konflikten auf Valoran ein Ende zu bereiten, indem er alle Stadtstaaten auf die Knie zwingt, egal welcher Seite sie angehören. Die Liga der Legenden ist für ihn das perfekte Werkzeug, seine Ziele zu erreichen - vorerst.<br><br>„Wer behauptet, das Böse müsse in finster dreinblickender Gestalt erscheinen?“', '„Dunkle Materie“ verursacht sehr hohen Schaden, man kann dieser Fähigkeit aber entgehen. Achte auf den Ton und die Grafik, um zu sehen, wo und wann sie einschlägt.', '„Ereignishorizont“ betäubt nur Einheiten am Rand. Innerhalb des Zaubers kann man sich immer noch bewegen und angreifen.', 'Der Schaden, den Veigar mit seiner ultimativen Fähigkeit austeilt, basiert sowohl auf deiner als auch auf seiner Fähigkeitsstärke.', 'Benutze „Ereignishorizont“, um deine Chancen zu erhöhen, „Dunkle Materie“ zu platzieren.', 'Veigar ist anfangs besonders Mana-intensiv, deshalb erhöht es die Effizienz deiner passiven Fähigkeit, wenn du Gegenstände mit Manaregeneration kaufst, sodass du „Unheilvoller Schlag“ öfter ausführen kannst.', 'Veigar ist ein sehr weiches Ziel, deshalb solltest du darauf achten, immer mindestens einen Beschwörerzauber zu haben, der defensiv eingesetzt werden kann.', 0, 0, 0, 3010, ' Mage'),
(52, 'Gnar', 150, '2014-10-21 17:54:20', '2015-04-09 10:19:37', 'Gnar', 150.00, 0.00, 100.00, 48.00, 540.00, 65.00, 3.00, 23.00, 0.00, 2.50, 0.00, 0.00, 0.00, 6.00, 30.00, 325.00, 0.00, 0.00, 0.50, 2.50, 'Das fehlende Bindeglied', 'Der Dschungel kennt bei Unbedachtheit keine Nachsicht. Jeder abgeknickte Ast erzählt eine Geschichte.<br><br>Ich habe jede Kreatur gejagt, die dieser Urwald zu bieten hat. Ich war mir sicher, dass mich hier keine Herausforderungen mehr erwarten würden, doch nun gibt es da etwas Neues. Jede Spur hat die Größe eines Riesenhauers; es hat Klauen wie Krummsäbel. Es kann einen Mann in zwei Hälften zerreißen. Endlich eine lohnende Beute.<br><br>Während ich meiner Beute durch den Dschungel hinterher pirsche, fällt mir nach und nach auf, welchen Schaden dieses Ding anrichtet. Ich trete in einen unförmigen Kreis gespaltener Bäume. Diese gigantischen hölzernen Wächter spendeten diesem Land über ungezählte Jahrhunderte hinweg Schatten. Ihrer Borke, die wie aus Eisen schien, konnten die schwachen Äxte all jener, die töricht genug waren, zu versuchen, sie zu fällen, nichts anhaben. Dieses Ding fegte sie hinweg, als wären sie dünne Zweige.<br><br>Wie kann eine Kreatur, die solch eine Stärke besitzt, einfach so verschwinden? Und obwohl sie diese unübersehbare Spur der Zerstörung hinterlassen hat, konnte ich nicht einen einzigen Blick auf sie erhaschen. Wie kann sie wie ein Orkan wüten und dann im Dickicht verwehen wie der Nebel am Morgen?<br><br>Mich überkommt ein Kribbeln, wenn ich mir vorstelle, wie ich dieser Kreatur endlich gegenübertrete. Sie wird eine gewaltige Trophäe abgeben.<br><br>Nachdem ich die Lichtung durchquert habe, folge ich dem Fluss, um mich neu zu orientieren. Dort erblicke ich ein kleines, oranges Fellknäuel, kauernd, wartend. Ich beobachte es heimlich aus der Entfernung. Ein winziger Fisch springt aus dem Fluss und die Kreatur setzt ihm hinterher und springt fröhlich in das vorbeirauschende Wasser. Zu meiner Freude stelle ich fest, dass es sich um einen Yordle handelt. Und einen Jäger noch dazu!<br><br>Das ist ein gutes Zeichen. Ich werde die Bestie finden. Mir entkommt nichts.<br><br>Die großen Ohren des Yordle richten sich blitzschnell auf und drehen sich in meine Richtung. Er rennt auf allen Vieren mit einem knöchernen Bumerang in der Hand, bis er plötzlich vor mir Halt macht. Er plappert.<br><br>Ich nicke dem jungen Yordle zustimmend zu und ziehe weiter. Ich durchquere das anspruchsvolle Terrain mit Leichtigkeit, während ich gleichzeitig versuche, keinen Hinweis auf meine Jagdbeute zu übersehen. Als ich gerade versuche, seine Witterung aufzunehmen, bin ich abgelenkt. Ein merkwürdiges Zwitschern lässt mich aufschrecken. Der Yordle ist mir gefolgt. Ich kann ihm nicht erlauben, meine Jagd zu stören. Ich drehe mich zu ihm um und weise in die Ferne. Er schaut mich fragend an. Ich muss nachdrücklicher werden, gutes Omen hin oder her.<br><br>Ich richte mich auf und gebe ein Brüllen von mir, der Wind peitscht durch das Fell des Yordle und die Erde unter uns erbebt. Nach einigen kurzen Augenblicken dreht er seinen Kopf und reckt mit etwas, das man für ein Lächeln halten könnte, seinen kleinen Bumerang hoch in die Luft. Ich darf mich nicht weiter aufhalten lassen. Ich schnappe ihm die Waffe aus der Hand und werfe sie zielsicher in einen Baum, wodurch sie hoch oben in den Ästen feststeckt. Er dreht sich um und versucht sie zu erhaschen, indem er wie wild geworden herumspringt.<br><br>Ich bin keine zehn Schritte weit gekommen, als ein Brüllen mir das Mark gefrieren lässt. Das ohrenbetäubende Bersten von Stein und das Krachen von Holz sind überall. Vor mir stürzt ein riesiger Baum auf den Pfad. Die knöcherne Waffe des Yordle ragt aus seinem Stamm hervor.<br><br>Ein Grollen, das nicht von dieser Welt zu stammen scheint, ertönt hinter mir.<br><br>Ich habe einen schrecklichen Fehler begangen.', 'Nachdem er sich von Groß zu Klein verwandelt hat, kann Gnar 15 Sekunden lang keine Wut aufbauen. Nutze die Gelegenheit, um sein Team anzugreifen.', 'Gnars Animationen und Ressourcenanzeige verändern sich, je näher er der Transformation kommt.', 'Gnars ultimative Fähigkeit betäubt, falls er dich in eine Mauer wirft. Sei also in der Nähe solcher Mauern vorsichtig.', 'Es ist sehr wichtig, wie du deine Wut einsetzt. Versuche, deine Transformationen zeitlich abzupassen, damit du aus beiden Erscheinungsformen das Optimum herausholst.', 'Positioniere dich an Mauern, um deine Gegner gegen diese zu werfen, sodass sie von deiner ultimativen Fähigkeit betäubt werden.', 'Kenne deine Stärken! Mini-Gnar ist schnell, verletzlich und verursacht fortdauernd hohen Schaden. Mega-Gnar ist langsam, widerstandsfähig und haut hohe Schadensspitzen raus.', 0, 0, 0, 1827, ' Fighter Marksman'),
(53, 'Graves', 104, '2014-10-21 17:54:20', '2015-04-09 10:19:37', 'Graves', 525.00, 40.00, 322.20, 54.21, 551.12, 84.00, 3.10, 24.38, 0.70, 6.67, 0.00, 0.00, 7.92, 2.90, 30.00, 330.00, 0.00, 0.00, 0.70, 3.20, 'Der Gesetzlose', 'Malcolm Graves wurde im Hinterzimmer einer Taverne in Bilgewasser geboren und dort mit einer Milchflasche voller Fusel zurückgelassen. Er überlebte eine Kindheit in den mit Piraten verseuchten Slums, indem er jeden miesen Trick, wie aus dem Lehrbuch, einsetzte. Mit der festen Absicht, sich ein neues Leben aufzubauen, stahl er sich mit dem ersten Schiff, auf das er sich schleichen konnte, als blinder Passagier gen Festland davon. Die harte Realität dieser Welt jedoch zwang ihn, sich durch ein widerliches Leben im Untergrund diverser Stadtstaaten durchzubeißen, wobei er immer dann einen Abgang machte, wenn ihm der Boden unter den Füßen zu heiß wurde. Bei einem bestimmten Kartenspiel mit verdammt hohem Einsatz, fand er sich Twisted Fate gegenüber. Beide deckten letztlich jeweils vier Asse auf. Es war für beide Hochstapler das erste Mal, dass sie jemandem auf Augenhöhe begegneten. So formten die zwei ein Bündnis, zinkten sich gegenseitig die Karten und kämpften sich alsdann Rücken an Rücken ihren Weg durch die Gassen frei. Gemeinsam zogen sie durch die Straßen - sie sammelten Chips, Spielkarten und Vorstrafen ohne Ende.<br><br>Unglücklicherweise beging Graves den Fehler, Dr. Aregor Priggs, einen hochrangigen zhaunitischen Beamten und Geschäftsmann, um eine beträchtliche Summe zu betrügen. Als Priggs herausfand, dass und wie er hereingelegt worden war, wurde er geradezu besessen von dem Wunsch nach Rache. Er erfuhr von Twisted Fates unbändigem Verlangen, Magie zu beherrschen und bot ihm einen Handel an: er sollte ihm Graves ausliefern und würde im Gegenzug Zugang zu einer Prozedur erhalten, die ihm seinen Wunsch erfüllen würde. Twisted Fate ging auf den Handel ein - er wusste ebenso wie Graves um seinen Teil ihrer Vereinbarung, doch das Angebot war zu gut. Einmal in seiner Gewalt, ließ Priggs Graves an einen Ort schaffen, der dazu gedacht war, Männer festzuhalten, deren Verbrechen - oder besser gesagt, deren Bestrafung - nicht an die Öffentlichkeit kommen sollten. Graves überlebte die jahrelange Gefangenschaft in den Händen von Zhauns skrupellosesten Aufsehern, bis ihm die Flucht gelang. Einer seiner Mitgefangenen stellte ihn einem exzentrischen Büchsenmacher vor, der ihm eine Schrotflinte nach exakt seinen Vorgaben modifizierte. Er nannte die Waffe „Schicksal“. Nachdem er Priggs einen Besuch abgestattet hatte, trat Graves der Liga der Legenden mit zwei Zielen bei: Twisted Fate und Rache.<br><br>„Im Knast gibt es ein Sprichwort: du hast nichts, außer jeder Menge Zeit, zu planen.“ - Graves, der Gesetzlose<br>', 'Graves verursacht fast nur normalen Schaden, weshalb Rüstung einen effektiven Konter darstellt.', 'Verlässt man den Wirkbereich von „Nebelwand“, enden dessen negative Auswirkungen sofort.', '', '„Nebelwand“ kann sowohl zur Flucht als auch zur Eröffnung eingesetzt werden.', '„Schnelles Ziehen“ kann genutzt werden, um in Reichweite für einen Volltreffer mit „Streuschuss“ zu kommen.', '', 0, 0, 440, 1693, ' Marksman');
INSERT INTO `champions` (`id`, `name`, `champion_id`, `created_at`, `updated_at`, `key`, `attackrange`, `mpperlevel`, `mp`, `attackdamage`, `hp`, `hpperlevel`, `attackdamageperlevel`, `armor`, `mpregenperlevel`, `hpregen`, `critperlevel`, `spellblockperlevel`, `mpregen`, `attackspeedperlevel`, `spellblock`, `movespeed`, `attackspeedoffset`, `crit`, `hpregenperlevel`, `armorperlevel`, `title`, `lore`, `enemytips1`, `enemytips2`, `enemytips3`, `allytips1`, `allytips2`, `allytips3`, `f2p`, `sale`, `sale_price`, `votes`, `tags`) VALUES
(54, 'Malzahar', 90, '2014-10-21 17:54:20', '2015-04-09 10:19:38', 'Malzahar', 550.00, 45.00, 325.60, 54.70, 514.40, 80.00, 3.00, 21.88, 0.80, 5.42, 0.00, 0.00, 6.00, 1.36, 30.00, 340.00, 0.00, 0.00, 0.55, 3.50, 'Der Prophet der Leere', 'Viele sind unter dem unbarmherzigen Blick der Sonne Shurimas verrückt geworden, doch Malzahar gab seinen Verstand in der kühlenden Umarmung der Nacht preis. Malzahar wurde als Seher geboren, das Geschenk der Prophetie ward ihm in die Wiege gelegt. Sein Talent, wenn auch noch ungeschliffen, versprach einer der größten Segen für Runeterra zu werden, doch ihm war ein anderer Pfad bestimmt. Seine Sensibilität gegenüber den ungestümen Gezeiten des Schicksals erlaubte es anderen, nicht willkommenen Dingen, an seinem Unterbewusstsein zu zerren. In seinen Träumen, in denen der Schleier, der die Welten trennt, am dünnsten ist, lockte ihn etwas Unheilvolles. Eine Zeitlang konnte Malzahar dem fortwährenden Drängen widerstehen, doch mit jeder Nacht, die verging, wurde die Stimme lauter, oder ging vielleicht tiefer, bis er dem Ruf nicht länger standhalten konnte.<br><br>Er wagte sich ohne Vorräte in die Wüste, angezogen durch die Verlockung eines trügerischen Zaubers. Sein Ziel: eine verlorene Zivilisation im Osten, in uralten Texten als Icathia bekannt. Nur wenige glaubten, dass solch ein Ort jemals existiert hatte und jene, die daran glaubten, waren sich sicher, dass der Sand längst alles begraben hatte, was davon übrig geblieben sein mochte. Als Malzahars aufgerissene Füße ihm letztendlich den Dienst versagten, fand er sich vor dem Sockel eines grotesk zerbröckelten Obelisken kniend wieder. Dahinter zeichneten sich die fremdartig wirkenden Umrisse einer zerstörten Stadt und die riesigen Götzenbilder dunkler und schrecklicher Gottheiten ab. Seine Augen, die sahen, was andere nicht sehen konnten, nicht sehen sollten, füllten sich mit der Essenz der Leere. Seine einst so unsteten Visionen der Zukunft wurden durch das unabänderliche Versprechen ersetzt, Valoran werde dereinst von den Kreaturen der Leere heimgesucht. Als er einsam und doch nicht allein zwischen den unendlichen Dünen stand, bemerkte er, dass die ihm bekannte Stimme als trockenes Kratzen aus seinem eigenen Mund kam und ihm drei Worte zuraunte, deren Gewicht seine Knie erzittern ließ: Liga der Legenden. Erfüllt von der schieren Macht der Leere selbst, machte Malzahar sich in Richtung Norden auf, um sich seinem Schicksal zu stellen.<br><br>„Das Land mag schmelzen, das Meer mag über seine Ufer treten, der Himmel mag auf uns herabfallen, doch Sie werden kommen“ - Malzahar<br>', 'Begleiter der Leere können nur bis zu 21 Sekunden auf dem Richtfeld überleben. ', 'Vermeide Wellen von Vasallen, die durch „Üble Visionen“ beeinträchtigt sind. Du kannst dir nie sicher sein, wann sie sterben und die Visionen auf dich übertragen könnten.', 'Wenn Malzahar seine ultimative Fähigkeit bereit hat, kann er im 1-vs.-1 ein harter Brocken werden. Du solltest sichergehen, dass du genügend Trefferpunkte hast, um einen ganzen Cocktail seiner Zauber zu überstehen.', 'Schrecke nicht davor zurück, Zauber ununterbrochen einzusetzen, um weitere Begleiter der Leere herbeizurufen.', 'Erschaffe ein „Leerenfeld“, bevor du „Leerengriff“ einsetzt, um deinen Schaden zu maximieren.', '„Leerenfeld“ ist besonders wirkungsvoll gegen neutrale Monster mit hoher TP-Zahl. Versuche es einzusetzen, um die blaue Verbesserung vom Uralten Golem zu erhalten.', 0, 0, 0, 1191, ' Mage Assassin'),
(55, 'Vi', 254, '2014-10-21 17:54:20', '2015-04-09 10:19:38', 'Vi', 125.00, 45.00, 295.60, 55.88, 582.80, 85.00, 3.50, 25.88, 0.65, 9.01, 0.00, 1.25, 8.09, 2.50, 32.10, 345.00, -0.03, 0.00, 0.90, 3.50, 'Piltovers Vollstreckerin', 'Für Vi stellt jedes Problem nur eine weitere Backsteinmauer dar, die es mit ihren gigantischen Hextech-Handschuhen zu durchschlagen gilt. Obwohl sie auf der falschen Seite des Gesetzes aufwuchs, setzt Vi ihr kriminelles Wissen nun dazu ein, der Polizeieinheit von Piltover zu dienen. Vis freche Art, ihr herber Humor und ihre unverhohlene Weigerung Befehle zu befolgen, können ihre nach Vorschrift handelnde Partnerin, Caitlyn, oft zur Weißglut bringen. Doch nicht einmal der Sheriff von Piltover kann leugnen, dass Vi einen unschätzbaren Gewinn im Kampf gegen das Verbrechen darstellt.<br><br>Da sie als Kind in den gesetzlosen Außenbezirken Piltovers aufgewachsen ist, hat Vi gelernt, wie man raubt und betrügt, um über die Runden zu kommen. Durch das Stehlen und Auseinandernehmen von Hextech-Geräten erlangte sie die Fertigkeiten einer meisterlichen Mechanikerin, während das Leben auf der Straße sie Eigenständigkeit lehrte. Als sie sechs Jahre alt war, fand eine bunt zusammengewürfelte Gruppe Krimineller Gefallen an der jungen Delinquentin und nahm sie bei sich auf. Im Alter von elf Jahren war sie zur erfahrenen Komplizin geworden und genoss den Nervenkitzel bei jedem Raubüberfall.<br><br>Vis Einstellung änderte sich, als ein Raubzug in einem Bergwerk schieflief. Sie war gezwungen, sich zu entscheiden, ob sie mit ihrer Bande floh oder versuchte die unschuldigen Minenarbeiter aus einem eingestürzten Tunnel zu retten. Vi entschied sich, die Heldin zu spielen. Während sie nach einem Weg suchte, die Bergleute aus den Trümmern zu befreien, entdeckte sie einen zerstörten Bergbau-Roboter. Sie improvisierte und schraubte seine riesigen Fäuste heraus, um sie in behelfsmäßige Hextech-Handschuhe umzufunktionieren. Als sie die schweren Waffen an ihre kleinen Hände angepasst hatte, beugte das junge Mädchen ihren Arm und schmetterte kraftvoll gegen die Trümmer. Die Wucht des Schlages sprengte den Fels auseinander. Nun da die Arbeiter frei waren und entkommen konnten, stahl sich Vi davon.<br><br>Nachdem dieser Job schiefgegangen war, brach Vi ihre Verbindungen zu der Bande ab. Sie kehrte in das Leben einer einsamen Kriminellen zurück, stahl von nun an aber nur noch von anderen Verbrechern. Im Laufe der Jahre modifizierte und verbesserte Vi ihre Hextech-Fäuste, wodurch sie Raubüberfälle auffliegen lassen und sich die Beute mit Leichtigkeit schnappen konnte. Schließlich erreichte ihr schlechter Ruf auch Caitlyn, den berühmten Sheriff von Piltover. Anstatt zu versuchen, Vi einzusperren, bot Caitlyn der Kriminellen an, der Gesellschaft ihre Schuld zurückzuzahlen, indem sie in Piltover auf der Seite des Gesetzes arbeitet. Vi lachte. Für sie klang ein Job, in dem sie Gauner aufmischen konnte, ohne dass sie gezwungen war, vor den Bullen davonzulaufen, perfekt. Sie nahm sofort an. Caitlyn hat nun alle Hände voll zu tun, dafür zu sorgen, dass Vi nicht aus der Reihe tanzt, während Vi Caitlyns Befehle als bloße Vorschläge ansieht. Doch wenn sie zusammenarbeiten, werden sie von allen Gesetzesbrechern Piltovers gefürchtet.<br><br>„Es ist eine Schande. Ich habe zwei Fäuste, doch du hast nur ein Gesicht“ - Vi<br>', 'Ein vollständig aufgeladener „Rammbock“ verursacht doppelten Schaden. Falls du also siehst, wie Vi beginnt, ihn aufzuladen, solltest du zurückweichen oder versuchen auszuweichen.', 'Vi wird deine Rüstung zertrümmern und zusätzliches Angriffstempo erhalten, wenn sie es schafft, dich dreimal nacheinander zu treffen. Versuche keine langen Auseinandersetzungen mit ihr auszufechten.', 'Vi kann nicht aufgehalten werden, während sie ihre ultimative Fähigkeit einsetzt. Denke daran, dass du deine Ortveränderungseffekte aufhebst, bis sie mit Aufladen fertig ist.', 'Ein vollständig aufgeladener „Rammbock“ verursacht doppelten Schaden. Er eignet sich bestens, um fliehende Gegner zu schnappen und ihnen den Rest zu geben.', '„Gewaltanwendung“ verursacht an jedem, den die Schockwelle überrollt, vollen Schaden. Setze dies bei Vasallen in der Lane ein, um Gegner zu treffen, die sich hinter ihnen verstecken.', '„Tätlicher Angriff“ ist ein mächtiges Werkzeug, um einen Kampf zu beginnen. Beachte aber, dass du deinem Team nicht zu weit voraus rennst.', 0, 1, 487, 1482, ' Fighter Assassin'),
(56, 'Kayle', 10, '2014-10-21 17:54:20', '2015-04-09 10:19:38', 'Kayle', 125.00, 40.00, 322.20, 56.00, 574.24, 93.00, 2.80, 26.88, 0.80, 8.26, 0.00, 0.00, 6.00, 2.20, 30.00, 335.00, -0.02, 0.00, 0.75, 3.50, 'Die Richterin', 'In einer weit entfernten Welt, in der noch immer ein uralter Krieg tobt, war Kayle einst eine große Heldin - die stärkste einer unsterblichen Rasse, dazu verpflichtet, das Böse auszulöschen, wo immer es auftaucht. Zehntausend Jahre lang kämpfte Kayle unermüdlich für ihr Volk und schwang ihr flammendes Schwert, das in einer Zeit vor der Zeit geschmiedet wurde. Sie verbarg ihren zarten Körper hinter ihrer verzauberten Rüstung, dem einzigen verbliebenen Meisterwerk einer ausgelöschten Rasse begabter Handwerker. Auch wenn sie ein schönes, eindrucksvolles Geschöpf ist, verbirgt Kayle dann und wann ihr Gesicht. Der Krieg hat von ihrem Geist schrecklichen Tribut gefordert. In ihrem Streben nach dem Sieg versuchte sie manchmal die Niederträchtigen aus ihrem Sumpf des Bösen herauszuziehen, doch eliminierte sie ungleich öfter jene, die sie jenseits jeder Chance auf Erlösung glaubte. Für Kayle kann die Gerechtigkeit allzu oft eine sehr hässliche Angelegenheit sein.<br><br>Vor zehn Jahren war Kayles Krieg gegen das Böse fast gewonnen ... bis ihre aufrührerische Schwester Morgana, eine Ausgestoßene ihres Volkes, plötzlich mächtige, neue Verbündete fand: Magier einer bis dahin ungekannten Welt namens Runeterra. Morgana tauschte ihre Dienste für eine Vielzahl von Beschwörern in Runeterras Liga der Legenden gegen mächtige, neue Fähigkeiten ein, die, sobald sie diese beherrschte, drohten, Kayle und ihr Volk in die Knie zu zwingen. Um ihre Welt zu retten, hatte Kayle keine andere Wahl als selbst einen Pakt mit der Liga einzugehen. Sie wandte sich an den Anführer der Liga, den Hohen Rat Reginald Ashram, und unterbreitete ihm ihrerseits ein Angebot. Im Austausch gegen eintausend Jahre der Dienerschaft Kayles beendete Ashram alle Eingriffe der Liga in Kayles Welt. Als Ashram vor fünf Jahren verschwand, gab es neue Gründe für Kayle, in Valoran zu bleiben: sie musste herausfinden, wo Ashram war oder weshalb er verschwunden war. Sie musste ihre Schwester Morgana auf den Richtfeldern besiegen und ihre ganz eigene Art der Gerechtigkeit in die Liga der Legenden einbringen.<br><br>„In der Liga der Legenden kommt die Gerechtigkeit auf schnellen Flügeln.“', '„Intervention“ macht Kayle und ihre Verbündeten nur gegen Schaden immun. Verlangsamungen und Betäubungen wirken immer noch. Also halte sie so in Schach, wenn sie zu eifrig sind.', 'Kayle ist normalerweise ein weiches Ziel. Falls du siehst, dass sie ihre ultimative Fähigkeit auf einen Verbündeten anwendet, solltest du sie angreifen.', 'Achte auf die von Kayle gewählten Gegenstände, um herauszufinden, welche Rolle sie im Team erfüllt.', '„Intervention“ auf einen Verbündeten, der viel Schaden verursachen kann, kann den Ausgang eines Kampfes wenden, da dieser dadurch frei angreifen kann.', 'Kayle kann abhängig von ihren Gegenständen entweder sehr viel Schaden verursachen oder ihre Verbündeten unterstützen.', 'Kayle profitiert sehr von Angriffsschaden und Fähigkeitsstärke, wodurch sich für sie Hybridgegenstände wie „Nashors Zahn“ und „Stärke der Dreieinigkeit“ sehr lohnen.', 0, 0, 0, 1098, ' Fighter Support'),
(57, 'Irelia', 39, '2014-10-21 17:54:20', '2015-04-09 10:19:38', 'Irelia', 125.00, 35.00, 288.80, 61.54, 607.20, 90.00, 3.30, 25.30, 0.65, 8.59, 0.00, 1.25, 8.09, 3.20, 32.10, 345.00, -0.06, 0.00, 0.65, 3.75, 'Der Wille der Klingen', 'Die Ionier haben einige der atemberaubendsten und tödlichsten Kampftechniken ganz Runeterras entwickelt - und dies ist nur eine der Manifestationen ihres immerwährenden Strebens nach Erkenntnis. Die auffälligste Klingenkunst allerdings, die entstand, war das ungewöhnliche Nebenprodukt einer Intervention von außerhalb. Meister Lito war ein Schwertkämpfer, dessen Lehren von den herrschenden Klassen fast aller Stadtstaaten geschätzt wurden. Seine Kunst war ein streng gehütetes Geheimnis, aber man raunte sich zu, in seinen Händen würden Schwerter zu atmen beginnen. Allerdings verstarb er unerwartet an einer geheimnisvollen Krankheit, welche selbst die klügsten Ärzte Runeterras vor ein Rätsel stellte. Er hinterließ seinem Sohn und seiner Tochter, Zelos und Irelia, eine wahrlich einzigartige Waffe. Zelos wurde Feldwebel im ionischen Militär und zog kurz vor der Invasion Noxus'' in Ionia aus, um Demacia um Hilfe zu ersuchen. Irelia, die ihr Heim bis zur Rückkehr Zelos'' hüten sollte, war allein, als die noxischen Truppen zuschlugen. <br><br>Die Ionier kämpften bewundernswert, doch schon bald tränkte ionisches Blut das von den Abdrücken der Stiefel fremder Truppen geprägte Land. Beim Großen Gefecht am Placidium bereiteten sich die Ionier bereits auf ihre Kapitulation vor. Doch wurden sie durch Irelia, welche die mächtige Klinge ihres Vaters erhob, beflügelt, ihren Widerstand aufrecht zu erhalten. Sie gelobte, die Stellung zu halten, bis ihr Bruder zurückkehren würde. Im Durcheinander des darauf folgenden Kampfes wurde Irelia mit einem dunklen, noxischen Zauber der Nekromantie verflucht. Als ihre Lebenskraft Irelia zu verlassen drohte, versuchte Soraka, das Sternenkind, ein letztes Mal, ihre dahinschwindende Seele zu verankern. Nicht gewillt, ihr Heim aufzugeben, erhob sich Irelia auf der Schwelle des Todes und auch das Schwert ihres Vaters erhob sich an ihrer Seite in die Luft. Irelia stürzte sich wieder in die vorderste Front, unbeeindruckt davon, dass die Klinge plötzlich zum Leben erwacht war. Die Waffe tänzelte mühelos um sie herum und setzte dem Leben unzähliger Noxier ein Ende, als diese nur vor Entsetzen starren konnten. Die so dezimierten Eindringlinge waren gezwungen, sich vom Placidium zurückzuziehen. Irelia wurde zu Ionias Anführerin der Wache ernannt und seit der Kampf um die Verteidigung ihrer Heimat auf den Richtfeldern weitertobt, hat es auch sie dorthin gezogen.<br><br>„Das Schwert tänzelt, als würde es mit Blut malen.“ - Aus einem noxischen Feldbericht.<br>', 'Achte auf Irelias „Gleichgewichtsschlag“, da dieser dich betäubt, solltest du mehr prozentuales Leben haben als sie.', 'Irelia kann schnell große Distanzen überbrücken, indem sie „Klingenwoge“ gegen geschwächte Ziele einsetzt (bei Todesstößen durch „Klingenwoge“ wird ihre Abklingzeit zurückgesetzt).', '', 'Benutze „Klingenwoge“, um große Distanzen schnell zu überbrücken, indem du dich auf dem Weg zu Champions über geschwächte Vasallen „hangelst“.', 'Spare dir „Transzendente Klingen“ für den richtigen Moment auf.', 'Nutze „Gleichgewichtsschlag“ für knappe oder schlecht laufende Kämpfe, um das Blatt zu wenden.', 0, 0, 0, 1541, ' Fighter Assassin'),
(58, 'Lee Sin', 64, '2014-10-21 17:54:20', '2015-04-09 10:19:39', 'LeeSin', 125.00, 0.00, 200.00, 61.18, 570.80, 85.00, 3.20, 24.22, 0.00, 7.42, 0.00, 1.25, 50.00, 3.00, 32.10, 350.00, -0.04, 0.00, 0.70, 3.70, 'Der blinde Mönch', 'Als Jugendlicher wollte Lee Sin unbedingt Beschwörer werden. Seine Willenskraft und seine Hingabe waren unter denen seines Alters ohne Gleichen und seine Fertigkeiten lenkten die Aufmerksamkeit von Reginald Ashram, damaliger Hoher Rat der Liga, auf ihn. Während er am Arcanum Majoris lernte, frustrierte Lee Sin der Lehrplan, der an die anderen Studenten angepasst war, zusehends. So verbrachte er in der Hoffnung auf einen vorzeitigen Abschluss seine Freizeit damit, die Feinheiten des Beschwörens zu ergründen. Er machte unglaubliche Fortschritte bei seinen arkanen Studien und überflügelte alle anderen Studenten. Allem Anschein nach hätte er zu einem der größten Beschwörer der Liga werden sollen, hätte er nicht diesen einen schrecklichen Fehler begangen. Zu ungeduldig versuchte er zum Test seiner Fähigkeiten eine Bestie aus den Seuchen-Dschungeln zu beschwören. Was er aber stattdessen beschwor, war ein kleiner Junge, doch nicht an einem Stück. Er hatte kaum Zeit, dem Jungen in das zu blicken, was einst dessen Antlitz war, bevor die durcheinandergewürfelte menschliche Masse leblos auf den Boden klatschte. Eine sich anschließende Untersuchung seitens der Liga ergab, dass das ganze Dorf des Jungen durch die Rückkoppelung des Rituals ausgelöscht worden war.<br><br>Lee Sins Anlagen waren so vielversprechend, dass die Liga Willens war, über den Vorfall hinwegzusehen, doch er selbst konnte sich niemals verzeihen. Er verließ die Akademie und reiste zum Shojin-Kloster, um sein Leben in ewiger Reue zu verbringen und schwor, nie wieder Magie auszuüben. Jahre später, in der Hoffnung, für sein Vergehen mit einem Martyrium büßen zu können, setzte er sich selbst aus Protest gegen die noxische Besatzung Ionias in Brand. Seine Taten ebneten den Weg für ein Liga-Spiel, in welchem Ionia obsiegte, doch zu der Zeit, als die Flammen erstickt wurden, waren seine Augen in ihren Höhlen vollständig verbrannt. Als Retter bejubelt, ward er wiedergeboren und seine Tatkraft gestärkt. Er trat der Liga der Legenden bei, um seine Buße mit Schweiß und Blut fortzusetzen, den einzigen Besitztümern eines wahren Mönchs.<br><br>„Die Handlungen eines Einzelnen mögen die Welt zerreißen, aber der Fleiß vieler kann sie wieder zusammenfügen.“ - Lee Sin<br>', 'Bleibe verteilt, um Lee Sins ultimative Fähigkeit, „Zorn des Drachen“, weniger stark wirken zu lassen.', 'Lee Sin kann mit „Eiserner Wille“ und „Verkrüppeln“ leicht normalen Schaden kontern, aber er ist weiterhin gegen Magie verwundbar.', 'Lee Sin baut stark darauf, seine Fähigkeitenkombinationen einzusetzen. Mach ihn kampfunfähig, damit er diese nicht mehr effektiv nutzen kann.', 'Benutze „Schallwelle“ vor „Zorn des Drachen“, um Gegner mit „Resonanzschlag“ zu verfolgen.', 'Nutze „Unruhe“ besser aus, indem du mit Fähigkeiten auf Treffer mit automatischen Angriffen wartest, um mehr Schaden zu verursachen und den Energieverlust zu verringern.', '„Lebensretter“ und „Eiserner Wille“ sind mächtige Werkzeuge im Dschungel.', 0, 0, 0, 1330, ' Fighter Assassin'),
(59, 'Elise', 60, '2014-10-21 17:54:20', '2015-04-09 10:19:39', 'Elise', 550.00, 50.00, 324.00, 50.54, 529.40, 80.00, 3.00, 22.13, 0.80, 5.70, 0.00, 0.00, 6.00, 1.75, 30.00, 330.00, 0.00, 0.00, 0.60, 3.35, 'Die Spinnenkönigin', 'Elises berückende Schönheit und Grazie verschleiern ihr erbarmungsloses, schwarzes Herz einer Jägerin. Mit mitleidloser Arglist lockt sie die Ahnungslosen mit Versprechen der Gunst des Spinnengottes. Nachdem sie ihre Menschlichkeit abgelegt hat und zu etwas viel Düstereren geworden ist, opfert Elise die Unschuldigen, um ihre Macht und ihre scheinbar ewige Jugend aufrecht zu erhalten. Niemand kann ergründen, wie viele in ihrem Netz gefangen wurden, getötet, um ihren unstillbaren Hunger zu nähren.', 'Elises Spinnengestalt ist gefährlicher, wenn du wenig Leben besitzt. Im Gegenzug ist ihre menschliche Form gefährlicher, wenn du noch viel Leben besitzt.', 'Mit „Abseilen“ kann sich Elise nur gerade nach oben und unten bewegen, außer sie kann sich auf einen nahen Gegner herablassen.', '„Abseilen“ besitzt eine lange Abklingzeit. Elise ist verwundbarer, nachdem sie diese Fähigkeit eingesetzt hat.', 'Die Spinnengestalt ist am effektivsten, um Gegnern mit wenig Leben den Todesstoß zu versetzen; „Neurotoxin“ in ihrer menschlichen Form verursacht mehr Schaden an gesunden Gegnern.', 'Wenn Elise eine Spinne ist, greifen kleine Spinnen das Ziel an, auf das Elise „Giftbiss“ angewendet hat.', 'Elises Spinnengestalt und die Spinnenfähigkeiten kosten kein Mana und können helfen, Mana zu sparen.', 0, 0, 0, 2917, ' Mage Fighter'),
(60, 'Volibear', 106, '2014-10-21 17:54:20', '2015-04-09 10:19:39', 'Volibear', 125.00, 30.00, 270.40, 59.54, 584.48, 86.00, 3.30, 26.38, 0.65, 8.09, 0.00, 1.25, 8.09, 2.67, 32.10, 345.00, -0.05, 0.00, 0.65, 3.50, 'Das Donnergrollen', 'Die unerbittlichen nördlichen Ausläufer Freljords bilden die Heimat der Ursaren, einem erbitterten, kriegerischen Volk, das der öden Tundra seit Jahrtausenden trotzt. Ihr Anführer ist ein zorniger Antagonist, der die Macht des Blitzes befehligt, um seine Gegner in Angst zu versetzen: Volibear. Zu gleichen Teilen Krieger und Mystiker ist Volibear bestrebt, die alten Traditionen und den kriegerischen Geist seines Stammes zu bewahren.<br><br>Obwohl die Legenden von einst legendären Heldentaten in der Schlacht künden, lebten die Ursaren in stiller Abgeschiedenheit. Die Krieger wurden von einem Anführer-Triumvirat geführt, welches eine lang gelebte Isolation aufrecht erhielt und damit die belanglosen Affären und Konflikte anderer vermied. Als Schamane im Dienste der Drei war Volibear ein respektierter Weiser, der für seine Einsichten bekannt war. Sie erlebten eine Ära nie dagewesenen Friedens, doch Volibear spürte, dass sich in ihm Unheil zusammenbraute. Der Wohlstand machte den Stamm sanft und schwach und viele hatten die heilige Kunst des Krieges längst vergessen. Mit der Zeit, so wusste Volibear, würde das Feuer ihrer Seelen erlöschen. Als er seine Besorgnis dem Triumvirat mitteilte, weigerten sie sich zuzuhören und mahnten ihn, sich seiner Stellung bewusst zu werden.<br><br>Auf der Suche nach Erkenntnis erklomm er den gefahrvollen Gipfel des heiligen Berges der Ursaren, einen Ort, der für alle Zeit in einen donnernden Mahlstrom gehüllt ist. Man sagte, das Auge des Sturms würde Omen offenbaren und der Legende nach würde der Sturm den nächsten großen Stammesführer kenntlich machen. Als Volibear den Gipfel erklomm, wurde er von einem unnatürlichen Blitzschlag getroffen. Als der Schamane erwachte, nahm eine schreckliche Vision von einem vollständig von der Dunkelheit eingenommenem Freljord von ihm Besitz. Volibear sah, wie eine unvorbereitete und selbstgefällige Ursaren-Armee von schrecklichen Eiskreaturen niedergemetzelt wurde. In diesem Augenblick wusste er, dass sein Volk untergehen würde, sollte es sich nicht auf den Krieg vorbereiten.<br><br>Volibear eilte den Berg hinab, um zu berichten, was er gesehen hatte, doch der Pfad wurde von drei Ursaren blockiert - dem Triumvirat. In dem Wissen, dass er den anhaltenden Frieden beenden würde, weigerten sie sich, Volibears Warnung zu beachten und befahlen ihm, still zu sein - freiwillig oder durch seinen Tod. Hartnäckig und entschlossen schwor Volibear, dass das Überleben der Ursaren von seiner Nachricht abhänge und verwickelte die drei in einen erbitterten Kampf. Es brach ein schrecklicher Konflikt aus und gerade, als Volibear seinen Widersachern zu erliegen drohte, rief er die Macht des Mahlstroms an. Er entfesselte damit reine Blitze und brachte das Trio mit einem mächtigen Donner zu Fall. Fassungslos und staunend wurde das Triumvirat des Zeichens des Anführers der Ursaren gewahr: die Macht des heiligen Sturms.<br><br>Seine ihm vorhergesagte Herrschaft anerkennend, ernannte das Triumvirat Volibear zum neuen Anführer der Ursaren. Sein Einfluss weitete sich schnell und bestimmt aus: Er erhob seinen Stamm aus der Selbstzufriedenheit und belebte ihre kampferprobten Traditionen neu - und schloss sich mit Sejuani, der Kriegerin, die an ihrer Seite gegen das aufziehende Unheil kämpfen würde, zusammen. Im Laufe der Zeit wurde der Stamm leidenschaftlich und war schon bald als furchteinflößendes und legendäres Kriegervolk bekannt. Volibear und die Ursaren sind nun bereit für die Finsternis, die am eisigen Horizont lauert.<br><br>„Die Ursaren können den Frieden nicht kennen, wenn sie nicht wissen, was Krieg bedeutet.“ - Volibear <br><br>', 'Volibear kann sehr schnell werden, wenn er Ziele verfolgt, aber er erhält einen viel kleineren Bonus, während er wegläuft.', 'Volibear regeneriert sehr viel Leben, wenn sein Leben auf ein kritisches Niveau fällt.', 'Volibears Effektivität leidet stark, wenn man ihn verlangsamt oder betäubt, während er versucht, auf ein Ziel zuzulaufen.', 'Stürme mit „Donnerrollen“ voran und verlangsame Gegner mit „Majestätisches Gebrüll“.', 'Volibear profitiert von zusätzlichem Leben und Abklingzeitverringerung.', 'Volibear muss dreimal kurz aufeinander angreifen, um „Blutrausch“ einsetzen zu können - genügend Durchhaltevermögen hierfür zu haben ist eine Möglichkeit, dieses Ziel zu erreichen.', 0, 1, 440, 2529, ' Fighter Tank'),
(61, 'Nunu', 20, '2014-10-21 17:54:20', '2015-04-09 10:19:39', 'Nunu', 125.00, 42.00, 283.56, 56.86, 598.28, 96.00, 3.45, 26.38, 0.50, 8.39, 0.00, 1.25, 7.44, 2.25, 32.10, 350.00, 0.00, 0.00, 0.80, 3.50, 'Der Yeti-Reiter', 'Manchmal werden die Bande der Freundschaft sogar stärker als die Bande des Blutes. Wenn solche Bande einen furchtlosen Jungen mit einem furchterregenden Yeti verbinden, wird aus diesem Band eine Kraft, mit der man rechnen muss. Vor die Aufgabe gestellt, ein schreckliches Biest zu zähmen, schmiedete Nunu eine Freundschaft, wo andere Ketten geschmiedet hätten. Nun sind Nunu und sein stattlicher Kumpel ein unzertrennliches Paar, das jugendlichen Überschwang und brutale Stärke mit der mythischen Macht eines Yetis verknüpft, um Hindernissen zu trotzen, die jedem gewöhnlichen Duo unüberwindbar erscheinen würden.<br><br>Nunu hatte an seine Eltern oder die Zeit, bevor er Teil des zurückgezogen lebenden Frostwächter-Stammes wurde, nur sehr vage Erinnerungen. Da er im Kreise derer, die ihm Unterschlupf gewährten, nie willkommen war, brachte Nunus Reiselust und Leidenschaft ihn oft gegen die Stammesältesten auf und der Junge träumte immer öfter von Orten, die weit hinter den Schatten der Frostwächter-Zitadelle lagen. Manchmal blieb es nicht bei Träumen, was seine Aufpasser überaus frustrierte. Dies war nie so offensichtlich als in dem Moment, als Nunu bei dem Bestienmeister des Stammes in die Lehre kam und mit der Versorgung der ihm unterstehenden Kreaturen betraut wurde.<br><br>Die Frostwächter hielten eine Menagerie der wilden Tiere Freljords zu ihrer Verfügung, doch in ihrer Sammlung war der Yeti einzigartig: eine ungewöhnliche Kreatur mit mystischen Eigenschaften und roher physischer Stärke. Der Bestienmeister lehrte Nunu, dass nur eine strenge Diät aus Pflanzen und regelmäßige Peitschenhiebe dieses gefährliche Biest bändigten. Doch je mehr Zeit Nunu mit der Pflege der Kreatur verbrachte, desto mehr begriff er, dass der Yeti kein wildes Monstrum war.<br><br>Als er sah, dass sein neuer Freund Willump immer schwächer und kränklicher wurde, begann Nunu für den Yeti Fleischreste zu stibitzen, in der Hoffnung, er würde wieder gesund. Tag um Tag wurde Willump kräftiger und nicht im Geringsten wild ... ganz im Gegensatz zu den Behauptungen des Bestienmeisters. Nunu hegte Hoffnungen, er könnte ihn davon überzeugen, dass der Yeti keine Gefahr darstellte, aber es sollte nicht sein. Das nächste Mal, als Nunu kam, um Willump seine Mahlzeit zu bringen, fand er den Käfig des Yetis in Trümmern vor, nur eine grobe Zeichnung im Inneren als Abschiedsgruß des Yetis. Ohne zu zögern brach Nunu in die Wildnis auf, um nach seinem Freund zu suchen.<br><br>Als Nunu schließlich zu Willump aufschloss, entdeckte er den Yeti umzingelt vom Bestienmeister und einer Gruppe Krieger des Stammes der Frostwächter. Da er Angst hatte, die Männer würden seinem Freund wehtun, warf sich Nunu selbst zwischen den Yeti und die Peitsche des Bestienmeisters, doch der brutale Mann ließ sich nicht von seinem Vorhaben abbringen. Als der wütende Bestienmeister seine Peitsche erneut erhob, bäumte sich der Yeti für ihn untypisch voller Wut auf. Selbst nach so vielen Misshandlungen war es nicht die Sorge um sich selbst, sondern die um den Jungen, der ihm so viel Freundlichkeit entgegengebracht hatte, die Willump letztlich eine Grenze überschreiten ließ. Der Yeti tobte und ließ den Mann blutüberströmt im Schnee zurück.<br><br>Von der Raserei Willumps in Angst und Schrecken versetzt flohen die übrigen Frostwächter-Krieger. Nunu begriff, dass es kein Zurück gab. Er brüllte Willump an, er solle rennen, bevor die Männer zurückkamen, um ihn zu töten, doch der Yeti weigerte sich, den kleinen Jungen allein zu lassen. Nunu stand vor einer schwierigen Entscheidung: seinen einzigen Freund im Stich lassen und ein Leben in Gefangenschaft bei den Frostwächtern führen oder in die raue Wildnis aufbrechen und das einzige Leben, das er kannte, hinter sich lassen. Nunu wählte den einzigen Weg, der einen Sinn ergab. Er sprang auf den Rücken des mächtigen Yeti und begleitete ihn auf seiner großen Flucht. Die beiden unternahmen ihre ersten Schritte in die weite Welt hinaus, von der sie so lange Zeit ferngehalten wurden.<br><br>„Willump und ich müssen eine ganze Welt erkunden. Kommt uns nicht in die Quere!“ - Nunu<br>', 'Nunus „Blutrausch“ ermöglicht es Spielern, aus Kämpfen zu fliehen. Achte also darauf, jedes Ziel mit „Blutrausch“ festzuhalten oder zu betäuben.', 'Unterbrichst du die Aufladung von „Kältesturz“, dann senkst du den Schaden, den dein Team erleiden wird.', 'Die Verwendung von „Blitz“ ist ein todsicherer Weg, um „Kältesturz“ zu entkommen.', '„Konsumieren“ erlaubt es Nunu, auch gegen Fernkämpfer zu bestehen.', 'Brich „Kältesturz“ vorzeitig ab, um zumindest einen Teil des Gesamtschadens zu verursachen, sollte dein Gegner versuchen, zu fliehen.', 'Oft ist es von Vorteil, „Kältesturz“ solange herauszuzögern, bis die erste Runde von Kampfunfähigkeits-Fertigkeiten durchgelaufen ist. Versuch, dich zurückzuhalten, bevor du dich in einen größeren Kampf stürzt.', 0, 0, 0, 920, ' Support Fighter'),
(62, 'Twisted Fate', 4, '2014-10-21 17:54:20', '2015-04-09 10:19:40', 'TwistedFate', 525.00, 38.00, 265.84, 49.95, 521.76, 82.00, 3.30, 20.54, 0.80, 5.50, 0.00, 0.00, 6.00, 3.22, 30.00, 330.00, -0.04, 0.00, 0.60, 3.15, 'Der Meister der Karten', 'Obwohl er der Spross armer Zigeuner gewesen ist, konnte sich Twisted Fate seinen Weg zum Reichtum als Kartentrickser in den zwielichtigen Untergrund-Spielhallen von Demacia und Noxus erspielen. Egal wie dicht die Obrigkeit ihm auch auf den Fersen war, der Schurke fand immer einen Weg, ihnen durch die Lappen zu gehen. Trotz seines soliden Glücks konnte er aber nie das gewinnen, was er am meisten begehrte: die Fähigkeit, Magie zu kontrollieren. Als Twisted Fate von einem Experiment in Zhaun erfuhr, das ihm vielleicht diesen Wunsch erfüllen konnte, setzte er wie ein echter Glücksspieler alles auf eine Karte und meldete sich als Freiwilliger.<br><br>Das Experiment wurde von Dr. Xavier Rath geleitet und man sagte Twisted Fate gleich zu Beginn, dass der Wetteinsatz für seine Teilnahme gepfeffert sein kann. Er könnte sich für immer verändern, es könnte aber genauso gut gar nichts passieren oder er könnte eines schrecklichen Todes sterben. Schmerz würde aber mit großer Wahrscheinlichkeit zu dem Deal dazugehören, ganz gleich, was er am Ende einbrachte. Doch dies waren bei weitem nicht die schlechtesten Vorzeichen, denen er sich in seinem Leben zu stellen hatte, deshalb keimte Hoffnung in ihm auf. Twisted Fate unterzog sich dem Experiment und erduldete, was nötig war, um eine Chance auf die Verwirklichung seines Traumes zu bekommen. Dann endete der Versuch - anscheinend ohne Ergebnis. Der Zigeunergauner verfiel in mörderische Wut, doch, bevor er das Team von Wissenschaftlern töten konnte, teleportierte er sich plötzlich viele Kilometer weit weg. Mit einem breiten Grinsen erkannte er, dass sein Glück einmal mehr zugeschlagen hatte. Jetzt bringt er sein Glück und seinen verwegenen Charme in die Kriegsakademie ein, wo er für viele der Champion ihrer Wahl ist - besonders für die Zocker unter den Beschwörern. Bis zum heutigen Tage ging Twisted Fate seiner unvermeidlichen Wiedervereinigung mit Dr. Rath aus dem Weg. Der Meister der Karten weiß trotz allem, dass eine Konfrontation bevorsteht.<br><br>„Obgleich die Zukunft für die meisten Menschen mysteriös und unbekannt ist, glaubt Twisted Fate fest daran, dass sie in seinen Karten steht.“', 'Konzentriere dich in einer frühen Spielphase darauf, der Fähigkeit „Joker“ auszuweichen, solange der Champion noch nicht genug Trefferpunkte hat, um den Treffer wegzustecken.', 'Wenn du wenig Leben hast, benutze „Schicksal“ als Anhaltspunkt, um dich rechtzeitig in Sicherheit zu bringen. Dies gibt dir einen Vorsprung bei deiner Flucht und ermöglicht es dir, Hinterhalten zu entkommen.', '', 'Finde gemeinsam mit deinen Verbündeten den besten Zeitpunkt, um „Schicksal“ zu benutzen, und so die Gegner in einen Hinterhalt zu locken.', 'Champions, die sich in den Schatten verbergen können, entkommen Kämpfen oft mit sehr wenig Leben. Benutze „Schicksal“, um getarnte Einheiten aufzudecken und ihnen den Rest zu geben.', 'Twisted Fate ist als Angriffsschaden- oder Fähigkeitsstärke-DPS-Charakter einsetzbar, sodass er in viele verschiedene Teamkonstellationen hineinpasst.', 0, 0, 0, 2776, ' Mage'),
(63, 'Jax', 24, '2014-10-21 17:54:20', '2015-04-09 10:19:40', 'Jax', 125.00, 35.00, 288.80, 61.97, 592.80, 85.00, 3.38, 27.04, 0.70, 8.37, 0.00, 1.25, 7.58, 3.40, 32.10, 350.00, -0.02, 0.00, 0.55, 3.00, 'Der Großmeister der Waffen', 'Es ist selten der Fall, dass ein Champion mehr nach den Taten beurteilt wird, die er nach dem Beitritt in die Liga der Legenden vollbracht hat, als nach denen vor dieser Zeit. Bei Jax aber, von dem man wohl sagen könnte, dass er der produktivste Wettkämpfer an der Kriegsakademie ist, ist es so. Bevor er der Liga beitrat, war Jax ein gewöhnlicher Söldner. Aus Gründen, die nur dem vormaligen Anführer der Liga, dem Hohen Rat Reginald Ashram, bekannt sind, wurde Jax an die Spitze der Liste der Kandidaten gesetzt, die sich einer Beurteilung durch die Liga unterziehen mussten - dem Befragungsprozess, der über Aufnahme oder Ablehnung des zukünftigen Champions entscheidet. Seine Beurteilung war die kürzeste in der Geschichte der Liga, in deren Verlauf das Portal der Anerkennung glühte und im selben Moment aufschwang, in dem sie begann. Jax musste sich während seiner Beurteilung weder einer aufgezeichneten Beobachtung noch Betrachtung stellen.<br><br>Jax stellte sich augenblicklich als Schrecken der Richtfelder heraus. Der selbsternannte „Waffenmeister der Liga“ hat eine Siegesserie hingelegt, die bis heute unübertroffen ist. Eine Reihe von Beschwörern in der Liga begann sich darum zu sorgen, dass die anerkannte Objektivität der Liga der Legenden durch einen unbekannten, unbesiegbaren Kämpfer in Frage gestellt werden würde. Aus diesem Grund erlegte der neue Anführer der Liga (der nach Reginald Ashrams Verschwinden an seine Stelle trat) Jax bestimmte Auflagen, unter denen er nun kämpfen sollte, auf. Dies war etwas, das die Liga nie zuvor getan hatte und seitdem auch nie wieder getan hat. Aus Protest stellte der stämmige Kämpfer daraufhin seine eigenen Gebote auf - er darf als einzige Waffe eine Messinglaterne benutzen. Weder die Auflagen der Liga noch seine eigenen schadeten seiner Siegesserie in irgendeiner Weise. Die Liga hat deshalb ihre Sanktionen aufgehoben, Jax jedoch seine eigenen nicht. Bis heute kämpft er mit seiner treuen Messinglaterne, und das ausgesprochen gut.<br><br>„Sei gewarnt - es gibt eine beachtliche Zunahme an Laternen-förmigen Verletzungen in der Liga der Legenden.“ - Gragas<br>', 'Versuch, ihn nur mit kurzen Attacken anzugreifen, anstatt ihn in einen dauerhaften Nahkampf zu verwickeln. Hindert man ihn daran, fortlaufend anzugreifen, kann man sein Schadenspotential deutlich verringern.', 'Jax'' kann allen Angriffen kurzzeitig ausweichen und er betäubt danach alle nahen Gegner, weshalb es sich auszahlen kann, hier gegebenenfalls etwas länger zu warten.', '', 'Jax kann mit „Sprungschlag“ zu verbündeten Einheiten, wozu auch platzierte Augen zählen, springen. So lässt sich eine möglicherweise nötige Flucht planen.', 'Jax profitiert besonders von Gegenständen mit Fähigkeitsstärke und Angriffsschaden, etwa „Guinsoos Wutklinge“ und „Hextech-Gunblade“.', '', 0, 0, 0, 1460, ' Fighter Assassin'),
(64, 'Shyvana', 102, '2014-10-21 17:54:20', '2015-04-09 10:19:40', 'Shyvana', 125.00, 0.00, 100.00, 60.71, 594.60, 95.00, 3.40, 27.63, 0.00, 8.59, 0.00, 1.25, 0.00, 2.50, 32.10, 350.00, -0.05, 0.00, 0.80, 3.35, 'Der Halbdrache', 'Als der Vereinigung eines Drachen und eines Menschen entsprungenes Halbblut befand sich Shyvana ihr Leben lang auf der Suche nach dem Gefühl der Zugehörigkeit. Die Hetzjagd machte sie zu einer grausamen Kriegerin und jene, die es wagen, sich gegen Shyvana zu stellen, sehen sich im Handumdrehen der feurigen Bestie gegenüber, die direkt unter ihrer Oberfläche schlummert.<br><br>Ihre Verwandten, die Drachen, erachten Shyvanas unreines Blut für eine Abscheulichkeit, sodass sie ihre gesamte Jugend hindurch unbarmherzig von einem grausamen Drachen verfolgt wurde. Sie und ihr Vater, ein ausgestoßener Drache, waren unaufhörlich auf der Flucht, so blieb ihnen ein richtiges Zuhause versagt. Da sie nichts als zahllose Schlachten kannte, wurde Shyvana immer hasserfüllter und wilder. Nach jahrelanger Zwietracht fiel ihr Vater letztendlich dem anderen Drachen zum Opfer, doch nicht ohne seinem Gegenüber eine tiefe Wunde zugefügt zu haben. Angetrieben von wutentbrannter Trauer verfolgte Shyvana den Mörder ihres Vaters, der sich nach Norden geflüchtet hatte, um neue Kraft zu sammeln. Dort traf sie auf eine Gruppe Menschen, die ebenfalls der Fährte des Drachen folgten. Obschon die Männer sie mit Furcht betrachteten, ging ihr Anführer friedlich auf Shyvana zu. Er stellte sich als Jarvan IV., Prinz von Demacia, vor und bot Shyvana auf ihrem Rachefeldzug Hilfe an. Zusammen spürten sie den bösartigen Drachen, der ihren Vater umgebracht hatte, auf und stellten sich ihm entgegen. Shyvana erwartete nicht, dass die Männer überlebten, doch als Feuer und Stahl aufeinandertrafen, kämpften Jarvan IV. und seine Mannen mit einer solchen Stärke, wie sie sie für Menschen als unmöglich erachtet hatte. Die gepanzerten Krieger zwangen ihren Gegenspieler, sich zu unterwerfen, und Shyvana setzte zum finalen Schlag an und riss der Bestie das Herz aus seinem Leib. Von ihrer Wildheit beeindruckt bot Jarvan IV. ihr einen Platz in den Rängen seiner Elitegarde an. Shyvana konnte noch immer Furcht in den Augen seiner Männer sehen, doch sie sehnte sich so sehr nach einem richtigen Zuhause. Im Vertrauen darauf, dass Jarvan IV. Wort hielte, nahm sie dessen Angebot an und dient nun als Kriegerin Demacias. Obwohl ihre menschlichen Verbündeten ihre Kraft bewundern, halten sie doch Abstand zu ihr. Shyvana ist darum bemüht, sich für den Gefallen des Prinzen mit der Macht des Drachen, der in ihr steckt, erkenntlich zu zeigen, doch kann sie nicht umhin, sich die Frage zu stellen, ob die Menschen sie nicht zurecht fürchten.<br><br>„Ich habe den Drachen meine Macht bewiesen - welche Herausforderungen mögen Menschen mir bieten?“ - Shyvana<br>', 'Ein deutlicher Teil von Shyvanas Stärke basiert auf Aggression, was sie schwach gegen Gegner macht, die ihr fern bleiben.', 'Alle von Shyvanas einfachen Fähigkeiten können in der Drachengestalt mehrere Gegner treffen. Gegen sie kämpfende Champions sollten daher Abstand zueinander halten.', 'Shyvanas Zornleiste zeigt an, wann sie ihre ultimative Fähigkeit einsetzen kann. Es kann sehr effektiv sein, ihr zuzusetzen, während ihre Leiste kaum gefüllt ist.', 'Alle von Shyvanas Fähigkeiten profitieren von Angriffen. Daher sind Gegenstände mit Angriffstempo für sie wertvoller als für die meisten anderen Champions.', '„Flammenodem“ früh zu steigern lohnt sich besonders gegen schwierige Gegner in einer Lane.', '„Ausbrennen“ ist ideal für den Dschungel. Monster bleiben während der gesamten Wirkdauer in Reichweite und das zusätzliche Lauftempo ermöglicht es ihr, Gegner leichter zu überrumpeln.', 0, 0, 440, 984, ' Fighter Tank'),
(65, 'Dr. Mundo', 36, '2014-10-21 17:54:20', '2015-04-09 10:19:41', 'DrMundo', 125.00, 0.00, 0.00, 61.27, 582.52, 89.00, 3.00, 26.88, 0.00, 7.76, 0.00, 1.25, 0.00, 2.80, 32.10, 345.00, 0.00, 0.00, 0.75, 3.50, 'Der Irre von Zhaun', 'Es heißt, dass der als Dr. Mundo bekannte Mann ohne jedes Gewissen geboren wurde. Stattdessen hatte er einen unstillbaren Drang, anderen in Experimenten Schmerzen zuzufügen. Als er fünf Jahre alt war, waren bereits die meisten Haustiere aus seiner Nachbarschaft verschwunden, und als er das Jugendalter erreicht hatte, waren auch seine Eltern nicht mehr aufzufinden. Zum Zeitpunkt, als er seine medizinische Zulassung erhielt, war er von den Behörden von Zhaun bereits von 38 Mordanklagen freigesprochen worden: Aus Mangel an Beweisen kam es nie zu einer Verurteilung.<br><br>Dr. Mundo wurde zu gleichen Teilen Serienmörder und verrückter Wissenschaftler, auch wenn niemand ganz sicher ist, inwieweit sein Gemetzel als Wissenschaft gewertet werden kann. Jedoch machte er gewaltige Fortschritte auf dem Gebiet der Abbildung der Schmerzantwort in Gehirn und Körper des Menschen, wodurch es ihm sogar möglich ist, den Schmerz selbst in den qualvollsten Situationen vollkommen zu unterdrücken. Er ist ebenso mit Hilfe der Chemie in die entwicklungsbiologisch ältesten Teile des Gehirns vorgedrungen, wodurch er herausfand, wie Aggression und Adrenalinausstoß gesteigert und Bewusstsein und Überlebensinstinkt zurückgefahren werden können. Kurzgefasst besteht Dr. Mundos Lebenswerk darin, herauszufinden, wie man mit Hilfe der Wissenschaft die perfekte Killermaschine erschafft. Im Stadtstaat Noxus wird derartiges Verhalten jedoch leider eher als ein Zeichen von Eigeninitiative und Karrieregeist und nicht als unmenschlich angesehen. Ursprünglich trat Dr. Mundo für Zhaun in die Liga ein, wurde dann aber angeworben, um zusätzlich für Noxus in der Liga der Legenden zu kämpfen. Dieser verrückte Doppelstatus ist Ausdruck für die blühenden Beziehungen zwischen Zhaun und Noxus. Seine Experimente setzt er bis heute fort, mitunter sogar mit sich selbst als Versuchsobjekt, was sich in seinem entstellten Aussehen und seiner ... eigenwilligen Weise zu sprechen wiederspiegelt. Es gibt sogar Gerüchte, dass das Oberkommando von Noxus ihm freie Hand bei der Verfolgung seines Lebenswerkes in seiner Freizeit zugestanden hat.<br><br>„Nimm dich vor dem Irren von Zhaun in Acht. In seinen Augen bist du bereits tot.“', 'Stimm dich mit deinen Verbündeten ab und versucht, gemeinsam Fähigkeiten mit hohem Schaden gegen Dr. Mundo einzusetzen, nachdem er seine ultimative Fähigkeit eingesetzt hat. Wenn du ihn nicht schnell genug tötest, wird er sich wieder heilen.', 'Versuche „Entzünden“ zu zaubern, wenn Dr. Mundo „Sadismus“ benutzt, um einen Großteil seiner Heilung wirkungslos zu machen.', '', 'Die Benutzung von „Sadismus“ im richtigen Moment kann dazu führen, dass sich Gegner überschätzen, angreifen und dann trotzdem verlieren, weil sie nicht genügend Schaden verursachen.', '„Geistessicht“ erhöht die Heilung deiner ultimativen Fähigkeit und verringert die Abklingzeiten all deiner Fähigkeiten', 'Beile sind sehr hilfreich beim Töten neutraler Monster. Anstatt zur Basis zurückzukehren, kannst du also neutrale Monster töten, bis deine ultimative Fähigkeit dich heilen kann.', 0, 0, 0, 2016, ' Fighter Tank'),
(66, 'Brand', 63, '2014-10-21 17:54:20', '2015-04-09 10:19:41', 'Brand', 550.00, 45.00, 325.60, 57.04, 507.68, 76.00, 3.00, 21.88, 0.60, 5.42, 0.00, 0.00, 8.01, 1.36, 30.00, 340.00, 0.00, 0.00, 0.55, 3.50, 'Die brennende Vergeltung', 'An einem weit entfernten Ort, bekannt als Lokfar, lebte ein seefahrender Barbar namens Kegan Rodhe. Wie es bei seinem Volke üblich war, segelte Kegan mit seinen Kameraden bis zum Horizont und darüber hinaus, um Schätze von denen zu stehlen, die das Pech hatten, ihre Aufmerksamkeit zu erregen. Einigen war er ein Monster, anderen ein einfacher Mann. Eines Nachts, als sie durch die arktischen Gewässer segelten, tanzten seltsame Lichter über den gefrorenen Eiswüsten. Sie hatten etwas hypnotisierendes, sie wurden von ihnen angezogen wie Motten vom Licht. Nachdem sie die Eiswüste durchquert hatten, kamen sie an eine Höhle, die über und über mit uralten Runen bedeckt war. Die Bedeutung der Runen war über die Jahrhunderte hinweg verloren gegangen, doch Kegan ging voran in das Innere der Höhle. Dort, in einem makellosen Käfig aus Eis schwebte eine tanzende Flammensäule. Es gab keine Erklärung dafür, dass sie brennen konnte, erst recht nicht an diesem Ort. Doch ihre Bewegungen waren so hypnotisierend wie der Gesang einer Sirene, fesselnd und verführerisch. Während die anderen zurückblieben, konnte Kegan nicht anders und näherte sich ihr, wobei er seine Hand ausstreckte ...<br><br>Das ist das Letzte, woran Kegan Rodhe sich erinnern kann, denn nun gehört sein Körper Brand. Es ist ein Wesen aus alten Zeiten, vielleicht sogar ein Opfer der Runenkriege. In uralten Texten ist es als Brennende Vergeltung bekannt. Es ist eine Kreatur aus purem, feurigem Hass, deren einziger Existenzgrund darin besteht, die Welt der Menschen und der Yordle in Schutt und Asche zu legen. Niemand ist sich sicher, wie Brand seinen Weg nach Valoran gefunden hat, doch er begann sofort mit seinen Raubzügen. Überwältigt von Truppen Demacias ließ man ihm die Wahl: innerhalb der Grenzen der Liga zu kämpfen oder zu sterben. Natürlich entschied er sich, seine zerstörerischen Kräfte in der Liga zu benutzen. Vorerst ...<br><br>„Dieser Ort wird brennen, nicht entflammt durch Glut, die eine zarte Brise heranträgt, sondern durch die Rache aus meiner Hand.“ - Brand<br>', 'Brand muss mit einer Fähigkeit treffen, um eine Kombination zu beginnen. Weiche seinem „Versengen“ oder „Flammensäule“ aus, um ihn aus dem Rhythmus zu bringen.', 'Versuche dich von Verbündeten zu entfernen, wenn er „Pyroklasmus“ einsetzt. Der Wirbel ist anfangs sehr langsam, was deinem Team genügend Zeit geben sollte, um zu reagieren.', 'Brands passive Fähigkeit lässt ihn besonders bei schnellen und kurzen Vorstößen glänzen. Versuche nicht zu viel Leben vor einem Kampf zu verlieren.', 'Verhindere, dass Gegner zu nahe an ihren Vasallen bleiben, indem du sie in Flammen hüllst und dann durch „Feuersbrunst“ bedrohst.', 'Brands Fähigkeiten lassen sich auf verschiedene Weise kombinieren.', '„Pyroklasmus“ springt zufällig zwischen nahen Gegnern hin und her, weshalb die Nutzung gegen kleinere Gegnergruppen effektiver ist, da ein einzelnes Ziel womöglich häufiger getroffen wird.', 0, 0, 0, 3307, ' Mage');
INSERT INTO `champions` (`id`, `name`, `champion_id`, `created_at`, `updated_at`, `key`, `attackrange`, `mpperlevel`, `mp`, `attackdamage`, `hp`, `hpperlevel`, `attackdamageperlevel`, `armor`, `mpregenperlevel`, `hpregen`, `critperlevel`, `spellblockperlevel`, `mpregen`, `attackspeedperlevel`, `spellblock`, `movespeed`, `attackspeedoffset`, `crit`, `hpregenperlevel`, `armorperlevel`, `title`, `lore`, `enemytips1`, `enemytips2`, `enemytips3`, `allytips1`, `allytips2`, `allytips3`, `f2p`, `sale`, `sale_price`, `votes`, `tags`) VALUES
(67, 'Diana', 131, '2014-10-21 17:54:20', '2015-04-09 10:19:41', 'Diana', 150.00, 40.00, 297.20, 53.04, 589.20, 90.00, 3.00, 26.05, 0.80, 7.42, 0.00, 1.25, 6.00, 2.25, 32.10, 345.00, 0.00, 0.00, 0.85, 3.60, 'Der Hohn des Mondes', 'Als unbeirrbare Personifikation der Macht des Mondes unternimmt Diana einen dunklen Kreuzzug gegen die die Sonne verehrenden Solari. Obschon sie einst um die Akzeptanz ihres Volkes kämpfte, formten Jahre der vergeblichen Bemühungen sie zu einer verbitterten, unbarmherzigen Kriegerin. Sie stellt ihre Kontrahenten nun vor ein schreckliches Ultimatum: Huldigt dem Licht des Mondes oder sterbt durch ihre Mondsichel-Klinge.<br><br>Obwohl sie als Solari geboren wurde, trieb Dianas wissbegieriges Wesen einen Keil zwischen sie und ihre Geschwister. Trost und Orientierung fand sie schon immer unter dem nächtlichen Himmel und hinterfragte deshalb die Vorherrschaft der Sonne in ihrer Gesellschaft. Die Ältesten der Solari begegneten ihrer Infragestellung nur mit Hohn und Strafen. Trotzdem blieb Diana davon überzeugt, dass, wäre sie in der Lage, für die Macht des Mondes einen Beweis zu erbringen, die Ältesten ihren Argumenten Gehör schenken würden. Jahrelang studierte sie abgeschieden in den Archiven der Solari, bis sie schließlich in einem alten Wälzer eine verschlüsselte Nachricht fand. Dieser Hinweis führte sie in ein abgeschiedenes Tal am Berg Targon, in dem sie schließlich den Eingang zu einem uralten, verschlossenen Tempel freilegen konnte. In seinem Inneren fand sie neben alten Relikten und verblichenen Wandmalereien eine verzierte Rüstung und eine wunderschöne Mondsichel-Klinge, die beide mit Zeichen des Mondes verziert waren. Diana legte die Rüstung an und kehrte noch in derselben Nacht zu den Ältesten der Solari zurück. Sie erklärte, dass die Artefakte belegten, dass andere einst den Mond verehrt hatten, ebenso wie sie es tat. Ihre Entdeckung von Beweisen, welche die Vorherrschaft der Solari in Frage stellten, schockierte die Ältesten. Zu Dianas Schrecken wurde sie von ihnen zu einer Ketzerin erklärt und damit zum Tode verurteilt. Während die Ältesten sie für die Hinrichtung vorbereiteten, gewann Dianas Wut und Trauer die Oberhand über ihr Verlangen, akzeptiert zu werden. Indem sie ihren Blick gen Himmel richtete, rief sie den Mond um Stärke an. Eine Woge übernatürlicher Kraft in sich spürend, sprengte Diana ihre Ketten, erhob ihre Reliktklinge, drehte sich um und metzelte die Ältesten nieder. Nachdem die Ruinen des Tempels hinter ihr lagen, fuhr Diana damit fort, all jene zu zerstören, welche die Macht des Mondes leugnen würden.<br><br>„Die Sonne erhellt die Wahrheit nicht. Ihr Licht verbrennt nur und macht blind.“ - Diana<br>', 'Weiche „Mondsichel-Klinge“ aus oder begib dich in Sicherheit, wenn du von „Mondlicht“ betroffen bist.', '„Fahle Kaskade“ wirkt nur einige wenige Sekunden. Warte ab und greife Diana an, wenn sich der Schild auflöst.', 'Diana kann sehr aggressiv spielen, wenn sie „Mondhast“ ohne „Mondlicht“ einsetzt, aber du kannst sie verlangsamen oder betäuben, wenn sie keine Chance hat, wieder zurück in Position zu gelangen.', 'Erfolgreiche Treffer mit „Mondsichel-Schwung“ sind besonders wichtig, aber ein verfehlter Schlag ist kein Untergang, denn die Abklingzeit ist kurz und die Manakosten sind niedrig.', 'Überdenke, wann du „Mondhast“ ohne „Mondlicht“ einsetzen solltest und wann das Warten auf „Mondsichel-Schwung“ sinnvoller ist.', 'Nutze „Mondsucht“ und „Mondhast“, um an Zielen dran zu bleiben und aktiviere „Mondsilber-Klinge“ für zusätzlichen Schaden.', 0, 0, 0, 4434, ' Fighter Mage'),
(68, 'Sejuani', 113, '2014-10-21 17:54:20', '2015-04-09 10:19:41', 'Sejuani', 125.00, 40.00, 400.00, 57.54, 600.00, 95.00, 3.30, 29.54, 0.45, 8.68, 0.00, 1.25, 7.21, 1.44, 32.10, 340.00, -0.07, 0.00, 0.85, 3.00, 'Der Zorn des Winters', 'Sejuani wurde mit Entbehrungen gestillt und von Barbarei großgezogen. Wo andere der Rauheit Freljords erlagen, wurde sie von ihr abgehärtet, bis Schmerz zu Kraft, Hunger zu Ermutigung und Frost zu einem Verbündeten bei der Auslese der Schwachen wurde. Durch ihr Martyrium lernte sie, dass, um im endlosen Winter zu bestehen, man ebenso kalt und unnachgiebig werden muss. In Sejuanis Augen verfügen ihre Anhänger entweder über den Eifer zu bestehen oder das Recht zu sterben. Sobald sie Freljord erobert haben wird, weiß sie, dass jene, die überleben, eine Nation bilden werden, die allen das Fürchten lehrt.<br><br>Als Kind musste die Anführerin der Winterklauen zusehen, wie die Zahl der Mitglieder ihres Stammes langsam schwand. Kälte und Hunger rafften alle dahin, die nicht widerstandsfähig genug waren. Sie war die einzige ihrer Zwillinge, die das zehnte Lebensjahr überschritt, sodass Sejuani sich sicher war, dass auch sie leidvoll sterben würde. In ihrer Verzweiflung suchte sie spirituellen Rat bei der Mystikerin ihres Stammes. Doch die Seherin sagte nicht Sejuanis Tod voraus. Stattdessen prophezeite sie, Sejuani würde eines Tages Freljord erobern und die zersplitterten Stämme ihrer Heimat vereinen.<br><br>Gerüstet mit dem unerschütterlichen Glauben an ihr Schicksal ging Sejuani an Grenzen, die jeden getötet hätten, der nicht mit ihrem Willen zum Überleben gesegnet ist. Sie ging ohne Essen und Felle in die Schneestürme hinaus, um dort zu trainieren, während eisige Winde ihr ins Fleisch stachen. Sie maß sich mit den stärksten Kriegern ihres Stammes, einem nach dem anderen, bis ihre Beine unter ihr nachgaben. Als sie die Führerschaft über ihren Stamm übernahm, befahl Sejuani ihren Kriegern, ihrem Beispiel zu folgen. Unter ihrer Herrschaft wurde der Stamm stärker als er es je gewesen war.<br><br>Letztlich war es ein Friedensangebot - anstatt einer Kriegshandlung - das Sejuanis Eroberungskampagne eröffnete. Am ersten Wintertag erschienen Gesandte von Ashes Stamm in Sejuanis Lager und boten ihr Avarosa-Getreide als Geschenk dar. Ashes Absicht war klar: Sollte sich Sejuani mit ihrem Stamm vereinen, würden die Winterklauen nie wieder Hunger leiden müssen. Für Sejuani war das Geschenk eine Beleidigung. In Ashes Stamm sah sie nur Männer und Frauen, alle dürr und verweichlicht, die es vorzogen, Landwirtschaft zu betreiben anstatt zu kämpfen. Ihre Verachtung ihnen gegenüber war absolut.<br><br>Sejuani trieb ihr Volk zusammen und setzte das Getreide in Brand. Sie verkündete, dass Ashes mildtätiges Angebot nur Schwäche hervorbringe. Nachdem sie den Gesandten die Vorräte abgenommen hatte, schickte Sejuani sie mit einer Nachricht zurück: Die Winterklauen würden den Avarosa beweisen, dass nur die Stärksten es verdienen, in Freljord zu überleben. Während das Getreide hinter ihr verbrannte, ritt Sejuani mit ihrem Kriegstrupp aus, um die erste von vielen weiteren schmerzhaften Lektionen zu erteilen.<br><br>„Ich wurde aus dem Eis geschnitten, von den Stürmen geformt und von der Kälte abgehärtet.“ - Sejuani<br>', '„Arktischer Ansturm“ und „Eisgefängnis“ auszuweichen kann sich als großer Vorteil herausstellen. Ein guter Umgang mit Bewegungsfähigkeiten oder Beschwörerzaubern, wie beispielsweise „Blitz“, kann gegen Sejuani helfen.', 'Man sollte versuchen, Sejuani zu betäuben, zu verlangsamen oder wegzustoßen, wenn sie „Nordwinde“ einsetzt, um den von ihr dadurch verursachten Schaden zu verringern.', '', '„Arktischer Ansturm“ ist auch abgesehen vom verursachten Schaden äußerst hilfreich, wenn es darum geht, aus haarigen Situationen zu entkommen, kanalisierte Fähigkeiten zu unterbrechen oder fliehende Gegner einzuholen.', '„Permafrost“ hat eine große Reichweite. Wenn du es aufhebst, bis ein Gegner versucht, mit einer Bewegungsfähigkeit zu entkommen, kannst du zu ihm aufholen, während er verlangsamt ist.', '„Eisgefängnis“ sollte man für Kämpfe aufbewahren, bei denen Teammitglieder anwesend sind, damit diese ebenfalls davon profitieren können.', 1, 0, 0, 1118, ' Tank Fighter'),
(69, 'Vladimir', 8, '2014-10-21 17:54:20', '2015-04-09 10:19:41', 'Vladimir', 450.00, 0.00, 0.00, 48.04, 542.80, 85.00, 3.00, 21.88, 0.00, 7.00, 0.00, 0.00, 0.00, 2.00, 30.00, 335.00, -0.05, 0.00, 0.60, 3.50, 'Der blutrote Schnitter', 'In den Bergen zwischen Noxus und den Sturmwind-Wüsten liegt ein verborgener Tempel, in dem die Geheimnisse uralter und schrecklicher Magie verwahrt werden. Der Tempel ist umgeben von blutleeren Leichen derer, die ihm irrtümlicherweise zu nahe kamen. Sie dienten nur dazu, die Neugier Vladimirs zu wecken, als er - in seiner Jugend - auf der Flucht aus Noxus durch diese Berge zog. Am Tag zuvor hatte der junge Vladimir zwei Jungen seines Alters brutal ermordet - nur um den berauschenden Geruch der herausströmenden blutroten Fluten zu genießen. Ihm wurde sofort klar, dass er nie seine mörderischen Gelüste unterdrücken könnte und seine verdorbenen Taten würden sicher auf ihn zurückfallen, sollte er in Noxus bleiben. Ohne Zögern verließ er den Stadtstaat und zog nach Süden aus.<br><br>Eine Spur aus Körpern führte ihn in einen zerfallenden Tempel aus Stein. Im Inneren fand er einen alternden Mönch, der ihn mit blutroten Augen musterte. Vladimir überraschte den Mönch, indem er den boshaften Blick mit Eifer erwiderte. Da er die unheimlichen Gelüste des Jungen erkannte, lehrte der Mönch Vladimir, wie er die Flüssigkeit des Lebens manipulieren und kontrollieren konnte. Vorbeiziehende Reisende dienten hierbei häufig der Übung. Als es für Vladimir an der Zeit war, die letzte Lektion zu erlernen, warnte der Mönch ihn, dass ein Versagen den Tod zur Folge haben würde. Vladimir versagte nicht, aber der Erfolg gebar eine grausige Überraschung. Während des Rituals wurde dem Mönch jeder Tropfen Blut entzogen und von Vladimir aufgenommen, wodurch dieser die magische Essenz seines Meisters, und die jedes Blutmagiers vor ihm, aufnahm. Allein und plötzlich ohne Aufgabe, entschloss sich Vladimir, nach Noxus zurückzukehren und die Aufnahme in die Liga einzufordern, um die Überlegenheit seines Könnens zu beweisen. Als der noxische Führungsstab beobachtete, welches grauenhafte Schicksal die Palastwachen erlitten, entschied er sich, Vladimirs widerliche Talente für sich einzusetzen.<br><br>„Das, was euch am Leben erhält, wird euch am Ende umbringen.“ - Vladimir<br>', 'Sei in Teamkämpfen vorsichtig, wenn du mit Vladimirs „Blutseuche“ infiziert bist.', 'Wenn du Vladimir dazu bringst, „Blutlache“ zu Beginn des Kampfes einzusetzen, erhöhen sich für ihn die Heilkosten der Fähigkeit.', 'Die „Klinge des gestürzten Königs“ ist sehr effektiv gegen Vladimir, da ihr Schaden vom Leben des Ziels abhängt.', '„Transfusion“ verursacht sofort Schaden am Gegner, noch bevor Vladimir geheilt wird, was sie zu einem der besten Finisher im Spiel macht.', 'Zaubere „Blutseuche“ so, dass sie möglichst viele Feinde gleichzeitig trifft.', '„Blutlache“ wehrt Projektile ab, deshalb ist sie bestens geeignet, um Kampfunfähigkeits-Fertigkeiten auszuweichen.', 0, 0, 0, 2813, ' Mage Tank'),
(70, 'Zac', 154, '2014-10-21 17:54:20', '2015-04-09 10:19:42', 'Zac', 125.00, 0.00, 0.00, 59.67, 614.60, 95.00, 3.38, 23.88, 0.00, 7.92, 0.00, 1.25, 0.00, 1.60, 32.10, 335.00, -0.02, 0.00, 0.55, 3.50, 'Die Geheimwaffe', 'Zac ist das Produkt eines zhaunitischen Experiments, einen hexochemisch angetriebenen Supersoldaten zu erschaffen - Zhauns Amorpher Champion. Die Kombination aus brachialer Stärke und grenzenloser Flexibilität macht ihn zu einem vielseitigen Moloch: ein kreativer Kämpfer, der über Hindernisse einfach hinwegspringt und seine Gegner einfach zerstampft. Obwohl er in einem Waffenlabor erschaffen wurde, haben ihn zwei liebevolle Eltern, die ihn zu einem netten und freundlichen Kind herangezogen haben, gerettet und adoptiert. Im Laufe der Jahre wuchs er zu einem leidenschaftlichen Helden heran, der sich dazu verpflichtet hat, die einfachen Bürger Zhauns zu beschützen.<br><br>Vor langer Zeit entwickelten zwei zhaunitische Wissenschaftler eine organische Substanz, die extremsten Bedingungen widerstehen, ihre biologische Struktur von selbst verändern und ungeahnte Ausmaße kinetischer Kraft generieren konnte. Während die Wissenschaftler, ein Ehepaar, zusahen, wie der Prototyp von einem Tropfen, der auf einem Teelöffel Platz fand, zu einem kleinen Klecks heranwuchs, stellten sie fest, dass ihre Schöpfung auf ihre Gegenwart reagierte. Sie sprang nach vorn, wenn sie sie riefen, und hüpfte, wenn sie sangen. Das Paar begann, in ihm mehr als nur ein Experiment zu sehen. Sie sahen ein kleines Kind voller Zuneigung und Freude.<br><br>Nachdem sie den Prototyp eines Abends getestet hatten, steckten sie den Klecks wieder zurück in seinen Käfig. Er schlotterte und zitterte in der Ecke und war untröstlich traurig. In diesem Moment wurde dem Paar bewusst, dass ihre geliebte Schöpfung sich ein freies Leben außerhalb des Labors wünschte. Ihr Gewissen plagte sie und so konnten sie nicht zulassen, dass der Prototyp als Waffe gebraucht wurde. Der Mann und seine Ehefrau flohen mit dem jungen Klecks und ersetzten seine Waffenbezeichnung - Zhauns Amorpher Champion - durch einen richtigen Namen: Zac. In einer ruhigen Nachbarschaft, weit von der Stadt Zhaun entfernt, zogen die Wissenschaftler Zac als ihr eigenes Kind groß.<br><br>Zac war immer anders als die anderen Kinder. Keines von ihnen besaß seine Stärke und Flexibilität, weshalb das Paar ihm lehrte, richtig von falsch zu unterscheiden und seine Gaben verantwortungsbewusst einzusetzen. Dank der Fürsorge und Hingabe seiner liebevollen Eltern verbrachte Zac eine friedliche, glückliche Kindheit.<br><br>Diese Kindheit endete, als das zhaunitische Laboratorium Zac letztlich ausfindig machte. Da die Mitarbeiter des Labors die Formel, die benutzt worden war, um den amorphen Prototypen zu erschaffen, nicht replizieren konnten, hatten sie nie aufgegeben, nach den Wissenschaftlern und ihrem Experiment zu suchen. Als sie die Familie aufgespürt hatten, drohten sie, sie auseinander zu reißen. Die Angestellten entführten Zacs Eltern und verlangten, dass das Paar bei seiner Gefangennahme und Rückkehr in das Labor half. Angesichts der Angst, seine Freiheit und seine Eltern zu verlieren, entfesselte Zac zum ersten Mal jedes Gramm seiner puren Energie und Masse. Er überwältigte die Geiselnehmer seiner Eltern, schlug die Labormitarbeiter in die Flucht und brachte seine Lieben heim. Von da an schwor Zac, alle einfachen Leute, die von außergewöhnlichem Verrat und Boshaftigkeit bedroht waren, zu verteidigen. Er, der ursprünglich erschaffen wurde, um zu zerstören, beschützt nun die Unschuldigen und Hilflosen.<br><br>„Selbst wenn du kein Rückgrat besitzt, musst du für dich selbst einstehen.“ - Zac<br>', 'Zac heilt sich mit Hilfe des Glibbers, der von ihm abfällt. Du kannst die Glibberstückchen zerstören, indem du auf sie drauf trittst.', 'Töte alle Tröpfchen von Zac, wenn er auseinanderfällt, damit er sich nicht neu bilden kann.', 'Verstummungen, Betäubungen, Festhalteeffekte und Hochschlagen unterbricht Zac, wenn er „Elastische Schleuder“ auflädt.', 'Glibbertröpfchen einzusammeln ist für dein Überleben sehr wichtig.', 'Wenn „Zellteilung“ bereit ist, versuche an einer Stelle zu sterben, an der es für das gegnerische Team schwierig ist, deine Tröpfchen zu töten.', 'Wenn du „Elastische Schleuder“ aus dem Nebel des Krieges heraus auflädst, haben deine Widersacher weniger Zeit zu reagieren.', 0, 0, 0, 1686, ' Tank Fighter'),
(71, 'Quinn', 133, '2014-10-21 17:54:20', '2015-04-09 10:19:42', 'Quinn', 525.00, 35.00, 268.80, 51.04, 532.80, 85.00, 3.00, 23.38, 0.40, 5.42, 0.00, 0.00, 6.97, 3.10, 30.00, 335.00, -0.06, 0.00, 0.55, 3.50, 'Demacias Schwingen', 'Quinn und Valor bilden ein außergewöhnliches Rangerteam. Mit Armbrust und Krallen führen sie die gefährlichsten Missionen ihrer Nation tief im Inneren des feindlichen Gebiets aus - von schnellen Aufklärungsaktionen bis zu tödlichen Schlägen. Die unzerstörbare Verbindung des Paares ist auf dem Richtfeld tödlich und lässt ihre Widersacher blind und von Pfeilen durchlöchert zurück, lange bevor sie überhaupt realisieren, gegen wen sie kämpfen: nicht eine, sondern zwei demacianische Legenden.<br><br>Als kleines Mädchen teilte Quinn die Abenteuerlust mit ihrem Zwillingsbruder. Sie träumten davon, Ritter zu werden, führten aber ein ruhiges, bescheidenes Leben an der ländlich geprägten Grenze Demacias. Zusammen malten sie sich triumphale Schlachten in weitentfernten Ländern aus, in denen sie ihrem König Ruhm verliehen und Feinde im Namen der demacianischen Gerechtigkeit töteten. Als Tagträume allein die Seelen der beiden Krieger nicht mehr befriedigten, unternahmen sie wagemutige Abenteuer durch die Wildnis, um nach den wahren Gefahren zu suchen. Ein solches Abenteuer endete in einer Tragödie, als ein schrecklicher Unfall das Leben ihres Bruders forderte. Von der Trauer überwältigt ließ Quinn von ihrem Traum vom Rittertum ab.<br><br>Am Jahrestag ihres großen Verlustes nahm Quinn all ihren Mut zusammen und kehrte an den Ort der Tragödie zurück. Zu ihrer Überraschung fand sie einen verwundeten demacianischen Adler, genau dort, wo ihr Bruder gestorben war - einen seltenen und wunderschönen Vogel, von dem man lange geglaubt hatte, er sei ausgestorben. Quinn pflegte das Küken wieder gesund und während sie zusammen aufwuchsen, entstand zwischen den beiden eine tiefe Verbindung. In ihrem neu gefundenen Freund sah Quinn dieselben Eigenschaften, die auch das Wesen ihres Bruders prägten, also gab sie ihm den Namen „Valor“. Das Paar fand im jeweils anderen Stärke und zusammen verfolgten sie den Traum, den sie einst aufgegeben hatte.<br><br>Nie hatte die demacianische Armee Helden wie Quinn und Valor gesehen. Ihr tödliches Können unterschied sie schon bald von gewöhnlichen Soldaten ihres Alters, doch viele hatten immer noch ihre Zweifel. Wie konnte ein Mädchen aus einfachen Verhältnissen, selbst mit einer so mächtigen Kreatur an ihrer Seite, auf Jahre der militärischen Ausbildung verzichten? Quinn und Valor bewiesen sich auf einer heiklen Mission, bei der sie einen noxischen Assassinen ausfindig machten, der einem ganzen demacianischen Bataillon entwischt war. Als sie ihn der Gerechtigkeit überantworteten, hatten sie sich endlich die Anerkennung und den Respekt ihrer Nation verdient. Die beiden dienen nun als lebende und kämpfende Ikonen demacianischer Stärke und Beharrlichkeit. Zusammen werden Quinn und Valor sich jeder Gefahr für ihre geliebte Heimat entgegenstellen.<br><br>„Die meisten Soldaten verlassen sich nur auf ihre Waffen. Nur wenige verlassen sich wirklich aufeinander.“- Quinn<br>', 'Wenn du markiert wurdest, beweg dich von Quinn weg, sodass sie daraus keinen Vorteil erlangt.', 'Behalte Quinns Position im Auge. Mit „Auswechseln“ kann Valor die Karte sehr schnell überqueren und dich überraschend angreifen.', 'Valor erlangt ein sehr hohes Lauftempo, wenn er sich nicht im Kampf befindet. Verursache Schaden an ihm, um ihn zu verlangsamen.', 'Valor wird bevorzugt Gegner markieren, die du angreifst. Er wird zudem Vasallen markieren, damit du leichter den Todesstoß setzen kannst.', '„Anspringen“ ist mächtig, muss aber mit Bedacht eingesetzt werden, denn Gegner können Quinn angreifen, wenn sie diese schlägt. „Anspringen“ kann manchmal genutzt werden, um Distanzen zu überbrücken, wenn du mit dem Rücken zur Wand stehst.', 'Nutze „Auswechseln“, um lange Strecken schnell zurückzulegen, um vor Gegnern zu flüchten oder verwundete Ziele zu jagen.', 1, 0, 0, 1015, ' Marksman Fighter'),
(72, 'Akali', 84, '2014-10-21 17:54:20', '2015-04-09 10:19:42', 'Akali', 125.00, 0.00, 200.00, 58.38, 587.80, 85.00, 3.20, 26.38, 0.00, 8.34, 0.00, 1.25, 50.00, 3.10, 32.10, 350.00, -0.10, 0.00, 0.65, 3.50, 'Die Faust der Schatten', 'Es gibt einen uralten Orden, der auf den ionischen Inseln seinen Ursprung hat und sich einzig der Erhaltung des Gleichgewichts verschrieben hat. Ordnung, Chaos, Licht und Dunkelheit - all diese Dinge müssen in perfekter Harmonie existieren, da dies die Natur des Universums ist. Dieser Orden ist als Kinkou bekannt und stellt ein Triumvirat an Schattenkriegern, um seinen Platz in der Welt zu sichern. Akali ist eine dieser Schattenkrieger, der die heilige Aufgabe auferlegt wurde, den Baum zu beschneiden, um jene zu eliminieren, die das Gleichgewicht Valorans bedrohen.<br><br>Als verschwenderische Kampfkünstlerin begann Akali das Training mit ihrer Mutter, kaum dass sie eine Faust bilden konnte. Die Disziplin ihrer Mutter war erbarmungslos und unerbittlich, folgte aber dennoch einem grundsätzlichen Prinzip: „Wir tun, was getan werden muss.“ Als sie die Kinkou im Alter von vierzehn Jahren in den Orden einführten, konnte sie bereits eine baumelnde Kette mit einem Schlag ihrer Hand durchtrennen. Es gab keinen Zweifel - sie würde ihrer Mutter als Faust der Schatten nachfolgen. In dieser Rolle hatte sie mit vielem zu tun, was in den Augen anderer moralisch fragwürdig gewesen wäre, aber für sie war es nur die Befolgung der unantastbaren Doktrin ihrer Mutter. Sie arbeitet nun mit ihren Gefährten Shen und Kennen zusammen, um das Gleichgewicht von Valoran zu erzwingen. Es ist daher keine Überraschung, dass diese geheiligte Aufgabe das Triumvirat direkt auf die Richtfelder geführt hat.<br><br>„Die Faust der Schatten schlägt direkt aus der Deckung des Todes selbst zu. Bringt nicht das Gleichgewicht ins Wanken.“', 'Akali kann auch durch „Zwielicht-Schleier“ verborgen noch immer von Flächenfähigkeiten getroffen werden.', 'Akali profitiert außerordentlich stark von „Mejais Seelenstehler“ und dem „Schwert des Okkulten“. Achte darauf, welche Gegenstände sie erhält und behalte sie entsprechend im Auge.', 'Kehre zur Basis zurück, falls deine Lebenspunkte niedrig sind und Akali mehrere Ladungen ihrer ultimativen Fähigkeit angesammelt hat.', 'Akali zeichnet sich dadurch aus, schwächere Charaktere zu töten. Lass dein Team den Kampf eröffnen und greife dann die Leute in den hinteren Reihen an.', 'Finde ein Gleichgewicht zwischen dem Ansammeln weiterer Essenzen des Schattens und der Anwendung von Schattentanz, bevor du die maximale Anzahl Essenzen erlangt hast.', '', 0, 0, 487, 2620, ' Assassin'),
(73, 'Tristana', 18, '2014-10-21 17:54:20', '2015-04-09 10:19:43', 'Tristana', 550.00, 32.00, 246.76, 51.54, 542.76, 82.00, 3.00, 22.00, 0.45, 6.19, 0.00, 0.00, 7.21, 1.50, 30.00, 325.00, -0.05, 0.00, 0.65, 3.00, 'Die Yordle-Schützin', 'Diese kleine, kanonenschwingende Yordle ist der Beweis dafür, dass Großartiges viele Formen und Größen annehmen kann. In einer Welt voller Unruhen weigert sich Tristana, vor irgendeiner Herausforderung zurückzuweichen. Sie repräsentiert den Gipfel kriegerischer Fähigkeiten, unbeirrter Tapferkeit und grenzenlosen Optimismus. Für Trist und ihre Kanone, Boomer, ist jede Mission eine Gelegenheit klarzustellen, dass Helden wahrlich existieren.', 'Wenn du siehst, dass Tristana in einem Kampf „Schnellfeuer“ aktiviert, dann betäub sie und entferne dich von ihr, bis die Wirkungsdauer der Fähigkeit abgelaufen ist.', 'Halte Abstand zu den Vasallen auf deinem Pfad, um weniger Kollateralschaden durch den „Sprengladung“ zu erleiden.', '', 'Mit ihrer riesigen Waffe kann Tristana aus großer Entfernung auf Ziele schießen. Nutze dies aus, um zu verhindern, dass dich deine Gegner zwischen die Finger bekommen.', 'Setze „Raketensprung“ ein, nachdem du deine „Sprengladung“ an einem Gegner aufgeladen hast, um ihn mit großem Schadensausstoß den Rest zu geben.', 'Verwende „Schnellfeuer“, um mehr „Sprengladung“ auf gegnerischen Champions anzusammeln.', 0, 0, 0, 4717, ' Marksman Assassin'),
(74, 'Hecarim', 120, '2014-10-21 17:54:20', '2015-04-09 10:19:43', 'Hecarim', 175.00, 40.00, 277.20, 61.38, 599.60, 95.00, 3.20, 26.72, 0.60, 7.00, 0.00, 1.25, 6.50, 2.50, 32.10, 345.00, -0.07, 0.00, 0.75, 4.00, 'Der Schatten des Krieges', 'Hecarim ist ein gewaltiger, gepanzerter Geist, dessen Name in Runeterra landauf, landab nur furchtsam geflüstert wird. Er patrouilliert in den Schatteninseln und hetzt all jene zu Tode, die töricht genug sind, einen Fuß auf diesen verfluchten Boden zu setzen. Als Vorhut des Untodes reitet Hecarim aus dem Schwarzen Nebel hervor und lacht höhnisch, während er die Lebenden unter seinen Eisen beschlagenen Hufen zertrampelt.', 'Hecarim erhält Leben von nahen Gegnern, wenn er „Geist des Schreckens“ einsetzt, aber es mangelt ihm an Durchhaltevermögen, weshalb besonders Schadensspitzen effektiv gegen ihn sind.', 'Hecarims ultimative Fähigkeit lässt Gegner Angst erleiden. Dein Team sollte sich verteilen, um ihn so indirekt zu schwächen.', '', '„Geist des Schreckens“ stellt Leben wieder her, wenn nahe Gegner Schaden erleiden, selbst wenn dieser von Verbündeten verursacht wurde. Nutze die Fähigkeit in größeren Kämpfen, um Hecarims Durchhaltevermögen zu steigern.', '„Vernichtender Ansturm“ verursacht mehr Schaden, je nachdem wie weit sich Hecarim zuvor bewegt hat. Versuche eine Kombination mit „Ansturm der Schatten“ oder mit Beschwörerzaubern, etwa „Geist“ oder „Blitz“, um so viel Schaden wie möglich zu verursachen.', '', 0, 0, 487, 1484, ' Fighter Tank'),
(122, 'Kalista', 429, '2014-11-20 21:01:00', '2015-04-09 10:19:40', 'Kalista', 550.00, 35.00, 231.80, 53.46, 517.76, 83.00, 3.25, 19.01, 0.40, 6.00, 0.00, 0.00, 6.30, 3.30, 30.00, 325.00, -0.05, 0.00, 0.55, 3.50, 'Der Speer der Rache', 'Kalista ist ein ewiger Geist der Vergeltung, dem ein kalt-lodernder Hass gegenüber allen Verrätern, Betrügern und Schwindlern innewohnt. Als sie noch lebte, war sie eine legendäre Kriegerin, doch als sie versuchte, eine Tragödie abzuwenden, wurde sie von denen, denen sie am meisten vertraute, verraten und getötet. Nun kann sie nicht sterben und wird beschworen, um Rache zu üben. Doch diese hat ihren Preis: Die Seele des Bittstellers wird verwirkt und für alle Ewigkeit an sie gebunden.', 'Kalistas Mobilität beruht auf ihren Angriffen. Dies bedeutet, wenn sie nicht in Angriffsreichweite ist, ist diese eingeschränkt. Zudem verringern Verlangsamungen ihres Angriffstempos die Distanz, die sie in einem Ansturm zurücklegen kann.', 'Kalista kann den Aufbau ihres normalen Angriffs nicht abbrechen. Auch wenn sie sehr beweglich ist, bietet dir dies ein Zeitfenster, um Fähigkeiten auf ihr zu platzieren, falls du genau vorhersagen kannst, wann sie ihren Angriff beginnen wird.', 'Falls du den Sichtkontakt mit Kalista unterbrechen kannst, dazu gehört auch hohes Gras, werden dich ihre normalen Angriffe verfehlen und auf den Boden fallen ohne Schaden anzurichten.', '„Reißen“ eignet sich besonders gut für Todesstöße, da dessen Abklingzeit zurückgesetzt wird, falls es das Ziel tötet.', 'Wenn du einmal einen Bewegungsbefehl eingibst, um „Kriegerische Anmut“ auszulösen, wird Kalistas Ziel für den normalen Angriff nicht gelöscht.', 'Durch ihre passive Fähigkeit wird Kalistas Lauftempo durch Angriffstempo effektiv erhöht.', 0, 0, 0, 1608, ' Marksman'),
(75, 'Sivir', 15, '2014-10-21 17:54:20', '2015-04-09 10:19:43', 'Sivir', 500.00, 50.00, 284.00, 52.04, 515.76, 82.00, 3.00, 22.21, 0.90, 5.17, 0.00, 0.00, 8.01, 1.60, 30.00, 335.00, -0.05, 0.00, 0.55, 3.25, 'Die Kampfmeisterin', 'Die Kampfmeisterin, Sivir, ist eine Söldnerin mit dem Ruf, erbarmungslos zu sein. Die Mischung aus unerschrockenem Mut und endloser Hingabe brachte ihr großen Ruhm und Reichtum ein. Angesichts ihres rätselhaften Erbes muss Sivir nun zwischen ihrem Verlangen, auf eigene Faust weiterzuziehen, und der Bürde eines großen Erbes abwägen.', '„Bumerangklinge“ kostet viel Mana. Weichst du ihr aus, bedeutet das für Sivir einen großen Rückschlag. Wirst du von der ausgehenden Spiralklinge getroffen, vermeide es erneut auf ihrem Rückweg getroffen zu werden.', 'Sivir ist ein Champion, der sehr gut pushen kann. Lässt man sie zu lange auf einer Lane, kann dies also leicht zum Verlust eines eigenen Turms führen.', 'Wenn du in der Lane gegen Sivir antrittst, kannst du das Timing von „Zauberschild“ stören, indem du einen Vorstoß vortäuschst und dich dann zurückziehst.', 'Sivirs „Bumerangklinge“ kehrt zu ihr zurück, wenn sie die maximale Reichweite erreicht hat. Du kannst also die Position wechseln, um Gegner zu treffen, die dir andernfalls entgehen würden.', '„Querschläger“ setzt bei der Aktivierung Sivirs normalen Angriff zurück. Dadurch lässt sich ihr Schaden maximieren, indem man diese Fähigkeit erst kurz nach einem erfolgten normalen Angriff benutzt.', 'Versuche „Zauberschild“ für gegnerische Fähigkeiten aufzusparen, die dich kampfunfähig machen können, wie etwa Betäubungen und Festhalteeffekte.', 0, 0, 0, 1056, ' Marksman'),
(76, 'Lucian', 236, '2014-10-21 17:54:20', '2015-04-09 10:19:43', 'Lucian', 500.00, 41.00, 298.88, 52.04, 554.40, 80.00, 3.00, 24.04, 0.70, 6.19, 0.00, 0.00, 8.18, 3.30, 30.00, 335.00, -0.02, 0.00, 0.65, 3.00, 'Der Läuterer', 'Lucian trägt mit uralter Macht durchdrungene Reliktwaffen und ist ein standhafter Beschützer vor den Untoten. Seine kalte Überzeugung lässt ihn niemals zögern, selbst im Angesicht der unerträglichen Schrecken, die er unter seinem Hagel reinigenden Feuers zerstört. Lucian verfolgt allein eine erbitterte Mission: die Seelen all jener zu reinigen, die vom Untod verführt wurden, unter ihnen auch die seiner ewig Geliebten.<br><br>So wie die Zwillings-Reliktwaffen, die sie führten, wurden Lucian und seine Frau Senna aus demselben Stein gehauen. Zusammen bezwangen sie jahrelang das Böse in Runeterra und brachten Licht ins Dunkel und reinigten all jene, die von der Verderbnis korrumpiert wurden. Sie waren der Inbegriff der Rechtschaffenheit: Sennas Hingabe zu ihrer Berufung war jederzeit unangefochten, während Lucians Freundlichkeit und Wärme die Herzen der vielen Leben berührte, die sie retteten. Als zwei Teile eines Ganzen waren sie aufopferungsvoll und untrennbar.<br><br>Auch wenn Lucian und Senna Zeugen eines Grauens wurden, das die meisten Krieger gebrochen hätte, schien nichts, was sie je gesehen hatten, vergleichbar mit den Schrecken, welche die Schatteninseln hervorbrachten. Als die Geisterbewohner dieses verfluchten Ortes begannen, sich in Runeterra auszubreiten, machten Lucian und Senna auf sie Jagd, wo immer sie ihrer gewahr wurden. Es war harte Arbeit, doch das furchtlose Paar setzte sich durch, bis zu einer tragischen Begegnung mit dem Seelensammler Thresh. Lucian und Senna waren solch albtraumhaften Untoten schon vorher begegnet, doch niemals einem, der so voller List und Tücke und so grausam gewesen ist. Als sich die schreckliche Schlacht entspann, wandte Thresh einen unerwarteten Trick an. Zu Lucians Entsetzen spielte die Kreatur Senna einen Streich und nahm ihre Seele gefangen und sperrte sie in einem Spektralgefängnis ein. Nichts konnte sie zurückbringen. Senna war verloren und zum ersten Mal musste sich Lucian seiner Mission allein stellen.<br><br>Auch wenn der Wächter die Hälfte von Lucians Herz genommen hatte, erschuf er damit gleichzeitig den gefährlichsten Widersacher der Schatteninseln. Lucian wurde zu einem Mann, der von seiner düsteren Bestimmung nicht abzubringen war und vor nichts Halt machen würde, um die Untoten vom Antlitz Runeterras zu beseitigen. Zu Ehren der Erinnerung an Senna nahm er die Waffe, die sie fallengelassen hatte, an sich und gelobte, ihre Mission bis zum Ende zu verfolgen. Im Besitz beider Reliktwaffen kämpft Lucian darum, die Untoten zu vernichten und die Seelen der Schatteninseln zu reinigen. Er weiß, dass Sennas Seele verloren ist, gibt aber die Hoffnung nie auf, dass er ihr eines Tages Frieden verschaffen wird.<br><br>„Sei dankbar. Dadurch, dass ich dich jetzt vernichte, erspare ich dir eine Ewigkeit der Qual.“ <br> - Lucian', 'Lucian hat hohe Schadensspitzen, jedoch wenig anhaltenden Schaden.', 'Lucian kann die Richtung von Niedermähen nicht ändern. Nutze dies zu deinem Vorteil, indem du die Geschosse umgehst.', 'Durchdringendes Licht verleiht Lucian keine zusätzliche Angriffsreichweite. Er braucht also trotzdem ein Ziel in Reichweite, um den Schuss ausführen zu können. Umgehe Durchdringendes Licht, indem du dir im Voraus überlegst, welchen Winkel Lucian wählen wird.', 'Für optimale Schadensspitzen solltest du versuchen, Erbarmungslose Verfolgung und Durchdringendes Licht zu kombinieren.', 'Flammenschuss explodiert sternförmig. Versuche ihn so abzufeuern, dass die Strahlen gegnerische Champions treffen.', 'Wenn du erst einmal einen Winkel für Niedermähen gewählt hast, kannst du diesen nicht mehr ändern. Wähle den Augenblick also mit Bedacht!', 0, 0, 0, 1691, ' Marksman'),
(77, 'Rengar', 107, '2014-10-21 17:54:20', '2015-04-09 10:19:44', 'Rengar', 125.00, 0.00, 5.00, 60.04, 586.20, 90.00, 3.00, 25.88, 0.00, 4.27, 0.00, 1.25, 0.00, 2.85, 32.10, 345.00, -0.08, 0.00, 0.40, 3.50, 'Der stolze Jäger', 'An den Wänden seiner Höhle türmt der Trophäenjäger Rengar die Schädel, Hörner, Klauen und Reißzähne der tödlichsten Kreaturen Valorans auf. Obschon seine Sammlung überaus umfangreich ist, bleibt er weiterhin unbefriedigt und sucht unermüdlich nach größeren Herausforderungen. Bei jedem Todesstoß nimmt er sich Zeit, studiert seine Beute, lernt von ihr und bereitet sich auf das nächste Zusammentreffen mit der einen Bestie vor, die er nie bezwingen konnte.<br><br>Rengar hat seine wahren Eltern nie gekannt, sondern wurde von einem Menschen großgezogen, den man als legendären Jäger schätzte. Er war ein musterhafter Schüler, der mit großer Wissbegierde die Lektionen seines Ziehvaters in sich aufsog und sie mit Hilfe seiner verblüffenden, tierischen Instinkte verfeinerte. Bevor seine Mähne voll ausgebildet war, brach Rengar auf eigene Faust auf und beanspruchte ein ausgedehntes Territorium für sich. An dessen Grenzen stellte er die Schädel der von ihm erschlagenen Beute auf - als Warnung an mögliche Angreifer. Er dachte, die unangefochtene Herrschaft über ein Gebiet würde ihm Erfüllung bringen, doch stattdessen wurde er rastlos. Kein wildes Tier in seinem Hoheitsgebiet stellte für ihn eine anspruchsvolle Beute dar und ohne respekteinflößende Gegner, die seine Grenzen ausloteten, schwand Rengars Kampfgeist. Er fürchtete, dass sich ihm nie wieder eine Jagd bieten würde, die ihren Namen verdiente; dass er den Nervenkitzel, den eine Jagd mit sich brachte, nie wieder spüren würde. Gerade als die Lage am aussichtslosesten schien, traf er auf das Monster. Es war eine beunruhigende, fremdartige Kreatur, die eindeutig nicht in seine Welt gehörte. Sie war mit riesigen, sensenartigen Klauen bewehrt und verschlang jedes Tier, das ihren Weg kreuzte. Durch die Aussicht auf eine Herausforderung übereifrig geworden, griff Rengar das Monster voreilig aus dem Hinterhalt an. Es war bei weitem allem, wogegen er bis zu diesem Zeitpunkt angetreten war, überlegen. Es entbrannte ein wilder Kampf und beide Seiten erlitten lähmende Wunden. Rengar verlor ein Auge, doch den herbsten Rückschlag hatte sein Stolz zu verzeichnen: Niemals zuvor hatte er versagt. Und es kam noch schlimmer: die Schwere seiner Verwundungen zwang ihn zum Rückzug. In den folgenden Tagen bewegte er sich an der Schwelle zwischen Leben und Tod. Der Schmerz machte ihm zu schaffen, doch tief in seinem Inneren verbarg sich auch ein Funken Freude. Die Jagd war eröffnet. Wenn solch mächtige Geschöpfe auf der Welt existierten, würde er sie finden und ihre Schädel besonders hoch aufspießen. Doch den Tod des Monsters wollte er auskosten. An der größten Wand seiner Höhle hält er einen Platz für den Kopf der Bestie frei, denn er schwört, dass diese Trophäe eines Tages das Herzstück seiner Sammlung bilden wird.<br><br>„Mache Jagd auf die Schwachen und du wirst überleben. Mache Jagd auf die Starken und du wirst leben.“ - Rengar<br>', 'Rengar kann eine verstärkte Variante seiner Fähigkeiten einsetzen, wenn seine Wildheit ihr Maximum erreicht hat. Versuche ihn anzugreifen, solange dies nicht geschehen ist.', 'Rengars passive Fähigkeit erlaubt es ihm, aus hohem Gras zu springen. Vermeide Kämpfe im Umfeld von hohem Gras.', 'Rengars ultimative Fähigkeit gewährt ihm vorübergehend Tarnung, weshalb du nicht alleine unterwegs sein solltest, wenn du angeschlagen bist.', 'Nutze Rengars ultimative Fähigkeit, um in Teamkämpfen und bei kleineren Gefechten wichtige Ziele aufzuspüren und diese auszuschalten.', 'Rengars Stärke basiert sehr auf seinen verstärkten Fähigkeiten, die er im richtigen Moment einsetzt, also handle bedacht!', 'Stelle sicher, dass dich dein Pfad wenn möglich durch hohes Gras führt, wenn du Gegner verfolgst, um Rengars passive Fähigkeit nutzen zu können.', 0, 0, 487, 1247, ' Assassin Fighter'),
(78, 'Warwick', 19, '2014-10-21 17:54:20', '2015-04-09 10:19:44', 'Warwick', 125.00, 30.00, 240.40, 62.43, 592.64, 98.00, 3.38, 25.88, 0.60, 8.39, 0.00, 1.25, 8.11, 2.88, 32.10, 345.00, -0.08, 0.00, 0.80, 3.50, 'Der Blutjäger', 'Warwick war einst ein Mann, der für seine Fähigkeit, menschliche Exemplare zum Zwecke dunkelster wissenschaftlicher Untersuchungen aufzuspüren, verehrt wurde. Als sein Ehrgeiz seine physischen Grenzen überstieg, trank er ein gefährliches Elixier, um sich in einen unaufhaltsamen Menschenjäger zu verwandeln. Doch für seine neugewonnene Stärke zahlte er einen hohen Preis.<br><br>Vor seiner Transformation fand Warwick seine Berufung in Zhaun als „Vermittler“ menschlicher Testobjekte. Die Leute betrachteten ihn aufgrund seiner einfallsreichen Methoden und seiner unbarmherzigen Zielstrebigkeit mit einer zurückhaltenden Mischung aus Furcht und Respekt. Mit seiner Reputation stiegen auch die Ansprüche, die an ihn gestellt wurden. Seine Klienten wollten seltenere und gefährlichere Exemplare und sie wollten sie schneller. Um ihren Forderungen gerecht zu werden, brauchte Warwick Stärke, die seine beschränkte menschliche Hülle übertraf. Sein langjähriger Freund, Singed, erdachte eine mächtige Rezeptur. Für das Rezept waren drei wichtige Zutaten vonnöten: Silber von den Schatteninseln, der Reißzahn eines schrecklichen Flammenfeuer-Wolfes und das Herz eines Himmelswesens. Warwick spürte die ersten beiden Ingredienzien mühelos in kürzester Zeit auf, doch die dritte erwies sich als größere Herausforderung. Er reiste nach Ionia, um Soraka, einer Kreatur, von der man glaubte, dass sie ein Kind der Sterne sei, eine Falle zu stellen. Doch sie durchschaute seine List und scheuchte ihn mit mächtiger Magie davon. Nicht dazu in der Lage, seine Niederlage zu akzeptieren, kehrte Warwick entstellt und wütend zu Singed zurück. Er forderte von dem Chemiker seinen unvollkommenen Trank, doch Singed warnte ihn, dass das Ergebnis unvorhersehbar sein würde. Die Warnung seines Freundes in den Wind schlagend, trank Warwick das Gebräu. Es verwandelte ihn in eine Kreatur, die halb Mensch, halb Wolf war, wodurch er mit purer Stärke und geschärften Sinnen beschenkt wurde. Hocherfreut begann er sofort, seine neugefundene Kraft auszutesten. Mit jedem Tag wurden seine Instinkte schärfer, doch seine menschliche Seite entglitt ihm immer mehr. Er fühlte, dass er die Kontrolle verlor: obwohl er seine Beute immer schnappte, konnte er sie oft nicht lebendig zurückbringen. Nun ist er auf der Suche nach Sorakas Herz, um seine Verwandlung zu stabilisieren, bevor sein Verstand den animalischen Trieben der Bestie nachgibt.<br><br>„Am Ende kriegt die Bestie uns alle.“ - Warwick<br>', 'Warwick ist ein sehr starker Urwaldkämpfer. „Hellsehen“ ist nützlich, um immer zu wissen, wo er sich befindet. Dies macht es leichter, ihm Hinterhalte zu legen.', 'Warwick ist ein sehr starker Gegner, wenn man alleine gegen ihn kämpft, besonders im späteren Verlauf des Spiels. Kämpf also gemeinsam mit deinen Verbündeten gegen ihn, um seine Effektivität zu senken.', 'Warwick schafft den Drachen in der Kluft der Beschwörer schon früh allein. Deshalb solltest du das ganze Spiel über versuchen, ihn davon abzuhalten, diesen zu töten.', 'Warwick ist ein besonders geeigneter Champion, um Monster im Wald zu töten. „Hungernder Schlag“ kann dein Leben aufrechterhalten, besonders wenn du die blaue Verbesserung vom uralten Golem bekommen kannst.', 'Warwicks ultimative Fähigkeit kann Treffereffekte, wie die des „Schwarzen Beils“ oder „Ende der Weisheit“, kumulieren.', '', 0, 0, 0, 2485, ' Fighter Tank'),
(79, 'Skarner', 72, '2014-10-21 17:54:20', '2015-04-09 10:19:44', 'Skarner', 125.00, 40.00, 272.20, 61.16, 601.28, 96.00, 4.20, 29.38, 0.45, 8.93, 0.00, 1.25, 7.21, 2.10, 32.10, 345.00, 0.00, 0.00, 0.85, 3.80, 'Der Kristallstachel', 'Skarner, der kristalline Wächter, verteidigt den Eingang zu einem Reich, das tief unter der Shurima-Wüste verborgen liegt. Die wenigen, die ein Überschreiten seines Herrschaftsbereiches überlebten, berichten von einer Kreatur mit furchteinflößender Intelligenz, Zorn und Präzision. Was diese gnadenlose Kreatur jedoch beschützt, weiß niemand.', 'Skarner kann fast nur im Nahkampf spürbar Schaden verursachen, also bleib ihm fern!', 'Skarners Lauftempo bleibt erhöht, solange sein Schild, „Kristallines Exoskelett“, besteht. Greife ihn an, um ihn zu verlangsamen.', 'Einige Spieler werden mit Skarner stark auf defensive Gegenstände setzen, andere hingegen eher auf ihre Offensive. Orientiere dich an ihren Gegenständen, um sie zu schlagen.', 'Deine normalen Angriffe verkürzen Abklingzeiten von „Kristallschnitt“ - warte zwischen dem Einsatz von „Kristallschnitt“, um mehr Schaden zu verursachen.', 'Baue mit „Kristallschnitt“ gegenüber Vasallen Angriffstempo auf, um dann mit voll aufgeladenem Angriffstempo in einen Kampf einzusteigen.', '„Pfählen“ eignet sich hervorragend, um einen Gegner für deine Verbündeten in Position zu bringen.', 0, 0, 440, 3091, ' Fighter Tank'),
(80, 'Malphite', 54, '2014-10-21 17:54:20', '2015-04-09 10:19:44', 'Malphite', 125.00, 40.00, 282.20, 61.97, 574.20, 90.00, 3.38, 28.30, 0.55, 8.37, 0.00, 1.25, 7.32, 3.40, 32.10, 335.00, -0.02, 0.00, 0.55, 3.75, 'Die Scherbe des Monolithen', 'Es gibt eine Welt der perfekten Harmonie, in der alle ein Teil des Ganzen sind. Der Monolith ist die Essenz aller Schöpfung und seine Bewohner sind nur kleine Teile der Gesamtheit. In seiner Symmetrie und seinem fast vollständigen Mangel an Ungewissheit ist er wunderschön. Die Felswesen, die dort leben, kennen ihren Platz und arbeiten, um ihre Pflicht voll und ganz zu erfüllen, so funktionieren sie fast wie ein Superorganismus oder Bienenstock. Malphite hat schon immer versucht, seine Möglichkeiten als Teil des Ganzen voll auszuschöpfen. Er ist ein bemerkenswertes Wesen, das versucht, eine makellose Ordnung zu erschaffen.<br><br>Eines Tages, ohne Vorwarnung, öffnete sich jedoch ein Dimensionsspalt und er wurde quer durch den Kosmos in die Welt Runeterra gerufen. Der Übergang war schmerzlich und schrecklich für ihn, da er der Melodie seines Volkes und des Monolithen entrissen wurde - Dinge, die immerfort mit ihm verbunden waren, seitdem er zur Welt kam. Er war außer sich, gefangen im Kreis der Beschwörer, als jene, die ihn gerufen hatten, ihm ihre Bitte vortrugen. Runeterra war eine Welt, deren Disharmonie sie fast verzehrte. Es war eine Welt, die Champions brauchte, die Ordnung in dieses Chaos brachten. Aus diesem Grund war das Felswesen beschworen worden, um ihnen dabei zu helfen. Jenseits seiner eigenen Angst und Sorge sah er, dass dies ein nachvollziehbares Ziel war, an dem er mitarbeiten konnte - vielleicht als einziger prädestiniert dafür. Heute fährt er wie ein Hammer auf jene herab, die Valorans Weg zur Ordnung stören, besonders wenn sie dabei Chaosmagie einsetzen. Leider hat bei Malphite auch eine Veränderung eingesetzt, da er gezwungen war, sich innerhalb der lebendigen Individualität der Welt seiner tiefen Einsamkeit zu stellen.<br><br>„Nehmt euch in Acht, Vasallen des Chaos! Der Splitter des Monolithen ist gekommen.“', 'Falls dein Champion hauptsächlich normalen Schaden verursacht, bleib besser hinter deinen Verbündeten zurück, wenn du gegen Malphite kämpfst. „Bodenschlag“ würde deinen ausgeteilten Schaden erheblich reduzieren.', 'Malphite ist einer der wenigen Tanks, die sich auf das Junglen verstehen. Pass auf, wenn er „Zerschmettern“ einsetzen kann.', '', 'Rüstung reduziert die Rate, mit der Angriffe „Granitschild“ durchdringen. Aktiviere „Brutale Schläge“, bevor ein Gegner den Schild zerstören kann, um den erlittenen Schaden zu minimieren.', 'Trotz seiner Fähigkeiten, die auf Rüstung aufbauen, benötigt Malphite in manchen Spielen Magieresistenz. In diesem Fall sollest du versuchen dir „Ägide der Legion“, „Merkurs Schuhe“ und „Schutzengel“ zu besorgen.', '', 0, 0, 292, 1509, ' Tank Fighter');
INSERT INTO `champions` (`id`, `name`, `champion_id`, `created_at`, `updated_at`, `key`, `attackrange`, `mpperlevel`, `mp`, `attackdamage`, `hp`, `hpperlevel`, `attackdamageperlevel`, `armor`, `mpregenperlevel`, `hpregen`, `critperlevel`, `spellblockperlevel`, `mpregen`, `attackspeedperlevel`, `spellblock`, `movespeed`, `attackspeedoffset`, `crit`, `hpregenperlevel`, `armorperlevel`, `title`, `lore`, `enemytips1`, `enemytips2`, `enemytips3`, `allytips1`, `allytips2`, `allytips3`, `f2p`, `sale`, `sale_price`, `votes`, `tags`) VALUES
(81, 'Yasuo', 157, '2014-10-21 17:54:20', '2015-04-09 10:19:45', 'Yasuo', 175.00, 0.00, 60.00, 55.38, 517.76, 82.00, 3.20, 24.71, 0.00, 6.51, 0.00, 0.00, 0.00, 3.20, 30.00, 345.00, -0.05, 0.00, 0.90, 3.40, 'Der entehrte Krieger', 'Yasuo ist ein Mann der Entschlossenheit, ein flinker Schwertkämpfer, der dem Wind befehligt, um seine Gegner umzufegen. Doch dieser einst so stolze Krieger fiel durch eine falsche Anschuldigung in Ungnade und wurde in einen verzweifelten Kampf ums Überleben gezwungen. Nun da sich die Welt gegen ihn gewandt hat, wird er alles in seiner Macht stehende tun, den Schuldigen büßen zu lassen und seine Ehre wiederherzustellen.<br><br>Einst war er ein brillanter Schüler an einer bekannten ionischen Schule der Schwertkunst und der Einzige seiner Generation, der es in der legendären Windtechnik zur Meisterschaft brachte. Viele glaubten, es wäre sein Schicksal, ein großartiger Held zu werden. Doch dieses Schicksal wendete sich für immer, als Noxus einfiel. Yasuo erhielt den Auftrag, einen ionischen Ältesten zu beschützen, verließ aber seinen Posten in der törichten Annahme, seine Klinge allein könnte einen Unterschied machen, und stürzte sich in die Schlacht. Als er zurückkehrte, war der Älteste erschlagen.<br><br>In Ungnade gefallen stellte sich Yasuo, bereit für seinen Fehler mit dem Leben zu zahlen. Doch musste er schockiert feststellen, dass er nicht nur der Pflichtverletzung, sondern des Mordes selbst angeklagt war. Obwohl er verwirrt und von Schuld zerfressen war, wusste er, dass der Assassine ungestraft davonkommen würde, falls er nicht unverzüglich handelte. Yasuo erhob sein Schwert gegen die Schule und kämpfte sich seinen Weg in dem Wissen frei, dass sein Verrat ganz Ionia gegen ihn aufbringen würde. Nachdem er nun zum ersten Mal in seinem Leben wahrhaftig allein war, zog er aus, um den wahren Mörder des Ältesten zu finden.<br><br>Yasuo verbrachte die nächsten Jahre damit, durch das Land zu streifen, auf der Suche nach irgendeinem Hinweis, der ihn zum wahren Mörder führen könnte. Die ganze Zeit hindurch wurde er gnadenlos von seinen ehemaligen Verbündeten gejagt und war immerfort gezwungen zu kämpfen oder zu sterben. Seine Mission trieb ihn unentwegt voran, bis er von dem einen Widersacher aufgespürt wurde, den er am meisten fürchtete - seinem eigenen Bruder, Yone.<br><br>An einen gemeinsamen Ehrenkodex gebunden verneigten sich die beiden Krieger und zogen ihre Schwerter. Leise umkreisten sie einander im Licht des Mondes. Als sie endlich voranstürmten, war Yone Yasuo in keiner Hinsicht gewachsen. Mit einem einzigen stählernen Hieb erschlug Yasuo seinen Bruder. Er ließ seine Waffe fallen und eilte an Yones Seite.<br><br>Von Gefühlen übermannt verlangte er zu wissen, wie seine eigene Verwandtschaft ihn für schuldig halten konnte. Yone sprach: „Der Älteste wurde mit der Windtechnik getötet. Wer könnte es sonst sein?“ Erkenntnis ergriff Yasuo, als er plötzlich begriff, weshalb er angeklagt worden war. Er erklärte erneut seine Unschuld und bat seinen Bruder um Vergebung. Tränen rannen über Yasuos Gesicht, als sein Bruder in seinen Armen verstarb.<br><br>Yasuo begrub Yone in der aufgehenden Sonne, doch ihm blieb keine Zeit zur Trauer. Es würde nicht lange dauern, bis andere sich an seine Spur heften würden. Die Offenbarung seines Bruders verlieh ihm neuen Antrieb. Jetzt hatte er den Hinweis, der ihn zum wahren Mörder führen würde. Er schwor einen Eid, suchte seine Habseligkeiten zusammen und zog, nachdem er einen letzten Blick auf das Grab von Yone geworfen hatte, mit dem Wind in seinem Rücken los. <br><br>„Die Geschichte eines Schwertes ist mit Blut geschrieben.“ - Yasuo<br>', 'Der Wirkungsbereich von Stahlsturm ist sehr begrenzt. Weiche seitlich aus, falls möglich.', 'Wenn Yasuo zweimal hintereinander Stahlsturm nutzt, feuert sein nächster einen Tornado ab. Sieh und höre genau hin, damit du dich aufs Ausweichen gefasst machen kannst.', 'Yasuo ist am schwächsten, wenn er gerade einen Wirbelwind entfesselt hat. Genau dann solltest du angreifen.', 'Stürme durch einen Vasallen hindurch, um Sausende Klinge bereit zu haben und deinen Gegenspieler zu jagen, sollte er fliehen. Sprinte direkt zu deinem Gegenspieler, um einen Vasallen als Fluchtmöglichkeit aufzuheben.', 'Auf Stufe 18 erreicht Yasuos Stahlsturm sein Höchst-Angriffstempo von 55 % aus Gegenständen.', 'Windschwert kann auf jedes Ziel angewendet werden, das in die Luft geschlagen ist, selbst bei denen deiner Verbündeten.', 0, 0, 0, 5107, ' Fighter Assassin'),
(82, 'Xerath', 101, '2014-10-21 17:54:20', '2015-04-09 10:19:45', 'Xerath', 525.00, 47.00, 316.96, 54.70, 514.40, 80.00, 3.00, 21.88, 0.80, 5.42, 0.00, 0.00, 6.00, 1.36, 30.00, 340.00, 0.00, 0.00, 0.55, 3.50, 'Der aufgestiegene Magier', 'Nun ist er ausgestattet mit unvorstellbarer Macht, doch einst war das Wesen, das als Xerath bekannt ist, ein Sterblicher aus Fleisch und Blut. Jetzt ist er etwas vollkommen anderes - eine Kreatur, angefüllt mit sich krümmender arkaner Energie. Aus Millennien überdauernder Gefangenschaft entlassen ist er nun bereit, seine Macht über Runeterra zu entfesseln und jeden zu vernichten, der sich ihm in den Weg stellt.', 'Xeraths Reichweite kann einschüchternd sein, aber ist man erst einmal an ihm dran, können ihm die meisten Champions leicht das Wasser reichen.', 'Xerath braucht lange, um Arkanes Ritual nutzen zu können. Achte auf seine Zauberanimationen und beginne rechtzeitig mit dem Ausweichen.', 'Schleier der Todesfee kann es für Xerath wesentlich schwerer machen, Schockkugel auf dich abzufeuern.', 'Es ist leichter, mit Arkanpuls zu treffen, wenn sich die Gegner auf dich zu oder von dir weg bewegen.', 'Auge der Zerstörung erleichtert es, mit Arkanpuls zu treffen, da das Ziel verlangsamt wird.', 'Wenn du einen Gegner mit Schockkugel betäubst, kannst du danach einen Volltreffer mit Auge der Zerstörung landen.', 0, 0, 0, 2528, ' Mage Assassin'),
(83, 'Teemo', 17, '2014-10-21 17:54:20', '2015-04-09 10:19:45', 'Teemo', 500.00, 40.00, 267.20, 47.54, 515.76, 82.00, 3.00, 24.30, 0.45, 5.74, 0.00, 0.00, 7.21, 3.38, 30.00, 330.00, -0.09, 0.00, 0.65, 3.75, 'Der flinke Späher', 'Teemo ist unter seinen Yordle-Brüdern und -Schwestern in Bandle eine Legende. Aus der Sicht eines normalen Yordle stimmt mit ihm irgendwas nicht. Auch wenn Teemo die Gesellschaft anderer Yordle genießt, besteht er auf regelmäßigen Einzelmissionen zur kontinuierlichen Verteidigung Bandles. Trotz seiner sehr herzlichen Persönlichkeit, legt sich während eines Kampfes in Teemos Kopf eine Art Schalter um, sodass die Leben, die er während seiner Patrouillenzüge beenden muss, ihn nicht belasten. Selbst als er noch ein junger Rekrut war, empfanden es seine Ausbilder und andere Lehrer als etwas beunruhigend, dass, obwohl Teemo normalerweise lieb und nett war, er todernst und höchst effizient wurde, sobald die Kampfübung begann. Teemos Vorgesetzte leiteten ihn schon bald an die Spähtrupps des Mutterschiffs weiter, eine der hervorragendsten Spezialeinheiten von Bandle neben den Megling-Kommandos.<br><br>Obwohl die meisten Yordle Solomissionen nicht mit besonders viel Raffinesse absolvieren, ist Teemo auf diesem Gebiet besonders effizient. Seine Erfolgsbilanz bei der Verteidigung Bandles gegen Eindringlinge macht ihn ohne weiteres zu einem der gefährlichsten lebenden Yordle. Doch darauf würde man im Leben nicht kommen, wenn man mit ihm bei einer Tasse Honigmet in seiner Lieblingstaverne sitzt. Bandle wählte Teemo als seinen ersten Champion aus und er war sofort in seinem Element. Seine unverkennbare Waffe - ein Blasrohr - schießt das seltene Ajunta-Gift ab, das er höchstpersönlich in den Urwäldern von Kumungu sammelt. Um mit den langen Perioden der Isolation besser zurechtzukommen, hat Teemo vor kurzem eine Freundschaft mit Tristana aufgebaut. Auch sie ist eine Liga-Championesse und Mitglied der Spezialeinheiten von Bandle. Diese Verbindung tut beiden Yordlen gut, auch wenn Valorans sensationsheischende Presse Gerüchte verbreitet, die Freundschaft würde zu einer romantischen Beziehung. Wie dem auch sei, Teemo ist in der Liga der Legenden ein Liebling der Massen und ein winziger Feind, den viele gelernt haben zu fürchten.<br><br>„Teemo bewegt sich auf einem schmalen Grat zwischen aufgewecktem Landsmann und gnadenlosem Killer, aber es gibt niemanden, den ich lieber zum Freund hätte.“ - Tristana<br>', 'Teemos „Giftschuss“ ist besonders für Spieler unangenehm, die getroffen werden und sich dann zurückziehen. Bleib daher in sicherer Entfernung, bis du selber angreifen willst.', 'Es kann nützlich sein, mit der „Linse des Orakels“ (Schmuck) Pilze an Schlüsselpunkten vorzeitig zu zerstören.', '', 'Teemos Pilze eigenen sich hervorragend, um Vasallen auszuschalten.', 'Platziere deine Pilze an Schlüsselpositionen der Karte, etwa in der Nähe des Drachens oder Baron Nashor, um Gegner aufzudecken, die versuchen, sie zu töten.', '', 0, 0, 292, 8267, ' Marksman Assassin'),
(84, 'Nasus', 75, '2014-10-21 17:54:20', '2015-04-09 10:19:45', 'Nasus', 125.00, 45.00, 275.60, 59.18, 561.20, 90.00, 3.50, 24.88, 0.50, 9.01, 0.00, 1.25, 7.44, 3.48, 32.10, 350.00, -0.02, 0.00, 0.90, 3.50, 'Der Bewahrer des Sandes', 'Für manche ist Nasus ein Halbgott, der durch die Ruinen einer uralten Zivilisation streift. Für andere ist er nichts als ein Mythos. In den Legenden ist von seiner Herrschaft über den Tod und die Zeit die Rede. Vor Jahrtausenden stand er als Bewahrer des Sandes an der Spitze der Gesellschaft Shurimas. Nun durchwandert er die ausgedörrte Wüste und sucht einen Weg, seinen Bruder Renekton den Fängen des Wahnsinns zu entreißen.', 'Solange Nasus durch seine ultimative Fähigkeit verwandelt ist, ist er stärker als die meisten Champions der Liga. Tritt ihm nur gegenüber, wenn du klar im Vorteil bist.', '„Verdorren“ auf der höchsten Stufe ist sehr effektiv, wenn es darum geht, DPS-Charakteren die Stirn zu bieten. Versuche zu vermeiden, allein davon erwischt zu werden.', 'Nasus kann man gut kiten. Versuch nicht, es mit ihm aufzunehmen, wenn er volle Trefferpunkte hat.', 'Achte darauf, mit dem „Aussaugenden Schlag“ den letzten Treffer zu erzielen. Dies hat am Ende eines Spiels große Auswirkungen.', 'Wenn du allein spielst, ist „Geisterfeuer“ bestens zum Farmen einer Lane geeignet. Wenn ihr zu zweit seid, ist es eine schlechte Wahl, wenn du dich zu weit vorwagst. Du musst die richtige Balance zwischen dem letzten Treffer durch den „Aussaugenden Schlag“ und Flächenschaden finden.', 'Wenn deine Verteidigung schwach ist, kannst du, selbst während deine ultimative Fähigkeit läuft, mit einem gezielten Fokus zu Fall gebracht werden. Versuche - auch wenn du dich auf DPS spezialisierst - ein paar Gegenstände zu kaufen, die deine Überlebenschance erhöhen.', 1, 0, 0, 1238, ' Fighter Tank'),
(85, 'Renekton', 58, '2014-10-21 17:54:20', '2015-04-09 10:19:46', 'Renekton', 125.00, 0.00, 100.00, 58.33, 572.16, 87.00, 3.10, 25.58, 0.00, 7.96, 0.00, 1.25, 0.00, 2.65, 32.10, 345.00, -0.06, 0.00, 0.75, 3.80, 'Der Schlächter des Sandes', 'Renekton war einst ein loyaler Torwächter der uralten Shurima, doch in den Jahrhunderten seit dem Niedergang dieses einst prächtigen Imperiums wurde er vom Wahnsinn zerfressen. Nun ist er wenig mehr als eine hasserfüllte Bestie, die ihren Bruder Nasus töten will, da sie ihn für seinen Geisteszustand verantwortlich macht.', 'Achte genau auf Renektons Zorn, denn so lässt sich leichter vorhersagen, wann er angreift.', 'Die Effektivität von Renektons Fähigkeiten lässt sich am einfachsten beeinflussen, indem man ihn kontinuierlich beharkt, so dass er seinen Zorn nur langsam oder überhaupt nicht aufbauen kann.', '', '„Schnitt und Tritt“ eignet sich hervorragend dafür, andere Champions zu belästigen. Benutze „Schnitt“ gefolgt von einer anderen Fähigkeit und dann „Tritt“, um wieder zu entkommen.', '„Fällen der Demütigen“ entzieht Gegnern im Umfeld eine Menge Leben, also nutze es möglichst mitten im Gerangel. Auch kannst du damit Gegnern eine nicht vorhandene Schwäche vortäuschen.', 'Abklingzeitverringerungen eignen sich besonders gut für Renekton, da er so seinen Zorn noch schneller ab- und wieder aufbauen kann.', 0, 0, 0, 1456, ' Fighter Tank'),
(86, 'Draven', 119, '2014-10-21 17:54:20', '2015-04-09 10:19:46', 'Draven', 550.00, 42.00, 310.56, 50.38, 557.76, 82.00, 3.50, 25.54, 0.65, 6.17, 0.00, 0.00, 8.04, 2.70, 30.00, 330.00, -0.08, 0.00, 0.70, 3.30, 'Der ruhmreiche Scharfrichter', 'Ganz anders als für seinen Bruder Darius war der Sieg in einer Schlacht für Draven nie genug. Er sehnte sich nach Anerkennung, Beifall und Ruhm. Zunächst suchte er in der noxischen Armee nach wahrer Größe, doch sein Sinn für das Dramatische wurde dort nicht ausreichend gewürdigt. Erpicht darauf, eine Methode zu finden, „Draven“ mit der ganzen Welt zu teilen, richtete er seine Aufmerksamkeit sodann auf das Strafvollzugswesen. Dort erarbeitete er sich die Berühmtheit, nach der er sich sehnte, indem er das lästige Geschäft der Exekutionen in ein ausgemachtes Spektakel verwandelte.<br><br>Bei Dravens erster Hinrichtung schockierte er die Zuschauer, als er dem verurteilten Gefangenen befahl, um sein Leben zu rennen. Kurz bevor der Mann es geschafft hatte, außer Sichtweite zu fliehen, brachte Draven ihn mit einem tadellosen Wurf seiner Axt zu Fall. Schon bald wurden Dravens Hinrichtungen zu einem Spießrutenlauf, bei dem noxische Gefangene um ihre letzte Chance im Leben rannten. Draven nutzte diese Prozesse als seine eigene persönliche Bühne und machte Exekutionen zu einer beliebten Form der Unterhaltung. Er stachelte die Schaulustigen zu wahren Begeisterungsstürmen an, während verzweifelte Häftlinge darum rangen, ihm zu entkommen. Keiner von ihnen hatte Erfolg. Nachdem er die ehrwürdigen, schwarzen Uniformen der noxischen Henker abgeschafft hatte, legte Draven strahlende Kleider an und entwickelte eine protzige, unverwechselbare Art sich zu bewegen, um sich zu profilieren. Die Massen strömten herbei, um Draven in Aktion zu erleben, und schnell verbreiteten sich Geschichten über seine Darbietungen. Mit seiner Popularität wuchs auch sein bereits überdimensioniertes Ego. Er musste immer im Mittelpunkt der Aufmerksamkeit stehen. Binnen kürzester Zeit wuchsen seine Ambitionen über die Grenzen Noxus und seiner Bevölkerung hinaus. Er entschied, dass die glorreichen Taten des Draven der gesamten Welt zur Schau gestellt werden sollten.<br><br> „‚Das Beste'' ist immer dort, wo ich am jeweiligen Tag entscheide, die Messlatte anzulegen.“ - Draven<br>', 'Versuche mit Skillshots auf die Landeposition von Dravens „Wirbelnde Axt“ zu zielen.', 'Störe Draven, damit er seine Äxte fallen lässt. Seine Stärke sinkt so erheblich.', '', 'Wenn sich Draven nicht bewegt, schlägt „Wirbelnde Axt“ in seiner Nähe auf. Sie landet direkt an seiner Position oder leicht links oder rechts.', 'Bewegt sich Draven nach dem Angriff, fällt „Wirbelnde Axt“ in seine Bewegungsrichtung. Nutze dies, um zu bestimmen, wohin die Axt fallen soll.', '', 0, 0, 0, 3922, ' Marksman'),
(87, 'Shaco', 35, '2014-10-21 17:54:20', '2015-04-09 10:19:46', 'Shaco', 125.00, 40.00, 297.20, 57.58, 582.12, 84.00, 3.50, 24.88, 0.45, 8.37, 0.00, 1.25, 7.16, 3.00, 32.10, 350.00, -0.10, 0.00, 0.55, 3.50, 'Der dunkle Hofnarr', 'Die meisten würden sagen, der Tod sei nicht lustig. Ist er auch nicht, außer man ist Shaco - dann ist er zum Schreien komisch. Er ist Valorans erster voll funktionstüchtiger mörderischer Komiker; er reißt Witze, bis jemand abkratzt, und dann lacht er. Die Gestalt, die mittlerweile als der dunkle Hofnarr bekannt ist, ist ein Rätsel. Niemand kann mit voller Sicherheit sagen, woher er einst kam, und Shaco verrät nie Einzelheiten über sich. Ein weit verbreiteter Glaube besagt, er sei nicht von Runeterra - er sei ein Ding, das aus einer dunklen und verdrehten Welt beschworen wurde. Andere wiederum denken, er wäre eine Manifestation der menschlichen, dunklen Triebe, weshalb er unaufhaltsam wäre. Der plausibelste Gedanke ist, er sei ein Auftragsmörder, der seinem eigenen wahnsinnigen Treiben überlassen wird, bis man seine Dienste benötigt. Auf jeden Fall ist Shaco ein listiger Kerl, der jeder Autorität entwischt, die ihn womöglich über irgendeine entsetzliche, gesetzesbrecherische Gräueltat befragen wollte. Auch wenn solcher Tratsch die Bewohner Valorans beruhigen mag, scheint es unvorstellbar, dass solch ein Verbrecher frei herumlaufen darf.<br><br>Welche Wahrheit auch immer hinter seiner Geschichte steckt, Shaco ist der Liga der Legenden aus Gründen beigetreten, die nur er kennt. Er ist eine schreckenerregende Figur, die meist sowohl von seinen Teammitgliedern als auch von den Medien gemieden wird. Nur die Beschwörer der Kriegsakademie wissen, weshalb solch einer Kreatur die Aufnahme in die Liga erlaubt wurde, doch die meisten Bewohner Runeterras glauben, dass dies die einzige Möglichkeit ist, den schwer fassbaren Shaco in Zaum zu halten. Es ist wenig überraschend, dass dieser Champion an Orten beliebt ist, an denen der Wahnsinn regiert - so ist er besonders gefragt bei den machthungrigen Beschwörern aus Zhaun und Noxus.<br><br>„Was auch immer du tust, sag ihm nur nicht, du hättest die Pointe nicht verstanden.“', 'Falls sich Shaco bereits in der frühen Spielphase gut schlägt, kann es sinnvoll sein, magische Augen zu kaufen.', 'Falls Shaco „Täuschen“ benutzt, um in einen Kampf einzugreifen, dann kann er es so schnell nicht wieder benutzen. Arbeite mit deinem Team zusammen, um ihn schnell niederzuringen.', '', 'Für Teamkämpfe ist mindestens eine Stufe in „Springteufel“ sehr wichtig, da er dazu benutzt werden kann, um viele Gegner auszuschalten.', 'Benutze „Täuschen“ durch Absätze oder Wände auf der Karte, um sicher zu entkommen.', 'Versuche Gegenstände zu wählen, die deinem Abbild ebenfalls Fähigkeiten geben.', 0, 0, 0, 210, ' Assassin'),
(88, 'Swain', 50, '2014-10-21 17:54:20', '2015-04-09 10:19:46', 'Swain', 500.00, 50.00, 324.00, 52.04, 516.04, 78.00, 3.00, 22.72, 0.80, 7.84, 0.00, 0.00, 6.00, 2.11, 30.00, 335.00, 0.00, 0.00, 0.65, 4.00, 'Der Meister der Taktik', 'Den frühesten Bericht über Swains Existenz haben wir aus den Notizen eines Krankenhausarztes aus Noxus. Diesen ist zu entnehmen, dass Swain klaglos und ohne zu schreien in die Station humpelte. Sein rechtes Bein war in zwei Hälften geteilt, aus der Haut stach der Knochen hervor. Ein kleiner, mürrischer Vogel schien an seiner Schulter befestigt. Der Doktor riss, vom Schrecken erfasst, die Augen auf, als der junge Heranwachsende Fragen über seine Gesundheit und sein Alter mit starrem, ruhigem Blick beantwortete. Weder angesichts des schallenden Krachens, als die Sandgewichte sein Schienbein wieder einrenkten, flackerte sein starrer Blick, noch zuckten seine Augen beim Aufplatzen seines Wadenbeines. Er lehnte die Empfehlung des Doktors ab, er solle dem inoperablen Schaden an seinem Bein eine magische Behandlung zukommen lassen, bat nur um eine nicht mehr gebrauchte Krücke und schlurfte von dannen. Als nächstes taucht er in Dokumenten des noxischen Militärs auf, auch wenn offensichtlich ist, dass diese nicht vollständig sind. Normalerweise würde ein verkrüppelter Junge mit Schimpf und Schande von der stolzen Legion Noxus'' vertrieben werden, doch die Aufzeichnungen über ihn belegen, dass der erste für ihn vorgesehene Dienstgrad der eines hochrangigen Offiziers war.<br><br>Die Männer, die unter ihm gedient (und überlebt) haben, blieben mit unerschütterlichem Glauben und grenzenloser Loyalität unter seinem Kommando. Er sprang die Hierarchie des Oberkommandos empor, indem er oft aufstieg, wenn Vorgesetzte um Herabstufung ihres Ranges baten, um seiner Einheit zugeteilt werden zu können. Als gerissener Stratege wurde Swain nach jeder Schlacht, die er geschlagen hatte, ausgezeichnet. Regelmäßig hinkte er in innerer Einkehr an der Spitze des Angriffs voran. Sein Aufstieg zur Macht schien unaufhörlich, bis er plötzlich, kurz vor der ionischen Invasion, in den inaktiven Dienst verbannt wurde - eine verblüffende Entscheidung, die förmlich nach bürokratischen Ränkespielen stinkt. Falls Swain über die Ereignisse, die sich zutrugen, erbost war, zeigte er dies nie. Sein Gesicht war so undurchschaubar, dass überall das Gerücht ging, es wäre eine Maske, die etwas vollkommen Unmenschliches hinter sich verbirgt. Noch mehr Spekulationen gab es um den Vogel, der nie seine Schulter verließ und dessen Namen er nur dem Tier selbst zuflüsterte. Als Demacia seine Präsenz in der Liga ausweitete, wurde Swain umgehend wieder in den aktiven Dienst versetzt.<br><br>„Wenn du die Fähigkeit zu bitten noch nicht verloren hast, darfst du noch nicht um Linderung bitten.“ - Swain<br>', 'Swain kann einen einzelnen Angreifer leicht ausschalten. Spreche dich mit deinen Verbündeten ab, wenn du ihn überrumpeln willst.', 'Eine hohe Beweglichkeit kontert alle von Swains grundlegenden Fähigkeiten: Entfernt man sich vom Raben, wird die Verlangsamung aufgehoben. Außerdem ist es leichter, „Nimmergeh''r“ auszuweichen und fokussierte Angriffe unter dem Einfluss von „Qual“ zu vermeiden.', '', 'Solltest du Probleme haben, „Nimmergeh''r“ effektiv einzusetzen, verlangsame dein Ziel zunächst mittels „Vergreisung“.', 'Kämpfst du auf einer Lane, versuche die Stärke deines Gegners einzuschätzen, um mit „ausgehungerte Schar“ angemessen aggressiv vorzugehen. Bei stärkeren Gegnern kann es vorteilhafter sein, stattdessen „Nimmergeh''r“ und „Qual“ aus der Entfernung einzusetzen.', '', 1, 0, 0, 2720, ' Mage Fighter'),
(89, 'Ziggs', 115, '2014-10-21 17:54:20', '2015-04-09 10:19:47', 'Ziggs', 550.00, 50.00, 334.00, 54.21, 524.40, 80.00, 3.10, 21.54, 0.80, 6.25, 0.00, 0.00, 6.00, 2.00, 30.00, 325.00, -0.05, 0.00, 0.60, 3.30, 'Der Hexplosions-Experte', 'Ziggs kam mit einem Talent für das Herumfriemeln auf die Welt, aber seine chaotische, hyperaktive Art war unter den Yordle-Wissenschaftlern untypisch. Da er ein verehrter Erfinder wie Heimerdinger werden wollte, verfolgte er mit wahnsinnigem Eifer ein ambitioniertes Ziel nach dem anderen, wobei ihm sowohl seine explosiven Misserfolge als auch seine noch nie dagewesenen Entdeckungen immer wieder neuen Mut machten. Bald schon gelangte die Kunde von Ziggs'' explosiver Experimentierfreude auch an die berühmte Yordle-Akademie in Piltover und ihre angesehenen Professoren luden ihn ein, sein Können zu demonstrieren. Dank der ihm eigenen Missachtung von Sicherheitsvorkehrungen fand die Präsentation jedoch ein jähes Ende, als der Hextech-Motor, den Ziggs vorführte, überhitzte und schließlich in die Luft flog, wobei er ein riesiges Loch in der Mauer der Akademie hinterließ. Die Professoren klopften sich den Staub von den Kleidern und bedeuteten ihm eindringlich zu gehen. Am Boden zerstört bereitete sich Ziggs darauf vor, in Schande nach Bandle zurückzukehren. Doch bevor er seine Heimreise antreten konnte, drang eine Gruppe zhaunitischer Agenten in die Akademie ein und nahm die Professoren als Geiseln. Das Piltover-Militär verfolgte die Gefangenen bis zu einem zhaunitischen Gefängnis, doch ihre Waffen waren nicht in der Lage, dessen verstärkte Mauern zu zerstören. Fest entschlossen es besser zu machen als sie, begann Ziggs damit, an einer neuen Art von Waffe herumzuexperimentieren, und stellte schnell fest, dass er seine unglückselige Zerstörungsgabe nutzen konnte, um die entführten Yordle zu retten.<br><br>Nach kurzer Zeit hatte Ziggs eine Reihe kraftvoller Bomben entwickelt, die er liebevoll „hexplosiv“ nannte. Mit seinen neuen Kreationen im Gepäck, die nur darauf warteten zum ersten Mal getestet zu werden, machte Ziggs sich auf den Weg nach Zhaun und schlich sich auf das Gefängnisgelände. Er feuerte eine gigantische Bombe auf das Gefängnis ab und sah mit Entzücken zu, wie die Explosion ein Loch in die verstärkte Mauer riss. Als sich der Rauch gelegt hatte, kletterte er in die Anlage und brachte die Wachen mithilfe eines Hagels weiterer Bomben zum Rennen. Er eilte zu der Zelle, sprengte die Tür aus ihren Angeln und geleitete die gefangengenommenen Yordle in die Freiheit. Als sie in die Akademie zurückkehrten, würdigten die gedemütigten Professoren Ziggs mit einem Ehrentitel - Dekan der Zerstörung - und schlugen ihm vor, diese neue Form des Yordle-Einfallsreichtums der Liga der Legenden vorzuführen. Da er nun endlich Anerkennung gefunden hatte, nahm Ziggs den Vorschlag an und war erpicht darauf, seine immer größer werdende Bandbreite an hexplosiven Vorrichtungen auf dem größten Testfeld der Welt zur Anwendung zu bringen: den Richtfeldern.<br><br>„Ziggs? Unberechenbar, gefährlich, ja, auf jeden Fall. Aber ziemlich brillant!“ - Heimerdinger<br>', 'Tritt nicht auf Ziggs'' Minen! Sie verlangsamen dich, wodurch er dich mit seinen anderen Fähigkeiten viel leichter treffen kann.', 'Viele von Ziggs'' Fähigkeiten besitzen lange Abklingzeiten. Versuche ihn zu erwischen, wenn er sie gerade erst eingesetzt hat.', 'Ziggs'' ultimative Fähigkeit, „Megainferno-Bombe,“ verursacht im Zentrum der Explosion mehr Schaden.', 'Selbst wenn du zu weit für einen Kampf entfernt bist, kannst du dennoch aus der Distanz mit „Megainferno-Bombe“ helfen.', 'Verlangsame deine Gegner mit „Hexplosives Minenfeld“, um mit anderen Fähigkeiten leichter zu treffen.', 'Die Möglichkeit, sich selbst mit „Sprengladung“ über Hindernisse zu katapultieren, kann auf der Flucht oder bei einer Verfolgung nützlich sein.', 0, 0, 0, 3319, ' Mage'),
(90, 'Janna', 40, '2014-10-21 17:54:20', '2015-04-09 10:19:47', 'Janna', 475.00, 64.00, 409.52, 51.96, 487.04, 78.00, 2.95, 19.38, 0.40, 5.42, 0.00, 0.00, 9.00, 2.61, 30.00, 335.00, 0.00, 0.00, 0.55, 3.80, 'Die Wut des Sturms', 'Es gibt Zauberer, die sich den wilden Kräften der Natur voll und ganz hingeben und die angestammten Pfade der Magie verlassen. Solch eine Zauberin ist Janna, die zum ersten Mal mit der Magie in Berührung kam, als sie als Waise im Chaos der Stadt Zhaun aufwuchs und auf den Straßen zurechtkommen musste. Das Leben war hart für das schöne, junge Mädchen. Sie überlebte durch ihre Cleverness und das Stehlen, wenn die Cleverness nicht ausreichte. Die ungezügelte Magie Zhauns war für Janna das erste und verführerischste Werkzeug, sich sowohl zu schützen als auch zu erheben. Janna bemerkte, dass sie eine Neigung für eine bestimmte Art von Magie hatte - die Elementarmagie der Luft. Sie schloss ihre Studien über die Luftmagie in nur wenigen Monaten ab, fast so, als wäre sie aus ihr geboren worden. Nahezu über Nacht wandelte sie sich von einem Straßenkind zu einem Avatar der Lüfte, wobei sie jene beeindruckte und übertraf, die sie unterrichteten. Diese rasante Entwicklung änderte auch ihre physische Erscheinung und verlieh ihr ein überirdisches Aussehen.<br><br>Jannas Ziel, die Ungerechtigkeit der Welt zu bekämpfen und dem Wahnsinn der Stadt Zhaun ein Ende zu bereiten, veranlasste sie, ihre ätherischen Fähigkeiten in die Dienste der Liga der Legenden zu stellen. Sie ist eine Stimme für die Regulierung magischer Experimente und eine Unterstützerin der Entwicklung der Techmaturgie, wodurch sie zur indirekten Verbündeten des Stadtstaates Piltover und der beeindruckenden techmaturgischen Vordenker, die dort leben, geworden ist. Zudem ist Janna besonders beliebt bei den vielen Fans der Liga. Oft steht sie bei Aufgaben, Fan-Tagen und anderen Ereignissen mit viel Prominenz im Mittelpunkt des Interesses. Doch Janna hat auch etwas Unnahbares an sich und ihre Gunst kann so schnell umschlagen wie der Wind.<br><br>„Lasst euch von ihrer Schönheit nicht bezaubern. Wie der Wind kann sie mit einer einzigen Böe schreckliche Zerstörung anrichten.“', 'Behalte gegen Janna eine Möglichkeit zu unterbrechen in der Hinterhand, falls sie ihre ultimative Fähigkeit einsetzen will.', 'Achte auf das Geräusch der Aufladung von „Heulender Sturm“, falls Janna versucht, dich von außerhalb der Sichtweite oder aus einem Gebüsch heraus zu treffen.', 'Janna ist am stärksten, wenn sie anderen Verbündeten Verbesserungen gewährt. Wenn du ihre Verbündeten drangsalierst, wird das ihre Fähigkeit, gegen dich zu kämpfen, verringern.', 'Das Auge des Sturms kann auf verbündete Türme angewendet werden.', 'Die Verwendung von Heulender Sturm, ohne vollständige Aufladung, kann benutzt werden, um das gegnerische Team auszuschalten.', 'Der Einsatz von Jannas Ultimativer Fähigkeit kann Gegner von einem verwundeten Verbündeten wegstoßen oder sogar Gegner voneinander trennen.', 0, 0, 0, 1547, ' Support Mage'),
(91, 'Talon', 91, '2014-10-21 17:54:20', '2015-04-09 10:19:47', 'Talon', 125.00, 40.00, 327.20, 55.21, 582.80, 85.00, 3.10, 26.88, 0.50, 8.51, 0.00, 1.25, 7.59, 2.70, 32.10, 350.00, -0.06, 0.00, 0.75, 3.50, 'Der Klingenschatten', 'Talons früheste Erinnerungen sind jene an die Dunkelheit der Gänge von Noxus'' Untergrund und das beruhigende Gefühl des Stahls einer Klinge. Erinnerungen an eine Familie, Wärme oder Güte fehlen ihm. Stattdessen sind das Klimpern gestohlenen Goldes und die Sicherheit einer Mauer in seinem Rücken alles, wonach er je verlangte. Nur durch seinen wachen Verstand und geschickte Diebstähle am Leben gehalten, fristete Talon sein Dasein im zwielichtigen Bauch von Noxus. Sein Können im Umgang mit der Klinge ließ ihn zu einer Gefahr werden und so schickten noxische Gilden Assassinen nach ihm aus und stellten ihn vor die Wahl: ihnen beitreten oder getötet werden. Als Antwort hinterließ er die Leichname seiner Verfolger im modrigen Stadtgraben von Noxus.<br><br>Die Mordversuche wurden immer gefährlicher, bis ein Assassine in einem Wettkampf, in dem er all seine Kraft aufbieten musste, mit Talon die Klingen kreuzte. Zu seiner Überraschung wurde Talon entwaffnet und sah sich dem Schwert seines Scharfrichters gegenüber, als der Assassine sich als General Du Couteau zu erkennen gab. Der General bot Talon die Wahl zwischen dem Tod von seiner Hand und dem Leben eines Agenten des Oberkommandos von Noxus. Talon wählte das Leben, unter der Bedingung, dass er nur Du Couteau allein diene, denn die einzigen Befehle, die er respektieren könne, seien die desjenigen, den er nicht besiegen könne. Talon blieb in den Schatten und führte geheime Missionen auf Du Couteaus Befehl hin aus, die ihn von den eisigen Ländern Freljords bis ins Allerheiligste der Stadt Bandle führten. Als der General verschwand, dachte Talon darüber nach, seine Freiheit zurückzufordern, doch er hatte einen immensen Respekt gegenüber Du Couteau entwickelt, nachdem er ihm jahrelang gedient hatte. Er wurde ganz besessen davon, den Aufenthaltsort des Generals ausfindig zu machen. Talons Verdachtsmomente führten ihn zu den Toren der Kriegsakademie, wo er der Liga der Legenden beitrat, um die für das Verschwinden Du Couteaus Verantwortlichen zu finden.<br><br>„Die drei tödlichsten Klingenmeister in ganz Valoran sind mit dem Hause Du Couteau verbunden: mein Vater, ich selbst und Talon. Fordere uns heraus, wenn du dich traust.“ - Katarina Du Couteau<br>', 'Talon setzt nur auf normalen Schaden. Konzentriere dich früh auf Rüstung, um seinen Schaden zu senken.', 'Talon setzt stark auf „Schattenangriff“, um aus einem Kampf zu entkommen. Ohne ist er deutlich verwundbarer.', 'Talon kann sich nicht heilen oder vor Schaden schützen. Wird er in der Lane geschwächt, muss er sich möglicherweise zurückziehen.', '„Noxische Diplomatie“ ergänzt sich gut mit „Kehlenschnitt“. Versuche „Noxische Diplomatie“ zu aktivieren, bevor du mit „Kehlenschnitt“ zu einem Gegner springst.', '„Schattenangriff“ ist ein mächtiges Fluchtmittel, kann aber auch beim Angriff auf eine Gruppe eingesetzt werden.', 'Denke daran, dir Ziele vor einem Kampf auszusuchen. Es kann von Vorteil sein, alle von Talons Fähigkeiten auf ein einzelnes Ziel zu konzentrieren, sie aufzuteilen ist jedoch selten sinnvoll.', 0, 0, 0, 4970, ' Assassin Fighter'),
(92, 'Orianna', 61, '2014-10-21 17:54:20', '2015-04-09 10:19:47', 'Orianna', 525.00, 50.00, 334.00, 40.37, 517.72, 79.00, 2.60, 17.04, 0.80, 6.87, 0.00, 0.00, 6.00, 3.50, 30.00, 325.00, -0.05, 0.00, 0.55, 3.00, 'Die Aufziehpuppe', 'Es gab in Piltover einst einen Mann mit Namen Corin Reveck, dessen Tochter auf den Namen Orianna hörte und die er über alles in der Welt liebte. Trotz ihres unglaublichen tänzerischen Talentes war sie sehr fasziniert von den Champions der Liga der Legenden. Diese Faszination führte soweit, dass sie damit begann, zu trainieren, um auch eine Championesse werden zu können. Unglücklicherweise führten der Umstand, dass sie so gut behütet war, und ihre blauäugige Naivität dazu, dass sie unnötige und gefährliche Risiken einging, die am Ende zu ihrem tragischen Ableben führten. Nach Oriannas Tod war Corin am Boden zerstört, verfiel in tiefe Depression und entwickelte eine Obsession für die Techmaturgie. Er konnte die Leere, die der Tod seiner Tochter in seinem Leben hinterlassen hatte, nicht ertragen, deshalb entschloss er sich dazu, einen Ersatz zu konstruieren - einen, der Oriannas Traum, der Liga beizutreten, Realität werden lassen sollte. Was daraus hervorging, ist die Aufzieh-Tötungsmaschine, die Corin nach seiner Tochter benannt hat. Wohlwissend, dass sie geschaffen wurde, eine Championesse zu werden, und in Anbetracht der Art und Weise, wie sich die Zeiten änderten, kreierte er die Kugel als ihren Begleiter und Beschützer. Diese nahezu symbiotische Schöpfung bedient sich einer anderen Art der Techmaturgie, die sich eher auf Elektrizität als auf einen Aufziehmechanismus stützt.<br><br>Orianna und die Kugel kämpfen nun als Champions in der Liga der Legenden, ihre manchmal fehlgeleitete Moral als Kompass nutzend. Sie versucht ernsthaft zu denen zu gehören, die um sie herum sind. Doch wie hart sie auch daran arbeitet, Orianna wird nie menschlich sein können und es bleibt immer etwas Nervenzermürbendes und Andersartiges an ihr. Auch wenn sie sich um soziale Interaktion mit den anderen Champions in der Liga der Legenden bemüht, gibt es nur wenige, die über ihre fremdartige Natur hinwegsehen können. Für die meisten ist es, als gäbe es in ihrem Inneren nur Leere, als wäre Orianna nur ein seelenloses Uhrwerk - wenn auch ein gefährliches, tödliches. Doch in den Augen ihres Vaters ist sie für alle Zeit die perfekte Tochter.<br><br>„Tanz'' mit mir, mein Begleiter. Tanz'' mit mir in das Vergessen.“', 'Orianna kann nur auf den Bereich um ihre Kugel einwirken. Nutze dies zu deinem Vorteil.', 'Achte darauf, wenn Oriannas Kugel zu ihr zurückkehrt, weil sie sich zu weit entfernt hat. Dies kann zu unerwarteten Situationen führen.', '', '„Befehl: Beschützen“ kann auf Orianna selbst angewendet werden, damit die Kugel schnell zu ihr zurückkehrt. Zusammen mit „Befehl: Angriff“ lassen sich so Gegner leicht beharken.', '„Befehl: Dissonanz“ ist sehr gut für eine Flucht geeignet, wenn Orianna die Kugel besitzt. Die Kombination aus erhöhtem Lauftempo und verlangsamendem Hindernis kann sich als sehr mächtig erweisen.', '„Befehl: Schockwelle“ kann mit der richtigen Positionierung der Kugel Gegner von Orianna weg- oder auf sie zuschleudern.', 0, 0, 0, 1149, ' Mage Support'),
(93, 'Fiddlesticks', 9, '2014-10-21 17:54:20', '2015-04-09 10:19:48', 'FiddleSticks', 480.00, 59.00, 350.12, 48.36, 524.40, 80.00, 2.62, 20.88, 0.80, 5.61, 0.00, 0.00, 6.00, 2.11, 30.00, 335.00, 0.00, 0.00, 0.60, 3.50, 'Der Unheilsbote', 'Für fast zwanzig Jahre hat Fiddlesticks allein im östlichsten Beschwörungszimmer der Kriegsakademie gestanden. Nur das brennende, smaragdgrüne Licht seines überirdischen Blickes durchsticht die muffige Dunkelheit seines staubbedeckten Heims. Hier hält der Unheilsbote stille Totenwache. Seine Geschichte von amoklaufender Macht soll allen Beschwörern innerhalb der Liga als warnendes Beispiel dienen. Vor Jahrzehnten lebte ein mächtiger Runenmagier aus Zhaun - Istvaan. Am Ende des fünften Runenkrieges wurde er zu einem der ersten Beschwörer der Liga. Den alten Gewohnheiten der Magier noch zu sehr verhaftet, brach Istvaan jedoch immer und immer wieder den Verhaltenskodex der Liga. In seinem allerletzten Kampf schoss er letztendlich über das Ziel hinaus. Er schloss sich selbst in die östlichste Beschwörungskammer ein und begann die am strengsten verbotenen Beschwörungsrituale zu vollführen - eine extra-planare Beschwörung.<br><br>Was genau innerhalb dieses Zimmers geschah, bleibt verborgen. An diesem Tag kam kein Champion, um Zhaun in der Kluft der Beschwörer zu repräsentieren. Auf wiederholtes Klopfen an der Tür hallte nur Stille wider. Der erste Lehrling, der eintrat, wurde in derselben Sekunde von einer überirdischen Sense getötet. Die wenigen, die ihm folgten und überlebten, wurden wahnsinnig vor Angst und sind nur mehr Hüllen von Männern, die etwas über Krähen und den Tod stammeln. Aus Angst vor dem Bösen, das selbst Istvaan nicht beherrschen konnte, versiegelte die Liga alle Zugänge zu der Kammer, in der Hoffnung, sie könnten zumindest kontrollieren, was sie nicht zerstören können. Jahre vergingen, doch die hölzerne Kreatur im Inneren bewegte sich nicht, außer um jeden zu töten, der dumm genug war, einzutreten. Da sie keinen Weg sahen, das Zimmer wieder in Besitz nehmen zu können, ersann der Rat stattdessen eine Aufgabe für Fiddlesticks: Henker. Auch wenn er auf den Richtfeldern zum Leben erwacht und sich den Regeln der Beschwörung scheinbar unterwirft, weiß niemand, worauf er in seinem Zimmer wartet. Sein regungsloses Gesicht gibt keinerlei Anhaltspunkte und seine Sense steht bereit, jeden niederzumähen, der vor ihm steht.<br><br>„Jene, die sagen ‚Du musst nichts fürchten, außer die Furcht selbst‘, haben die Krähen noch nicht gespürt.“', 'Vermeide es, in der Nähe deiner Verbündeten anzugreifen. „Dunkler Wind“ prallt zwischen dir und ihnen hin und her und verlängert so die Dauer der Verstummung.', 'Wenn Fiddlesticks seinen „Krähenschwarm“ aktiviert hat, versuch eine Betäubung oder Verlangsamung auf ihn wirken zu lassen und beweg dich für die Dauer des Zaubers aus seinem Wirkungsbereich.', 'Wenn Fiddlesticks nirgends zu sehen ist, achte auf einen Hinterhalts-„Krähenschwarm“ aus dem Gebüsch heraus.', 'Töte mit „Dunkler Wind“ viele Vasallen und setze „Entziehen“ ebenfalls gegen diese ein, um möglichst viel Leben zu gewinnen.', 'Wende „Erschrecken“ auf deine Gegner an, bevor du „Krähenschwarm“ oder „Entziehen“ aktivierst, um maximalen Schaden zu verursachen.', 'Fiddlesticks ist sehr verletzbar, wenn du Gegenstände mit Fähigkeitsstärke verwendest. Versuch ein Gleichgewicht zwischen Offensive und Defensive durch Runen, Meisterschaften und Gegenstände zu schaffen.', 0, 0, 0, 1614, ' Mage Support'),
(94, 'Fiora', 114, '2014-10-21 17:54:20', '2015-04-09 10:19:48', 'Fiora', 125.00, 40.00, 287.20, 59.88, 592.80, 85.00, 3.20, 24.88, 0.50, 6.84, 0.00, 1.25, 7.59, 3.00, 32.10, 350.00, -0.07, 0.00, 0.80, 3.50, 'Die große Duellantin', 'Fiora, Demacias berüchtigtste Duellantin verdiente sich ihren Ruhm mit ihrer scharfen Klinge und ihrer noch schärferen Zunge. Sie rühmt sich einer vornehmen, aristokratischen Erziehung und ihrer leidenschaftlichen Hingabe, ihre Kunst zu perfektionieren. Nachdem sie die Gleichaltrigen in ihrer Heimat um Längen hinter sich gelassen hat, ist Fiora nun auf der Suche nach mächtigeren Gegnern. Sie wird erst ruhen, wenn die Welt ihre Meisterschaft anerkannt hat.<br><br>Als jüngster Spross des Hauses Laurent, einer Familie, die für ihre lange Ahnenreihe herausragender Duellanten bekannt ist, verstand sich Fiora immer als zu Großem berufen. Sie strebte danach, so geschickt in der Kunst des Duellierens zu werden wie ihr Vater, ein legendärer Schwertkämpfer, und ihr Talent reichte schon bald über das ihrer Geschwister hinaus. Gleichaltrige empfanden Fioras Selbstbewusstsein als Arroganz, doch sie kümmerte sich nicht darum und arbeitete nur noch härter daran, eine würdige Nachfolgerin ihres Vaters zu werden. Ihre Hingabe erwies sich jedoch als unangebracht. Am Vorabend eines arrangierten Duells wurde Fioras Vater dabei ertappt, wie er ein langsam wirkendes Lähmungsgift in das Getränk seines Kontrahenten schüttete. Sein Betrug zerstörte das Ansehen der Familie und auch Fioras Ehrenhaftigkeit wurde in Frage gestellt. Außer sich vor Wut und bestrebt, ihren Namen reinzuwaschen, forderte sie ihren Vater zu einem Duell heraus. Auch wenn dieser mit Kraft und Stil kämpfte, wurde ihr klar, dass der Mann die Disziplin, die einen wahren Duellanten ausmachte, verloren hatte. Sie entwaffnete ihn und mit der Klinge an seiner Brust forderte sie von ihm die Kontrolle über das Haus Laurent. Ihr Vater gab auf, doch selbst im Moment des Sieges wusste Fiora, dass ihr Ansehen noch immer befleckt war. Gewillt ihr Schicksal selbst in die Hand zu nehmen, schwor Fiora das falsche Erbe ihres Vaters zu überwinden und zu beweisen, dass sie nicht nur die beste Duellantin Damacias, sondern ganz Valorans ist.<br><br>„Ich bin hierhergekommen, um mich einer Herausforderung zu stellen. Ist das alles, was diese Narren zu bieten haben?“ - Fiora<br>', 'Spare dir kampfunfähig machende Effekte auf und nutze sie, wenn Fiora „Temposchub“ einsetzt - die Wirkung hält nur 3 Sekunden lang an und Fiora muss währenddessen so viel Schaden wie möglich verursachen.', 'Fiora kann sehr gut an Gegnern dranbleiben, solange sie auf „Ausfallschritt“ zurückgreifen kann. Nach zwei Aktivierungen fällt die Abklingzeit jedoch recht lange aus, was sie verwundbar macht.', '', 'Die Regeneration von „Duellantin“ wirkt kumulativ gegen Champions, weshalb man um kleinere Geplänkel keinen Bogen machen sollte.', '„Klingenwalzer“ verursacht nicht nur Schaden, sondern verhindert auch, dass dich der Gegner als Ziel wählen kann.', '', 0, 0, 0, 1415, ' Fighter Assassin'),
(95, 'Cho''Gath', 31, '2014-10-21 17:54:20', '2015-04-09 10:19:48', 'Chogath', 125.00, 40.00, 272.20, 61.16, 574.40, 80.00, 4.20, 28.88, 0.45, 8.93, 0.00, 1.25, 7.21, 1.44, 32.10, 345.00, 0.00, 0.00, 0.85, 3.50, 'Der Schrecken der Leere', 'Es gibt einen Ort zwischen den Dimensionen, zwischen den Welten. Einigen ist er als die Außenwelt bekannt, anderen nur als das Unbekannte. Für jene aber, die wirklich wissen, ist es die Leere. Trotz ihres Namens ist die Leere kein leerer Ort, sondern die Heimat unaussprechlicher Dinge - Schrecken, die nicht für den menschlichen Verstand bestimmt sind. Cho''Gath ist eine Kreatur, die aus dieser Leere geboren wurde, ein Ding, dessen wahre Natur so schrecklich ist, dass die meisten nicht einmal seinen Namen aussprechen. Seine Gefährten haben die Dimensionsgrenzen nach einer Lücke abgesucht, um einen Weg nach Runeterra zu finden und ihr eigenes Paradies des Horrors über die Welt zu bringen. Man nennt sie die Kinder der Leere, Kreaturen, die so uralt und entsetzlich sind, dass sie gänzlich aus den Geschichtsbüchern gestrichen wurden. Man erzählt sich, dass die Kinder der Leere gewaltige Armeen unsäglicher Wesen auf anderen Welten befehligen. Sie sollen einst von mächtiger Magie, die vor Urzeiten in Vergessenheit geriet, von Runeterra vertrieben worden sein.<br><br>Falls diese Geschichten wahr sind, müssen auch die Gerüchte, die mit ihnen einhergehen, wahr sein: dass die Kinder der Leere eines Tages zurückkehren. Noch heute geht etwas Dunkles in Icathia vor, etwas, das die Beschwörungsrituale der Liga verändert und Cho''Gath so seine Anwesenheit ermöglicht. Es ist eine fremde Kreatur voller Bosheit und Gewalt, etwas, dass alle, außer die Tapfersten, vor Angst erschaudern lässt. Cho''Gath scheint sich sogar an seinem Raub zu laben und wächst und bläht sich auf, während es sich selbst vollfrisst. Noch schlimmer ist allerdings, dass die Kreatur intelligent ist, wenn nicht sogar sehr intelligent, weshalb sich die meisten fragen, wie ein solches Monster in Schach gehalten werden kann. Glücklicherweise hat die Macht der Beschwörung Cho''Gath in der Liga der Legenden eingeschlossen. Hier werden Cho''Gaths Fähigkeiten als Kind der Leere eingesetzt, um dabei zu helfen, über das Schicksal Runeterras mitzubestimmen. Der Schrecken der Leere weiß genau, welches Schicksal er für Runeterra wählen würde, wenn er nur den Hauch einer Chance dazu hätte.<br><br>„Wehe dem Tag, an dem Cho''Gath der Liga überdrüssig wird.“', 'Durch den Kauf von TP-Gegenständen senkt man die Chance, schnell von Cho''Gath getötet zu werden.', 'Versuch auf jeden Fall, Cho''Gath daran zu hindern, seine maximale Größe zu erreichen, oder sie wiederzuerlangen, wenn du ihn getötet hast.', '„Riss“ hat eine Rauchwolke, welche das Gebiet, das er trifft, markiert. Versuche die Augen danach offen zu halten, um Cho''Gath davon abzuhalten, seine Fähigkeiten zu kombinieren.', 'Versuche deine Angriffe so mit „Dornentod“ abzustimmen, dass sie Vasallen töten und gleichzeitig Champions beschäftigen.', 'Begnüg dich mit Vasallen, wenn du es nicht schafft, Champions zu verschlingen, bis du größer bist.', 'Der Einsatz von „Riss“ in Kombination mit „Fleischfresser“ auf Vasallen ist eine gute Möglichkeit, Leben und Mana zurück zu gewinnen.', 1, 0, 0, 3066, ' Tank Mage'),
(96, 'Rammus', 33, '2014-10-21 17:54:20', '2015-04-09 10:19:49', 'Rammus', 125.00, 33.00, 310.44, 55.88, 564.48, 86.00, 3.50, 31.38, 0.50, 7.92, 0.00, 1.25, 7.84, 2.21, 32.10, 335.00, 0.00, 0.00, 0.55, 3.80, 'Das Panzergürteltier', 'Die Rätsel, die sich um Rammus ranken, sind zahlreich. Wie konnte eine einfache Wüstenkreatur plötzlich zu einem Bewusstsein gelangen? Wie konnte er sich seine berühmte Rüstung anfertigen? Wonach sucht er auf seinem Weg durch die Shurima-Wüste? Eines hingegen ist sicher: Wer versucht, den erbarmungslosen Rammus aufzuhalten, ist ein Narr.', 'Achte darauf, wann seine „Eingerollte Abwehrhaltung“ abgelaufen ist. Rammus hat geringere Werte als ein normaler Frontkämpfer, wenn er sich nicht in dieser Haltung befindet.', 'Rammus verbessert häufig seine Rüstung, was ihn besonders anfällig gegen Zauberschaden macht, wenn er nicht „Eingerollte Abwehrhaltung“ aktiviert hat.', '', '„Dornenwalze“ eignet sich hervorragend zur Flucht.', 'Gegnerische Champions im Umfeld verbündeter Türme können verspottet werden, um den Angriff der Türme auf diese zu lenken.', '„Beben“ und „Eingerollte Abwehrhaltung“ eignen sich später dazu, Türme auszuschalten. Sind die Fronten verhärtet, kann es nützlich sein, auszubrechen und Gebäude anzugreifen.', 0, 0, 0, 1092, ' Tank Fighter');
INSERT INTO `champions` (`id`, `name`, `champion_id`, `created_at`, `updated_at`, `key`, `attackrange`, `mpperlevel`, `mp`, `attackdamage`, `hp`, `hpperlevel`, `attackdamageperlevel`, `armor`, `mpregenperlevel`, `hpregen`, `critperlevel`, `spellblockperlevel`, `mpregen`, `attackspeedperlevel`, `spellblock`, `movespeed`, `attackspeedoffset`, `crit`, `hpregenperlevel`, `armorperlevel`, `title`, `lore`, `enemytips1`, `enemytips2`, `enemytips3`, `allytips1`, `allytips2`, `allytips3`, `f2p`, `sale`, `sale_price`, `votes`, `tags`) VALUES
(97, 'LeBlanc', 7, '2014-10-21 17:54:20', '2015-04-09 10:19:49', 'Leblanc', 525.00, 50.00, 334.00, 54.88, 516.00, 75.00, 3.50, 21.88, 0.80, 7.42, 0.00, 0.00, 6.00, 1.40, 30.00, 335.00, 0.00, 0.00, 0.55, 3.50, 'Die Täuscherin', 'Jede Stadt hat ihre dunkle Seite, selbst jene, deren Reputation bereits eine fragwürdige Note hat. Noxus - obgleich sein Name bereits mit einer Mischung aus Ehrfurcht und Abscheu behaftet ist - bildet bezüglich dieser einfachen Wahrheit keine Ausnahme. Tief in den verschlungenen Verliesen, welche die Erde unterhalb seiner dunklen, verwinkelten Straßen honigwabenartig durchziehen, liegt die wahre Schattenseite dieser ausufernden Metropole, Zufluchtsort aller Arten von Böswilligkeit. Unter den Kulten, Zirkeln und Geheimgesellschaften, welche dieses Labyrinth ihr Zuhause nennen, waltet LeBlanc, die Täuscherin, über die Schwarze Rose, ein Relikt einer verloren gegangenen, doch ähnlich skrupellosen Zeit in Noxus'' Geschichte. Unbarmherzig und scheinbar alterslos waren LeBlanc und ihresgleichen während der Ära vor der Militarisierung der noxischen Regierung eine Hauptsäule des politischen Geschäfts in Noxus. In diesen Tagen traf sich diese Gilde mächtiger Magier im Verborgenen, um ihren geheimen Plan voranzutreiben und dabei subtiler vorzugehen, als jene, die momentan an der Macht sind, es vorziehen.<br><br>Während ihre wahren Motive immer rätselhaft geblieben sind, war der Glaube weit verbreitet, dass die Schwarze Rose zu Zeiten, als in Noxus noch die Aristokratie herrschte, die wahre Kraft hinter dem Thron war. Als rohes, martialisches Können zur Legitimation dafür wurde, wer über das Imperium wacht, schien die Schwarze Rose über Nacht zu verschwinden. Viele glaubten, ihre Zeit wäre einfach vorüber gewesen und dass ihre Mitglieder ihr Streben nach sozialer und politischer Vormacht aufgegeben hätten. Doch als LeBlanc wieder an den Toren der Kriegsakademie erschien, wurde klar, dass diese Meister der Schatten und der Flammen einfach nur den richtigen Zeitpunkt abgewartet hatten, auf das Erstehen einer neuen, umfassenden Autorität wartend: die Liga der Legenden.<br><br>„Für jene, die nicht über das hinausblicken können, was direkt vor ihren Augen liegt, ist die Welt eine ganz andere.” - LeBlanc, die Täuscherin<br>', 'Betäubungen und Schweigen können LeBlanc davon abhalten, mit „Verzerrung“ zurückzuspringen.', 'Bleibe hinter Vasallen, um einen Treffer mit „ätherische Ketten“ schwerer zu machen und so vielleicht eine suboptimale Nutzung von „Verzerrung“ zu provozieren.', '', '„Verzerrung“ erlaubt es dir, mit deinen anderen Fähigkeiten aggressiv vorzugehen, während du dich wieder in Sicherheit bringen kannst.', 'Mit „Verzerrung“ kannst du dich in eine bessere Position für „Ätherische Ketten“ bringen.', 'Du kannst "Siegel der Bosheit" mit „Ätherische Ketten“ kombinieren, um bis zu 4 Sekunden lang zu verhindern, dass Champions mit „Blitz“ entkommen können.', 0, 1, 395, 1326, ' Assassin Mage'),
(98, 'Zilean', 26, '2014-10-21 17:54:20', '2015-04-09 10:19:49', 'Zilean', 550.00, 60.00, 360.80, 51.64, 499.28, 77.00, 3.00, 19.13, 0.80, 5.44, 0.00, 0.00, 6.00, 2.13, 30.00, 335.00, 0.00, 0.00, 0.50, 3.80, 'Der Zeitwächter', 'In den Ebenen von Urtistan existierte einst eine große Stadt. Vor langer Zeit wurde diese, wie die meisten Länder hinter der Großen Barriere, in einem schrecklichen Runenkrieg ausgelöscht. Ein Mann überlebte jedoch: ein Zauberer namens Zilean. Er hatte sich im Uhrenturm der Stadt niedergelassen, was angesichts seiner Obsession, der Zeit, nur allzu passend erscheint. Als sich die Verwüstungen des Krieges seinem Zuhause näherten, experimentierte Zilean mit mächtigen Tempus-Zaubern, um alle möglichen Versionen der Zukunft zu erkennen, damit ihm die Entdeckung einer friedlichen Lösung gelänge. Doch Zileans Verzauberungen beeinflussten seine Wahrnehmung des Zeitablaufs und so befand er sich in einer kontemplativen Stase, als Urtistan von einer vollständigen Phalanx dunkler Beschwörer-Ritter unbekannter Herkunft überfallen wurde. Als ihm sein Fehler bewusst wurde, war Urtistan nichts weiter als ein schwelendes Trümmerfeld. Die Beschwörer, die für die Vernichtung der Stadt verantwortlich waren, hatten den Uhrenturm wohlweislich unangetastet gelassen. Zum einen, um Zileans Aufmerksamkeit nicht auf sich zu lenken und zum anderen, um ihm seine Nachlässigkeit zur Marter werden zu lassen.<br><br>Zilean blieb kaum Zeit, seinen unermesslichen Verlust zu betrauern, da er erkannte, dass seine gefährlichen Forschungen einen fürchterlichen Nebeneffekt hatten: Chrono-Dysplasie. Diese geheimnisvolle Krankheit verlieh ihm Unsterblichkeit, löste jedoch sein Bewusstsein von dessen Anker in der Gegenwart. Nun irrt sein Geist in der Zeit von einem zufälligen Punkt, an dem er bereits lebte, bis zum Jetzt umher. Dabei ist er unfähig, den Ablauf der Ereignisse zu beeinflussen. Der qualvollste Aspekt dieses Fluches ist, dass Zilean Urtistan ab und zu so erlebt, wie es einst war, und den Rest der Zeit in seinen verlassenen Ruinen verbringt. Nur der mächtigen Beschwörer-Magie, die von den Mitgliedern der Liga der Legenden eingesetzt wird, war es möglich dieses Leiden zu lindern und Zilean trat der Liga in der Hoffnung bei, ein Heilmittel zu finden und danach einen Weg, sein Volk zu retten.<br><br>„Es gibt keinen größeren Schmerz als den eines Verlustes, welcher noch vor einem liegt.“ - Zilean<br>', 'Wenn du Zilean auf den Fersen bleiben kannst, dann ist es manchmal sinnvoll zu warten, bis seine ultimative Fähigkeit verblasst ist, bevor du ihm den Todesstoß versetzt.', 'Zilean ist sehr schwach, wenn er von einem Team angegriffen wird, ansonsten aber sehr schwer zu töten. Versuch ihn daher als Team anzugreifen.', '', 'Du kannst „Zeitbombe“ und „Zurückspulen“ zusammen nutzen, um „Zeitbombe“ zweimal schneller hintereinander auf ein Ziel anzuwenden. Durch Anbringen der zweiten Bombe detoniert die erste und betäubt alle Gegner in der Nähe.', '„Zeitkrümmung“ ist ideal, um Verbündeten bei einem fliehenden Gegner zu helfen oder selbst zu entkommen.', '„Zeitverschiebung“ ist eine sehr wirksame Abschreckung gegen einen Angriff auf deine Carries, aber wenn du „Zeitverschiebung“ zu früh im Kampf einsetzt, kann es dazu führen, dass der Feind die Ziele zu schnell wechselt und der Zauber weniger effektiv ist.', 0, 0, 0, 1552, ' Support Mage'),
(99, 'Soraka', 16, '2014-10-21 17:54:20', '2015-04-09 10:19:49', 'Soraka', 550.00, 60.00, 350.80, 50.04, 529.04, 78.00, 3.00, 23.38, 0.40, 2.50, 0.00, 0.00, 9.00, 2.14, 30.00, 325.00, 0.00, 0.00, 0.50, 3.80, 'Das Sternenkind', 'Soraka ist eine Heilerin, die mit der Magie der Sterne gesegnet ist und der jede lebende Kreatur am Herzen liegt. Einst gehörte sie zu den himmlischen Wesen, doch sie opferte ihre Unsterblichkeit und betrat die Welt der Sterblichen. Solange das Böse das Leben in Valoran bedroht, gestattet sich Soraka nicht, Frieden zu finden.<br><br>Über Jahrhunderte hinweg lebte Soraka in einem verzauberten Hain. Sie, als Wesen von den Sternen, heilte die Kranken und Verwundeten, die sie aufsuchten. Ein Mann namens Warwick kam zu ihrem Hain und bat sie darum, seine Frau, die leblos in seinen Armen lag, zu heilen. Seine Verzweiflung berührte Sorakas Herz. Obwohl es für die Rettung seiner Frau zu spät war, bot sie ihm an, den Schmerz seines Verlusts zu lindern. Warwick, der sich weigerte, diesen Schmerz loszulassen, stürmte aus dem Hain, kehrte aber in den folgenden Tagen zurück, um Sorakas Rat zu lauschen. Mehr und mehr fühlte sie sich zu dem sich grämenden Mann hingezogen. Eines Tages erzählte ihr Warwick, dass er die Männer gefunden habe, die seine Frau getötet hatten. Er glaubte, dass Rache seinen Schmerz lindern würde - und wenn er kämpfend stürbe, so fände er doch wenigstens seinen Frieden. Obgleich sie ihn eindringlich bat, davon Abstand zu nehmen, ignorierte Warwick sie und verließ den Hain. Die Stimmen der Sterne warnten Soraka davor, ihm zu folgen, doch sie musste dazwischen gehen.<br><br>Sie betrat die Welt der Sterblichen und fand Warwick bald im verzweifelten Kampf gegen eine Gruppe Männer. Sie versuchte, ihn zu heilen, doch für jede Wunde, die sich schloss, wurden ihm zwei neue geschlagen. Soraka erkannte, dass sie würde kämpfen müssen, um ihren Freund zu retten. Die Sterne schrien in ihren Gedanken auf und forderten sie auf, ihre Kräfte nicht dazu einzusetzen Schaden anzurichten. Sie aber ignorierte die Warnung und blendete die Angreifer mit einem Blitz aus gleißendem Licht. Diese schrien voller Furcht, schirmten ihre Augen vor ihrem göttlichen Glanz ab und flohen. Sorakas himmlische Gestalt verblasste und die Sterne verstummten - wegen dieses Verstoßes wurde sie sterblich. Noch immer fühlte sie die Kraft der Sterne in sich, gleichwohl boten diese ihr nicht länger Rat. So fand sie Trost darin, Warwick in Sicherheit zu wissen, und versorgte behutsam seine Wunden. Der Mann aber, den sie Freund nannte, jagte ihr einen Dolch zwischen die Rippen. Während ihr Lebenssaft aus ihr hervorströmte, wurde Soraka klar, dass er sie getäuscht hatte und dass alles, was er getan hatte, Teil eines komplizierten Täuschungsmanövers war. Sie fühlte sich gedemütigt und verraten und so griff sie einmal mehr nach der Macht der Sterne, versengte sein Fleisch und verfluchte seine Grausamkeit. Voller Pein jaulte er auf, zog sich zurück und ließ Soraka zurück, um über ihr Schicksal nachzugrübeln. Auch wenn sich ihr Leben verändert hatte, so fühlte sie sich doch gekräftigt und von einem neuen Ziel erfüllt. Sie war nicht länger an den Hain gebunden und so schritt sie mit dem Schwur hinaus in die Welt der Sterblichen, die Verwundeten zu heilen und die Hilflosen zu beschützen.<br><br>„Die Grausamkeit eines Einzelnen wird mich nicht blind machen für das Leid von so vielen.“ - Soraka<br>', 'Konzentriere deine Angriffe auf Soraka, wenn sie sich in einem Teamkampf an vorderster Front befindet, um ihre Verbündeten zu heilen.', 'Nutze die lange Abklingzeit von „Äquinoktium“ zu deinem Vorteil, falls sie es einsetzt.', 'Es ist einfacher, sich auf Soraka zu konzentrieren als auf den Verbündeten, den sie heilt.', 'Soraka ist eine mächtige Verbündete im Kampf, die mit ihrer starken Heilung die Gruppe in Bewegung hält.', 'Du kannst „Wunsch“ auf Verbündete auf der anderen Seite der Karte anwenden, um sie vor andernfalls tödlichen Angriffen zu schützen.', '„Äquinoktium“ kann genutzt werden, um Gegner auf Distanz in Schach zu halten.', 0, 0, 0, 2250, ' Support Mage'),
(100, 'Nocturne', 56, '2014-10-21 17:54:20', '2015-04-09 10:19:49', 'Nocturne', 125.00, 35.00, 273.80, 59.21, 582.80, 85.00, 3.10, 26.88, 0.45, 8.26, 0.00, 1.25, 6.75, 2.70, 32.10, 345.00, -0.06, 0.00, 0.75, 3.50, 'Der ewige Albtraum', 'Vor Nocturne glaubte man, Träume wären Hirngespinste der Vorstellungskraft, bedeutungslose Bilder, die durch den Verstand huschten, wenn man schlief. Dieser Glaube wurde auf die Probe gestellt, als eine Reihe mit dem Schlaf verbundener Vorfälle Beschwörer der Liga heimsuchte. Einige wachten schreiend auf und waren so entsetzt, dass sie nur schwer wieder beruhigt werden konnten. Einige konnten nicht einschlafen und wurden langsam wahnsinnig, während die Nächte an ihnen vorüberzogen. Wieder andere wachten einfach nie wieder auf. Ärzte waren ratlos, bis ein Feldentwerfer direkt neben einem Nexus im Gewundenen Wald das Bewusstsein verlor. Zeugen sagten, er habe einmal aufgeschrien und dann aufgehört zu atmen. Gleich danach strömte magische Energie aus dem Nexus aus und Nocturne erschien.<br><br>Nocturne war nicht an einem freundlichen Kennenlernen in dieser Welt gelegen. Er erschlug alles, was er finden konnte, bevor Beschwörer ihn durch Magie bändigen konnten. Nach einer Zeit intensiver Untersuchungen vermuteten Liga-Experten, Nocturne würde Beschwörer im Schlaf jagen und sie an einem Ort angreifen, an dem ihre Magie nutzlos war. Dies schien seine einzige Berufung zu sein. Die Familien der Opfer verlangten nach Gerechtigkeit, doch die Verantwortlichen der Liga sorgten sich darum, dass der Tod Nocturne nur an den Ort zurückbringen würde, von dem er gekommen war. Sie banden ihn an ein Nexusfragment und hielten ihn auf diese Weise in der physischen Welt fest. Als Strafe für seine Verbrechen erlaubten sie es Beschwörern, Nocturne in Ligaspielen zu beschwören, wodurch sein Wille den Beschwörern, die er hasst, unterworfen und so sein eigener, persönlicher Albtraum geschaffen wurde. Liga-Gelehrte wissen nicht, ob er wirklich aus der Ebene der Träume gekommen ist oder ob es noch mehr wie ihn gibt. Einige vertreten die Theorie, dass der Akt des Beschwörens das Unterbewusstsein der Beschwörer so beeinflusst, dass sie Nocturne im Schlaf anlocken. Die vielleicht verstörendste Theorie ist, dass Nocturne der Albtraum einer Person ist, der nun zum Leben erwacht ist. Falls dies wahr ist, fragt man sich, wer ist der Träumer?<br><br>„Die Dunkelheit rückt immer näher ... sie ist jetzt pechschwarz ... aber ich kann ihn noch immer sehen ...“ - Kelvin Ma, Patient Nr. 4236<br>', 'Bleibe bei deinen Verbündeten, wenn „Paranoia“ aktiv ist - setze auf zahlenmäßige Überlegenheit!', 'Nocturnes „Unsagbarer Schrecken“ kann durch Distanz gebrochen werden. Spare dir entsprechende Fähigkeiten auf, bis er ihn einsetzt.', '', 'Die Nutzung von „Paranoia“ im richtigen Moment kann es Wert sein, auch wenn man keine Gelegenheit hat, sich auf einen Gegner zu stürzen.', '„Dämmerungsbringer“ lässt sich nicht nur offensiv einsetzen. Man kann damit auch aus den Kampf oder vom sicheren Tod entkommen.', 'Benutze „Tuch der Dunkelheit“ zusammen mit „Paranoia“. Deine Gegner könnten in Panik verfallen und einen wichtigen, kampfunfähig machenden Zauber am Zauberschild verschwenden.', 0, 0, 440, 694, ' Assassin Fighter'),
(101, 'Jinx', 222, '2014-10-21 17:54:20', '2015-04-09 10:19:50', 'Jinx', 525.00, 45.00, 245.60, 53.04, 517.76, 82.00, 3.00, 22.88, 1.00, 5.84, 0.00, 0.00, 6.68, 1.00, 30.00, 325.00, 0.00, 0.00, 0.50, 3.50, 'Die Schießwütige', 'Für Jinx besteht das Leben daraus, verheerende Schäden anzurichten, ohne einen Gedanken an die Konsequenzen zu verschwenden. Dabei hinterlässt sie eine Schneise des Chaos und der Panik. Als wahnsinnige und impulsive Kriminelle verabscheut sie nichts so sehr wie die Langeweile und entfesselt voller Vergnügen ihre eigene sprunghafte Art des Pandämoniums an dem Ort, der ihr am trübsten erscheint: Piltover. Ausgerüstet mit einem Arsenal tödlicher Spielzeuge entfacht sie die grellsten Explosionen und lautesten Knalle - umso besser, wenn sie damit die unglückseligen Gesetzeshüter schockieren und überraschen kann. Dem Arm des Gesetzes immer einen Fingerbreit voraus macht sich Jinx einen besonderen Spaß daraus, Piltovers Elite an der Nase herumzuführen - allen voran Vi.<br><br>Piltover war lange als Stadt des Fortschritts bekannt, als ein Ort, an dem Frieden und Ordnung herrschten. Diese Ruhe wurde auf die Probe gestellt, als eine neue Art Kriminelle eintraf, wie man sie nie zuvor gesehen hatte. Diese rätselhafte Gesetzlose ersann eine Vielzahl verdrehter und zerstörerischer Gaunereien, welche die ganze Stadt in Gefahr brachten, und ließ die Bevölkerung benommen von der schlimmsten Verbrechensserie in Piltovers Geschichte zurück.<br><br>Als die Serie von Verbrechen, die keinen erkennbaren Sinn hatten, die Stadt heimsuchten, wurde die Gesetzesbrecherin immer öfter gesehen. Ist die Herkunft der jungen Frau auch ein Rätsel, so sahen doch manche Spuren von Hextech-Mechaniken aus Piltover an ihren Waffen, während andere den Straßenchic aus Zhaun in ihrer Kleidung erkannt haben wollen. Da ihre Ankunft immer Ärger verhieß, gaben ihr jene, die ihr über den Weg liefen, schon bald einen Namen: Jinx.<br><br>Jinx‘ Randale uferten immer weiter aus. Caitlyn - der Sheriff von Piltover - reagierte darauf, indem sie den Ausnahmezustand ausrief und eine stadtweite Fahndung herausgab. In typischer Jinx-Manier versah die Kriminelle die Schatzkammer von Piltover, das sicherste Gebäude der Stadt, mit einer direkten Herausforderung an seinen rauesten Officer. Mit Hilfe einer Karikatur von Vis Gesicht auf der gesamten Fassade der Schatzkammer, zusammen mit einer gekritzelten Notiz über Zeit und Datum ihres vorgesehen Überfalls, forderte Jinx die Vollstreckerin ganz offen heraus, sie davon abzuhalten, das Gebäude auszurauben.<br><br>Fest entschlossen, die Unruhestifterin hinter Schloss und Riegel zu bringen, wartete Vi aufmerksam vor der Schatzkammer, bis Jinx‘ Zeit schließlich gekommen war. Ihrem hingeschmierten Versprechen treu zeigte sich die lächelnde Plage. Da sie wusste, dass dies ihre Chance war, die Gesetzlose dingfest zu machen, verfolgte Vi sie ins Innere des Gebäudes. Sie brauste durch eine Mauer nach der anderen, um Jinx, die kicherte, als sie die evakuierte Schatzkammer mit feurigen Explosionen in Brand setzte, zu jagen. Vi hatte die Kriminelle endlich im Tresor in die Enge getrieben, doch Jinx war noch nicht erledigt. Mit einem wahnsinnigen Lachen feuerte sie eine Salve aus Raketen ab und brachte damit das gesamte Gebäude über ihnen beiden zum Einsturz.<br><br>Als Vi letztlich aus den Ruinen krabbelte, fand die angeschlagene Vollstreckerin keine Spur mehr von Jinx. Und wie zum Hohn fehlte nicht eine Unze Gold aus dem Tresor, der nun in Trümmern lag. Stattdessen hinterließ die Kriminelle ihrer liebsten Gesetzeshüterin einen Abschiedsbrief - eine Herausforderung, die erst jetzt durch das klaffende Loch in der Silhouette von Piltover sichtbar wurde. Die Lichter der Stadt ergaben eine einfache Stichelei: Du wirst mich niemals kriegen. Als Vi die Nachricht las, hörte sie das ferne Lachen ihrer neuen Nemesis und zum allerersten Mal war die Stadt in vollkommene Dunkelheit getaucht.<br><br>„Oh, sieh nur, eine hübsche Kiste voll Mitleid! Oh, warte, ist gar keins drin!“ - Jinx<br>', 'Jinx'' Minigun braucht etwas Zeit, sich aufzuladen. Falls du siehst, wie sie mit Raketen herumhantiert, versuche, auf sie drauf zu springen und sie schnell umzupusten.', 'Jinx'' ultimative Fähigkeit verursacht weniger Schaden, je näher du an ihr dran bist.', 'Jinx'' Verlangsamungsgranaten haben eine lange Abklingzeit und sind ihr primäres Mittel, sich selbst zu schützen. Falls sie ihr Ziel verfehlen, hat sie es schwer zu entkommen, wenn sie angegriffen wird.', 'Raketen sind nicht immer die beste Wahl! Jinx'' Minigun ist unglaublich mächtig, wenn sie vollständig aufgeladen ist. Wechsle auf sie, wann immer ein gegnerischer Champion dir zu nahe kommt.', 'Jinx'' Raketen verursachen während der Explosion den vollen Schaden an allen Gegnern. Nutze sie gegen Vasallen in der Lane, um gegnerische Champions in der Nähe zu treffen, ohne die Vasallen auf dich zu lenken.', 'Wenn ein Kampf ausbricht, solltest du versuchen, am Rande der Auseinandersetzung zu bleiben, indem du mit Raketen und Brzl! arbeitest. Renne nicht rein und vergeude deine aufgeladene Minigun, bis du nicht das Gefühl hast, dass es sicher ist.', 0, 0, 487, 1599, ' Marksman'),
(102, 'Yorick', 83, '2014-10-21 17:54:20', '2015-04-09 10:19:50', 'Yorick', 125.00, 35.00, 293.80, 57.58, 563.80, 85.00, 3.50, 25.05, 0.45, 8.18, 0.00, 1.25, 6.75, 3.00, 32.10, 345.00, 0.00, 0.00, 0.70, 3.60, 'Der Totengräber', 'Yorricks Geschichte ist sowohl tragisch als auch furchteinflößend. Er ist ein Ghoulwesen, das am Rande der Sterblichkeit sein Dasein fristet. Manche sagen, er sei der Letzte seines Familienzweigs, der starb, ohne dass ein Nachfahre sein Erbe fortführen konnte, und dass er dazu verflucht ist, seinen Familienpflichten selbst nach dem Tod nachzukommen. Mit der verfluchten Schaufel, die er zu Lebzeiten bei sich trug, setzt er sein makabres Werk fort ... gräbt ohne Unterlass und füllt die Gräber auf den gespenstischen Schatteninseln.', 'Du kannst den Beschwörerzauber „Zerschmettern“ gegen Yoricks Vasallen einsetzen, um sie sofort auszuschalten.', 'Wendet Yorick seine ultimative Fähigkeit auf einen Verbündeten an, könnte es leichter sein, den Wiedergänger zu zerstören, damit das eigentliche Ziel nicht erst noch wiederbelebt wird.', ' Die Höhe des durch „Omen des Hungers“ wiederhergestellten Lebens hängt vom verursachten Schaden ab, wodurch die Effektivität durch Magieresistenz verringert wird.', '„Omen der Pestilenz“ kann genutzt werden, um Projektile von Skillshots abzufangen.', ' „Omen des Todes“ funktioniert zuverlässiger, wenn man es erst kurz vor dem Ableben eines Verbündeten einsetzt, auch wenn es dann weniger mächtig ist.', ' Solange „Omen des Todes“ aktiv ist, zählen sowohl der Wiedergänger als auch der wiederbelebte Champion für den Bonus von „Unheiliger Pakt“.', 0, 0, 0, 5768, ' Fighter Mage'),
(103, 'Urgot', 6, '2014-10-21 17:54:20', '2015-04-09 10:19:50', 'Urgot', 425.00, 55.00, 312.40, 52.05, 586.52, 89.00, 3.60, 24.54, 0.65, 6.50, 0.00, 0.00, 8.59, 2.90, 30.00, 335.00, -0.03, 0.00, 0.60, 3.30, 'Der Stolz des Scharfrichters', 'Es gibt Krieger, die sich durch ihre Stärke, ihren Verstand oder ihr Geschick im Umgang mit Waffen einen Namen machen. Andere weigern sich einfach zu sterben. Auf Urgot, einem einstigen großen Soldaten aus Noxus, trifft wohl eher letzteres zu. Dazu neigend, sich Hals über Kopf in die feindlichen Linien zu stürzen, säte Urgot Chaos in den gegnerischen Reihen, wobei er häufig schmerzliche Wunden davontrug. Als sein Körper sich weigerte, weitere Strapazen durchzustehen, wurde dem verkrüppelten Urgot die Position des hohen Henkers von Noxus zugesprochen. Bis dahin waren seine Hände ruiniert und er konnte kaum noch gehen. Sensenartige Fortsätze wurden an seinen entstellten Gliedmaßen angebracht, um sein blutiges Werk fortzuführen.<br><br>Schließlich fand Urgot sein Ende in dem Augenblick, der eigentlich seine Sternstunde hätte sein sollen. Aufgrund seines militärischen Hintergrunds begleitete er häufig Militäreinheiten auf den Weg in feindliches Gebiet, um dort zu richten. Durch einen Hinterhalt fiel Jarvan IV., Kronprinz von Demacia, in die Hände von Urgots Division. Zu weit von Noxus entfernt, um den Transport ihrer Trophäe zu riskieren, entschied sich Urgot dafür, sich der Geisel zu entledigen. In letzter Sekunde gelang es jedoch einer verwegenen Vorhut, geführt von Garen, der Macht von Demacia, einzugreifen. Urgot wurde durch den strebsamen Krieger zweigeteilt, als dieser darum kämpfte, seinen Prinzen zu befreien. In Anerkennung seiner Dienste wurden die Überreste des Henkers zur trostlosen Akademie gebracht, um dort wiederbelebt zu werden. Ein Lebenswerk voller Misshandlungen hatte jedoch seinen Körper in einem katastrophalen Zustand zurückgelassen; ein Problem für die Kunst der Totenbeschwörer. Professor Stanwick Pididly, der führende Gelehrte von Zhaun, bot jedoch eine Lösung an. In Pididlys Laboren wurde ein albtraumhafter neuer Körper für Urgot geschmiedet. Nun, so viel Maschine wie Mensch, ist Urgot in der Liga der Legenden angekommen, um den Mann zu finden, der einst sein Leben beendete.<br><br> „Wir können ihn wiederherstellen. Wir haben die Techmaturgie.“ - Professor Stanwick Pididly<br>', 'Bleibe in Bewegung, um nicht von „Noxische Ätzladung“ getroffen zu werden. Solltest du trotzdem getroffen werden, versuche sofort auf Distanz zu gehen, um nicht von „Säurejäger“ getroffen zu werden.', 'Urgot erhält Verlangsamungsangriffe, während sein „Terrorkondensator“ aktiv ist. Füge ihm genug Schaden zu, um seinen Schild zu entfernen, damit er diesen Effekt verliert.', '', 'Versuche, den Mauszeiger über einem Gegner zu halten, der durch „Noxische Ätzladung“ beeinflusst wird, bevor du „Säurejäger“ einsetzt. So kannst du garantieren, dass „Säurejäger“ alle anderen möglichen Ziele ignorieren wird.', 'Urgot ist hervorragend für Hinterhalte geeignet. Versuche, Gegner mit „Noxische Ätzladung“ gefolgt von mehreren „Säurejägern“ zu treffen.', '', 0, 0, 0, 988, ' Marksman Fighter'),
(104, 'Miss Fortune', 21, '2014-10-21 17:54:20', '2015-04-09 10:19:51', 'MissFortune', 550.00, 38.00, 275.84, 49.54, 577.80, 85.00, 3.00, 24.04, 0.65, 6.19, 0.00, 0.00, 8.04, 3.01, 30.00, 325.00, -0.05, 0.00, 0.65, 3.00, 'Die Kopfgeldjägerin', 'Für jene, die den rauen Meeren Runeterras trotzen, ist das Erringen eines eigenen Schiffes und einer eigenen Mannschaft das Ziel aller Wünsche. Sarah Fortune, eine hochangesehene (manche würden sogar sagen legendäre) Kopfgeldjägerin aus Bilgewasser, konnte dieses Ziel schon kurz nach ihrem sechzehnten Geburtstag erreichen. Sie machte damit ein für alle Mal klar, dass genau sie diejenige war, zu der man kommt, wenn man eine Lösung für ganz spezielle Ärgernisse suchte. Keine Kopfgeldjagd war ihr zu schwer oder zu gefährlich für ihren weiblichen Charme und ihren geübten Umgang mit ihren Zwillingspistolen „Schrecken“ und „Ehrfurcht“. Ihr Erfolg gab ihr die Mittel, sich ganz rechtmäßig ihr eigenes Schiff zu kaufen ... mit ein bisschen kokettem Gefeilsche versteht sich. Ganz das Kind der Fortuna war Miss Fortune dann aber doch nicht immer. Als sie jung war, tauchten erste Handelsschiffe am Horizont ihres ruhigen Zuhauses am Nordstrand, dem größten Abschnitt der Insel der Blauen Flamme, auf. Handelsrouten zogen Piraten an und die Einwohner fanden sich allzu schnell im Wahn der Plünderungen gefangen wieder.<br><br>Eines Tages kehrte die junge Sarah nach Hause zurück und hörte Schüsse und Geschrei. Die Vordertür war eingetreten; im Inneren sah sie ihre Mutter in einer Lache voller Blut liegen. Ein plötzlicher Hieb an den Kopf ließ sie direkt neben ihrer erschlagenen Mutter zusammenbrechen. Das Letzte, woran sie sich erinnern konnte, waren die roten Augen ihres mit einem Piratentuch vermummten Angreifers. Miss Fortune empfindet tiefes Misstrauen gegenüber Piraten und befindet sich fortlaufend mit dem berüchtigten Gankplank (dem einzigen Kapitän, der ihrem Charme widersteht) im Streit darüber, in welche Richtung sich Bilgewasser entwickeln soll. Ihre zwei Ziele: die Einwohner Bilgewassers zu einer starken und unabhängigen Gesellschaft zu vereinen und den Piraten zu finden, der ihre Mutter ermordete. Dafür trat sie der Liga der Legenden als Championesse bei und bietet ihre Fertigkeiten im Tausch gegen Wohlstand und Einfluss an. Beides soll ihr helfen, ihre Ziele zu erreichen.', 'Miss Fortunes erhöhtes Lauftempo wird entfernt, wenn sie Schaden erleidet oder beeinträchtigt wird.', 'Miss Fortune ist leicht auszuschalten, wenn man an sie herankommt; konzentriere dich zuerst auf sie, wenn mehrere Champions am Kampf beteiligt sind.', '', 'Miss Fortune wird immer schneller, wenn sie nicht angegriffen wird. Versuche nicht getroffen zu werden, um davon zu profitieren.', 'Benutze „Durchschuss“ gegen den hintersten Vasallen, wenn sich gegnerische Champions dahinter verstecken; die Kugel wird weiterfliegen und sehr viel Schaden verursachen.', '„Durchschuss“ wendet Treffereffekte an, wodurch Gegenstände wie „Frosthammer“ oder „Blutdürster“ sehr effektiv werden.', 0, 0, 0, 1215, ' Marksman'),
(105, 'Wukong', 62, '2014-10-21 17:54:20', '2015-04-09 10:19:51', 'MonkeyKing', 175.00, 38.00, 265.84, 59.88, 577.80, 85.00, 3.20, 24.88, 0.65, 6.19, 0.00, 1.25, 8.04, 3.00, 32.10, 345.00, -0.05, 0.00, 0.65, 3.50, 'Der Affenkönig', 'Im Chaos der Runenkriege ging ein gewaltiger Runenstein im Seuchen-Dschungel verloren. Er verblieb dort, über Jahrhunderte hinweg unberührt, und gewährte mit seiner mächtigen Magie der Wildnis um sich Empfindungsfähigkeit und Gesundheit. Eine Gruppe von Affen, die durch die Magie besonders beeinflusst wurde, begann damit, den Stein anzubeten. Ihr Anführer - ein weiser Gelehrter - kam schließlich zu der Überzeugung, er könne selbigen kontrollieren, um die Affen unsterblich zu machen. Er vollzog ein kompliziertes Ritual, aber es lief anders, als er sich vorgestellt hatte. Der Runenstein wurde zerstört und anstatt die Gabe der Unsterblichkeit zu verteilen, brachte er Kong hervor, einen Affen, der die Stärke und Macht des Steins in seinem Herzen weiterführte. Kong wurde von einem unstillbaren Verlangen, ständig besser zu werden, getrieben. Er suchte alle Bestien und Monster des Seuchen-Dschungels auf, um einen würdigen Gegner zu finden, aber nichts brachte ihm die Herausforderung, nach der es ihm begehrte. Er bat den Gelehrten um Rat und erfuhr so von der Legende haarloser Affen, die im Norden leben würden und die die Welt mit Verstand und Macht nach ihren Wünschen formen würden.<br><br>Kong zog aus und reiste nach Norden, um herauszufinden, ob hinter der Legende eine Wahrheit stecken würde. Er überquerte die Südlichen Ödlande und bald darauf die Große Barriere. Auf seinem Weg traf er so auf Master Yi, der in tiefe Meditation versunken war. Kong fragte ihn nach dem stärksten Krieger des Nordens und Yi erzählte ihm von der Liga der Legenden. Die Geschichte durchdrang Kong - sie versprach ihm einen Ort, an dem er gegen die stärksten Krieger der Welt antreten könne, es wäre für ihn wie ein Paradies. Kong bat Yi darum, ihn dieser Liga vorzustellen und ihm die Wege der Menschen zu lehren, auf dass er einen würdigen Champion abgeben würde. Im Gegenzug würde er Yi ehren, indem er dessen Wuju-Stil benutzen würde, um der größte Krieger zu werden, den Runeterra je gesehen hat. Da er seine Leidenschaft als bewundernswert empfand, stimmte Yi zu, doch nur unter der Bedingung, dass Kong seinerseits eines Tages die Lektionen des Wuju einem eigenen Schüler beibringen würde. Im Sinne dieser Vereinbarung benannte er Kong in „Wukong“ um und übergab ihm eine Waffe, die seiner ungewöhnlichen Natur entsprach - einen verzauberten Stab, den der junge Doran gefertigt hatte. Die Waffe war ein Meisterstück ohne Gleichen. Nach hartem Training und unter der Führung von Yi trat Wukong der Liga der Legenden bei, um sich selbst als der Beste zu beweisen und der Welt die wahre Macht des Wuju zu zeigen.<br><br>„Nur im Kampf erfährt man, wer man wirklich ist.“ - Wukong<br>', 'Wukong wird häufig „Trugbild“ nach „Nimbusschlag“ einsetzen. Warte mit deinen Fähigkeiten einen Augenblick, um sicherzugehen, dass du den echten Wukong triffst.', 'Wukong wird schwerer zu töten, wenn er von seinen Gegnern umgeben ist. Versuche ihn zu isolieren, um dies zu deinem Vorteil zu nutzen.', '', '„Trugbild“ und „Nimbusschlag“ ergänzen sich gut, um schnell zuzuschlagen und sich zurückzuziehen, noch bevor der Gegner reagieren kann.', 'Benutze „Trugbild“ nahe hohem Gras, um deinen Gegner völlig zu verwirren.', '', 0, 0, 0, 4378, ' Fighter Tank'),
(106, 'Blitzcrank', 53, '2014-10-21 17:54:20', '2015-04-09 10:19:51', 'Blitzcrank', 125.00, 40.00, 267.20, 61.54, 582.60, 95.00, 3.50, 24.38, 0.80, 8.51, 0.00, 1.25, 6.00, 1.13, 32.10, 325.00, 0.00, 0.00, 0.75, 3.50, 'Der große Dampfgolem', 'Die Stadt Zhaun ist ein Ort, an dem Magie und Wissenschaft aus den Bahnen geraten sind. Unkontrolliert durchgeführte Experimente haben die Stadt einen hohen Preis gekostet. Jedoch räumen Zhauns lasche Restriktionen ihren Forschern und Erfindern so viel Spielraum ein, dass sie die Grenzen der Wissenschaft in immer kürzeren Abständen auf Gedeih und Verderb immer weiter hinausschieben. Unter diesen Umständen schaffte ein Team aus Doktoranden der Techmaturgischen Universität von Zhaun den Durchbruch auf dem Gebiet der intelligenten Dampfautomatisierung. Ihre Schöpfung, der Dampfgolem Blitzcrank, wurde entwickelt, Urteile spontan zu vollstrecken, um bei Zhauns gefährlichen Abfallbeseitigungs-Prozessen Unterstützung zu leisten, da die Umstände oft eine Überwachung durch Menschen nicht erlaubten. Doch schnell zeigten sich bei ihm unvorhergesehene Verhaltensweisen.<br><br>Mit der Zeit konnten die Wissenschaftler einen Lernprozess nachweisen und Blitzcrank wurde schnell zu einer Berühmtheit. Doch wie es traurigerweise oft der Fall ist, heimste ein anderer - Professor Stanwick Pididly - die Lorbeeren für die Erschaffung des Golems ein - auch wenn heute die meisten die Wahrheit kennen. Infolge des sich anschließenden rechtlichen Mahlstroms wurde offensichtlich, dass keiner der beiden Parteien wirklich am Wohlergehen des Dampfgolems gelegen war und so ersuchte Blitzcrank demütig um persönliche Autonomie. Mit durch die überwältigende Unterstützung der Öffentlichkeit gestärktem Rücken brauchte der freiheitlich gesinnte Rat von Zhaun nur ein paar Wochen, um Blitzcrank zu einer vollkommen unabhängigen, empfindungsfähigen Wesenheit zu erklären. Als Einziger seiner Art verließ der Golem Zhaun. Der Streit hatte ihn betrübt und er fühlte, dass er nirgends so richtig dazu- oder hingehörte. Seine Reisen führten ihn alsbald an den einen Ort in Valoran, an dem auch einzigartige Wesen willkommen sind - zur Liga der Legenden. Glücklicherweise konnte er seine Konstruktion leicht anpassen, um den Härten, die ihn auf den Richtfeldern erwarteten, gewachsen zu sein.<br><br>„Auch wenn Blitzcrank alles zerschmettern kann, was sich ihm in den Weg stellt, hat er wirklich ein Herz aus Gold ... ummantelt von einem eisernen Rahmen ... in einer Hülle aus Stahl.“', 'Blitzcranks passive „Manabarriere“ gewährt ihm ein Schild, wenn er stark geschwächt ist.', 'Hinter Vasallen zu bleiben, kann dich vor dem Raketengriff schützen. Blitzcranks Raketengriff greift sich immer nur den ersten Gegner auf den er trifft.', '', 'Eine Kombination aus „Raketengriff“, „Geladene Faust“ und „Statisches Feld“ kann gegen einzelne Gegner verheerend wirken.', 'Benutze Blitzcranks „Raketengriff“, um einen Gegner in Schussweite deines Turmes zu ziehen, gefolgt von „Geladene Faust“ gibt dies dem Turm genug Zeit, den Gegner mehrmals zu treffen.', '', 0, 0, 395, 2798, ' Tank Fighter'),
(107, 'Shen', 98, '2014-10-21 17:54:20', '2015-04-09 10:19:51', 'Shen', 125.00, 0.00, 200.00, 60.17, 570.80, 85.00, 3.38, 25.72, 0.00, 8.37, 0.00, 0.00, 50.00, 3.40, 30.00, 335.00, -0.04, 0.00, 0.55, 4.00, 'Das Auge des Zwielichts', 'Es gibt einen uralten Orden, der auf den ionischen Inseln seinen Ursprung hat und sich einzig der Erhaltung des Gleichgewichts verschrieben hat. Ordnung, Chaos, Licht und Dunkelheit - all diese Dinge müssen in perfekter Harmonie existieren, da dies die Natur des Universums ist. Dieser Orden ist als Kinkou bekannt und stellt ein Triumvirat an Schattenkriegern, um seinen Platz in der Welt zu sichern. Shen ist einer dieser Schattenkrieger, dem die heilige Aufgabe erteilt wurde, die Sterne zu beobachten, um Urteile ungetrübt von Vorurteilen fällen zu können.<br><br>Shen wurde in einem Klan geboren, deren Mitglieder schon seit Generationen Ränge im Kinkou bekleiden. Sein ganzes Leben lang wurde er ausgebildet, um ein Auge des Zwielichts zu werden und somit leidenschaftslos entscheiden zu können, was zum Schutze des Gleichgewichts getan werden müsse. In seinem letzten Test für diese Aufgabe musste er am Takanu teilnehmen, einer Zeremonie, in der sein Vater vor seinen Augen gefoltert wird, um seine Entschlossenheit zu testen. Jegliche Reaktion, wie auch immer sie ausgesehen hätte, hätte sein Scheitern bedeutet. Doch er wandte seinen Blick nicht ab und blinzelte nicht ein einziges Mal. Als ein Auge des Zwielichts muss Shen Entscheidungen treffen, an denen normale Geister zerbrechen würden, indem er jegliches Gefühl aus seinen Schlussfolgerungen verbannt. Er arbeitet nun mit seinen Gefährten Akali und Kennen zusammen, um das Gleichgewicht von Valoran durchzusetzen. Es ist daher keine Überraschung, dass diese geheiligte Aufgabe das Triumvirat direkt auf die Richtfelder geführt hat.<br><br>„Das Auge des Zwielichts sieht nicht die Leiden seiner Opfer, sondern nur die Eleganz des Gleichgewichts.“', 'Shen ist ein sehr ausdauernder Champion, der Schaden auf vielfache Weise absorbieren kann. Greife ihn nur mit Bedacht an, auch wenn er sehr geschwächt erscheint.', 'Er kann auch jedem verbündeten Champion unabhängig von der Entfernung sofort zur Hilfe eilen, sei also auf der Hut, denn ein 1-gegen-1 kann so schnell zu einem 1-gegen-2-Kampf werden.', '', '„Schattensturz“ stellt mehr Energie wieder her, wenn mehrere Gegner getroffen werden, weshalb du die Fähigkeit nicht immer gleich gegen den ersten, einzelnen Gegner anwenden solltest.', 'Achte auf das Leben deiner Verbündeten. Du kannst ihnen selbst auf anderen Lanes mit „Geeinter Halt“ beistehen, denn es hat keine maximale Reichweite. Benutze F2-F5, um sie schnell anwählen zu können.', '', 0, 0, 0, 1296, ' Tank Fighter'),
(108, 'Braum', 201, '2014-10-21 17:54:20', '2015-04-09 10:19:52', 'Braum', 125.00, 45.00, 310.60, 55.38, 576.16, 87.00, 3.20, 26.72, 0.80, 8.18, 0.00, 1.25, 6.00, 3.50, 32.10, 335.00, -0.03, 0.00, 1.00, 4.00, 'Das Herz Freljords', '„Möchtest du eine Gutenachtgeschichte hören?“<br><br>„Oma, für sowas bin ich zu alt.“<br><br>„Du bist nie zu alt für eine gute Geschichte.“<br><br>Widerwillig krabbelt das Mädchen in ihr Bett und wartet, da sie weiß, dass sie diesen Kampf nicht gewinnen wird. Ein bitterkalter Wind weht vor der Tür und peitscht den fallenden Schnee zu teuflischen Wirbeln auf.<br><br>„Was für eine Geschichte? Vielleicht eine über die Eishexe?“, fragt Großmutter.<br><br>„Nein, nicht die.“<br><br>„Was hältst du von einer Geschichte über Braum?“ Das Schweigen genügt ihr als Antwort. Die alte Frau lächelt. „Oh, es gibt so viele Geschichten über ihn. Meine Großmutter erzählte mir immer von der Zeit, als Braum unser Dorf vor dem großen Drachen beschützt hat! Oder einmal - vor sehr langer Zeit - rannte er über einen Fluss aus Lava! Oder -“ Sie hält inne; legt einen Finger auf ihre Lippen. „Habe ich dir erzählt, wie Braum seinen Schild bekommen hat?“<br><br>Das Mädchen schüttelt den Kopf. Das Feuer im Kamin knistert und hält den Wind fern.<br><br>„Also gut. In den Bergen über unserem Dorf lebte ein Mann namens Braum -“<br><br>„Das weiß ich!“<br><br>„Er blieb die meiste Zeit auf seinem Bauernhof und kümmerte sich um seine Schafe und Ziegen, doch er war der freundlichste Mann, den man je getroffen hat. Er hatte immer ein Lächeln im Gesicht und ein Lachen auf den Lippen.<br><br>Eines Tages nun passierte etwas Schreckliches: Ein kleiner Trolljunge, etwa in deinem Alter, kletterte auf den Berg und stieß auf ein Gewölbe, das in den Berg gehauen war. Dessen Eingang wurde von einer gewaltigen Steintür bewacht, in deren Mitte ein Splitter aus Wahrem Eis saß. Als er die Tür öffnete, wollte er seinen Augen nicht trauen: Das Gewölbe war voller Gold, Juwelen - jeder Schatz, den du dir nur vorstellen kannst!<br><br>Was er aber nicht wusste, war, dass diese Schatzkammer eine Falle war. Die Eishexe hatte sie verflucht - und als der Trolljunge sie betrat, fiel die magische Tür mit einem lauten Donnern hinter ihm zu und er war eingeschlossen! Er konnte tun, was er wollte, er konnte nicht hinaus.<br><br>Ein Hirte, der zufällig vorbeikam, hörte seine Schreie. Alle eilten zu Hilfe, doch selbst die stärksten Krieger konnten die Tür nicht öffnen. Die Eltern des Jungen waren ganz aufgelöst. Die Klagerufe seiner Mutter hallten durch die Berge. Es schien hoffnungslos.<br><br>Und dann hörten sie, zur Überraschung aller, aus der Ferne ein Lachen.“<br><br>„Das war Braum, stimmt''s?“<br><br>„Du bist clever! Braum hatte ihre Rufe gehört und kam mit großen Schritten den Berg herunter. Die Dorfbewohner erzählten ihm von dem Trolljungen und dem Fluch. Braum lächelte, nickte, drehte sich zu der Schatzkammer um und schaute die Tür an. Er stemmte sich gegen sie. Zog an ihr. Haute dagegen, trat dagegen, versuchte, sie aus den Angeln zu reißen. Doch die Tür rührte sich nicht.“<br><br>„Aber er ist doch der stärkste Mann, den die Welt je gesehen hat!“<br><br>„Es war verwirrend“, stimmte ihre Großmutter zu. „Vier Tage und Nächte lang saß Braum auf einem Felsbrocken und grübelte über eine Lösung nach. Es stand ja das Leben eines Kindes auf dem Spiel.<br><br>Als die Sonne dann am fünften Tag aufging, weiteten sich seine Augen und ein breites Grinsen erhellte sein Gesicht. ‚Wenn ich nicht durch die Tür gehen kann‘, sagte er, ‚dann muss ich eben durch -‘“<br><br>Das Mädchen denkt nach. Ihre Augen weiten sich. „- den Berg!“ <br><br>„Durch den Berg. Braum machte sich auf zum Gipfel und begann, sich geradewegs durchzuschlagen, eine Faust nach der anderen hämmerte er sich durch den Fels, Steine flogen hinter ihm weg, bis er tief im Berg verschwunden war.<br><br>Während die Dorfbewohner den Atem anhielten, zerbröckelte der Stein um die Tür herum - und als der Staub sich gelegt hatte, sahen sie Braum mitten in den Reichtümern stehen, mit dem schwachen, aber glücklichen Trolljungen auf dem Arm.“<br><br>„Ich wusste, dass er es schaffen kann!“ <br><br>„Doch bevor sie gemeinsam feiern konnten, begann alles zu beben und zu erzittern: Braums Tunnel hatte den Berggipfel geschwächt und nun brach er in sich zusammen! Braum überlegte schnell, schnappte sich die verzauberte Tür und hielt sie wie einen Schild über sich. Dieser schützte die Menschen, als der Berg um sie herum zusammenbrach. Als das Beben vorüber war, war Braum erstaunt: Die Tür hatte nicht einen einzigen Kratzer abbekommen! Braum wusste, dass sie etwas ganz Besonderes war.<br><br>Und von dem Moment an hatte Braum diesen magischen Schild immer bei sich.“<br><br>Das Mädchen sitzt ganz gerade und versucht, ihre Aufregung zu verbergen. Ihre Großmutter wartet. Sie zuckt mit den Schultern und steht auf, um zu gehen.<br><br>„Oma“, hält das Mädchen sie zurück, „kannst du mir noch eine erzählen?“<br><br>„Morgen.“ Ihre Großmutter lächelt, küsst ihre Stirn und bläst die Kerze aus. „Du musst jetzt schlafen und es gibt noch viele Geschichten zu erzählen.“', 'Braum muss „Winterbiss“ oder einen normalen Angriff ausführen, um „Erschütternde Hiebe“ zu starten. Solltest du markiert werden, gehe aus der Kampfzone, bevor du noch 3-mal getroffen wirst. So vermeidest du eine Betäubung.', 'Braums ultimative Fähigkeit hat eine lange Ausführzeit, die du zum Ausweichen nutzen kannst. Wenn du den vereisten Boden betrittst, den die Fähigkeit hinterlässt, wirst du verlangsamt. Positioniere dich also so, dass du nicht hindurchlaufen musst.', '„Unverwüstlich“ verleiht Braum eine extrem starke, in eine bestimmte Richtung wirkende Verteidigung. Du wartest besser, bis sie abgeklungen ist, oder umgehst die Fähigkeit.', 'Arbeite mit deinen Verbündeten zusammen, um Steigerungen von „Erschütternde Hiebe“ aufzubauen. Ermutige sie, markierte Ziele mit normalen Angriffen anzugreifen.', 'Stelle dich vor einen verwundbaren Freund und schirme ihn mit dem Schild von „Unverwüstlich“ vor Projektilen ab.', '„Gletscherspalte“ hinterlässt ein mächtiges Verlangsamungsfeld. Positioniere es mit Bedacht, um Teamkämpfe auseinanderzuziehen und den Ansturm des Gegners zu verlangsamen.', 0, 0, 487, 1413, ' Support Tank'),
(109, 'Xin Zhao', 5, '2014-10-21 17:54:20', '2015-04-09 10:19:52', 'XinZhao', 175.00, 35.00, 273.80, 57.54, 591.16, 87.00, 3.30, 25.88, 0.45, 8.18, 0.00, 1.25, 7.25, 2.60, 32.10, 345.00, -0.07, 0.00, 0.70, 3.50, 'Der Seneschall von Demacia', 'Immer wenn Jarvan III., der König von Demacia, eine seiner Ansprachen vom glänzenden Marmorbalkon auf dem königlichen Palast hält, steht Xin Zhao neben ihm. Als persönlicher Diener der Lichtschild-Dynastie wird er auch als Seneschall von Demacia bezeichnet. Seine rätselhafte, ruhige Wachsamkeit führte zu einer Reihe von Vermutungen über sein „geheimes Leben“ und seine Herkunft. Sei es als „Doppelagent von Zhaun“, der sich am Esstisch andient, oder als „in Schuld stehender Runenmagier“, der in den Ausgaben von „Feste Größe Demacias“ sinniert - Xin Zhao gibt keinerlei Hinweise preis, die die Neugier der Massen befriedigen könnten ... und das mit gutem Grund.<br><br>Vor der Bildung der Liga der Legenden war Noxus bekannt für ein Spektakel namens „Die Zerfleischung“. Es war ein Gladiatorwettbewerb mit einer grausamen Regel: jedes Mal, wenn ein Kämpfer einen Kampf gewann, erhöhte sich die Anzahl der Gegner (in der Regel Kriegsgefangene), gegen die er im nächsten Kampf gleichzeitig kämpfen musste. Dies bedeutete in der Regel den Tod eines jeden Wettkämpfers, aber dafür mit einem unvergleichlichen Ruhm. Xin Zhao, damals bekannt als Viscero, wurde für einen Kampf gegen 300 Soldaten vorgesehen, fast 6-mal soviel wie der bisherige Rekord. Dies war offensichtlich als sein letzter Kampf geplant. Jarvan II., der von dieser geplanten unvergleichlichen Meisterleistung hörte, infiltrierte die Arena um ihm eine Alternative anzubieten: Demacia dienen und jene bestrafen, die ihn unausweichlich zum Tode verurteilt hatten, als Gegenleistung für seine Freiheit. Xin Zhao, erstaunt dass ein König für ihn sein eigenes Leben riskierte, willigte ein. Im Schutze eines vereinbarten Angriffs von Demacia auf Noxus befreite Jarvan Xin Zhao und seine 300 vorgesehenen Gegner. Auf ihrem Rückzug fing Xin Zhao einen vergifteten Pfeil ab, der für Jarvan gedacht war. Diese loyale Tat eines Mannes, der sich keinen Gehorsam anderen gegenüber geschworen hatte, brachte ihm einen Platz an der Seite des Königs bis zu dessen Tod ein. Nun, da er seinem Sohn Jarvan III. dient, tritt Xin Zhao in einen neuen Ring: die Richtfelder, um für das Land zu kämpfen, das ihn aufgenommen hat, und um das Vermächtnis jenes Mannes zu ehren, der seinem Leben einen Sinn gegeben hat.<br><br>„Der Tod ist unvermeidbar, man kann nur Niederlagen abwenden.“ - Demacianisches Handbuch der Waffen<br>', 'Mit seinem Angriff und seiner ultimativen Fähigkeit, die Schaden an allen Einheiten um ihn herum verursachen, ist Xin Zhao ein guter Initiator. Dein Team sollte möglichst weit verteilt stehen, bis er seine ultimative Fähigkeit gezündet hat.', 'Xin Zhao verlässt sich vor allem auf „Drei-Krallen-Schlag“ für mehr Schaden und verkürzte Abklingzeiten, weshalb es einen spürbaren Unterschied bewirken kann, wenn du es schaffst, seine Kombination zu unterbrechen.', '', 'Xin Zhao ist ein guter Initiator für Kämpfe. Führe den Angriff an und benutze deine ultimative Fähigkeit, um soviel Schaden wie möglich zu verursachen.', 'Oft ist es besser, mindestens eine Stufe von „Schlachtruf“ freizuschalten, damit du von der Heilung profitieren kannst.', 'Versuche, dich in die richtige Position zu bringen, damit das Zurückstoßen durch deine ultimative Fähigkeit möglichst effektiv ausfällt.', 0, 0, 0, 2899, ' Fighter Assassin');
INSERT INTO `champions` (`id`, `name`, `champion_id`, `created_at`, `updated_at`, `key`, `attackrange`, `mpperlevel`, `mp`, `attackdamage`, `hp`, `hpperlevel`, `attackdamageperlevel`, `armor`, `mpregenperlevel`, `hpregen`, `critperlevel`, `spellblockperlevel`, `mpregen`, `attackspeedperlevel`, `spellblock`, `movespeed`, `attackspeedoffset`, `crit`, `hpregenperlevel`, `armorperlevel`, `title`, `lore`, `enemytips1`, `enemytips2`, `enemytips3`, `allytips1`, `allytips2`, `allytips3`, `f2p`, `sale`, `sale_price`, `votes`, `tags`) VALUES
(110, 'Twitch', 29, '2014-10-21 17:54:20', '2015-04-09 10:19:52', 'Twitch', 550.00, 40.00, 287.20, 49.04, 525.08, 81.00, 3.00, 23.04, 0.45, 6.00, 0.00, 0.00, 7.25, 3.38, 30.00, 330.00, -0.08, 0.00, 0.60, 3.00, 'Die Seuchenratte', 'H.I.V.E. Vorfallsbericht<br>Verstoß: Industriell betriebene Tötung<br>Status der Akte: Ungelöst<br>Ermittelnder Agent: Rol, P.<br><br>Team reagierte auf Meldung verdächtiger Person, kriminelle Aktivität; bewegte sich weiter zur Sickergrubenfabrik in Sektor 90TZ. Sektor 90TZ offenbar nicht mehr vorhanden. An seiner Stelle: Krater, Rauch, giftige Dämpfe. Befragung privater Sicherheitskräfte lässt auf Notwendigkeit besserer privater Sicherheitskräfte schließen.<br>Einsatzteam betrat Krater. Giftige Abwässer ließen Gebäudetrümmer schmelzen. Zwei Überlebende ausfindig gemacht, einer teilweise verflüssigt und auf den Boden tropfend. Sechs tote Körper innerhalb des Trümmerhaufens aufgefunden, drei davon nur zu Teilen; zwei scheinen von vor dem Zwischenfall zu stammen. Todesursachen unter anderem abruptes Abbremsen, ätzende Liquidation und/oder tödliche Wunden durch Armbrustbeschuss. Unklar, ob Täter Laboratorium zerstören oder Spuren verwischen wollte.<br><br>1. Überlebender (Ra Qintava, Anlagenforscher) zum Verhör gebracht, konnte aber wegen 1) posttraumatischem Stress und 2) Liquefaktion von Zunge und unterem Kiefer keine Aussagen machen. Warten auf toxischen Befund und Anpassen einer Prothese.<br><br>Such- und Rettungsteam entdeckte offenbar Barackenstadt, die aus Müll errichtet wurde. Unter den sichergestellten Gegenständen befanden sich unter anderem:<br><br>     57 durchnässte Liebesromane, unleserlich, mit handschriftlichen Anmerkungen<br>     108 Flaschen, ohne Aufschrift (möglicherweise giftige Abwässer)<br>     90 Kilo Kaugummi (möglicherweise eine Art Installationskunstprojekt)<br>     1 Becher Zehennägel, gekennzeichnet nach Zehen, Datum und Gemütslage<br><br>2. Überlebende (Valori Olant, Schlammanalystin) auf dem Weg der Besserung; nach längerer therapeutischer Elektroschock-Behandlung wieder klar. Aussageprotokoll in Auszügen:<br><br>     V.O.: ICH MUSS ETWAS TUN ... <br>     SCHWESTER: Sie hat so viel Blut verloren ...<br>     P.R.: Ihre Mitarbeiter haben mehr als das verloren ...<br>     V.O.: ES IST IMMER NOCH DA DRAUẞEN!<br>     P.R.: Gute Frau, sie müssen sich konzentrieren. Sagen sie mir, wie er ausgesehen hat.<br>     V.O.: WIE EINE RATTE! (Pause)<br>     SCHWESTER: Wie eine was?<br>     P.R.: Sie meinen klein? Mit Knopfaugen? Gesicht wie eine Ratte ...?<br>     V.O.: ICH MEINE, ES SAH AUS WIE EINE RIESIGE, GOTTVERDAMMTE RATTE! (Pause). MIT EINER ARMBRUST! (Pause).<br>     P.R.: (zur Schwester) Können wir sie mit Schmerzmitteln beruhigen ...?<br>     V.O.: SIE HÖREN MIR NICHT ZU! ES IST EINE MORDENDE, PSYCHOPATHISCHE, RIESIGE, DURCHGEDREHTE RATTE!  <br>     UND SIE HAT EINE WESTE AN!<br>     P.R.: Schwester?<br>     SCHWESTER: (injiziert Sedativum in Olants Arm) Bin dabei.<br>     [ZENSIERT]<br>     V.O.: Wir waren doch nur einfache Wissenschaftler. Wir arbeiteten daran, menschliche Abfälle zu billiger Babynahrung zu verarbeiten ... [ZENSIERT] Ich sah ... ich weiß nicht, wie ich es sonst ... diese wildgewordene, gewaltige RATTE ... die uns anschrie! Und gegen die Fässer trat! Sie spuckte auf unsere Nahrung! [ZENSIERT] Das Labor war versiegelt. Überall lagen Industrieabfälle herum. Wir konnten nicht entkommen. [ZENSIERT] Ich wachte auf und alles war dunkel. Säure hatte meine Augäpfel verätzt. Ich konnte diese unruhige Bestie RIECHEN; sie war nur Zentimeter von meinem Gesicht entfernt. Sie sagte „NIEMAND STIEHLT TWITCH SEINE LECKEREIEN!“, kicherte wie irre und flitzte davon ... Ich kann sie noch immer in meinem Kopf riechen. OH MEIN GOTT, ICH KANN SIE NOCH IMMER RIECHEN ...<br><br>Ende des Protokolls. Zu diesem Zeitpunkt begann das Opfer zu schreien; hat seitdem nicht aufgehört. <br><br>[NACHTRAG: Qintava, schriftliche Aussage]<br>Beschreibung des Verdächtigen, wie berichtet:<br>     NAME/BEKANNTER DECKNAME: „Twitch“<br>     GESCHLECHT: Männlich (nicht bestätigt)<br>     ALTER: Unbekannt<br>     GRÖSSE: 1,46 Meter (gebückt)<br>     GEWICHT: < 45 Kilo (nass)<br>     BESONDERE  MERKMALE: Ist eine riesige Ratte<br>     STATUS: Auf freiem Fuß; bewaffnet, extrem gefährlich; NICHT ANGREIFEN!<br><br>H.I.V.E - An der Sache unbedingt dranbleiben!', 'Twitch ist nicht besonders widerstandsfähig. Arbeite gemeinsam mit Teammitgliedern und fokussiere ihn, wenn du ihm ungetarnt begegnest.', '„Zauberschild“ wehrt zwar den Schaden von „Tödliches Gift“ nicht ab, dafür aber die Effekte, die Twitch damit auslösen kann.', 'Wenn du annimmst, Twitch habe die Lane verlassen, dann lass es deine Teammitglieder umgehend wissen.', 'Twitchs Angriffstempo gehört zu den schnellsten im Spiel. Versuche, dies mit Gegenständen zu unterstützen, die Treffereffekte bewirken, etwa „Schwarzes Beil“ oder „Ende der Weisheit“.', '„Kontaminieren“ besitzt eine große Reichweite. Versuch zuvor, so viel „Tödliches Gift“ wie möglich zu verteilen.', 'Du kannst fliehende Gegner außerhalb deiner Angriffsreichweite mit „Giftflasche“ verlangsamen.', 1, 0, 0, 3032, ' Marksman Assassin'),
(111, 'Master Yi', 11, '2014-10-21 17:54:20', '2015-04-09 10:19:52', 'MasterYi', 125.00, 42.00, 250.56, 60.04, 598.56, 92.00, 3.00, 24.04, 0.45, 7.59, 0.00, 1.25, 7.25, 2.00, 32.10, 355.00, -0.08, 0.00, 0.65, 3.00, 'Der Wuju-Schwertkämpfer', 'Mit Hilfe der uralten Kampfkunst des Wuju hat Master Yi seinen Körper gestählt und seinen Verstand geschärft, bis Gedanke und Bewegung eins wurden. Auch wenn er die Anwendung von Gewalt als letzten Ausweg wählt, stellen die Anmut und die Geschwindigkeit, mit der er seine Klinge schwingt, sicher, dass die Lösung stets zügig erfolgt. Als letzter Praktizierender des Wuju hat Master Yi sein Leben der Suche nach fähigen Schülern gewidmet, welche das Vermächtnis seines verlorenen Volkes weitertragen sollen.<br><br>Noch bevor Yi ein Meister des Wuju wurde, zählte er zu den begabtesten Praktizierenden dieser geheimnisvollen Kampfkunst. Schon bald stellte er seine Meisterschaft unter Beweis, als sein entlegenes Dorf die Nachricht über eine gewaltige noxische Invasion erreichte. Yi fegte über die Schlachtfelder Ionias und schlug die Woge der mächtigen Infanterie von Noxus mit schnellen und tödlichen Schlägen zurück, was das Oberkommando von Noxus tief beschämte. Als sie erkannten, welche Gefahr die Jünger des Wuju für ihre Invasion darstellten, entschlossen sich die Noxier, einen albtraumhaften, chemischen Angriff über die Heimat der tödlichen Kunst zu entfesseln. All jene, die irgendwie das giftige Machwerk überlebt hatten, waren unwiederbringlich dem Wahnsinn anheimgefallen. Yis Heimat war in Trümmern zurückgelassen worden.<br><br>Als der Krieg beendet war, kehrte Yi zu den grotesken Überresten seines Dorfes zurück. Dort wurde er zum letzten Opfer des Angriffs. Nachdem, wenn nicht sein Körper, so doch seine Seele erheblichen Schaden genommen hatte, klammerte Yi sich an das einzige Gefühl, das noch in seinem Herzen war: Rache. Allein von dem Verlangen, all jene zu bestrafen, die seine Heimat zerstört hatten, angetrieben, verbrachte Yi viele Jahre damit, in völliger Abgeschiedenheit zu trainieren. Er wurde ein noch tödlicherer Kämpfer als je zuvor, doch die wahre Meisterschaft des Wuju blieb ihm noch immer versagt.<br><br>Als Yis Frustration ihren Höhepunkt erreicht hatte, unterbrach ein Affe mit ungewöhnlich edlem Auftreten seine Übungseinheit. Er stand aufrecht und so groß wie ein Mensch da, beobachtete Yi und ahmte seine Bewegungen nach. Yi scheuchte den Affen fort, doch das flinke Wesen hatte großen Spaß daran, Yis eigene Techniken gegen ihn einzusetzen. Allmählich spürte Yi, wie sein Ärger nachließ, während er sich mit dem verspielten Tier balgte, und als die Last des Hasses vollends verflogen war, konnte er den Affen bei seinem Schwanz packen. Yi verstand in diesem Moment, dass er nie ein Meister des Wuju werden könnte, so lange er die Kampfkunst aus Rache betrieb. Und als er den Affen freiließ, trennte er sich auch von seinem Verlangen, das Blut seines Feindes zu vergießen.<br><br>Yi dankte dem Affen dafür, dass er ihm gezeigt hatte, wofür er die ganze Zeit blind gewesen war, und war überrascht, als das Geschöpf ihm daraufhin antwortete. Er wünschte sich, Yis Kunst des Kämpfens zu erlernen. Das war eine eigenartige Bitte, doch dadurch sah Yi einen neuen Weg vor sich liegen: der Weg, das Andenken an sein verlorenes Volk zu ehren, bestand darin, dessen Lehren an eine neue Generation weiterzugeben.<br><br>„Die Schneide der schärfsten Klinge kann es nicht mit der Ruhe des friedvollen Geistes aufnehmen.“ - Master Yi<br>', '„Meditieren“ ist ein effektiver wiederholender Heilzauber, aber ein noch schwacher Master Yi ist anfällig gegen koordinierte Teamhinterhalte.', 'Wenn Master Yi versucht, mit „Eröffnungsschlag“ effektiver Vasallen zu töten, dann greife ihn einige Male an, damit er zum Heilen Mana für „Meditieren“ aufbrauchen muss.', 'Auch wenn Master Yi beim Einsatz von „Highlander“ nicht verlangsamt werden kann, können andere kampfunfähig machende Fähigkeiten ihn aufhalten.', 'Trittst du in deiner Lane gegen Fernkämpfer an, kann dir „Meditieren“ den notwendigen Vorteil verschaffen, um länger als diese in der Lane zu bleiben und schneller als diese Stufen zu gewinnen.', 'Der „Wuju-Stil“ ist besonders am Anfang sehr stark, um Todesstöße gegen Vasallen zu erzielen.', 'Versuch „Eröffnungsschlag“ auf einen Vasallen vor einem gegnerischen Champion anzuwenden, damit du am Ende des Zaubers eine sichere Distanz aufgebaut hast.', 0, 0, 0, 1102, ' Assassin Fighter'),
(112, 'Taric', 44, '2014-10-21 17:54:20', '2015-04-09 10:19:52', 'Taric', 125.00, 56.00, 349.08, 57.88, 619.20, 90.00, 3.50, 25.88, 0.80, 7.94, 0.00, 1.25, 6.00, 2.02, 32.10, 340.00, 0.00, 0.00, 0.50, 3.20, 'Der Edelsteinritter', 'Es gibt eine Form der Magie, die vielen Bewohnern Runeterras unbekannt ist und die bei den wenigen, die sich ihrer Existenz bewusst sind, einen schlechten Ruf hat. Es ist die Magie der Erde, die ihre Macht aus den Schwingungen von Kristallen und Edelsteinen bezieht. Taric, der Edelsteinritter, ist der einzige auf Runeterra, der diese Form der Magie praktiziert, nachdem er plötzlich aus einer weit entfernten Welt nach Runeterra beschworen wurde. In seiner Heimat war Tarics Vater in seiner Heimatstadt ein angesehener Heiler und Taric war schon als kleiner Junge an den Tätigkeiten seines Vaters interessiert. Auch wenn sein Verständnis von Kräutern, Pflanzen und Tiermedikamenten stetig wuchs, war es die Macht der Edelsteine, die den Heranwachsenden am meisten faszinierte. Es dauerte nicht lange, bis Taric die wohlbehütete Bibliothek seines Vaters erschöpft hatte und seinen eigenen Weg einschlug. Er wollte den Leuten helfen, aber nicht nur, indem er ihre Wunden versorgte und ihre Sorgen linderte. Er würde kein Heiler werden, sondern ein Verteidiger, jemand, der mit Hilfe der Macht der Erde bewahrt und beschützt.<br><br>Taric wurde zu einem wandernden Ritter, der im ganzen Land berühmt als Hüter der Gerechtigkeit war, bis zu dem Tage, an dem ein Beschwörungszauber ihn aus seiner Heimat riss und nach Runeterra brachte. Auch wenn er zunächst orientierungslos und verwirrt war, fühlt er nun, dass der Kontinent Valoran jemanden wie ihn braucht. Taric vermisst seine Welt zwar, ist aber glücklich, in der Liga zu kämpfen und als Beschützer all jener zu dienen, die ihn brauchen. Seine gepflegte und stilvolle Erscheinung zusammen mit seiner schimmernden Edelsteinrüstung und -waffen haben ihn schnell zu einer Berühmtheit in der Liga der Legenden werden lassen. Aus diesem Grund sind Valorans Medien sehr an seinem Privatleben interessiert. Doch während er sehr offen und freigiebig in Bezug auf sein Leben als Champion ist, spricht er nur wenig über sein Leben jenseits der Liga und wahrt seine Privatsphäre.<br><br>„Tarics Vater hat ihm beigebracht, dass jeder Stein eine Bedeutung hat. Für Tarics Gegner bedeuten alle Steine Ärger.“', 'Taric hat durch seine Fähigkeit „Zerschmettern“ eine sehr hohe Rüstung, wodurch Zauberer ihn wesentlich leichter verletzen können als Kämpfer mit normalem Schaden.', 'Notiere dir, welche Beschwörerzauber Taric hat. Falls er „Klarheit“ hat, kann es vollkommen nutzlos sein, ihn gleich mit Zaubern zu befeuern.', '', 'Wendet Taric „Verzaubern“ auf sich selbst an, wird er stärker geheilt. Dadurch ist er sehr effektiv darin, das Feuer von Türmen auf sich zu lenken.', 'Manchmal ist es besser, „Zerschmettern“ nicht einzusetzen und die zusätzliche Rüstung zu behalten.', '', 0, 0, 0, 1427, ' Support Fighter'),
(113, 'Amumu', 32, '2014-10-21 17:54:20', '2015-04-09 10:19:53', 'Amumu', 125.00, 40.00, 287.20, 53.38, 613.12, 84.00, 3.80, 23.54, 0.52, 8.88, 0.00, 1.25, 7.38, 2.18, 32.10, 335.00, -0.02, 0.00, 0.85, 3.30, 'Die traurige Mumie', 'Amumu ist eine winzige, lebendige Mumie, die auf der Suche nach ihrer wahren Identität die Welt durchstreift. Er hat sich, in Bandagen gewickelt, aus einer Grabstätte in der Shurima-Wüste erhoben und weiß nichts über seine Vergangenheit. Stattdessen ist er von einer unkontrollierbaren Traurigkeit erfüllt.', 'Vermeide es, dich mit anderen Verbündeten Amumu zu nähern, wenn er seine ultimative Fähigkeit bereit hat.', 'Unberechenbare Bewegungen oder das Verbergen hinter Vasallen-Wellen erschwert es Amumu, einen Kampf mit dem „Bandagenwurf“ zu eröffnen.', 'Amumus „Verzweiflung“ macht für Nahkämpfer das Anhäufen von Gegenständen mit Leben zu einer gefährlichen Angelegenheit.', 'Amumu ist sehr von seinen Verbündeten abhängig. Versuch mit ihnen zusammen zu arbeiten, um eine maximale Effektivität zu erreichen.', 'Amumu profitiert sehr stark von Gegenständen, die die Abklingzeiten herabsetzen, auch wenn es häufig schwer ist, an diese zu gelangen. Versuch möglichst die Verbesserung des Golems zu bekommen, um keine Attribute für kürzere Abklingzeiten zu opfern.', '„Verzweiflung“ ist besonders gegen robuste Nahkämpfer interessant. Versuche daher in Reichweite der Gegner mit dem meisten Leben zu bleiben.', 0, 0, 0, 1791, ' Tank Mage'),
(114, 'Gangplank', 41, '2014-10-21 17:54:20', '2015-04-09 10:19:53', 'Gangplank', 125.00, 40.00, 282.20, 59.04, 631.08, 81.00, 3.00, 26.04, 0.70, 5.51, 0.00, 1.25, 7.67, 2.75, 32.10, 345.00, -0.04, 0.00, 0.75, 3.30, 'Die Salzwassergeißel', 'Gangplank wurde als Sohn von Vincent dem Schatten, einem schrecklichen Piratenkapitän, geboren - einem der reichsten und gefürchtetsten Seeräuber auf der ganzen Insel der Blauen Flamme. Man könnte meinen, diese Herkunft brächte dem Jungen ein angenehmes Leben voller Privilegien ein, aber in Wahrheit war genau das Gegenteil der Fall. In der Stadt Bilgewasser aufzuwachsen, ist nicht leicht. Piraten sind nicht für ihr Mitgefühl bekannt und diese Einstellung reicht auch bis in ihre Familien hinein. Vincent wollte, dass sein Sohn zu einem zähen und starken Burschen heranwächst und war deshalb besonders streng mit dem jungen Gangplank. Schon als Kind war Gangplank hinterlistig wie eine Schlange und man sagt, er habe mit offenen Augen geschlafen. Als er heranwuchs, wurde der junge Mann schnell zum skrupellosesten und gefürchtetsten Piraten in Bilgewasser. Sein Paps war nie stolzer auf seinen Sohn, als an dem Tag, als Gangplank seinen achtzehnten Geburtstag feierte - und seinem alten Herren einen Dolch in den Rücken jagte und das berühmte Piratenschiff, Todesquell, für sich beanspruchte.<br><br>Der Kontinent Valoran allerdings ist für einen Piraten ein gefährlicher Ort und Gangplank hat die Zeichen der Zeit erkannt. Das Piratenversteck, das als Bilgewasser bekannt ist, würde bald durch den Sog valoranischer Politik und der Kriegsakademie niedergemacht. Es wurde Zeit, dass Bilgewasser seinen eigenen Champion bekam, der die Stadt in der Liga der Legenden repräsentiert, und wer wäre besser dafür geeignet, als der grimmigste Pirat von allen? Man sagt, Gangplank habe genügend Macht und Einfluss, um in seiner Heimat den Titel des Piratenkönigs für sich zu beanspruchen, dass er aber den rechten Augenblick abwartet, um genug Ansehen als Champion zu erlangen, bevor er wieder in sein Leben als Seeräuber zurückkehrt.<br><br>„Yo ho, puste den Kerl um. Oder schieß'' ihm wenigstens in den Rücken und schnapp'' dir seine Beute.“', '„Unterredung“ verursacht sehr viel normalen Schaden. Gegenstände mit Rüstung können gegen einen zu guten Gangplank helfen.', 'Die kumulierte Verlangsamung von „Groggetränkte Klinge“ kann es dir schwer machen, von Gangplank wegzukommen. Weiche seinen Angriffen 3 Sekunden lang aus, dann werden alle Kumulationen aufgebraucht sein.', '', '„Unterredung“ wendet auch Treffereffekte, wie sie durch „Frosthammer“ oder „Schwarzes Beil“ verursacht werden, an.', 'Achte auf Champions mit wenig Leben auf der Karte, dann kann „Kanonensperrfeuer“ zu ihrem überraschenden Ende führen.', 'Versuch „Kanonensperrfeuer“ auf den Fluchtweg fliehender Gegner zu plazieren.', 0, 0, 0, 1576, ' Fighter Support'),
(115, 'Trundle', 48, '2014-10-21 17:54:20', '2015-04-09 10:19:53', 'Trundle', 125.00, 45.00, 281.60, 60.04, 616.28, 96.00, 3.00, 27.54, 0.60, 9.43, 0.00, 1.25, 7.50, 2.90, 32.10, 350.00, -0.07, 0.00, 0.85, 2.70, 'Der Trollkönig', 'Trundle ist ein schwerfälliger und verschlagener Troll mit boshaftem Charakter. Es gibt nichts, was er nicht bis zur Unterordnung schlagen könnte, bis es seinem Willen gehorcht, nicht einmal das Eis selbst. Mit seiner gewaltigen, gefrorenen Keule lässt er seine Gegner erzittern und durchbohrt sie mit schartigen Eissplittern. Erbittert um sein Territorium kämpfend jagt Trundle jeden, der dumm genug ist, sein Revier zu betreten, und lacht, während das Blut der Eindringlinge im Boden der Tundra versickert.<br><br>Trundles Kriegstrupp folgte einst einem dummen und feigen Stammesführer. Unter der Herrschaft solch eines schwachen Anführers fürchtete Trundle, er und seine Sippe würden zur Beute anderer Trollhorden, die sich überall in der Eiswüste herumtreiben. Als seine Herausforderung an den Stammesführer in einer Niederlage endete, tat Trundle etwas, das nicht sehr trollhaft war: anstatt auf seine Fäuste verließ er sich auf seinen Verstand. Blitzschnell reagierte er und entspann eine große Geschichte über die Trollanführer längst vergangener Zeiten und behauptete, diese hätten sehr mächtige Waffen als Symbole ihres Herrschaftsanspruches getragen. Obwohl er die Geschichte vom Fleck weg erfunden hatte, wettete Trundle, dass er, sollte er eine solche Waffe finden oder stehlen können, der rechtmäßige Anführer des Kriegstrupps werden würde. Die Trolle glaubten ihm, doch hielt ihn niemand für fähig, solch eine Herausforderung zu meistern. In dem Wissen, der überhebliche Troll würde beim bloßen Versuch umkommen, stimmte der törichte Stammesführer zu und Trundle zog unter dem wohlbekannten Klang des Gelächters hinaus.<br><br>Auf sich allein gestellt, aber unerschrocken, wagte sich Trundle in das Unheil verkündende Reich der gefürchteten Eishexe. Dort, zwischen uralten und gefährlichen Geheimnissen verborgen, plante er, eine Waffe zu finden, um seine ausgeklügelte Geschichte zu beweisen. Er überwältigte die Wachen der Eishexe und war auch für ihre düsteren, magischen Fallen zu gerissen, doch passte nichts, was er plündern konnte, zu der Macht, die er seiner Sippe beschrieben hatte. Schließlich fand er eine unerwartete Beute: eine riesige und magische Keule aus nie schmelzendem Wahren Eis. Als er die Waffe an sich nahm, erstaunte ihn die kalte Macht, die ihn durchströmte. Doch dann erschien die wutentbrannte Eishexe höchstpersönlich. Als sie ihre dunkle Magie beschwor, glaubte Trundle, das Ende stünde ihm bevor und er habe sein Volk enttäuscht, doch erneut hatte er eine kluge Idee. Mit wissendem Lächeln machte er der Eishexe ein hinterhältiges Angebot: eine Trollarmee, so erzählte er ihr, wäre sehr viel nützlicher als ein einzelner Trollleichnam ...<br><br>Als Trundle zum Kriegstrupp zurückkehrte, verbeugten sich die anderen Trolle angesichts seiner Eroberung. Er nannte seine Waffe „Knochensplitter“ und genoss den Moment, als der blanke Schock im Gesicht seines Stammesführers zu lesen war, bevor er klein beigab. Das Kommando an sich reißend verkündete Trundle, dass es keine Stammesführer mehr geben würde - nur einen Trollkönig, vor dem alle Mitglieder seiner Sippe niederzuknien haben. Die Trolle vereinten sich hinter ihrem ungestümen, neuen Anführer und bereiteten sich auf den bevorstehenden Krieg vor. Mit Trundle an der Spitze des Ansturms ist die Zeit der Trolle endlich angebrochen. <br><br>„Überliste jeden, den du nicht schlagen kannst; und schlage jeden, den du nicht überlisten kannst.“ - Trundle<br>', 'Trundle ist sehr gut darin, an einer bestimmten Stelle zu kämpfen. Versuche, ihn aus seiner „Eisigen Domäne“ zu locken.', 'Versuche, möglichst schnell aus dem Wirkbereich seiner „Eissäule“ zu entkommen, da sie dich deutlich verlangsamt.', '', 'Trundle sticht beim Kampf in seiner „Eisigen Domäne“ hervor. Versuche Gegner hinein zu locken.', 'Benutze „Unterwerfen“, um einen gegnerischen Tank „aufzuweichen“ oder ein Ziel für den Fokus deines Teams zu schwächen.', '„Mampfen“ eignet sich gut, um den normalen Schaden von Gegnern zu senken; konzentriere dich damit auf Gegner, die vor allem auf Angriffsschaden setzen.', 1, 0, 0, 2056, ' Fighter Tank'),
(116, 'Kassadin', 38, '2014-10-21 17:54:20', '2015-04-09 10:19:54', 'Kassadin', 150.00, 70.00, 347.60, 58.85, 564.04, 78.00, 3.90, 23.38, 0.80, 7.79, 0.00, 0.00, 6.00, 3.70, 30.00, 340.00, -0.02, 0.00, 0.50, 3.20, 'Der Leerengänger', 'Es gibt einen Ort zwischen den Dimensionen, zwischen den Welten. Einige nennen ihn die Außenwelt, andere nur das Unbekannte. Die meisten nennen ihn jedoch die Leere. Trotz ihres Namens ist die Leere kein verlassener Ort, sondern vielmehr Heimat unaussprechlicher Dinge, für Menschen nicht zu ertragender Horror. Auch wenn das Wissen darüber in der modernen Zeit verloren gegangen ist, gibt es einige, die durch Zufall herausgefunden haben, was auf der anderen Seite ist und die sich nie wieder abwenden konnten. Kassadin ist eine solche Kreatur, ein Mensch der dazu gezwungen war, ins Angesicht der Leere zu blicken und dadurch für immer verändert wurde. Er war einst ein Forscher auf der Suche nach verbotenem Wissen und hat herausgefunden, dass das, was er eigentlich suchte, etwas ganz anderes war. Er ist einer der wenigen, die ihren Weg in das vergessene Icathia gefunden haben und überlebten, um davon zu berichten, indem sie den winzigen Brotkrumen, die in uralten Texten versteckt sind, folgten.<br><br>Inmitten einer verfallenden, riesigen Stadt enthüllte Kassadin Geheimnisse, die er nie verraten wird - Geheimnisse, die ihn vor Furcht erzittern ließen, angesichts der Dinge, die da kommen werden und ihm offenbart wurden. Die Macht des Ortes drohte ihn für immer zu verzehren, doch Kassadin wählte den einzigen Weg, der ihm möglich war, um zu überleben - er ließ die Leere in sich eindringen. Rätselhafterweise konnte er die fremden Triebe, die mit der Leere einhergingen, überwinden und ging daraus als etwas Übermenschliches hervor. Obwohl ein Teil von ihm an diesem Tag starb, weiß er, dass er Valoran vor den Dingen schützen muss, die an der Tür kratzen und nur darauf warten, hineinzugelangen und Qualen über die Welt zu bringen. Sie sind nur noch einen Schritt entfernt ... das bezeugt das Erscheinen der als Cho''Gaths bekannten Abscheulichkeit.<br><br>„Wenn du in die Leere starrst, kannst du sie nicht hinter dir lassen. Wenn du Kassadin anschaust, ist er wahrscheinlich bereits da.“', 'Kassadin verursacht größtenteils magischen Schaden. Falls er seine Sache (zu) gut macht, solltest du in Erwägung ziehen, Gegenstände mit Magieresistenz, wie etwa „Merkurs Schuhe“ und „Schleier der Todesfee“, zu kaufen.', 'Jedes Mal, wenn Kassadin seinen „Kluftgang“ wiederholt einsetzt, kostet es ihn mehr und mehr Mana. Behalte dies im Hinterkopf, wenn du ihn verfolgst.', 'Damit er seine Verlangsamung „Energiewelle“ ausführen kann, bedarf es 6 eigenen oder fremden genutzten Fähigkeiten. Setze deine eigenen Fähigkeiten im Kampf gegen ihn mit Bedacht ein, sobald er diese Fähigkeit lernt.', 'Kassadin kann mit unterschiedlichen Gegenständen gespielt werden: Mit Mana und Fähigkeitsstärke als Zauberer oder mit verkürzten Abklingzeiten und Magieresistenzen als Anti-Zauberer.', 'Kassadins ultimative Fähigkeit ist vielseitig einsetzbar und schneller wieder bereit als andere vergleichbare Fähigkeiten. Gebrauche sie häufig.', 'Versuch die Verbesserung vom „Uralten Golem“ zu bekommen, um den steigenden Manakosten des „Kluftgangs“ entgegenzuwirken.', 0, 0, 0, 1296, ' Assassin Mage'),
(117, 'Vel''Koz', 161, '2014-10-21 17:54:20', '2015-04-09 10:19:54', 'Velkoz', 525.00, 45.00, 325.60, 54.94, 507.68, 76.00, 3.14, 21.88, 0.80, 5.42, 0.00, 0.00, 6.00, 1.36, 30.00, 340.00, 0.00, 0.00, 0.55, 3.50, 'Das Auge der Leere', 'Ich trete in das blendende Licht. Blinzeln. Blinzeln, blinzeln, blinzeln. Meine Augen passen sich an und werten die Landschaft vor mir aus.<br><br>Da trippelt etwas. Ich sehe auf eine kleine, weiße Kreatur herab, die auf ihren Hinterbeinen steht und an meinem Körper schnüffelt. Sie fasziniert mich.<br><br>Wozu bist du gut?<br><br>Ich analysiere die Kreatur. Ein Blitz aus heißem, magentafarbenem Licht, ein Staubhaufen, wo es kauerte.<br><br>Säuger ... nachtaktiv ... Beeindruckendes Hörvermögen. Unglaublich schwach. Trotzdem vermehren sie sich so üppig.<br><br>„Hm“, murmele ich zu mir selbst. Hoffentlich wird es hier noch komplexere Dinge zu erforschen geben. Diese faszinieren mich.<br><br>Aufnehmen und lernen: Das ist mein Ziel. Die anderen, die mit mir reisen, sind primitiv: töten und fressen, töten und fressen. Ich muss alle verfügbaren Informationen sammeln - alle wertvollen Ressourcen ernten.<br><br>Schließlich kommen wir in eine Stadt, die zerstört ist, bis auf einen unberührten Turm. Er scheint beschützt zu werden - oder absichtlich unangetastet geblieben zu sein. Ich zersetze den Aufbau der Ruinen. Meine Analysen ergeben, dass dieses Habitat ein Ort großer Magie war. Ich bin nicht überrascht, dass es Ziel solcher Zerstörung war. Der Turm hat etwas Verlockendes an sich. Während die anderen plündern, betrete ich die Zitadelle.<br><br>Überall liegen geheimnisvolle Gerätschaften herum. Ich untersuche eine. Ein weiterer Blitz heißen, magentafarbenen Lichts, ein weiterer Staubhaufen.<br><br>Faszinierend: Ein Werkzeug, um ihr Konzept von Zeit zu verändern.<br><br>Merkwürdig.<br><br>Beispiellos.<br><br>Dem Zustand des Turmes nach zu urteilen, hat der Besitzer ihn erst vor kurzem verlassen. Die zurückgelassenen Artefakte haben an mehr als einem Ort und zu mehr als einer Zeit existiert. Einige sind komplexer als andere. Alle sind eindrucksvoller als alles, was ich auf dieser Ebene gesehen habe. Ganz offensichtlich weiß der Besitzer von Dingen, derer ich noch auf keiner meiner Reisen gewahr wurde.<br><br>Ich brauche dieses Wissen.<br><br>Als ich den Turm verlasse, bemerke ich, dass die Anderen auf den Eingang zukommen, bereit ihn zu zerstören, wie sie auch alles andere zerstört haben, auf das wir stießen. Sie werden meinem Ziel nur im Wege stehen. Es gibt ein paar Dinge, welche die Leere nicht wahllos verschlingen sollte.<br><br>Ohne Vorwarnung lasse ich eine Tentakel hervorschnellen, deren Spitze vor Hitze weiß glüht. Blitze zucken durch die erste Kreatur und schlagen sie zurück. Ihre Schreie verstummen, als ich alle drei Gliedmaßen ausfahre. Energie knistert von einem zum anderen, verbrennt die Luft dort, wo die Ströme sich treffen. Die anderen beiden rennen. Sie wissen, was sie erwartet.<br><br>Müssen sie immer fliehen?<br><br>Ich öffne mein Auge ganz weit und entfessele einen Energiestrahl, der den flüchtenden Kreaturen folgt. Sofort zerfallen sie zu Asche. „Hmm. Der Schmelzpunkt von Leerenwesen ist nicht konsistent”, bemerke ich.<br><br>Doch dies hat keine Konsequenzen. Der Hunger in mir wächst an. Ich bin ausgehungert. Unersättlich wie nie zuvor.<br><br>Ich habe einen flüchtigen Blick auf das ultimative Wissen erhascht.<br><br>Und ich werde es erlangen.', 'Vel''Koz ist besonders gefährlich, wenn er allein kämpft. Versuche ihn schon früh auszuschalten.</li>', 'Vel''Koz ist relativ unbeweglich und anfällig für Hinterhalte.</li>', '„Lebensformdesintegrator“ kann durch Betäuben, Verstummen und Hochschlagen unterbrochen werden.</li>', 'Nutze beim Laning „Leerenspalt“, um Vasallen zu töten und bei deinem Gegenspieler Steigerungen von „Organische Zersetzung“ aufzubauen. Anschließend kannst du deine anderen Fähigkeiten einsetzen.</li>', 'Wenn du „Plasmaspaltung“ diagonal abfeuerst und sie sich auf maximaler Reichweite aufspaltet, kommst du an Gegner heran, die außerhalb der Reichweite des ursprünglichen Projektils stehen. Allerdings erfordert das schon etwas Geschick.</li>', 'Überlege dir genau, wann du „Lebensformdesintegrator“ einsetzt. Viele Champions verfügen über Fähigkeiten, welche diese unterbrechen können.</li>', 0, 0, 487, 2616, ' Mage'),
(118, 'Zyra', 143, '2014-10-21 17:54:20', '2015-04-09 10:19:54', 'Zyra', 575.00, 50.00, 334.00, 53.38, 479.32, 74.00, 3.20, 20.04, 0.80, 5.69, 0.00, 0.00, 6.00, 2.11, 30.00, 325.00, 0.00, 0.00, 0.50, 3.00, 'Die Gebieterin der Dornen', 'Danach trachtend, die Kontrolle über ihr Schicksal zu erlangen und eine zweite Chance im Leben zu erhalten, transferierte Zyra, eine uralte und sterbende Pflanze, ihr Bewusstsein in einen menschlichen Körper. Vor Jahrhunderten herrschten sie und ihre Art über den Kumungu-Dschungel, wo sie Dornen und Ranken nutzten, um jedes Tier zu verzehren, das es wagte, in ihr Territorium einzudringen. Als die Jahre vergingen, ging die tierische Population stetig zurück. Nahrung wurde zunehmend seltener und Zyra konnte nur hilflos zusehen, wie die letzten ihrer Art verwelkten. Sie dachte, sie würde einsam und verlassen vergehen, bis ihr das Erscheinen einer unachtsamen Hexe die Chance auf eine Erlösung bot.<br><br>Es war das erste Mal seit Jahren, dass Zyra eine Kreatur spüren konnte, die so nahe an sie herankam. Der Hunger trieb sie zu der Hexe, aber ein anderer, noch tieferer Instinkt überkam sie. Mit Leichtigkeit umschlang sie die Frau mit dornigen Ranken, aber während sie dieses letzte Mahl genoss, drangen fremdartige Erinnerungen in ihre Gedanken. Sie erblickte große Dschungel aus Metall und Stein, in denen es vor Menschen und Tieren nur so wimmelte. Mächtige Magie durchströmte ihre Ranken und sie erdachte einen eleganten, aber dennoch gewagten Plan, um zu überleben. Mit Hilfe der Erinnerungen der Frau konnte Zyra ihre neu erlangte Magie nutzen, um für sich eine menschliche Form zu erschaffen. Sie wusste nicht, was für eine Welt auf sie warten würde, aber sie hatte einfach nichts zu verlieren. Als Zyra ihre Augen öffnete, wurde sie von der bloßen Macht, die ihren Fingerspitzen innewohnte, überwältigt. Aber erst als sie die ausgedörrten Überreste der Pflanze erblickte, die sie einst verkörperte, wurde ihr klar, wie verwundbar sie nun wäre. Würde dieser Körper sterben, gäbe es kein Geflecht aus Ranken, durch die sie sich zurückziehen konnte, keine Wurzeln, um sie nachwachsen zu lassen ... aber sie fühlte, wahrlich am Leben zu sein. Sie betrachtete die Welt zum ersten Mal so, wie es die Tiere taten, und ein düsteres Grinsen zeichnete sich langsam auf ihren Lippen ab. Sie war neugeboren und es gab nun so viel, das für sie erreichbar war.<br><br>„Näher an der Blüte, näher an den Dornen.“ - Zyra<br>', 'Zyras Saat kann einfach zertreten werden. Zertrete sie vor allem dann, wenn sie diese nutzt, um ihrem Team Sicht über bestimmte Areale zu gewähren.', 'Näher an Zyra heranzugehen kann die richtige Entscheidung sein, wenn sich dann ihre Pflanzen oder ihre Saat zu weit entfernt befinden.', 'Pflanzen können durch drei normale Angriffe oder einen Zauber und einen normalen Angriff ausgeschaltet werden.', 'Indem du erst einen Zauber wirkst und dann eine Saat in dessen Pfad ausbringst, kannst du sichergehen, dass sie sich an der richtigen Stelle befindet.', 'Saat gewährt auch deinem Team Sicht.', 'Zyra ist hervorragend für Hinterhalte. Suche nach Möglichkeiten, um mit Saaten im hohen Gras eine Falle zu stellen und Gegner hineintappen zu lassen.', 0, 0, 0, 2258, ' Mage Support'),
(119, 'Nami', 267, '2014-10-21 17:54:20', '2015-04-09 10:19:54', 'Nami', 550.00, 43.00, 377.24, 51.21, 489.32, 74.00, 3.10, 19.72, 0.40, 5.42, 0.00, 0.00, 9.00, 2.61, 30.00, 335.00, -0.03, 0.00, 0.55, 4.00, 'Die Gezeitenruferin', 'Nami kanalisiert die Urenergien des Ozeans, indem sie seine geheimnisvollen, stärkenden Eigenschaften und die rohe Kraft der Gezeiten für sich nutzt. Auch wenn viele es ihr nicht zutrauten, bewies Nami den Mut und die Zielstrebigkeit, sich einer gefährlichen Aufgabe anzunehmen, der sich niemand sonst gewachsen fühlte. Nun glaubt ihr Volk, sie sei die Gezeitenruferin, eine Auserwählte, deren Schicksal darin besteht, eine Suche, die für das Überleben ihres gesamten Volkes essentiell ist, abzuschließen.<br><br>Die heilige Pflicht der Gezeitenruferin besteht darin, einen Mondstein an sich zu nehmen, ein mächtiges Objekt, das man nur in den hoch aufragenden Weiten der Welt an der Oberfläche finden kann. Ihr Volk, die Marai, vertrauen darauf, dass das Licht des Mondsteins sie vor den Schrecken der Tiefe schützt. Doch die Macht des Steines währt nur einhundert Jahre. Bevor sein Licht erlischt, muss die Gezeitenruferin in die Große Tiefe reisen, eine Tiefseeperle heraufholen und sie an die Oberfläche bringen. Dort findet in der Nacht der Wintersonnenwende des einhundertsten Jahres ein zeremonieller Austausch mit einem Landgänger statt, der den Mondstein bei sich trägt. Indem sie die Perle gegen den Mondstein eintauscht, stellt die Gezeitenruferin das Überleben der Marai für ein weiteres Jahrhundert sicher.<br><br>Doch zu Namis Zeit, als die einhundert Jahre zu Ende gingen, konnte keine Gezeitenruferin gefunden werden. Ohne eine Auserwählte, welche die Aufgabe bewältigte, würde ihr Volk auf eine Katastrophe zusteuern. Doch die Marai warteten ab und vertrauten darauf, dass eine Gezeitenruferin erscheinen würde. Nami wollte nicht untätig herumsitzen und beharrte darauf, dass, ohne eine Gezeitenruferin, die sie alle rettete, jemand etwas unternehmen musste. Mutig entschied sie, die Aufgabe selbst in die Hand zu nehmen und begab sich allein in die gefährlichen Tiefen. Niemand erwartete, dass sie überleben würde, doch nach sechs Tagen der Schlachten gegen unaussprechliche Schrecken kehrte Nami mit der Perle in der Hand zurück. Die Marai begrüßten sie als die neue Gezeitenruferin. Nun musste Nami nur noch an die Oberfläche reisen und den Austausch abschließen.<br><br>Als Nami an der Oberfläche ankam, fand sie jedoch nur das menschenleere Ufer vor. Tagelang wartete sie in einer mystischen Bucht und wusste nicht, was sie tun sollte. In all den Legenden, die sich um die Gezeitenruferin rankten, hatte der Träger des Mondsteins es nie verpasst, dort zu sein. Nami musste eine Entscheidung treffen. Sie kannte die Welt an der Oberfläche nur aus Geschichten und Gerüchten, doch das Überleben der Marai hing von ihr ab. Nachdem sie die Gezeiten beschwört hatte, um an Land zu kommen, begann Nami ihre Suche nach dem Mondstein und wurde die erste ihrer Art, welche die Welt oberhalb des Ozeans erkunden sollte. Sie ließ ihre Heimat zurück und schwor, nicht zurückzukehren, bis sie die Aufgabe der Gezeitenruferin abgeschlossen hatte.<br><br>„Ich bin die Flut und niemand hält mich auf.“ - Nami<br>', '„Wassergefängnis“ ist eine sehr mächtige Fähigkeit mit langer Abklingzeit. Dies solltest du nutzen, falls diese Fähigkeit bei Nami fehlschlägt.', '„Flutwelle“ hat eine sehr große Reichweite, bewegt sich aber nur langsam vorwärts. Dessen solltest du dir bewusst sein, wenn sie auf dich zukommt, damit du ihr aus dem Weg gehen kannst.', 'Versuche zu vermeiden, gegen einen Gegner zu kämpfen, der „Segen der Gezeitenruferin“ erhalten hat. Er hält nur kurz an, deshalb kann es dir schon sehr helfen, ihn abzuwarten.', '„Wassergefängnis“ besitzt eine lange Abklingzeit, deshalb solltest du es im richtigen Moment einsetzen.', 'Der Einsatz von „Ebbe und Flut“ während einer Auseinandersetzung mit gegnerischen Champions kann das Blatt zu deinen Gunsten wenden.', 'Namis ultimative Fähigkeit kann sehr nützlich sein, wenn du den Kampf auf Gegner eröffnen möchtest, die weit weg sind.', 0, 0, 487, 1012, ' Support Mage'),
(120, 'Jarvan IV.', 59, '2014-10-21 17:54:20', '2015-04-09 10:19:54', 'JarvanIV', 175.00, 40.00, 302.20, 55.71, 571.20, 90.00, 3.40, 27.00, 0.45, 8.18, 0.00, 1.25, 6.75, 2.50, 32.10, 340.00, -0.05, 0.00, 0.70, 3.60, 'Das Vorbild von Demacia', 'Seit Jahrhunderten die königliche Familie stellend verbrachten die Mitglieder der Lichtschild-Linie ihr Leben damit, Kriege gegen jene zu führen, die sich der demacianischen Morallehre widersetzten. Man sagt, jedem Lichtschild sei die anti-noxische Einstellung in die Wiege gelegt. Jarvan IV. stellt dabei keine Ausnahme dar, auch wenn er der erste Lichtschild ist, der im Zeitalter der Liga der Legenden geboren wurde. Wie seine Vorväter vor ihm führte er die demacianischen Truppen in blutige Schlachten mit noxischen Kräften. Bei zahlreichen Gelegenheiten vergoss er sein Blut an der Seite verwundeter Verbündeter und gefallener Kameraden. Bei seiner vernichtendsten Niederlage wurde er von einem noxischen Bataillon unter dem Kommando Jericho Swains ausmanövriert und gefangen genommen. Dieser Fehler kostete ihm fast das Leben durch die Hand Urgots, doch Jarvan wurde von der Furchtlosen Vorhut, einer demacianischen Elite-Kampftruppe, angeführt von Jarvans Jugendfreund Garen, gerettet.<br><br>Jene, die ihm nahestehen, glauben, seine Gefangenschaft habe ihn verändert. Xin Zhao wurde folgendermaßen zitiert: „Seine Augen schienen dich nie wirklich anzuschauen, nur durch dich hindurch, auf etwas, von dem er seinen Blick nicht abwenden konnte.“ Eines Tages wählte er, ohne Vorwarnung, eine Gruppe demacianischer Soldaten aus und verließ Demacia, wobei er schwor, „Sühne“ zu suchen. Er begann seine Suche, indem er die gefährlichsten Tiere und Banditen aufspürte und jagte, die er im nördlichen Teil Valorans finden konnte, doch schon bald wurde er seiner Beute müde. Auf der Suche nach etwas, das nur er verstand, wagte er sich in das Gebiet südlich der Großen Barriere vor. Fast zwei Jahre lang hörte man nichts mehr von ihm. Nachdem viele das Schlimmste befürchtet hatten, kehrte er mit großem Trara auf die Straßen Demacias zurück. Seine demacianische Plattenrüstung war mit Knochen und Schuppen unbekannter Kreaturen verziert. In seinen Augen lag die Lebenserfahrung eines Menschen, doppelt so alt wie er. Von den zwölf Soldaten, die mit ihm fortgegangen waren, kehrten nur zwei zurück. In einem Ton, der so kalt und hart war wie Stahl, schwor er, die Feinde Demacias in die Knie zu zwingen.<br><br>„Es gibt nur eine Wahrheit und du wirst sie an der Spitze meiner Lanze finden.“ - die „letzten Worte“ Jarvans IV bei seiner fehlgeschlagenen Hinrichtung<br>', 'Meide den Bereich zwischen Jarvan IV. und seiner „Demacianische Standarte“, um nicht in die Luft geschlagen werden zu können.', 'Die durch „Kataklysmus“ geschaffenen Arenen wirken unüberwindbar, aber du kannst sie mit Fähigkeiten überwinden.', '', 'Du kannst „Drachenschlag“ zusammen mit „Demacianische Standarte“ benutzen, um aus deinen eigenen durch „Kataklysmus“ geschaffenen Arenen zu entkommen.', 'Verteile deine normalen Angriffe auf mehrere Ziele, um deinen Schaden zu maximieren.', 'Benutze „Demacianische Standarte“ zum Spähen, wenn du dir über möglicherweise auftauchende Gegner Sorgen machst.', 0, 0, 0, 1829, ' Tank Fighter'),
(121, 'Ezreal', 81, '2014-10-21 17:54:20', '2015-04-09 10:19:55', 'Ezreal', 550.00, 45.00, 310.60, 50.24, 484.40, 80.00, 3.00, 21.88, 0.65, 6.42, 0.00, 0.00, 8.09, 2.80, 30.00, 325.00, 0.00, 0.00, 0.55, 3.50, 'Der verwegene Forscher', 'Der kühne, junge Abenteurer Ezreal hat einige der abgelegensten und verlassensten Orte Runeterras erkundet. Während einer Expedition in die verschütteten Ruinen der uralten Shurima barg er ein Amulett mit unglaublicher mystischer Kraft. Auch wenn es angefertigt wurde, um von einem der Aufgestiegenen getragen zu werden, passte der riesige Talisman genau an seinen Arm, wodurch seine rohen magischen Fähigkeiten in solchem Umfang verstärkt wurden, dass ihm der Ruf eines Helden vorauseilt. Was ihn wiederum eher verlegen macht.', 'Ezreal ist ein sehr anfälliger Champion, bring also den Kampf zu ihm.', 'Ezreal ist vollständig auf den Fernkampf mit seinem Bogen ausgebildet. Achte darauf, dass immer Vasallen zwischen dir und ihm stehen.', '„Mystischer Schuss“ wird auf Treffereffekte angewendet. Dazu gehört auch der „Segen des Echsenältesten“ in der Kluft der Beschwörer. Pass auf, was du tust, wenn du einem Ezreal mit Siegelverbesserungen begegnest.', 'Benutze „Arkaner Sprung“, um deine anderen Fähigkeiten und Schüsse besser einsetzen zu können.', 'Ezreal kann entweder auf Angriffsschaden oder Fähigkeitsstärke setzen, je nachdem, wie du ihn ausstattest.', 'Du kannst „Energietrommelfeuer“ so ausrichten, dass du mehrere Vasallen-Wellen oder sogar Monster triffst.', 0, 0, 440, 4002, ' Marksman Mage'),
(123, 'Rek''Sai', 421, '2014-12-11 23:05:24', '2015-04-09 10:19:42', 'RekSai', 175.00, 0.00, 100.00, 55.63, 611.20, 90.00, 3.35, 28.30, 0.00, 7.34, 0.00, 1.25, 0.00, 2.00, 32.10, 335.00, 0.00, 0.00, 0.65, 3.75, 'Die Leerenwühlerin', 'Als größte und wildeste Vertreterin ihrer Spezies ist Rek''Sai eine erbarmungslose Jägerin, die Tunnel durch den Boden gräbt, um ihre Beute zu überfallen und zu verschlingen. Ihr unersättlicher Hunger hat ganze Regionen des einst so großartigen Shurima-Imperiums verwüstet. Händler, Kaufleute und bewaffnete Karawanen nehmen Umwege von Hunderten Meilen auf sich, um diese riesigen Gebiete zu umgehen, obgleich bekannt ist, dass listige Banditen Unvorsichtige in ihre Jagdgründe gelockt haben. Sobald Rek''Sai jemanden aufgespürt hat, ist sein Schicksal besiegelt. Es gibt keine Hoffnung auf Entkommen. Sie bedeutet den Tod aus den Tiefen des Sandes.', 'Solltest du einen von Rek''Sais Tunneln sehen, stelle dich kurz auf einen der Eingänge, um ihn zu zerstören.', 'Rek''Sais „Wütender Biss“ gewinnt an Schaden, wenn sie „Zorn“ aufbaut. Sei in ihrer Nähe besonders vorsichtig, wenn ihr „Zorn“ voll aufgeladen ist.', 'Wenn Rek''Sai in der Nähe ist, kann sie deine und die Position deiner Verbündeten sehen, aber nur, wenn ihr euch bewegt.', 'Wenn du auf der ganzen Karte Tunnel anlegst, hast du die Wahl, wenn du „Leerenansturm“ ausführen möchtest.', 'Nutze „Eingraben“, bevor du dich auf der Karte bewegst, um vom erhöhten Lauftempo und der durch „Erschütterungssinn“ gewährten Sicherheit zu profitieren.', '„Erschütterungssinn“ kann dich vor herannahenden Gegnern warnen und ist besonders nützlich, wenn du dich auf gegnerisches Territorium begibst.', 0, 0, 0, 173, ' Fighter'),
(124, 'Bard', 432, '2015-04-09 10:19:35', '2015-04-09 10:19:35', 'Bard', 500.00, 50.00, 350.00, 52.00, 535.00, 85.00, 3.00, 25.00, 0.45, 5.40, 0.00, 0.00, 6.00, 2.00, 30.00, 330.00, 0.00, 0.00, 0.55, 4.00, 'Der wandelnde Beschützer', 'Bard reist durch Welten, die jenseits der Vorstellungskraft sterblicher Wesen liegen. Einige von Valorans großartigsten Gelehrten haben ihr ganzes Leben damit zugebracht, die Mysterien, die er verkörpert, zu verstehen. Diesem rätselhaften Geist verlieh man im Laufe der Geschichte Valorans schon viele Namen, doch Titel wie Kosmischer Vagabund und Großer Beschützer bilden nur einen flüchtigen Aspekt seines wahren Daseinszweckes ab. Wenn die unbegreifliche Struktur des Universums bedroht ist, sorgt Bard dafür, dass all das, was existiert, nicht ausgelöscht wird.', 'Auch Bards Gegenspieler können die Eingänge zu den Tunneln von „Magische Reise“ nutzen, um sich fortzubewegen. Du kannst ihm also folgen, wenn du glaubst, dass dies sicher ist.</li>', 'Du kannst Bards Heilschreine zerstören, indem du einfach über sie hinweg läufst. Überlasse sie seinen Verbündeten nicht kampflos.', 'Bards ultimative Fähigkeit, „Innehalten“, wirkt sich auf Verbündete, Gegner und Türme gleichermaßen aus. Manchmal kann es zu deinem Vorteil sein, wenn du in den Wirkungsbereich springst!</li>', 'Es ist wichtig, Glocken zu sammeln, um die Angriffe deiner Meeps zu stärken, aber lasse deinen Lanepartner nicht im Regen stehen! Versuche dich und deinen Verbündeten durch den Einsatz von „Magische Reise“ in die Lane zu bringen und so einen erfolgreichen Start zu ermöglichen.</li>', 'Lasse deinem „Schrein des Beschützers“ Zeit zum Aufladen - er heilt um einiges effektiver, wenn er volle Kraft besitzt.</li>', 'Vergiss nicht, dass auch Gegner die Eingänge von „Magische Reise“ nutzen können und dass deine ultimative Fähigkeit auch deine Verbündeten trifft!</li>', 0, 0, 0, 0, ' Support Mage');
